INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(1, '-', '2020-05-25 11:31:07.000000', '[hälso- och sjukvård] aktivitet (23.6.6) som stöder vårdprocessen (8.2) utan att direkt påverka patientens (5.2.1) hälsotillstånd (3.2)', '-', 'FVM', 'Beslutad', 'administrativ aktivitet', '-', '-', '28.2.3.1', 135, 'ANMÄRKNING 1: Vid sidan de hälso- och sjukvårdsaktiviteter som avses påverka patientens hälsotillstånd krävs en rad aktiviteter för att administrera resurser, ekonomi, bokningar etc.\r\n\r\nANMÄRKNING 2: Administrativa aktiviteter inkluderar ekonomi och statistik.', '2020-05-25, perha11: Uppdaterad!', '-', '-'),
(2, 'Inte definierad', '2020-05-25 11:32:12.000000', 'process (3.6.1)', '-', '-', 'Avråds', 'administrativ process', '-', '-', '62.5', 135, 'FÖRKLARING: Ersätts av hälso- och sjukvårdsadministration 8.2.3.', '2020-05-25, perha11: Uppdaterad!', '-', '-'),
(3, '-', '2020-05-20 10:01:13.000000', 'information för entydig lägesbestämning av plats', '-', 'Informatik VGR (ISO 19160-1 reviderad)', 'Beslutad', 'adress', '-', '-', '-', 2, '-', '2020-02-27, BB: Magnus kompletterar med oreviderad definition av källa.\r\n2020-05-08, PErha11: Sätts preliminär för beslut\r\n2020-05-20, annbr113, karkj, magfo, perha11: Beslutad', '-', '-'),
(4, '-', '2020-06-04 10:13:00.000000', 'beståndsdel i läkemedelsprodukt (27.8.2) vars syfte är att ge effekt', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'aktiv substans', '-', '-', '27.8.4', 155, 'ANMÄRKNING 1: Definitionen förtydligas genom att hänvisa till läkemedelsprodukt. Att begreppet inkluderas beror på att s.k. generisk förskrivning ska möjliggöras i Kärnsystemet, dvs. förskrivningen anger inte läkemedelsprodukt utan aktiv substans. Man förskriver alltså paracetamol, varefter apoteket kan expediera Alvedon, Paracetamol, Pamol, Panodil eller Pinex.', '2020-05-29, perha11: kompletterad med alternativ definition från SoS\r\n2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', 'Definition enligt Socialstyrelsens termbank:\r\n(i läkemedel:) beståndsdel vars syfte är att ge terapeutisk effekt eller möjlighet att ställa diagnos\r\n\r\nAnmärkning: Med aktiv substans kan exempelvis avses:\r\n-en enkel substans som är aktiv i sig själv, t.ex. paracetamol -en förening av substanser (ett salt), t.ex. morfinhydroklorid -den del i en förening av substanser som är aktiv (eng. active moiety), t.ex. morfin.\r\nAndra beståndsdelar i läkemedel kan exempelvis vara färgämnen, konserveringsmedel, bindemedel (som möjliggör sammanpressning av tabletter) och drageringsmedel (som används för att ge ytskiktet på tabletter önskvärda egenskaper). Sådana substanser kallas hjälpämnen.'),
(5, '-', '2020-06-12 16:06:57.000000', 'något som utförs av någon eller något', '-', 'Rikstermbanken eller TNC', 'Beslutad', 'aktivitet', '-', '-', '23.6.6', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(6, '-', '2020-06-12 16:06:33.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) under vilket status för hälso- och sjukvårdsaktiviteter (7.2) i en vårdplan (9.2) förändras', '-', 'Contsys SE', 'Beslutad', 'aktivitetshantering inom hälso- och sjukvård', '-', '-', '7.2.7.3', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(7, '-', '2020-06-12 16:05:44.000000', 'önskat utfall av ett hälso- och sjukvårdsaktivitetselement (7.2.7)', '-', 'FVM efter revidering av formulering i 3R Contsys', 'Avråds', 'aktivitetsmål', '-', '-', '61.4', 135, 'ANMÄRKNING 1: Ersätts av vårdaktivitetsmål 9.2.6 - posten reviderad 2019-06-19.  Ett antal begrepp som analyserats i arbetet med Västra Götalandsregionens begreppssystem och som inte ingår i den fastställda begreppssamlingen. Referensnumren i definitionerna stämmer inte eftersom dessa begrepp inte ska användas i regionens informatikarbete.', '2020-06-12, marel67: Städad.', '-', '-'),
(8, '-', '2020-06-12 16:04:59.000000', 'paket av hälso- och sjukvårdaktiviteter', '-', 'Bilaga 1 FVM upphandling', 'Beslutad', 'aktivitetspaket', '-', '-', '-', 135, '-', 'Inhämtad från bilaga 1 2017-10-24\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(9, '-', '2020-06-12 16:04:29.000000', 'tidsperiod under vilken hälso- och sjukvårdsaktiviteter (7.2) med samma aktivitetsmål (40.4) utförs för en patient (2.1.1)', '-', 'FVM utgående från 3R Contsys', 'Beslutad', 'aktivitetsperiod', '-', '-', '30.2.2.5', 135, 'ANMÄRKNING 1: Begreppet avser en period under vilken en patient är föremål för hälso- och sjukvårdsaktiviteter riktade mot samma hälsotillstånd. Perioden kan vara del av ett vårdtillfälle, inkludera ett vårdtillfälle, omfatta enbart öppen vård eller sträcka sig över såväl öppen som sluten vård. Den är alltid del av en process som startat inom ramen för ett vårdmandat.\r\n\r\nEXEMPEL 1: En serie blodtrycksmätningar. Cellgiftbehandling, strålbehandling. Plasmaferes under sluten vård (utförs upprepade gånger).', '2020-06-12, marel67: Städad.', '-', '-'),
(10, 'För att få ta del av ospärrade uppgifter hos en annan vårdenhet eller vårdprocess krävs att användaren gör ett aktivt val. Det innebär att användaren först ska bedöma om uppgifterna är nödvändiga för att han eller hon ska kunna fullgöra sina arbetsuppgifter. Därefter ska användaren göra ett aktivt val i journalsystemet för att bekräfta bedömningen. Det aktiva valet ska\r\nloggas för att dokumentera bedömningen.', '2020-03-26 15:04:55.000000', 'särskild åtgärd för att få tillgång till del av patientjournal som inte visas när den öppnas efter sökning', '-', 'VGR', 'Beslutad', 'aktivt val', '-', '-', '-', 1, 'Anmärkning: För att en vårdgivare ska kunna behandla uppgifter som en annan vårdgivare gjort tillgängliga i systemet för sammanhållen journalföring krävs det att:\r\n\r\n- uppgifterna rör en patient som det finns en aktuell patientrelation med \r\n- uppgifterna kan antas ha betydelse för att förebygga, utreda eller behandla sjukdomar och skador \r\n  hos patienten inom hälso- och sjukvården\r\n- och patienten samtycker till det.\r\n \r\nOm dessa förutsättningar är uppfyllda får användaren ta del av uppgifterna genom att göra ett aktivt val i journalsystemet. Det aktiva valet bekräftar att användaren bedömt att förutsättningarna är uppfyllda. En vårdgivare som får tillgång till uppgifter genom sammanhållen journalföring är personuppgiftsansvarig för den behandling av personuppgifter som sker i verksamheten och ansvarar för att uppgifterna hanteras enligt reglerna i patientdatalagen.', '2020-03-26, Perha11: Källa och anmärkning tillagd.', '-', '-'),
(11, '-', '2020-06-12 16:03:39.000000', 'vårdkontakt (10.2.2.1.1) där patientens (5.2.1) hälsotillstånd (6.4) kräver omedelbar bedömning (27.2.7.2.2)', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'akut vårdkontakt', '-', '-', '30.2.2.1.1.1.4', 135, 'ANMÄRKNING 1: Alla vårdkontakter kan vara akuta eller inte akuta. Eftersom detta kännetecken kan ärvas av alla underordnade begrepp sätts relationen till den överordnade vårdkontakten och inte en vårdkontakt i öppen vård. I Socialstyrelsens termbank pekas akut vårdtillfälle och akut öppenvårdskontakt ut var för sig.', '2020-06-12, marel67: Städad.', '-', '-'),
(12, 'en begränsad uppsättning väldefinierade instruktioner för att lösa en uppgift, utifrån ett givet starttillstånd, inom ett ändligt antal steg. ELLER: en systematisk procedur för hur man genom ett begränsat antal steg utför en beräkning eller löser ett problem. Jämförs ofta med (mat-)recept.. Innehåller ibland iterationer, ofta val enligt specificerade regler....', '2020-06-12 16:02:51.000000', 'systematisk procedur för hur man genom ett begränsat antal steg utför en beräkning eller löser ett problem', '-', 'Wikipedia', 'Beslutad', 'algoritm', '-', '-', '-', 3, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(13, '-', '2020-06-12 16:02:07.000000', 'vårdskada (28.2.4.3.2) som medför bestående funktionsnedsättning (26.4.2.5.2) eller får andra betydande konsekvenser', '-', 'FVM', 'Beslutad', 'allvarlig vårdskada', '-', '-', '28.2.4.3.2.1', 135, 'ANMÄRKNING 1: Allvarlig vårdskada är inte definierad i Socialstyrelsens termbank. I patientsäkerhetslagen (2010:659) 1 kap. 5 § står:  Med allvarlig vårdskada avses vårdskada som  1. är bestående och inte ringa, eller  2. har lett till att patienten fått ett väsentligt ökat vårdbehov eller avlidit.  Detta betraktas i FVM som betydande konsekvenser, medan en vårdskada som inte är allvarlig även om det är en vårdskada inte behöver ha kroniska konsekvenser eller leder till bestående besvär utan stor betydelse.', '2020-06-12, marel67: Städad.', '-', '-'),
(14, '-', '2020-06-12 16:01:12.000000', 'öppenvårdskontakt (30.2.2.1.1.1) som tillhör ambulanssjukvården (30.2.2.6)', '-', 'FVM', 'Beslutad', 'ambulansinsats', '-', '-', '30.2.2.6.1', 135, 'ANMÄRKNING 1: Av den definition som Socialstyrelsen ger till ambulanssjukvård (30.2.2.6) framgår att detta är en särskild verksamhet som bedrivs av ambulanspersonalen såväl utanför som i ambulansen. En ambulansinsats börjar därför när ambulansen larmas ut eller avgår till upphämtningsplatsen och avslutas när antingen personalen lämnar den vårdsökande efter rådgivning eller lastar ur den värdsökande vid vårdenhet.', '2020-06-12, marel67: Städad.', '-', '-'),
(15, '-', '2020-06-12 15:59:45.000000', 'hälso- och sjukvård (3.1.1) som utförs av hälso- och sjukvårdspersonal (5.2.3.3) i eller i anslutning till ambulans', '-', 'Socialstyrelsens termbank', 'Beslutad', 'ambulanssjukvård', '-', '-', '30.2.2.6', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(16, '3 begrepp för samma sak. Står på antitumorala regimerna.Betyder att ssk ska ha ökad beredskap för anafylaxi med kontroller av vitalparametrar & läkemedel tillgänliga för ev. anafylaxi. Begreppen används säkert inom andra områden än onkologi eller hematologi eller barncancervård.', '2020-06-15 11:02:53.000000', 'uppmärksamhet på patient avseende risk för överkänslighetsreaktion med behandlingsresurs tillgänglig', '-', 'Informatik VGR', 'Beslutad', 'anafylaxiberedskap', '-', '-', '-', 90, '-', '2020-02-27, BB: Definition klar\r\n\r\n2020-06-12, marel67: Städad. Behöver redas ut för att bestämma \"huvudterm\" av de tre med ev synonymer? Flyttas därför till Preliminär så BB får utöva sin magi.\r\n\r\n2020-06-14, karkj, magfo perha11: förädlad och beslutad! Två föreslagna termer avseende andra begrepp (akutberedskap, chockberedskap) strukna.', '-', '-'),
(17, 'beskrivning av organens lokalisation i förhållande till andra organ och kroppens position i rummet (Källa: VGR)', '2020-06-08 14:18:22.000000', 'kroppsdels placering i förhållande till andra kroppsdelar', '-', 'Informatik VGR', 'Beslutad', 'anatomisk lokalisation', '-', '-', '-', 2, 'ANMÄRKNING 1: Kroppsdelars och organs position beskrivs alltid med personen i upprätt ställning. Vanligen betraktas människokroppen framifrån varför patientens högra sida ses till vänster och vice versa.', '2020-02-27, BB: Definition klar.\r\nKodverk behövs, skickas till RIM och Kodverk.\r\n2020-05-08, Perha11: Definition justerad, preliminär\r\n2020-05-20, magfo, karkj, perha11: Åter till Pågår, Jira 627\r\n2020-06-08, marel67, verwi6, magfo, perha11, davte1, ajla: Definition justerad. Åter till preliminär.\r\n2020-06-09, karkj, magfo, perha11: Beslutad!', '-', '-'),
(18, '-', '2020-06-12 15:50:06.000000', 'person (3.3.4) inom familjen eller bland de närmaste släktingarna', '-', 'Socialstyrelsens termbank', 'Beslutad', 'anhörig', '-', '-', '25.2.2.1', 135, 'ANMÄRKNING 1: Se termposten närstående för jämförelse mellan Contsys och FVM begreppssystem! Att skilja ut anhöriga från närstående kan t.ex. vara viktigt för rätten att ta del av patientens journal. En närstående kan vara en person patienten inte är släkt med men har stort förtroende för, medan en anhörig genom blodsband är bunden till patienten men av patienten inte alls godkänns för att ta del av journalinformation.', '2020-06-12, marel67: Städad.', '-', '-'),
(19, '-', '2020-06-12 15:49:25.000000', 'tredjepart inom hälso- och sjukvård (5.2.4) som har en personroll (3.3.6)', '-', 'Contsys SE', 'Beslutad', 'annan vårdare', '-', '-', '5.2.4.1', 135, 'EXEMPEL 1: En släkting (familjemedlem), en granne.', '2020-06-12, marel67: Städad.', '-', '-'),
(20, '-', '2020-06-12 15:48:42.000000', 'hälso- och sjukvårdsaktivitet (7.2) som utförs av annan vårdare (5.2.4.1)', '-', 'FVM', 'Beslutad', 'annan vårdares aktivitet', '-', '-', '27.2.5.1', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(21, '-', '2020-06-12 15:47:47.000000', 'kontrakt mellan en hälso- och sjukvårdspersonal (5.2.3.3) och en hälso- och sjukvårdsorganisation (5.2.3.1) som beskriver de roller (3.3.5) och ansvar som tilldelas denna hälso- och sjukvårdspersonal (1.1.3)', '-', 'Contsys SE', 'Beslutad', 'anställning inom hälso- och sjukvård', '-', '-', '5.2.3.2', 135, 'ANMÄRKNING 1: Det finns ett formfel i Contsysdefinitionen. En hälso- och sjukvårdsorganisation har ingen rättslig status, är rätt och slätt en organisation. I det svenska sammanhanget finns begreppet vårdgivare, som definieras separat (se den termposten) av såväl Socialstyrelsen som FVM och alltid är en juridisk person (eller enskild näringsidkare). Endast en sådan kan anställa.', '2020-06-12, marel67: Städad.', '-', 'kontrakt mellan en hälso- och sjukvårdspersonal och en vårdgivare som beskriver de roller och ansvar som tilldelas denna hälso- och sjukvårdspersonal (FVM)'),
(22, '-', '2020-06-12 15:46:33.000000', 'person som använder IT-tjänst (Lösningen)', '-', 'Rikstermbanken', 'Beslutad', 'användare', '-', '-', 'Inte definierad', 135, '-', '171009: Avser användare av Lösningen.(Kommentar: slutanvändare är uttryckligen avrådd term.)\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(23, '-', '2020-06-12 15:45:49.000000', 'gränsen mellan användare och dator där formerna för kommunikation är noga specificerade', '-', 'Rikstermbanken eller  Institutet för infologi, Rune Pettersson: Informationsdesign från a till ö | 2008', 'Beslutad', 'användargränssnitt', '-', '-', '-', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(24, 'Stöd till användaren för applikationsrelaterade \"hur gör jag\"-frågor.\r\nAvser såväl reaktiva som proaktiva åtgärder i syfte att stödja användare och öka deras kunskap om förvaltningsobjekt. Syftet är att vidmakthålla och vidareutveckla användares kunskap om förvaltningsobjekt.', '2020-06-12 15:45:18.000000', 'funktion, inom eller utanför Lösningen, för att hjälpa Användaren med lösningsrelaterade frågor i syfte att använda Lösningen på ett optimalt sätt', '-', 'dP Std                                                                                                                                                                                                                                                        F', 'Beslutad', 'användarstöd', '-', '-', '-', 135, '-', 'Inhämtad från bilaga 1 2017-10-24\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(25, 'Innefattar IT-support samt användarstöd', '2020-06-12 15:44:25.000000', 'verksamhet för att stödja användare', '-', 'dP Std FVM upphandling', 'Beslutad', 'användarsupport', '-', '-', '-', 135, '-', '2017-05-30, Perha11:\r\nkan avse både användning av applikationer och tekniskt användarstöd\r\nBeskrivning i lista C: avser den support och de supportaktiviteter Leverantören ska tillhandahålla Kunden och Kommunerna i enlighet med Avtalet och som närmare beskrivs i Bilaga 8, Underhåll och support.\r\n\r\n2017-11-06: Termen support förekommer i två betydelser i kravdokumentet och byts därför till specialiseringarna användarsupport och kundsupport.\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
