(27, '-', '2020-08-05 15:34:03.000000', 'gränssnitt som gör det möjligt att nyttja funktioner för tjänster som finns tillgängliga i en annan miljö och funktionssamling', '-', 'Svenska datatermgruppen: Ordlista + förkortningar (ej frågor och svar) | 2012. Reviderad.', 'Beslutad', 'api', '-', '-', '80.26', 135, 'ANMÄRKNING 1: Förkortning av Application Program Interface.', '2020-05-29, karkj: Status ändrad till ej påbörjad.\r\n2020-07-06, vikee1, marel67: Preliminärt definierad.\r\n2020-08-05, ollka3, magfo: Definitionen förädlad. Beslutad.', '-', '-'),
