(29, '-', '2020-06-12 15:42:28.000000', 'diagnos (26.7) som beskriver hälsotillståndet (6.4) vid bedömning (27.2.7.2.2) under pågående hälso- och sjukvårdsprocess (8.2)', '-', 'FVM', 'Beslutad', 'arbetsdiagnos', '-', '-', '26.4.2.1.1', 135, 'ANMÄRKNING 1: Termen arbetsdiagnos har använts i FVM till dess Contsys SE blev tillgängligt. Definitionen är enklare men täcker in det väsentliga i den preliminära bedömningen.', '2020-06-12, marel67: Städad.', '-', '-'),
(30, '-', '2020-06-12 15:41:42.000000', 'ordningsföljd för utförda hälso- och sjukvårdsaktiviteter (7.2) i en vårdprocess (8.2)', '-', 'FVM', 'Beslutad', 'arbetsflöde', '-', '-', '28.2.1.2', 135, 'ANMÄRKNING 1: En vårdplan är en karta över den planerade processen. Vårdplanen läggs upp efter hälsoproblemet eller hälsoangelägenheten. Processen är den följd av aktiviteter som genomförs enligt vårdplanen. Men aktiviteterna behöver inte genomföras i en viss ordning föreskriven i vårdplanen, och utfall av en aktivitet i processen kan föranleda att en aktivitet som inte är förtecknad i vårdplanen också utförs. Det arbete som verkligen utförs är en följd av aktiviteter som dokumenteras. I dokumentationen framgår ordningsföljden, och av detta kan beskrivas ett arbetsflöde som i sig är grund för utvärdering av processen och indirekt vårdplanen.', '2020-06-12, marel67: Städad.', '-', '-'),
(31, '-', '2020-06-12 15:40:15.000000', 'förmodat tillstånd (6.4.2.1) som en eller flera hälso- och sjukvårdsprofessionell aktörer (5.2.3.3.1) har fastställt vara bäst överensstämmande med de för tillfället kända observerade tillstånden (6.4.1)', '-', 'Contsys SE', 'Beslutad', 'arbetshypotes', '-', '-', '6.4.2.1.1', 135, 'ANMÄRKNING 1: En arbetshypotes är vad som i tidigare journalföring kallats preliminär bedömning men också en sammanfattning i diagnosens kortform av tillståndet när som helst under processen, t.ex. före eller efter en hälso- och sjukvårdsaktivitet.\r\n\r\nANMÄRKNING 2: Den alternativa definitionen avser termen arbetsdiagnos i FVM:s tidigare arbete. Det ska tilläggas att man i arbetet med journal via nätet skapat sökordet tidiga hypoteser, något som kan omfatta arbetshypotes. Tidiga hypoteser publiceras inte på nätet.', '2020-06-12, marel67: Städad.', '-', 'diagnos (26.7) som beskriver hälsotillståndet (2.2) vid bedömning (27.2.7.2.2) under pågående vårdprocess (8.2)'),
(32, '-', '2020-06-12 15:38:33.000000', 'vårdgivarens (25.2.3.1.1) kostnad för hälso- och sjukvårdspersonalens (5.2.3.3) arbetade tid', '-', 'FVM', 'Beslutad', 'arbetskostnad', '-', '-', '27.5.1.1', 135, 'ANMÄRKNING 1: Arbetskostnad är väsentlig att räkna ut som en del av hälso- och sjukvårdens finansieringsbehov. För en enskild hälso- och sjukvårdspersonal är årskostnaden detsamma som bruttolönen per år plus lönebikostnader och individkopplade personalkostnader (sjuklön, utbildning etc.). I en hälso- och sjukvårdsprocess kan den totala kostnaden för ingående arbete räknas ut, och denna kostnad kan med hjälp av registrerad arbetstid brytas ner på enskilda hälso- och sjukvårdsaktiviteter.', '2020-06-12, marel67: Städad.', '-', '-'),
