(35, '-', '2020-06-12 15:33:04.000000', 'klassifikationskod för gruppering av läkemedel (3.4.3) i fem nivåer', '-', 'Socialstyrelsens termbank', 'Beslutad', 'ATC-kod', '-', '-', '27.8.5', 135, 'ANMÄRKNING 1: Nivå 1: Anatomisk huvudgrupp, 14 st (1-ställig). Nivå 2: Terapeutisk undergrupp (3-ställig). Nivå 3: Farmakologisk undergrupp (4-ställig). Nivå 4: Kemisk undergrupp (5-ställig). Nivå 5: Kemisk substans (7-ställig). För humanläkemedel gäller ATC-kod: A-V. Nationellt grupperas även varor som inte är läkemedel. Ex.: medicintekniska produkter har ATC-kod W-Z. ATC står för Anatomical Therapeutic Chemical Classification System.', '2020-06-12, marel67: Städad.', '-', '-'),
