(42, '-', '2020-06-12 15:22:03.000000', 'överenskommelse om att träffa någon vid en viss tidpunkt och på en viss plats', '-', 'Contsys SE', 'Beslutad', 'avtal om möte', '-', '-', '3.7.1', 135, 'ANMÄRKNING 1: Varken termen eller definitionen är korrekt översättning från engelskan. Den engelska termen är appointment som betyder möte, definitionen arrangement to meet someone at a particular time and Place. Det handlar alltså inte om avtal utan \"arrangemang\", det vill säga skapande av förutsättningar för ett möte. I de underordnade begreppen bibehålls otydligheten.', '2020-06-12, marel67: Städad.', '-', '-'),
