(47, '-', '2020-06-12 15:18:23.000000', 'person (3.3.4) som är yngre än 18 år', '-', 'FVM eller Föräldrabalken', 'Beslutad', 'barn', '-', '-', '23.3.4.1', 135, 'ANMÄRKNING 1: I föräldrabalken (1949:381) 9 kap. 1 § står: Den som är under arton år (underårig) är omyndig och får inte själv råda över sin egendom eller åta sig förbindelser … Om förmyndare skrivs i föräldrabalken 10 kap. 2 §: För barn som står under vårdnad av bägge föräldrarna är dessa förmyndare. [...] 5 §: Har en underårig inte någon förmyndare, skall rätten förordna en sådan.', '2020-06-12, marel67: Städad.', '-', '-'),
(48, 'Pontus: \r\nFinns ej i SoS eller rikstermbank. Ordet innebär att man bryter kroppens naturliga hudbarriär genom olika ingrepp ex operationssår, sätta dränage, PVK eller CVK osv. Dvs både sår och infarter eller utfarter.', '2020-07-08 14:26:18.000000', '[hälso- och sjukvård] icke naturlig förbindelse genom kroppsytan', '-', 'VGR', 'Beslutad', 'barriärbrott', '-', '-', 'Inte definierad', 6, 'ANMÄRKNING 1:  Ett barriärbrott kan uppstå  genom trauma eller hälso- och sjukvårdsaktiviteter, synligt eller icke synligt. Ett övergripande begrepp till in- och utfarter samt olika typer av sår.', 'Att kunna få ett samlingsbegrepp på sår och infarter eller utfarter att använda för kravställan kring en grafisk översikt över patientens slangar och sår. Magnus frågar Gunnar H.\r\n\r\n2018-02-14 Pontus: Behöver ej definieras då vi använder in- och utfarter samt sår istället. Bredare och mer lätthanterliga ord. \r\n\r\n2017-11-06: vi inväntar en definition från Gunnar o Pontus\r\n\r\n2020-02-18, Perha: Ny defenition och anmärkning\r\n\r\n2020-06-12, marel67: Städad.\r\n2020-07-08, vikee1: Rättat stavfel i definitionen.', '-', '-'),
(49, '-', '2020-05-08 17:14:17.000000', '[hälso- och sjukvård] penetration av hud eller annan del av kroppsytan i samband med hälso- och sjukvårdsaktivitet (7.2)', '-', 'Informatik VGR', 'Publicera ej', 'barriärbrott', '-', '-', '36.4.2.5.1', 135, '-', '2020-02-18, Perha11: Måste stämmas av med dubblett\r\n2020-05-08, Perha11: Bubblett, kan tas bort', '-', '-'),
(50, 'Inom varje Verksamhet skapas basschema för varje enskild Hälso- och sjukvårdspersonals\r\ntjänst för att nå Verksamhetens mål samt lagstiftning och politiska riktlinjer. Detta basschema\r\ninnehåller exempelvis regelverk för fastlagd anställningsform, arbetspass, arbetstidsregler,\r\nflexavtal, heltidsmått, fackliga avtal.\r\nBasschema kan kombineras med önskemål om andra arbetstider från Hälso- och\r\nsjukvårdspersonalen för bildandet av arbetstidsschema. Dessa önskemål måste dock\r\nsynkroniseras med regelverket för basschemat för att upprätthålla Verksamhetens mål.', '2020-05-07 14:12:10.000000', 'schema som innehåller regelverk för anställningsform, arbetspass, arbetstidsregler, flexavtal, heltidsmått, fackliga avtal och andra överenskommelser i syfte att uppfylla verksamhetens behov av personalresurser', '-', 'Informatik VGR', 'Beslutad', 'basschema', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-04-09, Perha11: Tillskriver beställare om mer fakta för att förstå behovet\r\n2020-05-05, Perha11, Marel67: Preliminärt definierad\r\n2020-05-07, magfo: bytt \"med mera\" mot \"och andra överenskommelser\" i definitionen.\r\n2020-05-20, karkj, magfo, perha11: Definition justerad, beslutad.', '-', '-'),
(51, 'Tillverkningspartiets nummer eller referens på förpackningen till ett läkemedel.\r\n\r\nInformation kring synonymer till batchnummer.\r\nhttps://www.lakemedelsverket.se/sv/rapportera-biverkningar/lakemedel/vad-ska-rapporteras#hmainbody2', '2020-08-03 10:33:58.000000', 'identifikationsnummer tilldelat en specifik mängd av produkt som tillverkats samtidigt under samma förhållanden', '-', 'Informatik VGR (från Rikstermbanken)', 'Beslutad', 'batchnummer', '-', 'lot number, batch number', '-', 135, 'ANMÄRKNING 1: Produkter med samma batchnummer är tillverkade med samma utrustning av samma råmaterial under en specifik tidsperiod.', '2017-04-18 annkl defineras inte, används i informationsmodellen\r\n\r\n2020-06-12, marel67: Städad.\r\n2020-06-24, magfo: Begreppet behövs i läkemedelssammanhang, se Jira 534.\r\n2020-07-07, vikee1, davte1, Preliminärt definierad.\r\n2020-07-29, magfo: Definitionen justerad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad!', '-', '-'),
(52, '-', '2020-06-12 15:14:24.000000', 'hälso- och sjukvårdsaktivitet (7.2) som innebär värdering av information (8.2) om aktuellt hälsotillstånd (4.2)', '-', '3R Contsys reviderad', 'Beslutad', 'bedömning', '-', '-', '27.2.7.2.2', 135, 'ANMÄRKNING 1: Avser bedömning av hälsotillståndet vid vilken tidpunkt som helst under vårdprocessen.', '2020-06-12, marel67: Städad.', '-', '-'),
(53, '-', '2020-06-09 00:00:00.000000', 'hälso-och sjukvårdsutföraraktivitet (7.2.1) där beslut tas om vidare handläggning av vårdbegäran (11.3)', '-', 'FVM', 'Beslutad', 'bedömning av vårdbegäran', '-', '-', '29.3', 1, 'Anmärkning 1     Vårdbegäran är en term som inte återfinns i lagstiftningen. Bestämmelser om remiss finns i SOSFS 2004:11 (M), och där talas om verksamhetschefens skyldigheter vid såväl utfärdande som mottagande vårdenhet. Vårdbegäran för egen räkning omnämns inte, men i Kärnsystemet ska finnas möjlighet att hantera alla typer av vårdbegäran på det sätt som föreskrivs för remiss i SOSFS 2004:11. Så snart en vårdbegäran mottagits startar därför en vårdprocess, där mottagande enhet ansvarar för att vårdbegäran handläggs. Först ska vårdbegäran bedömas. Om den accepteras görs ett vårdåtagande och processen går vidare. Om den inte accepteras ska den hänvisas, dvs. skickas till annan vårdenhet, vilket ska meddelas inremitterande och patienten. Om det är en vårdbegäran för egen räkning är dessa två samma person, vilket ska markeras i informationsmodellen så att endast ett meddelande skickas.   Anmärkning 2     I Socialstyrelsens termbank finns uttrycket \"beslut avslag av vårdbegäran\" med beskrivning \"tidpunkt i en vårdprocess då beslut tas om att avslå en vårdbegäran\". Det finns emellertid inget begrepp betecknat \"avslag av vårdbegäran\", så vad detta innebär är okänt. I dokumentet \"RUTIN Hantering av vårdbegäran, Neurologmottagning barn\" (dokument 16709 i Barium) anges för Västra Götalandsregionen att en remiss eller vårdbegäran kan avslås med ett direktsvar. I upphandling av Kärnsystem är bedömningen att en vårdbegäran alltid startar en hälso- och sjukvårdsprocess, där en hälso- och sjukvårdspersonal med medicinskt ansvar gör bedömningen att vårdbegäran kan besvaras direkt (detta kräver att den läses och att innehållet läggs till grund för ett beslut). Då anslutas processen genast och ska dokumenteras med skälen till att vårdbegäran direktbesvaras. Alternativet är att vårdåtagande görs och en vårdplan upprättas.', '2020-06-09, perha11: städad', '-', '-'),
(54, '-', '2020-06-12 15:13:51.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) där en åsikt bildas angående hälsotillstånd (6.4) och eller eller hälso- och sjukvårdsaktivitet (7.2)', '-', 'Contsys SE', 'Beslutad', 'bedömning inom hälso- och sjukvård', '-', '-', '7.2.7.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
