(62, 'Patientinformation om vad som ska ske. Standardiserad plan för behandling av specifik diagnos. (Ingår i en personcentrerad hälsoplan)', '2020-07-30 15:06:13.000000', 'information till patient om planerade aktiviteter avseende visst hälsoproblem', '-', 'Informatik VGR', 'Beslutad', 'behandlingsplan', '-', '-', '-', 4, 'ANMÄRKNING 1: Omfattande resonemang kring detta begrepp, standardiserad vårdplan, individuell plan och hälsoplan finns på JIRA 802.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: Ändrat status till ej påbörjad.\r\n2020-07-06, vikee1, marel67: Skapat kort i Jira, https://vgregionit.atlassian.net/browse/INFMTK-992. Satt till Definieras ej tillsvidare.\r\n2020-07-29, magfo: Ändrat till Pågår, ska förstås inte tas bort.\r\n2020-07-30, magfo: Skrivit definition och anmärkning med hänsvisning till JIRA 802.\r\n2020-08-05, ollka3, magfo: Beslutad', '-', '-'),
(63, '-', '2020-06-12 09:58:58.000000', 'grupp av hälso- och sjukvårdsaktiviteter (9.2.7) som inkluderar de hälso- och sjukvårdsaktiviteter (7.2) som bedöms föreligga behov av för att hantera specificerade hälsobehov (6.5.3)', '-', 'Contsys SE', 'Beslutad', 'behovsbestämd hälso- och sjukvårdsaktivitet', '-', '-', '9.2.8', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(64, 'Från VGR:s begreppssystem', '2020-04-30 09:07:28.000000', 'rättighet att ha åtkomst till viss information (3.9.5), vissa lokaler, eller utföra viss aktivitet (23.6.6)', '-', 'TNC, Basord i vårt fackspråk (reviderad)', 'Beslutad', 'behörighet', '-', '-', '31.6', 1, 'Anmärkning 1: TNC:s definition har ändrats på följande punkter:  1) t.ex. har tagits bort. Om frasen används finns en rad rättigheter som behörigheten också avser men om vilka vi inte vet något. 2) ordet åtgärd har bytts mot aktivitet som är rotbegrepp i FVM begreppsmodell (hämtat från Contsys).', '2020-04-30, Perha11: Definitionen justerad', '-', 'rättighet att ha åtkomst till t.ex. viss information eller vissa lokaler, eller till att utföra vissa åtgärder (Rikstermbanken eller TNC, original)'),
(65, '-', '2020-06-12 09:58:35.000000', 'bestämmelse i lagstiftningen som under vissa omständigheter kan upphäva behovet av samtycke (11.2.6)', '-', 'Contsys SE', 'Beslutad', 'behörighet enligt lag', '-', '-', '11.2.9', 135, 'ANMÄRKNING 1: 3R Contsys ger definitionen \"bestämmelse i lagstiftning som under vissa omständigheter kan upphäva behovet av informerat samtycke\" vilket är en god översättning av definitionen i Contsys på originalspråket. Vilka omständigheter det rör sig är framgår i lagen, och \"under vissa omständigheter\" är inte bara onödigt utan gör definitionen oklar. Ordet \"kan\" gör att sambandet är osäkert. Det ska framgå i begreppsmodellen att bemyndigande enligt lag antingen föreligger (och då tar det över samtycke) eller inte (varvid samtycke krävs). Samtycke kan enligt Socialstyrelsens definition (se 6.5) bara ges efter information, varför \"informerat\" är ett onödigt ord. \r\n\r\nANMÄRKNING 2: I FVM har man valt termen \"bemyndigande\" eftersom det ofta rör sig om en tillfällig rätt att frångå samtyckeskravet, inte en ständig rätt att göra det. Lagen ska med andra ord tolkas i varje enskilt fall, inte ge en ständig behörighet.', '2020-06-12, marel67: Städad.', '-', 'Behörighet definieras i Rikstermbanken \"uppfyllande av formella krav\" (samt på många sätt knutet till hur man får tillgång till delar av IT-system). Bemyndigande förklaras i Rikstermbanken \"det att tilldela någon befogenhet\" (hämtat ur den svensk-albanska tolkordboken)'),
(66, 'adress till en fysisk plats (Källa: VGR (SS637003:2015 reviderad))', '2020-05-20 09:55:02.000000', 'adress till en fysisk plats', '-', 'SS637003:2015 (reviderad)', 'Beslutad', 'belägenhetsadress', '-', '-', '-', 2, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning.\r\n2020-05-13, Marel67: Flyttad till Preliminär.\r\n2020-05-20, annbr113, karkj, magfo, perha11: Beslutad', '-', '-'),
(67, '-', '2020-06-12 09:57:00.000000', 'bearbetning av informationsmängder i syfte att stöda effektivt beslutsfattande', '-', 'FVM, fritt efter Rikstermbanken eller MSB', 'Beslutad', 'beslutsstöd', '-', '-', '23.5.8', 135, 'ANMÄRKNING 1: Datorbearbetning utgår främst från kunskaper ur medicinska riktlinjer tillsammans med uppgifter i epikriser med kodade diagnoser, åtgärder och läkemedel.\r\n\r\nANMÄRKNING 2:  Beslutsstödet ska dels vägleda vid uppläggning av individuell plan för en patient, dels kunna ge snabba tips om behov att ändra taktik i en pågående process.', '2020-06-12, marel67: Städad.', '-', '-'),
(68, '-', '2020-06-12 09:56:14.000000', 'hälso- och sjukvårdspersonal som begär tjänst eller resurs', '-', 'SO (reviderad)', 'Beslutad', 'beställare [hälso- och sjukvård]', '-', '-', '-', 135, 'ANMÄRKNING 1: Alltid en person som gör beställningen, men kan göra det på uppdrag av en organisation.\r\n\r\nANMÄRKNING 2: SO definierar \"person eller organisation som beställer ngt vanligen ngt mer om­fattande\".', '2020-06-12, marel67: Städad.', '-', '-'),
