(71, 'enskilt, team, grupp, gruppteam. Registreringsregler vilka operatörer som får kopplas till en vårdkontakt enligt socialstyrelsen. \r\nNär är man assistent? När har man en ansvarsroll?', '2020-05-20 11:30:29.000000', 'klassificering av öppenvårdsbesök baserat på antal deltagande patienter och hälso- och sjukvårdspersonal', '-', '-', 'Beslutad', 'besöksform', '-', '-', '-', 7, 'ANMÄRKNING 1:  Kan vara:\r\n- enskilt - en patient, en hälso-och sjukvårdspersonal\r\n- grupp - flera patienter, en hälso-och sjukvårdspersonal\r\n- team - en patient, flera hälso-och sjukvårdspersonal \r\n- gruppteam - flera patienter, flera hälso-och sjukvårdspersonal', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-07, verwi6, marel67: Utredning pågår i samarbete med FVMEE.\r\n2020-05-14, verwi6, perha11: Preliminär beskrivning!\r\n2020-05-20, karkj, magfo, perha11: Definierat och beslutat', '-', '-'),
(72, 'officiell definition: [2020-02-13 09:02]  Karin Kjellberg:  \r\norsak som hälso- och sjukvårdspersonal anger för patients öppenvårdsbesök (SoS termbank)', '2020-05-13 11:34:21.000000', 'orsak som hälso- och sjukvårdspersonal anger för patients öppenvårdsbesök', '-', 'Socialstyrelsens termbank', 'Beslutad', 'besöksorsak', '-', '-', '-', 8, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning.\r\n2020-05-13, Marel, Karkj: Beslutad enligt Socialstyrelsens termbank.', '-', '-'),
(73, 'FRÅN FVMEE ARBETET: Elviskodverk med mix av äpplen och päron idag. Mål att bryta isär detta kodverk till flera informationsmängder. Innehåller bl.a. initial vårdkontakt, olika typer av distanskontakter, behandling/besök/provtagning, utförarplats.\r\n\r\nTyp av vårdkontakt finns i RIM.', '2020-05-13 10:13:35.000000', '-', '-', '-', 'Publicera ej', 'besökstyp', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-13, Marel67: Uppdaterad kontext. Fortfarande oklarheter kring detta.\r\n2020-05-14, perha11: Ska inte finnas med enligt Per Sjöli, hänvining till kontakttyp.', '-', '-'),
(74, '-', '2020-06-12 09:54:35.000000', 'oavsedd effekt', '-', 'FVM', 'Beslutad', 'biverkning', '-', '-', '28.2.4.6', 135, 'ANMÄRKNING 1: Termen biverkning förekommer nästan enbart i anslutning till läkemedelsbehandling. Den uttrycker att läkemedlet utöver den önskade effekten också har en annan effekt som inte eftersträvats. Den effekten behöver inte vara negativ. Alla biverkningar kan därför inte anses vara skada på patient. \r\n\r\nANMÄRKNING 2: Eftersom biverkning i detta begreppssystem inte behöver vara ogynnsam redovisas ett separat begrepp med ny definition.\r\n\r\nEXEMPEL 1: Viktnedgång vid behandling med epilepsiläkemedel. Håravfall vid behandling med cellgift. Buksmärtor vid behandling med inflammationsdämpande läkemedel.', '2020-06-12, marel67: Städad.', '-', 'ogynnsam och oavsedd reaktion på ett läkemedel (Socialstyrelsens termbank)'),
(75, '-', '2020-05-20 10:11:46.000000', 'belägenhetsadress till permanent- eller fritidsbostad', '-', 'SIS-TR 33:2017(sv) (reviderad)', 'Beslutad', 'bostadsadress', '-', '-', '-', 2, 'ANMÄRKNING 1: bostadsadress avser vanligen entré till byggnad med en eller flera bostäder men kan också ange våningsplan och lägenhetsnummer m m.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-13, Marel67: Flyttad till Preliminär\r\n2020-05-20, annbr113, karkj, magfo, perha11: Justerad, beslutad', '-', '-'),
(76, '-', '2020-06-12 09:51:30.000000', 'tid som automatisk medicinteknisk produkt (7.2.9.2) används', '-', 'FVM', 'Beslutad', 'brukstid', '-', '-', '27.9.4', 135, 'ANMÄRKNING 1: Brukstiden genererar drift- och kapitaltjänstkostnad för utnyttjande av apparat.', '2020-06-12, marel67: Städad.', '-', '-'),
(77, '-', '2020-06-12 09:50:47.000000', 'formaliserad representation av informationselement', '-', 'VGR (förslag till contsysrevidering ISO)', 'Beslutad', 'data', '-', '-', '3.9.1', 135, 'ANMÄRKNING 1: formaliserad representation möjliggör automatisk kommunikation, behandling och lagring.\r\n\r\nANMÄRKNING 2: representation av fakta, idéer eller liknande i en form lämpad för överföring, tolkning eller bearbetning av människor eller av auFattasatiska hjälpmedel (Rikstermbanken eller Terminologicentrum TNC: Basord i våra fackspråk 2012)', '2020-06-12, marel67: Städad.', '-', '-'),
