(80, '-', '2020-06-12 09:48:36.000000', 'dataregister (3.9.2) innehållande endast elektroniska journalutdrag (12.5.1), under tillsyn och ansvar av en hälso- och sjukvårdsaktör (5.2), tillgängliga för behöriga hälso- och sjukvårdsaktörer (5.2) oberoende av deras organisationstillhörighet', '-', 'Contsys SE', 'Beslutad', 'delbar informationsmängd', '-', '-', '12.3', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(81, '-', '2020-06-12 09:48:11.000000', 'överlåtelse av befogenhet', '-', 'VGR (förslag till contsys-revision ???)', 'Beslutad', 'delegation', '-', '-', '5.2.3.3.3', 135, 'ANMÄRKNING 1: Befogenhet kan överföras för specifik subprocess och eller eller en viss tidsperiod.', '2020-06-12, marel67: Städad.', '-', '-'),
(82, 'Med delegering avses i denna författning att någon som tillhör Hälso- och sjukvårdspersonalen och som är formellt kompetent för en medicinsk arbetsuppgift överlåter denna till en annan person som saknar formell kompetens för uppgiften\r\nKälla: SOSFS 1997:14', '2020-06-12 09:47:12.000000', '-', '-', '-', 'Publicera ej', 'delegerad', '-', '-', '-', 135, 'Se delegering', 'Se delegering i  A-listan\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(83, '-', '2020-06-12 09:45:28.000000', 'utdelande av mandat (23.8.2)', '-', 'FVM', 'Beslutad', 'delegering', '-', '-', '23.8.2.1', 9, 'ANMÄRKNING 1: Det saknas officiell definition av termen delegering. Rikstermbanken ger med referens till Språkrådets svenska-albanska tolkordbok följande kommentar: \"delegering eller delegation innebär att beslutanderätt flyttas från högre till lägre nivå i en organisation. Den lägre nivån bemyndigas att handlägga och fatta beslut i ärenden med samma befogenheter som tillkommer den högre; ansvaret för besluten ligger dock kvar på den högre nivån.\" Inom hälso- och sjukvården agerar var och en på eget professionellt ansvar (patientsäkerhetslagen 6 kap. 2 och 3 §§ beskriver detta i detalj). Detta innebär att ansvaret vid delegering i hälso- och sjukvården är delat mellan den som delegerar och den som fått delegeringen.', '2020-06-12, marel67: Städad.', '-', '-'),
(84, '-', '2020-06-12 09:44:41.000000', 'avser leverans och implementation av Lösningen vid enskilda eller grupper av vårdenheter i enlighet med Överordnad Tidplan.', '-', 'Bilaga 1 FVM upphandling', 'Beslutad', 'delleverans', '-', '-', '-', 135, '-', 'Inhämtad från bilaga 1 2017-10-24\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(85, 'Skillnad mellan en patients nuvarande resultat och historiska resultat som överskrider en fördefinierad gräns.', '2020-06-12 09:44:00.000000', 'jämförelse mellan konsekutiva laboratorievärden för en patient i syfte att påvisa plötsliga förändringar, vanligen som del i datorbaserad kvalitetssäkring', '-', 'dP Std FVM upphandling', 'Beslutad', 'deltacheck', '-', '-', '-', 135, '-', '2020-06-12, marel67: Städad.', '-', '2020-06-12, marel67: Städad.'),
(86, 'Att i detalj planera vilka resurser som fyller uppskattat behov på 1h-x dagars sikt', '2020-05-04 11:28:39.000000', 'verksamhet som förbereder framtida aktiviteter i detalj för att bestämda mål ska uppnås', 'Inte definierad', 'Socialstyrelsens Termbank - reviderad', 'Beslutad', 'detaljplanering', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-04. ajla: Preliminärt definierat\r\n2020-05-05, Perha11 Karkj : Beslutad!', '-', '-'),
(87, '-', '2020-06-12 09:43:20.000000', 'sammanfattande kortfattad beskrivning av en patients (5.2.1) hälsotillstånd (6.4) sådant det uppfattats av hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM', 'Beslutad', 'diagnos', '-', '-', '26.7', 135, 'ANMÄRKNING 1: Socialstyrelsens definition hänför sig till störningar i hälsotillståndet. En diagnos är emellertid också att en person är helt frisk, och omständigheter kring detta fynd kan kodas enligt ICD-10-SE, ICF, Snomed CT eller andra kodlistor. Varje diagnos ska kunna kodas, och därför har definitionen vidgats.\r\n\r\nANMÄRKNING 2: Observera att det är hälsotillståndet som ligger till grund för diagnosen, inte endast sjukdom eller skada.', '2020-06-12, marel67: Städad.', '-', 'bestämning och benämning av sjukdom, skada, störning eller förändring i kroppsfunktion (Socialstyrelsens termbank)');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(88, '-', '2020-06-12 09:41:51.000000', 'statistisk kod för klassificering av sjukdom (26.4.2.5.3) och relaterade hälsoproblem (6.4.2.5)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'diagnoskod', '-', '-', '26.7.1', 135, 'ANMÄRKNING 1: Diagnoskoden har tre funktioner. Den första är att ligga till grund för olika sekundärklassificeringar, till exempel DRG (Diagnosis Related Groups) och ACG (Adjusted Clinical Groups), vilka bland annat används vid beräkningen av ersättningar inom olika delar av hälso- och sjukvård. Den andra är statistisk. Diagnoskoder rapporteras till Socialstyrelsen enligt gällande författning, där de bearbetas till statistik över sjukdomsförekomst i befolkningen. Den tredje är forskning och utveckling. Genom att korsreferera diagnoskoder med åtgärdskoder och läkemedelskoder kan grad av framgång för viss behandling vid viss sjukdom mätas till grund för beslutsstöd och kunskapsspridning.   \r\n\r\nANMÄRKNING 2: I informationsmodellen beskrivs diagnoskoden som dels ett kodvärde, dels en text. Denna text hämtas ur diagnosklassifikationen och får inte användas som diagnos (2.2.4) eftersom den inte alls kan vara lika detaljerad som diagnosens text.', '2020-06-12, marel67: Städad.', '-', '-'),
(89, 'Avser när en vårdkontakt sammanfattas i ICD10-koder som används för DRG gruppering, rapportering till Socialstyrelsen mm.', '2020-03-24 12:20:24.000000', '[hälso- och sjukvård] kodning för sammanfattande beskrivning av en patients (5.2.1) hälsotillstånd (6.4) sådant det uppfattats av hälso- och sjukvårdspersonal (5.2.3.3)', '-', '-', 'Beslutad', 'diagnoskodning', '-', '-', '-', 10, 'Exempel: När en vårdkontakt sammanfattas i ICD10-koder som används för DRG gruppering, rapportering till Socialstyrelsen m m.', '2020-02-28, Perha11: Inflyttad från Nybeställning\r\n2020-03-20, Perha11: klinisk kodning tillagd som avrådd synonym\r\n2020-03-24, Perha11: Definition klar.', '-', '-'),
(90, '-', '2020-05-19 12:02:50.000000', '[informationsteknologi] process där information överförs till digitalt format i syte att lagra, överföra eller bearbeta informationen med informationsteknologisk utrustning', '-', 'VGR', 'Publicera ej', 'digitalisering', '-', '-', '-', 1, 'ANMÄRKNING: I processen används digitala teknologier och digitiserade data för att skapa nya arbets- och kommunikationsprocesser.', '2020-02-18, Perha11: Justerad def samt anmärkning\r\n2020-05-19, PErha11: bubblet, publicera ej.', '-', '-'),
(91, '-', '2020-05-19 12:07:06.000000', 'överföring av information (3.9.5) i form av data (3.9.1) och metadata till digitala format', '-', 'Digital informationshantering och infrastruktur för kulturarvet | 2014 (reviderad)', 'Beslutad', 'digitalisering', '-', '-', '80.3', 135, 'ANMÄRKNING 1: Information kan till exempel vara text, bild eller ljud.', '2020-05-08,Perha11: Till beslut\r\n2020-05-19, perha11, magfo, karkj: Definition förädlad, anmärkning tillagd. Beslutad!', '-', '-'),
(92, '-', '2020-06-12 09:40:49.000000', 'konvertering av information (3.9.5) från analog till digital form', '-', 'Computer Sweden, IT-ord, Ord och uttryck i it-branschen', 'Beslutad', 'digitisering', '-', '-', '80.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(93, '-', '2020-06-12 09:40:19.000000', 'distanskontakt (30.2.2.2.1) med synkron kommunikation mellan patient (5.2.1) och hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM', 'Beslutad', 'direkt distanskontakt', '-', '-', '30.2.2.2.1.1', 135, 'ANMÄRKNING 1: Begreppet har inte definierats av termbanken. I Contsys talas om direkt hälso- och sjukvårdsaktivitet, ett begrepp som dock inte definieras men refereras i definitionen av utförarplats. En aktivitet kan vara direkt eller indirekt såsom implicit framgår i Contsys, men även en kontakt kan vara direkt (synkron) eller indirekt(asynkron). Se inledningen till avsnitt 7! En direkt distanskontakt kräver telekommunikation eller digital kommunikation. \r\n\r\nEXEMPEL 1: Telefonförfrågning, mobiltelefonkonsultation (t.ex. kry.se), klinisk videokonferens där patienten deltar, telefonmöte eller videomöte för samordnad vårdplanering.', '2020-06-12, marel67: Städad.', '-', '-'),
(94, '-', '2020-06-12 09:39:23.000000', 'vårdplats (27.7) i sluten vård (29.5) med fysisk utformning, utrustning och bemanning som säkerställer patientsäkerhet (28.2.4.4) och arbetsmiljö', '-', 'Socialstyrelsens termbank', 'Beslutad', 'disponibel vårdplats', '-', '-', '27.7.2', 135, 'ANMÄRKNING 1: Eftersom ordet \"fysisk\" finns i definitionen är det klart att detta rör sig om sängar som ska vara utrustade så att hälso- och sjukvård kan bedrivas på säkert sätt i en god arbetsmiljö. Ansvarig för patientsäkerhet och arbetsmiljö är verksamhetschefen, som beslutar om disponibla vårdplatser. Ofta är antalet detsamma som antalet fastställda vårdplatser, men personalbrist och risk för spridning av vårdrelaterade infektioner kan föranleda verksamhetschefen att besluta om minskat antal disponibla vårdplatser. Stor inströmning av patienter kan för patientsäkerheten kräva ökat antal platser, och det är också då verksamhetschefen som beslutar om detta, medveten om att det saknas finansiell täckning för det ökade antalet disponibla platser.', '2020-06-12, marel67: Städad.', '-', '-'),
(95, 'Mätning av värden på distans utan att patient vet om det (indirekt distanskontakt?)\r\n\r\nPatienten vet om att värden läses av och skickas men behöver inte göra detta aktivt.\r\n\r\nAutomatiserat flöde.', '2020-06-16 09:49:23.000000', 'avläsning av digitalt överförd information från patientmonitorering', '-', 'Informatik VGR', 'Beslutad', 'distansavläsning', '-', '-', '-', 7, 'ANMÄRKNING 1: patientmonitorering definieras: upprepad utredande vårdaktivitet (7.2.7.2) för inhämtning av patients (5.2.1) hälsotillstånd (6.4)\r\n\r\nANMÄRKNING 2:  På internetmedicin.se kan i avsnittet om intrakardiell defibrillator (ICD) bl.a. läsas \"Distansavläsning av ICD via webbaserade system blir allt vanligare. Om en patient får ett tillslag från ICD-dosan skickas ett meddelande till respektive ICD-mottagningen som kan kontaktas under kontorstid.\" Detta klargör att distansavläsning inte görs synkront med signalregistreringen utan ställs till vårdenhetens förfogande för avläsning när det är lägligt.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-04, ajla: Lagt in beskrivning, mejlar beställare om mer information\r\n2020-05-26, ajla, marel67: Fyllt på kontexten med svar från beställare.\r\n2020-05-26, karkj, perha11: Definition omarbetad. Kvarstående frågor > åter till pågår, jira 669\r\n2020-06-16, karkj, magfo: definitionen förädlad, begreppsposten beslutad. Jirakort 669 avslutat.', '-', '-'),
(96, '-', '2020-06-12 09:38:31.000000', 'öppenvårdskontakt (30.2.2.1.1.1) där patient (5.2.1) och hälso- och sjukvårdspersonal (5.2.3.3) är rumsligt åtskilda', '-', 'FVM byggt på Socialstyrelsens termbank', 'Beslutad', 'distanskontakt', '-', '-', '30.2.2.2.1', 135, 'ANMÄRKNING 1: Eftersom termen \"öppenvårdskontakt\" införts i FVM används denna i stället för den definitionsliknande term som finns i termbanken. Se 5.1.1. Dessutom nämns patient först och hälso- och sjukvårdspersonal sist för att ordningsföljden ska vara densamma som i definitionen av öppenvårdsbesök.', '2020-06-12, marel67: Städad.', '-', '-'),
(97, '-', '2020-06-12 09:37:44.000000', 'samling av information som behandlas som en enhet och som lagrats på ett medium', '-', 'Rikstermbanken eller MSB', 'Beslutad', 'dokument', '-', '-', 'Inte definierad', 5, 'ANMÄRKNING 1: Dokument kan lagras på olika medier, t.ex. papper, hårddisk, cd-skiva, databas. Dokument kan utväxlas mellan användare och system. Dokument kan delas in i textdokument, bilddokument och AV-dokument. Dokument kan vara en katalog, ett reklamblad, en film, ett fotografi, en ljudfil etc.', '2020-02-20, BB: Formell definition \r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(98, '-', '2020-06-12 09:36:48.000000', 'insamling och sammanställning av information (3.9.5)', '-', 'FVM, efter Rikstermbanken eller språkrådet, reviderad', 'Beslutad', 'dokumentation', '-', '-', '23.9.5.1', 135, 'ANMÄRKNING 1: Rikstermbanken redovisar förklaring (inte definition): \"insamling och sammanställning av fakta\" ur Språkrådets svensk-albanska tolklexikon. Ordet fakta finns inte definierat, men det som kan utväxlas om fakta är förstås just information, varför detta ord ersatt fakta när definitionen skrivits.', '2020-06-12, marel67: Städad.', '-', '-'),
(99, '-', '2020-06-12 09:36:04.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) under vilket patientrelaterad information skapas eller upprätthålls', '-', 'Contsys SE', 'Beslutad', 'dokumentation inom hälso- och sjukvård', '-', '-', '7.2.7.8', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(100, '-', '2020-06-12 09:34:39.000000', '-', '-', 'Se A-listan FVM upphandling', 'Avråds', 'dokumentera', '-', '-', '-', 135, 'ANMÄRKNING 1: Se dokumentering: hälso- och sjukvårdsaktivitet där patientjournal skapas eller underhålls.', '2020-06-12, marel67: Städad.', '-', '-'),
(101, '-', '2020-06-12 09:34:06.000000', 'hälso- och sjukvårdsaktivitet (7.2) där patientjournal (12.2.1) skapas eller underhålls', '-', '3R Contsys reviderad', 'Beslutad', 'dokumentering', '-', '-', '32.2.1.1', 135, 'ANMÄRKNING 1: Termen \"indirekt hälso- och sjukvårdsaktivitet\" finns inte i FVM begreppssystem eftersom \"indirekt\" eller \"direkt\" framgår av kontakttypen när aktiviteten utförs. Det är alltid hälso- och sjukvårdspersonal som skriver i patientjournal och aktiviteten att föra journal är därför alltid en hälso- och sjukvårdstjänst. \r\n\r\nANMÄRKNING 2: Önskan att använda substantiv som termer för begreppen gör att ordet \"dokumentering\" (finns i SAOL) valts i stället för \"dokumentera\".', '2020-06-12, marel67: Städad.', '-', '-'),
(102, '-', '2020-06-12 09:32:56.000000', 'avgränsad uppsättning av relaterade delar', '-', 'VGR', 'Beslutad', 'domän', '-', '-', '-', 135, '-', '2020-02-20, BB: Definierad\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(103, '-', '2020-07-29 11:49:41.000000', '[inom apoteket] uttag ur tillverkarens originalförpackning och färdigställande av läkemedelsprodukter (6.1.3.2) för varje doseringstillfälle till patient (2.1.1)', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'dosdispensering', '-', '-', '27.2.1.5', 135, 'ANMÄRKNING 1: Socialstyrelsens definition: (inom apoteket:) uttag ur tillverkarens originalförpackning och färdigställande av läkemedelsprodukter för varje doseringstillfälle till enskild person. Eftersom personen i fråga får läkemedel som ordinerats av hälso- och sjukvårdspersonal och expedieras av hälso- och sjukvårdspersonal vid apotek bedöms personen vara patient, vilket bör föranleda ändring av termbankens definition.', '2020-06-12, marel67: Städad.\r\n2020-07-29, magfo: Inkluderat synonymen Apodos från Patientbakgrund 2009. Apodos är varumärke som registrerades i Europeiska unionen 2006-11-22 och inte alls term för begreppet. Namnet apodos (som term med liten begynnelsebokstav) är så brett missbrukat att synonymen tillåts. I kommande patientöversikt får endast dosdispensering användas.', '-', '-'),
(104, '-', '2020-06-12 09:29:32.000000', 'patient (5.2.1) som får vissa av sina läkemedel (3.4.3) genom dosdispensering (27.2.1.5)', '-', 'FVM', 'Beslutad', 'dospatient', '-', '-', '25.2.1.1', 135, '-', '2020-06-12, marel67: Städad.', '-', 'patient som gett samtycke till att få vissa av sina läkemedel dosdispenserade samt till att ge förskrivare och legitimerad hälso- och sjukvårdspersonal tillgång till receptinformation som finns lagrad hos E-hälsomyndigheten (Socialstyrelsens termbank)'),
(105, '-', '2020-06-12 09:28:40.000000', 'förteckning över alla förskrivningar (29.2.9.2.1) för en dospatient (2.1.1.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'dosrecept', '-', '-', '29.2.9.2.3', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(106, '-', '2020-06-12 09:28:00.000000', 'förmåga att ta kontroll över sin situation och uppnå sina mål', '-', 'FVM', 'Beslutad', 'egenmakt', '-', 'empowerment', '27.4', 135, 'ANMÄRKNING 1: Låneordet empowerment är rikt använt när man önskar betona vikten av patientens delaktighet och den enskildes bestämmanderätt men också stärkning av självförtroende och i förlängningen rättshandlingsförmågan. I kärnsystemet bör begreppet betecknas med ett ord på svenska språket. Många definitioner och beskrivningar finns, bl.a. \"tilltro till egen förmåga\" och \"människans inneboende kraft\". Båda dessa synes spegla endast ett par av aspekterna på egenmakt.', '2020-06-12, marel67: Städad.', '-', '-'),
(107, '-', '2020-06-23 11:40:08.000000', 'löpande registrering av värden avseende en individs hälsotillstånd som utförs av individen själv', '-', 'SKR, reviderad', 'Beslutad', 'egenmonitorering', '-', '-', '-', 135, 'ANMÄRKNING 1: Information som samlas in genom egenmonitorering blir patientgenererade hälsodata (32.2.2.7) som utgör icke validerad hälso- och sjukvårdsinformation (12.5.3.3), vilken såsom hälso- och sjukvårdsinformation för import (12.5.3.4) efter validering (av hälso- och sjukvårdspersonal) kan betecknas journalhandling (32.2.4).\r\n\r\nANMÄRKNING 2: (ur korrespondens med Erica Sandberg och Karina Tellinger) Egenmonitorering genomförs med stöd av digital teknik som anger objektiva mätvärden med eller utan subjektiva skattningar. Värdena tillgängliggörs för vårdtagare och vårdenhet.', '2020-02-18, Perha11:  OK?\r\n2020-06-12, marel67: Städad.\r\n2020-06-23, magfo: ny definition från Erica Sandberg/Karina Tellinger. Ska upp till beslut. Jira 709.\r\n2020-06-23, karkj, magfo: Liten justering i SKR:s definition. Beslutad.', '-', '-'),
(108, '-', '2020-06-12 09:25:48.000000', 'skriftlig vårdbegäran för egen räkning (31.3.6)', '-', 'FVM', 'Beslutad', 'egenremiss', '-', '-', '31.3.6.1', 135, 'ANMÄRKNING 1: I 3R Contsys-modellen liksom i NI avråds från termen \"egenremiss\". I stället ska endast begreppet \"vårdbegäran för egen räkning\" användas. Eftersom en sådan kan vara muntlig eller skriftlig och uttrycket \"egenremiss\" är djupt rotat i svensk hälso- och sjukvård kan begreppet inte förnekas, och då bör det inkluderas i begreppssystemet. I ett informationssystem behöver begreppet representeras så att en patient kan fylla i en elektronisk blankett för egenremiss.', '2020-06-12, marel67: Städad.', '-', '-'),
(109, '-', '2020-08-05 10:11:49.000000', 'hälso- och sjukvårdsaktivitet (7.2) som patient (5.2.1) själv utför efter ordination (29.2.9) av hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM', 'Beslutad', 'egenvårdsaktivitet', '-', '-', '27.2.4.1', 135, 'ANMÄRKNING 1: Socialstyrelsens definition av egenvård i SOSFS 2009:6 avser ordination av egenvård. När den utförs av patienten kallas den i detta begreppssystem egenvårdsaktivitet.\r\n\r\nEXEMPEL 1: Konditionsträning efter fysisk aktivitet på recept. Självadminstrering av förskrivet läkemedel. Vårdåtgärder, förebyggande åtgärder etc. som patienten företar sig på eget initiativ utan att ha fått ordination av hälso- och sjukvårdspersonal exkluderas i föreskriften.', '2020-06-12, marel67: Städad.\r\n2020-08-04, ollka3, sofan63, magfo: Egenvård tillförd som synonym. Begreppet egenvård publiceras inte.', '-', '-'),
(110, '-', '2020-06-12 09:22:22.000000', 'hälsorelaterad tidsperiod när ordinerad egenvård (7.2.4) utförs', '-', '3R Contsys', 'Publicera ej', 'egenvårdsperiod', '-', '-', '62.6', 135, '-', '2020-06-12, marel67: Publiceras ej. Dubblett till period för egen vård 10.2.2.3.', '-', '-'),
