(112, '-', '2020-06-12 09:20:43.000000', 'register (23.9.2.1) med information (3.9.5) om en patients (5.26.1) hälsa (2.1) och hälso- och sjukvård (3.1.1) som ges i ett format som kan bearbetas av datorer', '-', 'ISO 13606-2:2008 eller Contsys SE definitionen ändrad från ISO-standarden i engelska Contsys', 'Beslutad', 'elektronisk hälsojournal', '-', '-', '3.9.7', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(113, '-', '2020-06-12 09:20:19.000000', 'journalkomponent (12.2.3) som endast inkluderar information (3.9.5) i elektroniskt format', '-', 'Contsys SE', 'Beslutad', 'elektronisk journalkomponent', '-', '-', '12.2.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(114, '-', '2020-06-12 09:19:49.000000', 'elektroniskt journalutdrag (12.5.1) som innehåller grundläggande hälso- och sjukvårdsinformation (3.9.4) avsedd för specifika ändamål', '-', 'Contsys SE', 'Beslutad', 'elektronisk patientöversikt', '-', '-', '12.5.2', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
