(116, '-', '2020-06-12 09:18:52.000000', 'del av en vårdaktivitetsperiod (10.2.2) under vilken en hälsoangelägenhet (6.3) specifikt hanteras', '-', 'Contsys SE', 'Beslutad', 'element inom vårdaktivitetsperiod', '-', '-', '10.2.2.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(117, '-', '2020-06-12 09:18:03.000000', '[hälso- och sjukvårdens organisation] vårdenhet (25.2.3.1.2) som leds av en enhetschef och utgör en del av en verksamhet (25.2.3.1.2.3)', '-', 'FVM utgående från Katalog i väst', 'Beslutad', 'enhet', '-', '-', '25.2.3.1.2.4', 135, 'ANMÄRKNING 1: En enhet kan vara en avdelning inom en vårdcentral, t.ex. barnavårdscentral, eller en vårdavdelning vid sjukhus. Vid vårdavdelningen förekommer olika titlar för chefen: avdelningschef, vårdenhetschef, avdelningsföreståndare. Titeln vårdenhetschef föranleder inte att avdelningen får kallas vårdenhet eftersom detta är ett överordnat begrepp som inrymmer alla nivåer under vårdgivare. \r\n\r\nANMÄRKNING 2: Enhet är en homonym eftersom den är organisatoriskt fastställd i betydelsen enligt denna termpost men också betecknar mått inom laboratoriemedicinen. \r\n\r\nEXEMPEL 1: Barnavårdscentral vid vårdcentral, vårdavdelning vid sjukhus, radiologisk avdelning vid verksamhetsområde för bild- och funktionsmedicin.', '2020-04-07, vikee1, lagt till synonymen avdelning.\r\n\r\n2020-06-12, marel67: Städad.', '-', '-'),
(118, '-', '2020-06-12 09:16:36.000000', '[laboratorieverksamhet] fastlagt jämförelsevärde av en storhet', '-', 'Socialstyrelsens termbank', 'Beslutad', 'enhet', '-', '-', '27.2.7.2.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(119, '-', '2020-06-12 09:15:45.000000', 'kostnad för resurs (3.4.1) vid dess enda utnyttjande', '-', 'FVM', 'Beslutad', 'enhetskostnad', '-', '-', '27.9.6', 135, 'ANMÄRKNING 1: Avser förbrukningsartiklar och kroppsmonterade medicintekniska produkter.', '2020-06-12, marel67: Städad.', '-', '-'),
(120, 'Ett ord som beskriver sammanfattning av vårdkontakten som varit.', '2020-06-12 09:14:22.000000', 'klinisk rapport (12.5.3) innehållande sammanfattande information (3.9.5) om en hel vårdprocess (8.2) eller en del av den', '-', 'FVM', 'Beslutad', 'epikris', '-', '-', '32.5.3.5', 135, 'ANMÄRKNING 1: Epikris skrivs klassiskt i slutet av ett vårdtillfälle. I kärnsystemet ska en sådan sammanfattning kunna upprättas när som helst i en process och redovisa öppen vård likaväl som sluten vård, en del av en vårdprocess som omfattar såväl öppen som sluten vård och, självklart, en hel avslutad vårdprocess.\r\n\r\nANMÄRKNING 2: Epikris och slutanteckning defineras var för sig.', '2020-06-12, marel67: Städad.', '-', '-'),
(121, '-', '2020-06-12 09:13:46.000000', 'hälso- och sjukvårdsrelaterad period (10.2) som inkluderar alla vårdaktivitetsperioder (10.2.2) i en enskild patientprocess (8.2.1)', '-', 'Contsys SE', 'Beslutad', 'episod för klinisk process', '-', '-', '10.2.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(122, '-', '2020-06-12 09:13:21.000000', 'hälso- och sjukvårdstjänst (8.2.6) som levereras elektroniskt', '-', 'VGR', 'Beslutad', 'e-tjänst', '-', '-', '28.2.6', 135, 'ANMÄRKNING 1: En elektronisk tjänst kännetecknas av att den erhålls via en dator, en mobiltelefon eller annan elektronisk enhet.', '2020-06-12, marel67: Städad.', '-', '-'),
(123, '-', '2020-06-12 09:12:48.000000', 'sammanställning av läkemedelsfakta från läkemedelsindustrin till förskrivare av läkemedel och apotekspersonal', '-', 'FASS', 'Beslutad', 'FASS', '-', '-', '27.8.6', 135, 'ANMÄRKNING 1: FASS är en förkortning som står för Farmaceutiska Specialiteter i Sverige.', '2020-06-12, marel67: Städad.', '-', '-'),
(124, 'Inte definierad', '2020-06-02 13:46:04.000000', 'läkare i primärvården som har ansvar för hälso- och sjukvården av viss patient', '-', 'Informatik VGR', 'Beslutad', 'fast läkarkontakt', '-', '-', '-', 135, 'EXEMPEL: Handläggande distriktsläkare i primärvården.\r\n\r\nANMÄRKNING 1: Vårdcentralen ska erbjuda sina listade patienter en fast läkarkontakt. Patienter som är multisjuka och/eller har ett kontinuerligt vårdbehov ska prioriteras. Den fasta läkarkontakten ska vara den läkare som personen så långt som möjligt får träffa vid besök för sin grundsjukdom och den ska samordna vården mellan olika vårdenheter.', '2020-06-02, verwi6, perha11: Kompletterad med anmärkning, beslutad.', '-', '-'),
(125, 'Inte definierad', '2020-06-16 14:33:11.000000', 'professionell hälso- och sjukvårdspersonal som är primär kontakt för viss patient', 'Inte definierad', 'FVM', 'Publicera ej', 'fast vårdkontakt', 'Inte definierad', 'Inte definierad', 'Inte definierad', 1, 'Exempel: Sjuksköterska som tar hand om en viss typ av patienter.  Kommentar: I primärvården ska patient erbjudas fast läkarkontakt, i specialistvården kan det vara legitimerad hälso- och sjukvårdspersonal med annat yrke.  (VGR avser att ändra professionell hälso- och sjukvårdspersonal till vårdutförare med särskild behörighet)\r\n\r\nANMÄRKNING 1: BEGREPPET ÄR AVSTÄLLT, FINNS BEGREPP MED SAMMA TERM SOM ÄR BESLUTAT.', '2020-05-19, perha11, magfo: Dubblett, publiceras ej.\r\n2020-06-16, magfo: Lagt till anmärkning att begreppet är avställt.', 'Inte definierad', '-'),
(126, '-', '2020-06-12 09:12:09.000000', 'vårdplats (27.7) i sluten vård (29.5) beslutad av vårdgivare (25.2.3.1.1)', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'fastställd vårdplats', '-', '-', '27.7.1', 135, 'ANMÄRKNING 1: Vårdgivaren delegerar vanligen till berörda sjukhusstyrelser eller förvaltningschefer att besluta om fastställda vårdplatser. Begreppet avser budget för en slutenvårdsresurs och är primärt inte kopplat till en fysiskt vårdplats (se disponibel vårdplats 9.1.2.3). \r\n\r\nANMÄRKNING 2: Socialstyrelsens definition av huvudman är \"myndighet eller organisation som juridiskt och ekonomiskt har ansvaret för viss verksamhet\". Denna definition säger inget om vilken verksamhet det rör sig om. I Västra Götalandsregionen skulle det kunna vara ledningen för Västra Götalandsregionens folkhögskolor som beslutar om vårdplatser. I fråga om hälso- och sjukvård är vårdgivare synonymt med huvudman, varför denna term väljs i definitionen.', '2020-06-12, marel67: Städad.', '-', 'vårdplats i sluten vård beslutad av huvudman (Socialstyrelsens termbank)'),
(127, '-', '2020-05-20 09:47:43.000000', 'belägenhetsadress där person är bosatt enligt folkbokföringslagen', '-', 'Rikstermbanken/Posten Sverige AB: Postodrlistan 2012 (reviderad)', 'Beslutad', 'folkbokföringsadress', '-', '-', '-', 2, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning.\r\n2020-05-13, Marel67: Flyttad till Preliminär.\r\n2020-05-20, annbr113, karkj, magfo, perha11: Justerad, beslutad', '-', '-'),
(128, 'patienter som enskilt ingår i en studie av forskare. I något finansierat forskningprojekt där ingen ersättning eller avgift ska betalas ut', '2020-05-07 14:08:24.000000', 'patient som utan att lida av någon sjukdom ingår i ett forskningsprojekt', '-', 'Informatik VGR', 'Beslutad', 'forskningspatient', '-', '-', '-', 7, 'ANMÄRKNING 1: anslagsfinasierat forskningprojekt där ingen patientavgift ska betalas och ingen ersättning utgår till hälso- och sjukvårdsutföraren.\r\n\r\nANMÄRKNING 2: begreppet studiepatient (se detta) avser patienter som inkluderas i en studie som ska pröva effekten av viss behandling.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-04, Perha11 BV: Preliminärd definierad\r\n2020-05-07, magfo: Tagit bort onödiga kommatecken i definitionen\r\n2020-05-12, karkj, perha11, magfo: Beslutad', '-', '-'),
(129, 'En definition måste ge stöd åt principer för när ett embryo övergår till att vara ett foster, hur journal förs vid intrauterin kirurgi samt regler för inducerad abort. Den terminologiska utredningen bör göras i samråd med Gertrude.', '2020-07-07 09:32:39.000000', '-', '-', '-', 'Pågår', 'foster', '-', '-', '-', 8, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: Ändrat status till ej påbörjad.\r\n2020-07-07, marel67: (Jira 999) Gertrude kontaktad och hon ska leta upp vad som står i lagtext kring detta.', '-', '-'),
