(132, 'plats med bestämt läge (Källa: VGR)', '2020-07-28 13:49:38.000000', 'plats med bestämt läge', '-', 'Informatik VGR', 'Pågår', 'fysisk plats', '-', '-', '-', 2, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, magfo: Posten ska utredas.\r\n2020-07-07, vikee1, davte1: Preliminärt definierad.\r\n2020-07-28, magfo: Behöver ytterligare utredning, se JIRA 152', '-', '-'),
(133, '-', '2020-06-12 09:08:55.000000', 'information (3.9.5) och instruktion till patient (5.2.1) om hälso- och sjukvårdsaktivitet (7.2) och vårdkontakt (10.2.2.1.1)', '-', 'FVM', 'Beslutad', 'förberedelseinformation', '-', '-', '32.2.3.2', 135, 'ANMÄRKNING 1: Inför en operation kan patienten behöva såväl information om ingreppet som instruktion om praktiska åtgärder före ingreppet. Det kan också behövas förhållningsregler på en vårdavdelning eller inför ett öppenvårdsbesök (t.ex. provtagning före, komma 15 minuter före besökstid).', '2020-06-12, marel67: Städad.', '-', '-'),
