(137, '-', '2020-06-12 09:04:38.000000', 'fördröjning av hälso- och sjukvårdsaktivitet (10.2.3) enligt patientens (5.2.1) preferens, när det varken föreligger en fördröjning på grund av hälsotillstånd (10.2.3.1) eller en fördröjning på grund av bristande resurser inom hälso- och sjukvårdsorganisation (10.2.3.2)', '-', 'Contsys SE', 'Beslutad', 'fördröjning på grund av patientpreferens', '-', '-', '10.2.3.3', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(138, '-', '2020-06-12 08:58:26.000000', 'informell vårdbegäran (11.3) där hälso- och sjukvårdspersonal (5.2.3.3) ber om råd eller hjälp avseende en patient (5.2.1) utan att kontakten formaliseras som remiss (11.3.3)', '-', 'FVM', 'Beslutad', 'förfrågan', '-', '-', '31.4', 135, 'ANMÄRKNING 1: Många gånger händer det att en hälso- och sjukvårdspersonal (oftast läkare) rådfrågar en kollega om en viss patient. Detta journalförs nästan aldrig. En konsultläkare tar emot telefonsamtal från kollegor som ställer frågor och ber om råd, något som ofta inte heller dokumenteras. När nu en ny vårdinformationsmiljö sätts upp är det angeläget att denna typ av kontakter dokumenteras. Tekniken får utvecklas, men det kräver att fenomenet erkänns, och därför definieras detta begrepp.', '2020-06-12, marel67: Städad.', '-', '-'),
(139, '-', '2020-06-12 08:57:41.000000', 'potentiellt hälsotillstånd (6.4.2) som av en hälso- och sjukvårdsaktör (5.2) förmodats föreligga på grundval av ett eller flera observerade tillstånd (6.4.1)', '-', 'Contsys SE', 'Beslutad', 'förmodat tillstånd', '-', '-', '6.4.2.1', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(140, '-', '2020-06-12 08:57:16.000000', 'person (3.3.4) som utövar förmynderskap (23.8.3)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'förmyndare', '-', '-', '25.2.4.3.4', 135, 'ANMÄRKNING 1: Om förmyndare se föräldrabalken 10 kap. 2 och 3 §§ och anmärkning 1 under vårdnadshavare (25.2.4.3.3)!', '2020-06-12, marel67: Städad.', '-', '-'),
(141, '-', '2020-06-12 08:56:38.000000', 'förvaltning av omyndigs egendom samt befogenheter att företräda denne i andra angelägenheter än dem som rör dennes person (3.3.4)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'förmyndarskap', '-', '-', '23.8.3', 135, 'ANMÄRKNING 1: En omyndig företräds i sina personliga angelägenheter av vårdnadshavaren och inte förmyndaren. Vanligen är förmyndare och vårdnadshavare samma person(er), men domstolsbeslut kan göra att det är olika personer.', '2020-06-12, marel67: Städad.', '-', '-'),
(142, '-', '2020-06-03 21:29:36.000000', 'person (3.3.4) behörig att utfärda recept (29.2.9.2.2), livsmedelsanvisning (29.2.9.3), hjälpmedelskort (29.2.9.4) eller dosrecept (29.2.9.2.3)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'förskrivare', '-', '-', '25.2.3.3.1.1', 135, 'ANMÄRKNING 1: Att vara förskrivare är inte bara att förskriva läkemedel etc. Funktionen kräver särskild behörighet som registreras genom att förskrivaren erhåller en förskrivarkod av Socialstyrelsen. Därför ska ordet behörig ingå i definitionen.', '2020-06-02, sofan63, magfo: Termpostens formalism fulländad. Beslutad.\r\n2020-06-03, magfo: En anmärkning tillagd, påverkar inte term och definition.', '-', '-'),
(143, '-', '2020-06-04 10:10:47.000000', 'utfärdande av recept (29.2.9.2.2), livsmedelsanvisning (29.2.9.3), hjälpmedelskort (29.2.9.4) och dosrecept (29.2.9.2.3)', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'förskrivning', '-', '-', '29.2.9.2.1', 155, 'ANMÄRKNING 1: \"Behörig\" är struket, se ordination, 3.2.2.2!\r\n\r\nANMÄRKNING 2: vem som gör förskrivningen påverkar inte begreppsinnehållet. Det är föredömligt att det står \"och\" i uppräkningen men \"eller\" i samma uppräkning avseende förskrivare.', '2020-06-03, karkj: Gammal begreppspost från FVM där definition bör ses över. Ändrat status till pågår.\r\n2020-06-03, magfo: Sett över och ändrat definitionen, kagt till anmärkning 3. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', 'utfärdande av recept, livsmedelsanvisning, hjälpmedelskort eller dosrecept av behörig hälso- och sjukvårdspersonal (Socialstyrelsens termbank original)'),
(144, '-', '2020-06-12 08:56:01.000000', 'handling, utfärdad av förskrivare (25.2.3.3.1.1), som innebär auktorisation för apotek att lämna ut ett hjälpmedel för det dagliga livet (6.1.1.3.5)', '-', 'FVM', 'Beslutad', 'förskrivning av hjälpmedel för det dagliga livet', '-', '-', '29.2.9.5', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(145, 'Inte definierad', '2020-03-10 00:00:00.000000', 'förteckning över de typer av hälso- och sjukvårdstjänster (8.2.6) som erbjuds av en eller flera vårdutförare (5.2.3)', '8.2.7', 'Contsys SE', 'Beslutad', 'förteckning över hälso- och sjukvårdstjänster', 'Inte definierad', 'Inte definierad', '8.2.7', 1, 'Anmärkning 1     förteckning av tjänsteutbud (FVM)  Anmärkning 1 förteckning av tjänsteutbud (FVM) Systemet med utbudskatalog är välutvecklat i flera röntgeninformationssystem (RIS). Det går lika bra att använda vid vilken vårdenhet som helst, men funktionen är nödvändig att bevara vid bild- och funktionsmedicinska verksamheter.  Anmärkning 2      Contsys term vårdgivare i definitionen bytt mot vårdutförare.', '2020-03-10, Perha11: Contsys id upppdaterad', 'Inte definierad', NULL),
(146, '-', '2020-06-12 08:55:25.000000', 'person (3.3.4) som är utsedd att företräda en viss person (3.3.4) som är ur stånd att vårda sig själv eller sin egendom och där dennes rättshandlingsförmåga är begränsad', '-', 'Socialstyrelsens termbank', 'Beslutad', 'förvaltare', '-', '-', '25.2.4.3.2', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(147, '-', '2020-08-01 22:25:19.000000', 'organisation inom vårdgivare som har styrelse och leds av förvaltningschef', '-', 'Informatik VGR', 'Beslutad', 'förvaltning', '-', '-', '25.2.3.1.2.1', 135, 'ANMÄRKNING 1: Förvaltningscheferna är direkt underställda vårdgivarens chef och kan enligt delegation ha vårdgivares befogenheter och skyldigheter. Hos en privat vårdgivare med liten organisation kan förvaltning och vårdgivare sammanfalla.\r\n\r\nEXEMPEL 1: Primärvårdsförvaltning, habiliteringsförvaltning (VGR Habilitering & hälsa), sjukhus.', '2020-06-12, marel67: Städad.\r\n2020-07-31, magfo: Efter diskussion med KIV kan inte en förvaltning kallas vårdenhet. Definitionen är därför ändrad och ny modell finns som bild i JIRA 964\r\n2020-08-05, ollka3, magfo: Beslutad.', '-', '-'),
(148, '-', '2020-06-04 14:14:33.000000', 'namn på projekt i VGR som syftar till att säkerställa möjligheter för återanvändning av vårdinformationsmiljöns information för operationella och analytiska tillämpningar', '-', 'Informatik VGR', 'Beslutad', 'Gemensam informationsplattform', '-', '-', '-', 155, 'ANMÄRKNING 1: \r\n‒ Operationellt datautbyte: sekundaktuell data utbyts mellan operationella tillämpningar och källsystem, i båda riktningar.\r\n‒ Analytiskt datauttag: enkelriktat flöde av data från källsystem till tillämpningar för sammanställt material för t ex forskning, uppföljning och analys.', '2020-02-20, BB: Påbörjat beskrivning, Stäm av!\r\n2020-05-08, Perha11: Beskrivning inlagd, bör förtydligas\r\n2020-06-04, perha11: Definition och anmärkning tillagd, preliminär.\r\n2020-06-04, magfo, vikee1, perha11: Definitionen förädlad, beslutad.', '-', '-'),
(149, 'Inte definierad', '2020-05-25 11:27:23.000000', 'som berör allt eller alla', '-', 'Svensk ordbok', 'Beslutad', 'generell', '-', '-', '-', 135, '-', '2020-05-25, perha11: Uppdaterad, definition justerad', '-', '-'),
(150, 'Från upphandlingen VGR.', '2020-05-20 13:45:59.000000', '(som har ett vidare användningsområde än i just den kontext i vilken den bearbetas)', '-', 'Wiktionary', 'Publicera ej', 'generisk', '-', 'generic', '80.7', 1, 'ANMÄRKNING 1:   Ordet generisk kommer av latinets genus, plural genera – sort, slag, kön. I biologi och andra veten­skaper används ordet generisk om egenskaper som finns hos alla individer av en viss art, t ex:\r\n– generic brand product – märkes­lös produkt, som ”kaffet Kaffe”;\r\n– generic drug – låg­pris­kopia av känt läke­medel med utgånget patent;\r\n– generic computer – märkeslös dator (”källarbygge”);\r\n– generisk marknads­föring (generic marketing) – märkes­lös marknads­föring för en typ av produkt, till exempel ”ät mer smör”;\r\n– generic user – vanlig användare, typisk användare (utan särskiljande egenskaper).\r\n\r\nFöretagsnamn och varumärken blir ibland generiska, det vill säga att namnen inte längre förknippas med originalprodukten eller dess tillverkare, t ex:\r\n– googla, om att göra sökningar med vilken sökmotor som helst, inte nödvändigtvis Google\r\n– topsa, Topz är ett varumärke\r\n– plexiglas\r\n– termos\r\n– post-it-lapp\r\n– perstorpplatta\r\n\r\nI upphovsrätten kallas detta för degeneration av varumärken. Företagen som äger varumärkena brukar motarbeta degenereringen, sällan med framgång.  (IDG IT-ordlistan)', '2020-05-08, Perha11: Kompletterat med alternativa definitioner och anmärkningar, Preliminär för beslut.\r\n2020-05-20, perha11: Åter till pågående för fortsatt utredning\r\n2020-05-25, perha11: Sätts som publiceras ej,  tas upp om det aktualiseras  igen', '-', '(generic) – allmän, märkeslös – utan särskilda kännetecken, med samma egen­skaper som andra av samma slag; inte skyddad av upphovsrätt, registrerat varumärke eller andra inskränk­ningar \r\n\r\nOrdet generisk finns på svenska, men det bör användas med urskillning, eftersom de flesta inte vet vad det står för. Ordet innebär egentligen att man särskiljer sorten, men inte individerna. Ordet generisk kommer av latinets genus, plural genera – sort, slag, kön. I biologi och andra veten­skaper används ordet generisk om egenskaper som finns hos alla individer av en viss art.(IDG IT-ordlistan)'),
(151, '-', '2020-06-12 08:54:02.000000', '[inom socialtjänsten] vård- och omsorgsplan (29.1) som beskriver hur en beslutad insats praktiskt ska genomföras för den enskilde', '-', 'Socialstyrelsens termbank', 'Beslutad', 'genomförandeplan', '-', '-', '29.2.2.3', 135, 'ANMÄRKNING 1: Avser insatser (aktiviteter) inom Socialtjänsten. Aktualiseras hos hälso- och sjukvården inom samordnad vårdplanering.', '2020-06-12, marel67: Städad.', '-', '-'),
(152, 'lägesbestämning av plats med geodetiska koordinater (Källa: VGR)', '2020-06-16 11:10:26.000000', 'lägesbestämning av plats med geodetiska koordinater', '-', 'Informatik VGR', 'Publicera ej', 'geodetisk position', '-', '-', '-', 2, 'ANMÄRKNING 1: Geodetiska koordinater är liksom GPS-koordinater lokaliserande på jordytan och nödvändiga om en plats ska lokaliseras inom ett stort område utan adressystem. Inom hälso- och sjukvården kan det röra sig om att en helikopter ska finna en skadad person i en skog. I den rutinmässiga verksamheten som stöds av ett dokumentationssystem kommer begreppet inte att aktualiseras utan är begränsat till fastighetssystem och transportsystem. Begreppet är därför definierat men inte publicerat.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-09, vikee1, perha11: Publiceras ej i väntan på utredning. Jira 801\r\n2020-06-16, karkj, magfo: definitionen skapad, begreppsposten beslutad men publiceras inte.', '-', '-'),
