(154, '-', '2020-06-12 08:51:58.000000', 'person (3.3.4) ) som är utsedd att företräda en viss person (3.3.4) som på grund av sjukdom (26.4.2.5.3), psykisk störning, försvagat hälsotillstånd eller liknande förhållande behöver hjälp med att bevaka sin rätt, förvalta sin egendom eller sörja för sin person utan att dennes rättshandlingsförmåga begränsas', '-', 'Socialstyrelsens termbank', 'Beslutad', 'god man', '-', '-', '25.2.4.3.1', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
