(157, '-', '2020-06-12 08:50:55.000000', 'konfiguration som utgår från startkonfigurationen (40.1), utformas i dialog mellan leverantör och kund och är en förutsättning för första skarpa driftsättning', '-', 'FVM upphandling', 'Beslutad', 'grundkonfiguration', '-', '-', '40.2', 135, 'ANMÄRKNING 1: Grundkonfigurationen ska möjliggöra fullskalig drift i normal produktionsmiljö.', '2020-06-12, marel67: Städad.', '-', '-'),
(158, 'Det läggs alltid till en anställds grundschema. För att visa på arbetstidsschema. Håller sig till avtal. Arbetstimmar i följd\r\n\r\nGrundschema: Behov finns för att grundschemat synkroniseras och hämtar Information från arbetstidsschema och basschema för att definiera varje Hälso- och sjukvårdspersonals schema inför planering och uppfyllande av Verksamheters mål och visualisering av arbetsuppgiftslistor och kalendrar för bokning. Planering kan bestå av exempelvis vårdbehov, Vårdenheters beräknade vårdtyngd, verksamhetsavtal och utifrån fackliga avtal', '2020-05-14 10:39:44.000000', 'schema som definierar förläggning av varje hälso- och sjukvårdspersonals arbetstid inför planering av verksamhet', '-', 'Informatik VGR', 'Beslutad', 'grundschema', '-', '-', '-', 7, 'ANMÄRKNING 1: Definition skapad utifrån FVM:s upphandlingsmaterial\r\nANMÄRKNING 2: Det finns också behov av att kunna skapa grundschema för resurser som inte är personal. T.ex: rullstol, dialysmaskin, sängplats, medicinteknisk utrustning\r\noch ambulans.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-05, Perha11, Marel67: Åter för utredning om vad som egentligen menas. Till Martin.\r\n2020-05-07 Marel67: Flyttad till preliminär\r\n2020-05-14, karkj, magfo: Definitionen kortad. Termposten beslutad.', '-', '-'),
