(161, '-', '2020-05-14 10:35:34.000000', 'formellt specificerad och beskriven koppling eller kontaktyta mellan system, enheter och människa i olika kombinationer', '-', 'Basord i våra fackspråk | 2012, TNC', 'Beslutad', 'gränssnitt', '-', '-', '80.8', 135, 'ANMÄRKNING 1: Gränssnitt kan t.ex. gälla fysisk hopkoppling, signaler eller funktioner. Om man avser kontaktytan mellan människa och maskin talar man ofta om användargränssnitt.', '2020-05-08, Perha11,: TIll Beslut\r\n2020-05-14, karkj, magfo: Termposten beslutad.', '-', '-'),
