(163, '-', '2020-05-05 13:25:10.000000', 'aktivitet (23.6.6) för att leda och styra tillgången på och användning av de hälso- och sjukvårdsresurser (7.2.9) som krävs för att utföra hälso- och sjukvårdsaktivitet (7.2)', '-', 'Contsys SE', 'Beslutad', 'hantering av hälso- och sjukvårdsresurs', '-', '-', '7.2.9.3', 1, '-', 'Från VGR begreppssystem 1.0\r\n\r\n2020-05-05, Perha11, Marel67.: Lagt tlll synonym', '-', '-'),
(164, '-', '2020-06-12 08:48:51.000000', 'uppsättning hälso- och sjukvårdsaktiviteter (7.2) som utförs som respons på en negativ händelse (8.2.4)', '-', 'Contsys SE', 'Beslutad', 'hantering av negativa händelser', '-', '-', '8.2.5', 135, 'ANMÄRKNING 1: Detta begrepp får inte förväxlas med avvikelsehantering, som inte förekommer i Contsys SE men är en viktig funktion i svensk sjukvård. Som framgår av termposten negativ händelse är en sådan en avvikelse liksom ett tillbud. hantering av negativa händelser består av hälso- och sjukvårdsaktiviteter som alltid riktar sig till ett hälsostatus som föreligger hos en enda patient, och begreppet avser alltså medicinska åtgärder för att neutralisera den negativa händelsen. Avvikelsehantering riktar sig inte till en viss patient utan avser att analysera orsakerna till tillbud och negativa händelser samt inkludera åtgärder för att förhindra ett upprepande.', '2020-06-12, marel67: Städad.', '-', '-'),
(165, '-', '2020-06-12 08:47:56.000000', '[hälso- och sjukvård] öppenvårdsbesök (5.5.2.1) i patients (1.1.1) bostad eller motsvarande', '-', 'Socialstyrelsens termbank', 'Beslutad', 'hembesök', '-', '-', '30.2.2.1.1.1.3', 135, 'ANMÄRKNING 1: (Ur termbankens termpost) Skilj från hemsjukvårdsbesök som hänförs till hemsjukvård. I den nationella statistiken räknas öppenvårdsbesök, t.ex. vid akut sjukdom hos patient som erhåller hemsjukvård men där orsaken inte omfattas av vård- och omsorgsplanen, som hembesök.', '2020-06-12, marel67: Städad.', '-', '-'),
(166, '-', '2020-06-12 08:47:17.000000', 'hälso- och sjukvård (3.1.1) när den ges i patients (5.2.1) bostad eller motsvarande och som är sammanhängande över tiden', '-', 'Socialstyrelsens termbank', 'Beslutad', 'hemsjukvård', '-', '-', '29.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(167, '-', '2020-06-12 08:46:53.000000', 'vårdkontakt (10.2.2.1.1) inom hemsjukvård (29.4) som innebär personligt möte mellan patient (5.2.1) och hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'hemsjukvårdsbesök', '-', '-', '30.2.2.1.1.1.7', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(168, '-', '2020-06-12 08:46:26.000000', 'individuellt utprovad produkt som syftar till att bibehålla eller öka aktivitet, delaktighet eller självständighet genom att kompensera en funktionsnedsättning (26.4.2.5.2)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'hjälpmedel för det dagliga livet', '-', '-', '27.6.4', 135, 'ANMÄRKNING 1: Hjälpmedel för det dagliga livet är vanligen medicintekniska produkter.', '2020-06-12, marel67: Städad.', '-', '-'),
(169, '-', '2020-06-12 08:45:50.000000', 'handling, utfärdad av förskrivare (25.2.3.3.1.1), som innebär auktorisation för apotek att expediera en viss förbrukningsartikel (6.1.1.3.4)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'hjälpmedelskort', '-', '-', '29.2.9.4', 135, '-', '2020-06-12, marel67: Städad.', '-', '-'),
(170, '-', '2020-06-12 08:45:26.000000', '[hälso- och sjukvård] landsting eller kommun som enligt hälso- och sjukvårdslagen (2017:30) ansvarar för att hälso- och sjukvård (3.1.1) erbjuds', '-', 'Hälso- och sjukvårdslagen (2017:30) 2 kap. 2§', 'Beslutad', 'huvudman', '-', '-', '23.3.8', 135, 'ANMÄRKNING 1: Hälso- och sjukvårdslagen (2017:30) 2 kap. 2§ lyder i sin helhet: \"Med huvudman avses i denna lag det landsting eller den kommun som enligt lagen ansvarar för att erbjuda hälso- och sjukvård. Inom en huvudmans geografiska område kan en eller flera vårdgivare bedriva verksamhet.\" En huvudman kan därför vara vårdgivare, men inom huvudmannens geografiska område (dvs landstingets) kan också andra vårdgivare agera, på huvudmannens uppdrag eller som fria aktörer vars patienter täcker alla kostnader ur egen ficka.', '2020-06-12, marel67: Städad.', '-', '-'),
(171, '-', '2020-06-12 08:44:41.000000', 'fysiskt, psykiskt och socialt välbefinnande, och inte endast frånvaro av sjukdom (26.4.2.5.3) eller skada (26.4.2.5.4)', '-', 'Socialstyrelsens termbank (bygger på WHO:s definition \"tillstånd av fullständigt fysiskt, psykiskt och socialt välbefinnande, inte endast frånvaro av sjukdom och funktionsnedsättning\")', 'Beslutad', 'hälsa', '-', '-', '26.1', 135, 'ANMÄRKNING 1: Hälsa är ett abstrakt begrepp som inte instansieras själv utan endast genom sina specialiseringar.', '2020-06-12, marel67: Städad.', '-', '-'),
(172, '-', '2020-06-12 08:43:43.000000', 'hälso- och sjukvårdsaktiviteter (7.2), tjänster, ledning eller styrning eller stöd som är relaterat till en individs hälsa (26.1)', '-', 'SS-EN 15224:2017', 'Beslutad', 'hälso- och sjukvård', '-', '-', '3.1.1', 135, '-', '2020-06-12, marel67: Städad.', '-', 'åtgärder för att medicinskt förebygga, utreda och behandla sjukdomar och skador (Socialstyrelsens termbank) \r\n\r\nhälso- och sjukvårdstjänster som hälso- och sjukvårdspersonal tillhandahåller patienter i syfte att bedöma, bibehålla eller återställa deras hälsotillstånd, inbegripet förskrivning, utlämning och tillhandahållande av läkemedel och medicinska hjälpmedel (EUROPAPARLAMENTETS OCH RÅDETS DIREKTIV 2011 eller 24 eller EU av den 9 mars 2011 om tillämpningen av patienträttigheter vid gränsöverskridande hälso- och sjukvård)'),
