INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(174, '-', '2020-06-12 08:41:28.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) med syfte att direkt förbättra eller upprätthålla ett hälsostatus (6.5)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsaktivitet för behandling', '-', '-', '7.2.7.1', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(175, 'Inte definierad', '2020-07-28 14:12:25.000000', 'aktivitet (23.6.6) som avser att direkt eller indirekt förbättra eller upprätthålla ett hälsostatus (6.5)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsaktivitet', '-', '-', '7.2', 135, 'ANMÄRKNING 1:  I NI är termen aktivitet (inom hälso- och sjukvård).\r\n\r\nANMÄRKNING 2: Begreppet säger inget om vem eller vad som utför aktiviteten. Den kan vara hälsofrämjande, sjukdomsförebyggande eller bidra till utredning och behandling av hälsoproblem.\r\n\r\nANMÄRKNING 3: [‎2020-‎06-‎16 16:38]  Gertrude Petersson:  \r\nI samband med session om förberedelse inför olika åtgärder på en mottagning eller avdelning där det krävs litet förberedelser ( som dukning eller sedering) kom det upp en diskussion om vad det skall kallas. I dag används den engelska översättning av procedure \"procedur\". Vårt förslag blev behandlande/ utredande/ diagnostiskt åtgärd.  SME tycker det blev omständigt och föreslog  ordet ingrepp istället.\r\n\r\nFrån SoS:\r\nÅtgärder i hälso- och sjukvården innebär patientinriktade insatser (handlingar) som huvudsakligen utförs i ett utredande, behandlande eller förebyggande syfte. En medicinsk kroppsundersökning, till exempel att lyssna på hjärta eller lungor på en patient, är en utredande åtgärd. Operativa ingrepp, som blindtarmsoperation eller starroperation, är exempel på behandlande åtgärder. Stöd för att sluta röka är en förebyggande åtgärd.', '2020-05-29, perha11: kompletterad med alternativ definition från SoS\r\n2020-06-02, karkj, perha11: Beslutad!\r\n2020-07-28, magfo: Synonymen vårdaktivitet tillåten, synonym åtgärd tillagd. Text av Gertrude tillagd som anmärkning.', '-', 'Beskrivning i Tillämpad begreppsmodell för ordination och hantering av läkemedel i hälso- och sjukvård:\r\n\r\nNågot som kan utföras av någon eller något inom hälso- och sjukvård och som är inriktat på visst resultat. Det kan till exempel röra sig om att hälso- och sjukvårdspersonal eller en medicinteknisk produkt utför något. Inom hälso- och sjukvård förekommer exempelvis följande typer av aktiviteter: utredning, behandling, planering och uppföljning. Aktiviteter kan vara exempelvis pågående, utförda eller planerade.'),
(176, 'Inte definierad', '2020-05-29 14:28:18.000000', 'element av hälso- och sjukvårdsaktivitet (7.2) som är inriktat på en typ av syfte', '-', 'Contsys SE - reviderad 2019-06-19.', 'Publicera ej', 'hälso- och sjukvårdsaktivitetselement', '-', '-', '7.2.7', 135, '-', '2020-05-29, perha11: Publiseras ej då den är borttagen ur modellen', '-', '-'),
(177, '-', '2020-06-12 08:41:03.000000', 'förteckning över de hälso- och sjukvårdsaktiviteter (7.2) som erbjuds av en hälso- och sjukvårdsutförare (5.2.3)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsaktivitetsförteckning', '-', '-', '7.2.2', 135, 'ANMÄRKNING 1: Contsys vårdgivare har bytts mot hälso- och sjukvårdsutförare.', '2020-06-11, marel67: Städad.', '-', '-'),
(178, '-', '2020-06-12 08:40:10.000000', 'organisation (3.3.1) eller person (3.3.4) som medverkar i hälso- och sjukvård (3.1.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsaktör', '-', '-', '5.2', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(179, '-', '2020-06-12 08:39:46.000000', 'representation av en angelägenhet, som är relaterad till en patients (5.26.1) hälsa (2.1) och eller eller tillhandahållandet av hälso- och sjukvård (3.1.1) till denna patient (5.2.1) , såsom den identifierats av en eller flera hälso- och sjukvårdsaktörer (5.2)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsangelägenhet', '-', '-', '6.2', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
