(181, '-', '2020-06-12 08:38:38.000000', 'resurs (3.4.1) som tillhandahålls för att finansiera tillhandahållande av hälso- och sjukvård (3.1.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsfinansiering', '-', '-', '7.2.10', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(182, '-', '2020-06-12 08:38:14.000000', 'information (3.9.5) som skapats i hälso- och sjukvårds verksamhet.', '-', 'VGR: (förslag Contsys-revision till ISO)', 'Beslutad', 'hälso- och sjukvårdsinformation', '-', '-', '3.9.4', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(183, '-', '2020-06-12 08:37:50.000000', 'hälso- och sjukvårdsinformation (3.9.4) som är möjlig att inkludera i en professionell hälsojournal (12.2.1) efter att en hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1) har bekräftat dess kliniska relevans för denna professionella hälsojournal (12.2.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsinformation för import', '-', '-', '12.5.3.4', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(184, '-', '2020-06-12 08:37:20.000000', 'mandat (23.8.2) , baserat på ett vårdåtagande (11.2.10) och antingen ett informerat samtycke (11.2.6) eller behörighet enligt lag (11.2.9) , som definierar rättigheterna och skyldigheterna för en enskild hälso- och sjukvårdsaktör (5.2) med avseende på dennas medverkan i hälso- och sjukvårdsprocess (8.2) som utförs för en specifik patient (5.2.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsmandat', '-', '-', '11.2', 135, '-', '2020-06-11, marel67: Städad.', '-', 'vårdmandat baserad på ett åtagande och antingen ett informerat samtycke eller auktoriserat enligt lag och som definierar rättigheter och skyldigheter för en hälso- och sjukvårdsaktör baserad på dennes involvering i hälso- och sjukvårdsprocessen för en patient (3R Contsys) mandat att tillhandahålla hälso- och sjukvårdsaktiviteter åt en patient (FVM)'),
(185, '-', '2020-06-12 08:36:26.000000', 'hälso- och sjukvårdsutförare (5.2.3) som har en organisatorisk roll (3.3.7)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsorganisation', '-', '-', '5.2.3.1', 135, 'ANMÄRKNING 1: Grupperingar eller undergrupper av en organisation, såsom avdelningar eller underavdelningar, kan också betraktas som organisationer om det finns behov av att identifiera dem. En organisations inre struktur beskrivs av dess organisatoriska mönster. Därför kan en organisation i sig betraktas som en fristående organisation eller som en överordnad struktur vilken innehåller avdelningar och underavdelningar, till exempel andra organisationer på lägre nivå. En hälso- och sjukvårdsorganisation har den roll varje sådan organisation har när den deltar i direkt tillhandahållande av hälso- och sjukvårdsaktiviteter.\r\n\r\nANMÄRKNING 2: I praktiken förlitar sig en hälso- och sjukvårdsorganisation på den aktivitet som utförs av hälso- och sjukvårdspersonal, oavsett om dessa är anställda eller kontrakterade uppdragstagare, eller med tillfälligt informella men funktionella förhållanden sinsemellan. Ett hälso- och sjukvårdsteam som arbetar tillsammans, till exempel i en specifik typ av klinisk process med deltagare från olika avdelningar, är också en typ av hälso- och sjukvårdsorganisation  \r\n\r\nANMÄRKNING 3: En fristående, ensampraktiserande person som hälso- och sjukvårdsprofessionell aktör ska betraktas som den enda medlemmen i sin egen hälso- och sjukvårdsorganisation. \r\n\r\nANMÄRKNING 4: Organisationer kan ha ett antal olika roller. När en organisation agerar i en roll där dess hälso- och sjukvårdspersonal deltar i direkt tillhandahållande av hälso- och sjukvård kallas den för en hälso- och sjukvårdsorganisation.\r\n\r\nANMÄRKNING 5: [VGR] Begreppet hälso- och sjukvårdsorganisation behöver i egenskap av organisation inte ha men kan ha en administrativ avgränsning. Det finns informellt skapade hälso- och sjukvårdsorganisationer liksom formellt avgränsade organisatoriska enheter som är administrativt definierade. Se exemplen!\r\n\r\nEXEMPEL 1:  Ett vårdteam, en gruppraktik, ett sjukhus, en sjukhusavdelning, en vårdenhet, allmänläkare med eget företag.', '2020-06-11, marel67: Städad.', '-', '-'),
(186, '-', '2020-06-03 11:30:36.000000', 'person (3.3.4) som i sitt yrke utför hälso- och sjukvård (3.1.1)', '-', 'VGR (förslag till Contsys-revision)', 'Beslutad', 'hälso- och sjukvårdspersonal', '-', '-', '5.2.3.3', 155, 'Anmärkning 1 VGR anmärkning: Begreppet inkluderar i Sverige legitimerad personal och personal som endast genom sin anställning erhåller mandat att utföra hälso- och sjukvård. Hälso- och sjukvårdspersonal arbetar alltid för en vårdgivare som kan vara en offentlig förvaltning (landsting eller enligt delegation sjukhus eller primärvådsförvaltning etc.) eller en privat vårdgivare, t.o.m. ett enmansföretag (t.ex. ensamarbetande privatläkare eller fysioterapeut). Därför kan en hälso- och sjukvårdspersonal vara deltagare i en hälso- och sjukvårdsorganisation, är alltid anställd av en vårdgivare och kan arbeta vid en eller flera vårdenheter. Contsys definition stämmer inte med det svenska sammanhanget, eftersom en hälso- och sjukvårdspersonal behåller denna roll också när hon eller han agerar utanför en hälso- och sjukvårdsorganisation (t.ex. har legitimerad personal sitt yrkesansvar även utanför arbetstid och utan att vara anställd av en vårdgivare)', '2020-06-03, karkj: Beslutad enligt tidigare inom FVM.', '-', '-'),
(187, '-', '2020-06-12 08:33:54.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) inom aktivitetshantering inom hälso- och sjukvård (7.2.7.3) under vilket en vårdplan (9.2) skapas eller ändras', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsplanering', '-', '-', '7.2.7.6', 135, 'ANMÄRKNING 1: Skapande av vård- och omsorgsplan i hälso- och sjukvården (FVM begrepp som hämtats från 3R Contsys men definieras enligt sin plats i begreppsmodellen).', '2020-06-11, marel67: Städad.', '-', '-'),
(188, '-', '2020-06-12 08:33:13.000000', 'grupp av hälso- och sjukvårdsaktiviteter (9.2.7) som samverkar eller påverkar varandra och som omformar underlag (input) till resultat (output, utfall)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsprocess', '-', '-', '8.2', 135, 'ANMÄRKNING 1: Process är definierat i ISO 9000 (termpost 3.61.). Hälso- och sjukvårdsprocess är varje process som ska påverka hälsostatus hos en patient.\r\n\r\nANMÄRKNING 2: Vårdprocessen startar när vårdbegäran mottas. I information om processen kan dock inkluderas aktiviteter utförda före den formella processtarten. T.ex. kan en person på grund av hälsoproblem utföra egenvård som försök att bli bättre men ge upp och ställa vårdbegäran för egen räkning. När den leder till vårdåtagande är det angeläget att egenvården inkluderas i processen eftersom den kan påverka utfallet av processen. Den ska alltså inte bara vara ett element i sjukhistorien.', '2020-06-11, marel67: Städad.', '-', 'process avseende hälso- och sjukvård som hanterar ett eller flera relaterade hälsoproblem eller hälsotillstånd i syfte att främja ett avsett resultat (Socialstyrelsens termbank)'),
(189, '-', '2020-06-12 08:31:55.000000', 'tidsintervall relaterat till hälsan (26.1) hos en patient (5.2.1) och eller eller tillhandahållandet av hälso- och sjukvård (3.1.1) för denna patient (5.2.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsrelaterad period', '-', '-', '10.2.', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(190, '-', '2020-06-12 08:31:31.000000', 'resurs (3.4.1) som behövs för att utföra hälso- och sjukvårdsaktivitet (7.2)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdsresurs', '-', '-', '7.2.9', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(191, '-', '2020-06-12 08:31:07.000000', 'definierat samband mellan hälso- och sjukvårdsangelägenheter (6.2) såsom det fastställts av en eller flera hälso- och sjukvårdsaktör (5.2)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdssamband', '-', '-', '6.6', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(192, '-', '2020-06-12 08:30:41.000000', 'hälso- och sjukvårdssamband (6.6) som omfattar alla hälso- och sjukvårdsangelägenheter (6.2) som är relaterade till en specifik patientprocess (8.2.1)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdssamband inom patientprocess', '-', '-', '6.6.1', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(193, '-', '2020-06-03 07:47:48.000000', 'tjänst (3.6.4) som är resultatet av en hälso- och sjukvårdsprocess (8.2)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdstjänst', '-', '-', '8.2.6', 135, 'ANMÄRKNING 1: I den gällande Contsysstandarden finns termen healtcare service som av 3R översatts med termen \"hälsoutfall för hälso- och sjukvårdsprocess\" och definierats \"resultat av en hälso- och sjukvårdsprocess som patient erhåller\". Detta är inte en tjänst (service), och begreppet hör i stället samman med hälsotillstånd efter en fullbordad process.', '2020-06-03, marel67: Städad.', '-', 'hälso- och sjukvårdsaktivitet som erbjuds av vårdenhet (FVM)'),
(194, '-', '2020-06-12 08:30:11.000000', 'hälso- och sjukvårdsaktivitet (7.2) som utförs av en tredjepart inom hälso- och sjukvård (5.2.4)', '-', 'Contsys SE', 'Beslutad', 'hälso- och sjukvårdstredjepartsaktivitet', '-', '-', '7.2.5', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(195, '-', '2020-06-12 08:29:44.000000', 'identifierad angelägenhet relaterad till en patients (5.26.1) hälsotillstånd (6.4)', '-', 'Contsys SE', 'Beslutad', 'hälsoangelägenhet', '-', '-', '6.3', 135, 'ANMÄRKNING 1: Även en frisk person kan behöva söka vård för vaccination, friskintyg för körkort, flygning etc. eller hälsokontroll. Mödravård och verksamheten vid barnavårdscentraler är också exempel när en patient utan hälsoproblem behöver söka vård. Screeningundersökningar i befolkningen grundar sig också på hälsoangelägenhet och inte hälsoproblem.', '2020-06-11, marel67: Städad.', '-', 'hälsoförhållande som utan att utgöra ett hälsoproblem kan föranleda patient att utfärda vårdbegäran för egen räkning (FVM)'),
(196, '-', '2020-06-12 08:28:38.000000', 'behov att påverka nuvarande hälsotillstånd (6.4)', '-', 'VGR', 'Beslutad', 'hälsobehov', '-', '-', '6.5.3', 135, 'ANMÄRKNING 1: Det önskade framtida hälsotillståndet kan vara ett hälsomål uttryck som måltillstånd.  ANMÄRKNING 2: Hälsobehov utgör motiv eller indikation för hälso- och sjukvårdsaktiviteter och är det grundläggande underlaget för vårdbehovsbedömningar.', '2020-06-11, marel67: Städad.', '-', '-'),
(197, '-', '2020-05-14 10:36:34.000000', 'register (23.9.2.1) omfattande utvald patientinformation avseende flera patienter (5.2.1)', '-', 'Informatik VGR', 'Beslutad', 'hälsodataregister', '-', '-', '32.3.2', 135, '-', '2020-05-08, Perha11: Till beslut\r\n2020-05-14, karkj, magfo: Termposten beslutad.', '-', '-'),
(198, '-', '2020-06-12 08:27:53.000000', 'underlag för person (3.3.4) att beskriva sitt hälsotillstånd (6.4)', '-', 'FVM', 'Beslutad', 'hälsodeklaration', '-', '-', '32.2.2.6', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(199, '-', '2020-06-12 08:27:25.000000', 'dataregister avseende en patients (5.26.1) hälsa (2.1) och hälso- och sjukvård (3.1.1)\r\n\r\nAlternativ definition  \r\ndokumentation om en patient som avser hälsa och hälso- och sjukvård (FVM)', '-', 'Contsys SE', 'Beslutad', 'hälsojournal', '-', '-', '12.2', 135, 'ANMÄRKNING 1: I Contsys finns begreppet journal som specialiseras som patientjournal (förd av hälso- och sjukvårdspersonal) och personlig journal som förs av andra än kliniker, i första hand patienten själv. I Socialstyrelsens termbank är begreppet journal begränsat till socialtjänsten, medan patientjournal är en samling av journalhandlingar. En journalhandling upprättas avseende en patients hälsa och behandling. I patientdatalagen (2008:355) sägs i 3 kap. 3 § att hälso- och sjukvårdspersonal (enligt termbankens definition) är skyldig föra patientjournal. Patientjournal stämmer därför med vad som beskrivs i 3R Contsys, medan termen journal bör undvikas i hälso- och sjukvården. Denna term ersätts därför i detta begreppssystem med hälsojournal, som kan upprättas av vem som helst men alltid avser en enda patient.', '2020-06-11, marel67: Städad.', '-', '-'),
(200, '-', '2020-06-12 08:24:42.000000', 'kalenderfunktion som underhålls av hälso- och sjukvårdsorganisation (5.2.3.1) och betjänar patient (5.26.1) med information (5.2) om pågående ärenden, bokade vårdkontakter (10.2.2.1.1) samt påminnelse (32.2.3.4.1) avseende hälsan (26.1)', '-', 'FVM', 'Beslutad', 'hälsokalender', '-', '-', '32.2.2.5', 135, 'ANMÄRKNING 1: Hälsokalender är ett nytt begrepp som innefattar patientens egen vårdadministration.', '2020-06-11, marel67: Städad.', '-', '-'),
(201, '-', '2020-06-12 08:24:02.000000', 'lagringsplats för personlig journal (12.2.2) och annan dokumentation (23.9.5.1) som disponeras av patienten (5.2.1)', '-', 'FVM', 'Beslutad', 'hälsokonto', '-', '-', '32.2.2.2', 135, 'ANMÄRKNING 1: Se kommentarer under personlig journal (12.2.2.2)', '2020-06-11, marel67: Städad.', '-', '-'),
(202, '-', '2020-06-12 08:23:25.000000', 'data (3.9.1) från övervakningssystem för att studera förändringar i en patients (5.2.1) hälsotillstånd (6.4) över tid som kan visas synkront och lagras', '-', 'FVM', 'Beslutad', 'hälsomonitoreringsdata', '-', '-', '32.2.3.3', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(203, '-', '2020-06-12 08:22:58.000000', 'önskat utfall av en hälso- och sjukvårdsprocess (8.2) som hanterar hälsobehov (6.5.3)', '-', 'Contsys SE', 'Beslutad', 'hälsomål', '-', '-', '9.2.5', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(204, '-', '2020-06-12 08:22:33.000000', 'hälso- och sjukvårdsaktivitet (7.2) som utförs av en hälso- och sjukvårdsutförare (5.2.3)', '-', 'Contsys SE', 'Beslutad', 'hälso-och sjukvårdsutföraraktivitet', '-', '-', '7.2.1', 135, 'ANMÄRKNING 1: I enlighet med resonemanget om vårdgivare eller hälso- och sjukvårdsutförare är termen ändrad från Contsys vårdgivaraktivitet.', '2020-06-11, marel67: Städad.', '-', '-'),
(205, 'Personcentrering är en etik som vägleder i praktiska handlingar som medmänniska och yrkesperson. Personcentrerad vård innebär ett partnerskap mellan patienter eller närstående och professionella inom vård, omsorg och rehabilitering. Baserat på noggrant lyssnande på patientens berättelse (ofta tillsammans med närstående) och övriga undersökningar skrivs en gemensam hälsoplan, som innehåller mål och strategier för genomförande och kort- och långsiktig uppföljning.', '2020-08-05 15:20:45.000000', 'plan med råd om hälsofrämjande levnadsvanor och åtgärder för att möta livsvillkor och hälsoproblem', '-', 'Informatik VGR', 'Beslutad', 'hälsoplan', '-', '-', '-', 4, 'ANMÄRKNING 1: En hälsoplan ska göras upp tillsammans med person/patient och vederbörandes närstående och har ett långt högre mål än en vårdplan, som tas i bruk när ett definierat hälsoproblem föreligger och ska bekämpas. Samtidigt får personen/invånaren/patienten inte åläggas någon rättslig skyldighet utöver vad förnuftet medför när hälsoplanen gjorts upp.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-06-09, vikee1, perha11: Pågår i väntan på mer kontext, Jira 802\r\n2020-07-06, vikee1, marel67: Preliminärt definierad.\r\n2020-07-29, magfo: Alternativ definition tillförd. Nytt brev till Erica S.\r\n2020-08-05, ollka3, magfo: Den alternativa definitionen fastställs. Belut.', '-', 'överenskommelse om mål och aktiviteter för att uppnå en förbättrad hälsa som upprättats mellan professionell hälso- och sjukvårdsaktör och patient (Centrum för personcentrerad vård reviderad)'),
(206, '-', '2020-06-12 08:21:50.000000', 'hälso- och sjukvårdsangelägenhet (6.2) som av en hälso- och sjukvårdsaktör (5.2) identifierats som problem för vilket hälso- och sjukvårdsaktiviteter (7.2) skall övervägas', '-', 'Contsys SE', 'Beslutad', 'hälsoproblem', '-', '-', '6.4.2.5', 135, 'ANMÄRKNING 1: Hälsoproblem har i VGR:s begreppssystem fått fyra specialiseringar (se termpostgruppen 26.4): sjukdom, skada, funktionsnedsättning och ohälsa, vilket tydliggörs i det begreppsdiagram som visas i Socialstyrelsens termbank. Gränserna mellan dessa är vaga, och de fyra begreppen har definierats endast för att de viktiga kännetecknen som avgränsar begreppen ska klargöras. Men en sjuk patient upplever ofta ohälsa. Skada är orsakad utifrån, och det är lätt att förstå att våld kan orsaka benbrott. Men förgiftningar ger inre symtom och räknas som skada. En infektion som man ådrar sig i arbetet kan räknas som arbetsskada fast infektioner räknas till sjukdomar. De allra flesta sjukdomar och skador leder till funktionsnedsättningar. Av ovanstående skäl ska man vara frikostig med att använda begreppet hälsoproblem medan ett av de underordnade begreppen används om man är säker på att det dominerar starkt över de tre sidoordnade begreppen. Observera också att begreppsmodellen knyter begreppet diagnos till hälsotillstånd (och inte t.ex. sjukdom) eftersom det finns tillfällen av full hälsa som i samband med en vårdkontakt föranleder diagnosregistrering. \r\n\r\nANMÄRKNING 2: Hälsoproblem är alltid förenat med försämrat välbefinnande och kan påkalla hälso- och sjukvårdsaktiviteter.', '2020-06-11, marel67: Städad.', '-', '-'),
(207, '-', '2020-06-12 08:20:10.000000', 'hälso- och sjukvårdssamband (6.6) som binder samman en uppsättning hälsoproblem (6.4.2.5)', '-', 'Contsys SE', 'Beslutad', 'hälsoproblemlista', '-', '-', '6.6.2', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(208, '-', '2020-06-12 08:19:35.000000', 'hälsostatus (6.5) när en hälso- och sjukvårdsprocess (8.2) initieras', '-', 'Contsys SE', 'Beslutad', 'hälsostatus som underlag', '-', '-', '6.5.1', 135, 'ANMÄRKNING 1: I Contsys termpost är \"initieras\" kursiverat som markering att ordet ingår i den refererade termfrasen \"hälso- och sjukvårdsprocess (3.3.1) initieras\". Detta torde vara tryckfel, och ordet initieras är inte kursiverat när det står i motsvarande ställning i andra termposter.', '2020-06-11, marel67: Städad.', '-', '-'),
(209, '-', '2020-06-12 08:18:35.000000', 'hälsostatus (6.5) när en hälso- och sjukvårdsprocess (8.2) avslutas', '-', 'Contsys SE', 'Beslutad', 'hälsostatus som utfall', '-', '-', '6.5.2', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(210, '-', '2020-06-12 08:14:36.000000', 'hälsotillstånd (6.4) vid en viss tidpunkt', '-', 'VGR(förslag till contsys-rev)', 'Beslutad', 'hälsostatus', '-', '-', '6.5', 135, 'ANMÄRKNING 1: [VGR] Ett hälsostatus kan bygga på flera observationer, vilket leder till att ett hälsostatus kan bestå av flera observerade tillstånd (6.4.1). Det bakomliggande hälsostatuset existerar dock även om den inte uppfattas av en observatör, till exempel den patient som har cancer innan den ger upphov till symptom.', '2020-06-11, marel67: Städad.', '-', '-'),
(211, '-', '2020-06-12 08:13:35.000000', 'hälsostatus (6.5) som är resultat av ett eller flera hälso- och sjukvårdsaktivitetselement (28)', '-', 'FVM i arbetet med att harmonisera till Contsys SE', 'Beslutad', 'hälsostatusutfall', '-', '-', '26.5.2.1', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(212, '-', '2020-06-03 11:28:36.000000', 'nivå av välbefinnande ur olika perspektiv', '-', 'VGR (förslag till Contsys-rev)', 'Beslutad', 'hälsotillstånd', '-', '-', '6.4', 155, 'Anmärkning 1: Hälsa definieras av WHO som ett tillstånd av fullständig fysiskt, psykiskt och socialt välbefinnande, inte enbart frånvaro av sjukdom och funktionsnedsättning. Hälsa kan alltså inte anges vara av olika grad eftersom den alltid är fullständig. Välbefinnande kan däremot variera. Om det är fullständigt får det kallas hälsa.  Anmärkning 2: I ICF (Klassifikation av funktionstillstånd, funktionsnedsättning och hälsa) från WHO beskrivs begreppet hälsa. I ICF identifieras fem hälsokomponenter: kroppsfunktion, kroppsstruktur, aktivitet, delaktighet och omgivningsfaktorer.  Anmärkning 3: En diagnos är ett sätt att beskriva och beteckna vissa typer av hälsotillstånd.  Anmärkning 4: Ur ett hälso- och sjukvårdsperspektiv används termen hälsotillstånd ofta för att beteckna ett farligt eller skadligt tillstånd (sjukdomar, störningar, personskador, osv.), eftersom de kan utföra motiv för vissa hälso- och sjukvårdsaktiviteter.', '2020-06-03, karkj: Beslutad sedan tidigare inom FVM.', '-', '-'),
(213, '-', '2020-06-12 08:12:51.000000', 'hälso- och sjukvårdsrelaterad period (10.2) under vilken ett hälsotillstånd (6.4) har observerats', '-', 'Contsys SE', 'Beslutad', 'hälsotillståndsperiod', '-', '-', '10.2.5', 135, 'ANMÄRKNING 1: Observation av ett hälsotillstånd kan leda till en vårdepisod.\r\n\r\nANMÄRKNING 2: Hälsotillståndsperiod avser endast observationen av hälsotillståndet, till exempel det tidsintervall under vilket en patient har observerat en blödning. Begreppet vårdepisod avser tid för hälso- och sjukvårdsaktiviteter.', '2020-06-11, marel67: Städad.', '-', '-'),
(214, '-', '2020-06-12 08:11:53.000000', 'hälso- och sjukvårdssamband (6.6) som visar utvecklingen av hälsotillstånd (6.4) under en hälso- och sjukvårdsprocess (8.2) och som inleds med det hälsotillstånd (6.4) som anger hälsostatus som underlag (6.5.1)', '-', 'Contsys SE I(6.6.3)', 'Beslutad', 'hälsotillståndsutveckling', '-', '-', '6.6.3', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(215, '-', '2020-06-12 08:11:26.000000', 'individuellt anpassad information (.2) sammanställd åt patient (5.2.1) av hälso- och sjukvårdspersonal (5.2.3.3) i syfte att stöda patientens (5.2.1) egenvård (7.2.4) och hälsofrämjande arbete', '-', 'FVM', 'Beslutad', 'hälsoundervisningsmaterial', '-', '-', '32.2.2.1', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(216, '-', '2020-06-12 08:10:54.000000', 'journalutdrag (12.5) som inkluderar alla journalkomponenter (12.2.3) som hör samman med ett hälso- och sjukvårdssamband (6.6) för en specifik angelägenhet', '-', 'Contsys SE', 'Beslutad', 'hälsoärende', '-', '-', '12.5.4', 135, 'ANMÄRKNING 1: Gruppering av de individanpassade vårdprocess som har startat med samma orsak till vårdbegäran (FVM, utgår från beskrivning i NI)', '2020-06-11, marel67: Städad.', '-', '-'),
