(218, '-', '2020-06-11 16:32:56.000000', 'skada på patient (28.2.4.3) som inträffar trots att adekvata åtgärder vidtagits vid patientens (5.2.1) kontakt med hälso- och sjukvården (3.1.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'icke undvikbar skada', '-', '-', '28.2.4.3.1', 135, 'ANMÄRKNING 1: Begreppet innefattar skador som ska utredas men som inte kan visas vara orsakad av fel eller underlåtenhet i behandlingen.', '2020-06-11, marel67: Städad.', '-', '-'),
(219, '-', '2020-06-11 16:30:49.000000', 'hälso- och sjukvårdsinformation (3.9.4) vars relevans inte har bedömts och inte uttryckligen konstaterats vara tillförlitlig av en hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1)', '-', 'Contsys SE', 'Beslutad', 'icke validerad hälso- och sjukvårdsinformation', '-', '-', '12.5.3.3', 135, 'ANMÄRKNING 1: Varje anteckning som patienten själv eller närstående eller annan vårdare gör och som kan valideras av hälso- och sjukvårdspersonal som journalhandling.', '2020-06-11, marel67: Städad.', '-', 'hälsojournal vars relevans inte har bedömts och angetts som giltig av hälso- och sjukvårdspersonal (3R Contsys reviderad)'),
(220, 'Från rikstermbanken: http://rikstermbanken.se/visaTermpost.html?id=71438\r\nsvensk term (rekommenderad) identitet\r\nDEFINITION: ställning såsom varande viss, entydigt bestämd fysisk eller juridisk person eller visst entydigt bestämt objekt Anmärkning: I uttryck som person-id händer det att förkortningen id utläses som identitet. I sådana uttryck bör dock id utläsas som identitetsbeteckning. Undvik uttrycket elektronisk identitet. Det är ett oklart uttryck, som kan ge sken av att man skulle ha en annan identitet ”på nätet” än annars.\r\n\r\nFinns ytterligare definitioner om identitet.', '2020-08-05 15:08:44.000000', 'ställning som entydigt bestämd person', '-', 'Svensk ordbok', 'Beslutad', 'identitet', '-', '-', '-', 5, 'ANMÄRKNING 1: I uttryck som person-id händer det att förkortningen id utläses som identitet. I sådana uttryck bör dock id utläsas som identitetsbeteckning.', 'Detta begrepp behöver ses över.\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, davte1: Kontext tillagt från rikstermbanken.\r\n2020-07-07, marel67: Definition tillagd. Flyttad till Preliminär.\r\n2020-08-05, ollka3, magfo: Definitionen justerad, posten beslutad.', '-', '-'),
(221, 'RSK 771-2008: Regionövergripande villkor för behörighetstilldelning, spärr för åtkomst samt regler för kontroll av åtkomst till patientuppgifter.', '2020-06-01 08:16:03.000000', 'samtycke som patienten eller företrädare inte kunnat ge men som förutsätts av omständigheterna', 'Inte definierad', 'Se A-lista FVM upphandling', 'Publicera ej', 'implicit samtycke', 'Inte definierad', 'Inte definierad', 'Inte definierad', 1, 'Inte definierad', '2020-06-01, perha11: Dubblett publiceras ej.', 'Inte definierad', '-'),
(222, '-', '2020-06-11 16:30:03.000000', 'samtycke (11.2.6) som patienten (5.2.1) eller företrädare (5.2.4.3) inte kunnat ge men som förutsätts av omständigheterna', '-', 'FVM', 'Beslutad', 'implicit samtycke', '-', '-', '31.2.6.2', 135, 'ANMÄRKNING 1: Samtycke kan inte alltid lämnas av patienten eller företrädare, t.ex. om patienten är medvetslös eller på annat sätt inte kan kommunicera eller förstå den givna informationen. Om de kliniska omständigheterna gör det angeläget att hälso- och sjukvårdspersonal utför hälso- och sjukvårdsaktivitet på patienten (t.ex. livräddande behandling) eller tar del av journalhandling (viktig information i sammanhanget) kan samtycke anses implicit, eftersom man får förutsätta att patienten skulle givit samtycke om hen kunde. Sådant samtycke kan också kallas passivt.', '2020-06-11, marel67: Städad.', '-', '-'),
(223, 'Ordledet distanskontakt har behållits för att begreppet ska stämma med Socialstyrelsens begreppsmodell. Med distans menas i detta fall att patienten befinnar sig på distans, antingen han är kommunikationspartner eller inte.', '2020-06-11 16:26:18.000000', 'distanskontakt (30.2.2.2.1) med asynkron kommunikation mellan patient (5.2.1) och hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM', 'Beslutad', 'indirekt distanskontakt', '-', '-', '30.2.2.2.1.2', 135, 'ANMÄRKNING 1: Med asynkron kommunikation menas att ena parten skickar meddelande till den andra utan att förvänta omedelbart svar. Ena parten kan också motta ett meddelande och beslutar själv om medelandet ska besvaras. Kommunikationen avser alltid en individuell patient, men denna patient kan stå utanför kommunikationen. \r\n\r\nEXEMPEL 1: Brevväxla med en patient, kommunicera via 1177 eller e-post. Motta och läsa provsvar och utlåtande avseende en viss patient, med eller utan att meddela svaret till patienten. Utfärda intyg, föra journal vid annat tillfälle än i direkt anslutning till besök.', '2020-06-11, marel67: Städad.', '-', '-'),
(224, '-', '2020-06-11 16:25:55.000000', 'plan för den hälso- och sjukvård (3.1.1) som ska ges till en patient (2.1.1) i handläggningen av aktuella hälsoproblem (6.4.2.5)', '-', 'FVM', 'Beslutad', 'individuell plan', '-', '-', '29.2.2.4', 135, 'ANMÄRKNING 1: I Socialstyrelsens termbank finns det abstrakta begreppet \"individuell plan\" beskrivet i begreppsdiagram men inte definierat. Begreppet är överordnat olika typer av individuella planer och har därför definierats som konkret i detta begreppssystem.', '2020-06-11, marel67: Städad.', '-', '-'),
(225, 'Från Upphandlingen VGR', '2020-05-12 16:15:34.000000', 'läran om informationsbehandling', '-', 'Sektionen för omvårdnadsinformatik', 'Beslutad', 'informatik', 'KOMMENTAR: Ordet informatik har motsvarigheter på andra språk, men den exakta betydelsen varierar. \r\nI Sverige är universitetsämnet informatik samhällsvetenskapligt inriktat (motsvarigheten på engelska brukar kallas social informatics), men i Tyskland och Frankrike brukar Informatik / informatique vara motsvarigheten till datorvetenskap i Sverige.', 'informatics', '-', 135, 'ANMÄRKNING 1: Informatik handlar om insamling, lagring, analys, representation, presentation, överföring och kommunikation av data och information, ofta med stöd av informationsteknologi för att kunna automatisera hanteringen. Det blir i detta sammanhang viktigt att skilja mellan data och information. (Sektionen för omvårdnadsinformatik) \r\n\r\nANMÄRKNING 2: Ordet informatik skapades 1957 av AI‑pionjären Karl Steinbuch. Informatik har nära anknytning till datorvetenskap, men är i Sverige mindre inriktat på maskinvara. – Ordet informatik har motsvarigheter på andra språk, men den exakta betydelsen varierar. \r\nI Sverige är universitetsämnet informatik samhällsvetenskapligt inriktat (motsvarigheten på engelska brukar kallas social informatics), men i Tyskland och Frankrike brukar Informatik / informatique vara motsvarigheten till datorvetenskap i Sverige. –  – På engelska: informatics. (IT-ordlista, IDG)', '2020-05-08, PErha11: Ny definition och alternativ definition samt nya kommentarer\r\n2020-05-12, verwi6, perha11: Preliminär\r\n2020-05-12, sofan63, karkj, perha11, magfo: Beslutad,', '-', 'vetenskapliga studiet av information och hur information behandlas i tekniska system i interaktion med människor (IT-ordlista, IDG)'),
(226, '-', '2020-06-11 16:25:09.000000', 'kunskap som gäller objekt och som i ett visst sammanhang har en viss betydelse', '-', 'ISO eller IEC 2382:2015 eller Contsys SE, definitionen i ISO-standarden ändrad i engelska Contsys', 'Beslutad', 'information', '-', '-', '3.9.5', 135, 'ANMÄRKNING 1: Fakta, händelser, saker, processer och idéer, inklusive begrepp, är exempel på objekt. \r\n\r\nANMÄRKNING 2: Information är något som har betydelse. Data kan betraktas som information när dess betydelse uppdagas.\r\n\r\nANMÄRKNING 3: [VGR] I strikt mening är det skillnad mellan data och information. Data blir information när någon har tolkat innebörden av dem. Många gånger behöver man inte hålla isär termerna data och information men t.ex. vid överföring mellan datorer eller lagring i datorminnen är det data, inte information, som hanteras.', '2020-06-11, marel67: Städad.', '-', '-'),
(227, '-', '2020-06-23 11:31:00.000000', 'information som är avgränsad utifrån uppsättning kriterier inom specifikt verksamhetsfält', '-', '-', 'Definiera ej', 'informationsdomän', '-', '-', '-', 5, 'Är detta en synonym till verksamhetsdomän?', 'Detta begrepp behöver ses över.\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, davte1, ajla: Ändra status till definieras ej, lagt till anmärkning är det en synonym till verksamhetsdomän samt gjort synonymen tillåten.', '-', '-'),
(228, '-', '2020-05-12 08:15:30.000000', 'enhet av information som kan skapas och lagras för att kunna förmedlas till en informationsanvändare', '-', 'Informatik VGR', 'Beslutad', 'informationselement', '-', '-', '-', 1, '-', '2020-05-12, perha11: Försök med ny definition. Preliminär!\r\n2020-05-12, karkj, sofan63, perha11, magfo: Beslutad.', '-', 'Gammal def: den minsta enhet av information som kan förmedlas mellan den som använder ett tekniskt system och själva systemet respektive mellan olika tekniska system'),
(229, '-', '2020-06-11 16:23:25.000000', 'detaljerad uppställning av semantiska regler som beskriver innehållet i ett sammanhang', '-', 'VGR', 'Beslutad', 'informationsspecifikation', '-', '-', '-', 5, '-', '2020-02-20, BB: Formell definition skapad och beskrivning justerad\r\n\r\n2020-06-11, marel67: Städad.', '-', '-'),
(230, 'Klassificering av information är en grundläggande aktivitet för att information\r\noch resurser ges nödvändigt skydd. Det är informationen som är\r\nskyddsobjektet, d v s det som ska skyddas.\r\nhttps://www.msb.se/RibData/Filer/pdf/25602.pdf', '2020-08-05 15:00:23.000000', 'beskrivning av värdedefinierad mängd information i verksamhet samt skyddsnivåer och hur den får hanteras', '-', '-', 'Beslutad', 'informationssäkerhetsklassificering', '-', '-', '-', 5, '-', '2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, davte1, ajla: Status ändrad till preliminär och tillagd kontext.\r\n2020-08-05, ollka3, magfo: Definitionen justerad, posten beslutad.', '-', '-'),
(231, 'Från risktermbanken: aktör som har ansvaret för den information som skapas och hanteras inom den egna verksamheten \r\n \r\n\r\nFrån alfresco VGR: \r\nDen som äger och ansvarar för att informationen är riktig och tillförlitlig samt för det sätt\r\ninformationen sprids. Informationsägaren är därmed riskägare för den information som ska hanteras\r\ni IT-systemet/lösningen. För att hantera risken bör informationsägaren genomföra en riskanalys. Om\r\ndet finns flera informationsägare som ska använda IT-systemet/lösningen bör samtliga delta i\r\nriskanalysen. https://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/workspace/SpacesStore/5a0405a4-fe76-4911-a3b6-316546f1af16/Rollbeskrivningar.pdf?a=false&guest=true', '2020-08-05 14:56:10.000000', 'aktör som ansvarar för information som skapas och hanteras', '-', 'Rikstermbanken/E-delegationen, reviderad', 'Beslutad', 'informationsägare', '-', '-', '-', 5, '-', '2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, davet1, ajla. Preliminär definiton och status ändrad till preliminär.\r\n2020-08-05, ollka3, magfo: Justerat definitionen, beslutat begreppsposten.', '-', '-'),
(232, '-', '2020-06-11 16:22:56.000000', 'tillstånd att utföra hälso- och sjukvårdsaktiviteter (7.2), som frivilligt ges av en patient (5.2.1) som har samtyckesförmåga, eller av patientens representant, efter att tillståndsgivaren har fått information om syftet med och de möjliga resultaten av hälso- och sjukvårdsaktiviteterna', '-', 'Contsys SE', 'Beslutad', 'informerat samtycke', '-', '-', '11.2.6', 135, 'ANMÄRKNING 1: Samtycke är avgörande för om en hälso- och sjukvårdsaktivitet får utföras eller inte (såvida inte bestämmelser i lag tar över kravet på samtycke). Samtycket måste ses i proportion till aktivitetens art och dignitet. Det ska t.ex. inte behövas ett dokumenterat informationsförfarande följt av viljeyttrat samtycke när hjärtat ska avlyssnas med stetoskop. Samtycket får då anses presumerat. Ett kirurgiskt ingrepp som är förenat med risk för komplikationer bör inte utföras utan noggrann information till patienten och ett uttryckligt samtycke som ska dokumenteras.', '2020-06-11, marel67: Städad.', '-', 'frivillig, särskild och otvetydig viljeyttring genom vilken en person som tillfrågats om något, efter att ha fått information, godtar det frågan gäller (Socialstyrelsen termbank)'),
(233, '-', '2020-06-11 16:21:08.000000', 'vårdkontakt (10.2.2.1.1) under vilken en klinisk process (8.2.1) initieras', '-', 'Contsys SE', 'Beslutad', 'initial vårdkontakt', '-', '-', '10.2.2.1.2', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(234, 'när en patient som skall opereras kommer till sjukhuset för att träffa kirurgen, anestisiologen, sjköterska, m.fl. Dette sker vanligtvis någon eller några veckor innan operation.', '2020-06-11 16:19:44.000000', '-', '-', '-', 'Avråds', 'inskrivningsbesök', '-', '-', '-', 12, 'Avrådd term, använd öppenvårdsbesök och ange typ av besök i kodverk', '2020-02-27, BB: Lämnar över till RIM och Kodverk', '-', '-'),
(235, 'från hemmet, från annat sjukhus eller klinik, från särskilt boende', '2020-08-05 14:49:22.000000', 'händelse när vårdtillfälle påbörjas', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'inskrivning i sluten vård', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-18, marel67, verwi6, davte1, sofan63: Term ändrad till inskrivning i slutenvård och olika inskrivningssätt (som var ursprungstermen) inlagda i definition för att kunna hittas vid sökning på inskrivningssätt.\r\n2020-08-05, ollka3, magfo: Definitionen kortad, posten beslutad.', '-', 'ANMÄRKNING 1: Det finns tre olika Inskrivningssätt :\r\n\r\n1 = från annat sjukhus eller annan klinik\r\n\r\n2 = från särskilt boende (individuellt behovsprövat boende som ges med stöd av socialtjänstlagen [2001:453] eller lagen [1993:387] om stöd och service till vissa funktionshindrade) \r\n\r\n3 = från ordinärt boende (patientens bostad eller motsvarande som inte ingår i särskilt boende)'),
(236, '-', '2020-05-12 16:16:36.000000', 'samordnande till en helhet', '-', 'FVM, bearbetad från regeringskansliet: EU-ordlista', 'Beslutad', 'integrera', '-', '-', '80.9', 135, '-', '2020-05-12, perha11: Ändrad term från integration till integrera. preliminär efter rensning och borttagning av dubblett\r\n2020-05-12: karkj, sofan63, perha11, magfo: Beslutad.', '-', 'samordnande eller sammanförande till en helhet (Hela definitionen från regeringskansliet. FVM gör bedömningen att ett sammanförande är en form av samordnande.)'),
