(239, '-', '2020-05-06 11:33:09.000000', 'förmåga att fungera ihop utan att särskilda åtgärder måste vidtas', '-', 'SIS : Stanlitermer | 2015', 'Beslutad', 'interoperabilitet', '-', '-', '80.11', 155, '-', '2020-05-06, Karkj, Perha11: beslutad', '-', '-'),
(240, '-', '2020-06-11 16:16:29.000000', 'person (3.3.4) eller grupp som har en roll (3.3.5) i relation till en verksamhet i en specifik sammanslutning eller visst verksamhetsområde', '-', 'ISO 8459:2009', 'Beslutad', 'intressent', '-', '-', '3.3.3', 135, '-', '2020-06-11, marel67: Städad.', '-', '-'),
(241, '-', '2020-06-11 16:15:53.000000', 'officiellt dokument som utfärdas av en hälso- och sjukvårdsaktör (5.2) och som intygar hälso- och sjukvårdsangelägenhet (6.2) gällande en patient (5.2.1)', '-', 'Contsys SE', 'Beslutad', 'intyg relaterat till en hälso- och sjukvårdsangelägenhet', '-', '-', '12.6', 135, 'ANMÄRKNING 1: Utöver de begrepp som definieras i Contsys finns en rad begrepp som regelbundet används i svensk hälso- och sjukvård. Flera av dessa begrepp har relationer till Contsys-begrepp, andra blir fristående och kan bilda egna begreppssystem. Följande kapitel tar upp begrepp som måste definieras i det svenska sammanhanget. De kan också vara aktuella att diskutera inom ISO näs Contsys ska revideras med början 2020. Kapitelindelningen är väsentligen parallell med indelningen i Contsys med den 2:a lagd före Contsys kapitelnummer. När det finns en nära relation till ett Contsys-begrepp är numreringen lagd intill Contsys-numret, eventuellt som en undernumrering (t.ex. god man numreras 25.2.4.3.1 eftersom patientens representant har nummer 5.2.4.3). Det finns begrepp som täcks av vad som beskrivs i Contsys och därför kan ställas av. Dessa är utan struktur förtecknade i kapitel 60.', '2020-06-11, marel67: Städad.', '-', '-'),
(242, '-', '2020-05-19 14:29:42.000000', 'försäkran att det som skrivits är sant enligt författarens uppfattning', '-', 'Informatik VGR', 'Beslutad', 'intygande', '-', '-', '-', 173, 'ANMÄRKNING 1: Intygande används för utlåtanden som har rättslig kraft och kan göras med elektronisk underskrift.', '2020-05-19, magfo, verwi6, perha11: Projektstyrgruppen har beslutat att definitionen ska vara \"bekräftelse av riktighet\" viket BB anser felaktigt. Definitionen är avstämd mot Rikstermbanken och kvarstår.', '-', '-'),
(243, '-', '2020-06-11 16:13:03.000000', 'färdigställande av ett ordinerat läkemedel (3.4.3) inför läkemedelsadministrering (27.2.1.1)', '-', 'HSLF-FS 2017:37, reviderad', 'Beslutad', 'iordningställande av läkemedel', '-', '-', '27.2.1.2', 135, 'ANMÄRKNING 1: Ordet läkemedelsadministrering används i definitionen i stället för administrering, som inte är definierat i termbanken.', '2020-06-11, marel67: Städad.', '-', '-'),
(244, 'Förklaring     \r\nJournalhandling definieras som underbegrepp till hälsojournal för att harmonisera med Contsys. Därför används inte termbankens definition som inte motsägs av FVM definition. Ordet \"upprättas\" innebär att handlingen skrivs (matas in i systemet) eller mottas utifrån, valideras och klassas som journalhandling.', '2020-06-10 16:11:43.000000', 'hälsojournal (12.2) som upprättas av hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM', 'Beslutad', 'journalhandling', '-', '-', '32.2.4', 135, 'ANMÄRKNING 1: Begreppet motsvaras i Contsys av journalavsnitt (health record component). En journalhandling ska alltid signeras av hälso- och sjukvårdspersonal, i första hand den som upprättat journalhandlingen. Signeringen finns av tre typer:  1) vidimering (vidi) som innebär att signeraren tagit del av innehållet men säger inget om huruvida detta föranleder åtgärd  2) signering som styrker att den som signerar har upprättat journalhandlingen  3) intygande som innebär att den som upprättat journalhandlingen försäkrar att dess innehåll är upprättarens mening .\r\n\r\nANMÄRKNING 2: Dokumentation vid ett laboratorium utgör journalhandlingar, t.ex. inkommen remiss till radiologi med berättigandebedömning, övriga anteckningar samt remissvaret. \r\n\r\nEXEMPEL 1: Provsvar, daganteckning, besöksanteckning, svar på undersökning, konsultfråga, konsultsvar, sjukintyg, läkarutlåtande, recept, ordination.', '2020-06-10, marel67: Städad.', '-', 'handling som upprättas eller inkommer i samband med vården av en patient och som innehåller uppgifter om patientens hälsotillstånd eller andra personliga förhållanden eller om vidtagna eller planerade vårdåtgärder (Socialstyrelsens termbank)'),
(245, '-', '2020-06-10 16:09:28.000000', 'del av en hälsojournal (12.2) som kan identifieras för att användas som referens eller för granskning', '-', 'Contsys SE', 'Beslutad', 'journalkomponent', '-', '-', '12.2.3', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(246, '-', '2020-06-10 16:08:53.000000', 'del eller helhet av en hälsojournal (12.2) som extraherats i kommunikationssyfte', '-', 'Contsys SE', 'Beslutad', 'journalutdrag', '-', '-', '12.5', 135, 'ANMÄRKNING 1: Contsys term journal har ändrats till patientjournal. 3R Contsys definierar \"utdrag avsedda för kommunikation innehållande hela eller delar av journal\". Vad utdraget ska användas till är inte väsentligt.\r\n\r\nANMÄRKNING 2: Utdrag ur patientjournalen kan utgöras av hela journalhandlingar eller delar av dem, en eller flera, som läggs samman för specifikt informationsbehov vid kommunikation av hälsojournalen. En hel patientjournal kan göras till journalutdrag.', '2020-06-10, marel67: Städad.', '-', 'utdrag innehållande hela eller delar av patientjournal (3R Contsys reviderad)'),
(247, '-', '2020-06-10 16:07:17.000000', 'funktion till hjälp att hitta och utnyttja resurser', '-', 'dp Std FVM upphandling', 'Beslutad', 'katalogtjänst', '-', '-', 'Inte definierad', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(248, '-', '2020-06-10 16:06:42.000000', 'journalutdrag (12.5) som förmedlar specifikt inriktad hälso- och sjukvårdsinformation (3.9.4) för att tillgodose mottagarens aktuella informationsbehov', '-', 'Contsys SE', 'Beslutad', 'klinisk rapport', '-', '-', '12.5.3', 135, 'EXEMPEL 1:  Remissvar, intyg, utdrag för forskning, utdrag för tillsyn.', '2020-06-10, marel67: Städad.', '-', 'journalutdrag innehållande speciellt inriktad hälsovårdsinformation för att uppfylla mottagarens specifika informationsbehov (3R Contsys)'),
(249, '-', '2020-06-10 16:05:28.000000', 'uppsättning av systematiskt framtagna uttalanden, avsedda att ge stöd för de beslut som fattas av hälso- och sjukvårdsaktörer (5.2), om hälso- och sjukvårdsaktiviteter (7.2) som ska utföras utifrån specificerade hälsoangelägenheter (6.3)', '-', 'Contsys SE', 'Beslutad', 'kliniskt kunskapsunderlag', '-', '-', '9.2.4', 135, 'ANMÄRKNING 1: Termen vårdprogram används ofta för detta begrepp. Emellertid används termen vårdprogram även för andra begrepp än vad kliniskt kunskapsunderlag avser. Denna Standard undviker därför termen vårdprogram.', '2020-06-10, marel67: Städad.', '-', '-'),
(250, '-', '2020-06-10 16:03:08.000000', 'logiskt samband mellan diagnoskod (26.7.1) , åtgärdskod (27.3) och ATC-kod (27.8.5) i ett visst skede av vårdprocessen (8.2).', '-', 'FVM', 'Beslutad', 'kodsamband', '-', '-', '26.7.3', 135, 'ANMÄRKNING 1: Begreppet står för resultatet av en teknisk eller logisk operation som skapar möjlighet till registrering av hur olika kombinationer av hälsotillstånd, aktiviteter och läkemedel förekommit. Detta samband ska användas i beslutsstödet för att stämmas av mot behandlingsresultat och eventuella avvikelser i syfte att bidra till handläggningsrekommendationer.', '2020-06-10, marel67: Städad.', '-', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(251, '-', '2020-05-28 09:40:41.000000', 'kombinerade koder och värden sammanfogade enligt kodschema', '-', 'Inera, Arkitektur och Regelverk Definition av kodverk och klassifikation Version 1.0 (reviderad)', 'Beslutad', 'kodverk', '-', '-', '(26.7.2)', 135, 'ANMÄRKNING 1: Ett kodverk bör innehålla värden som är ömsesidigt uteslutande.\r\nKodverk kan variera i omfattning från enklare kodverk för exempelvis kön till mer komplexa kodverk för\r\nverksamhetsområden på olika nivåer. Sjukdomsklassifikationen ICD-10-SE kan ses som ett\r\nexempel på ett komplext kodverk.\r\n\r\nVärdena i kodverk uttrycks i klartext, vanligen i form av ord, men kan också ha annan representation, exempelvis en bild. Koderna i kodverk är ofta numeriska eller alfanumeriska. (Inera) \r\n\r\nANMÄRKNING 2: Klassifikationer kan existera utan koder kopplade till sina kategorier, men i de fall koder finns, så kan klassifikationer också ses som former av kodverk. (Inera)\r\n\r\nANMÄRKNING 3:  ICF är ett exempel på ett kombinerat kodverk och klassifikation. (Informatik VGR)', '2020-04-21, Perha11: Begreppet städat, beställare tillagd\r\n\r\n2020-04-15, Kommentar från Gärd Engström:\r\n\r\nVi behöver en entydig definition av termen kodverk. OLLI kodverk - förteckning över koder\r\n\r\nDefinition av kodverk till arkitekturarbetet med datakatalog.\r\nkodverk-Klassifikation där varje element givit en kod enligt regler i ett kodschema\r\nEtt kodverk behöver väl inte vara en klassifikation.\r\n\r\nRegelverk för kodverk\r\nkodverk\r\nkodsystem\r\nkombination av en uppsättning koder (2.2) och en uppsättning kodtexter (2.3) som sammanfogats enligt ett kodschema (2.4) (Inera) ANMÄRKNING	Kodverk kan vara små som exempelvis kodverk för kön eller stora som ICD-10 och Snomed CT.\r\n2020-04-21, Perha11: Ska vi se över begreppet utifrån gärds kommentar?\r\n2020-05-26, ajla, marel67: Flyttat till preliminär\r\n2020-05-26, karkj, perha11: Definitionen ändrad, nya anmärkningar samt synonym tillagd. Preliminär!\r\n2020-05-28, karkj, magfo, perha11: Beslutad', '-', 'förteckning över koder /FVM (VGR begreppssystem 1.0, 26.7.2)'),
(252, '-', '2020-06-10 16:01:31.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) under vilket minst två hälso- och sjukvårdsaktörer (5.2) kommunicerar', '-', 'Contsys SE', 'Beslutad', 'kommunikation inom hälso- och sjukvård', '-', '-', '7.2.7.9', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(253, 'Enligt svensk standard Ledningssystem för kompetensförsörjning så ska det finnas en sådan', '2020-05-07 11:32:55.000000', 'plan för att säkerställa att rätt kompetens blir tillgänglig utifrån verksamhetens framtida behov', '-', 'Informatik VGR, utifrån Sis SS 624070:2017', 'Beslutad', 'kompetensförsörjningsplan', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-05, Perha11 Mared67: Preliminärt definierad.\r\n2020-05-07, Karkj, Perha11: Beslutad', '-', '-'),
(254, '-', '2020-06-10 16:00:58.000000', 'oönskad utveckling av process (3.6.1)', '-', 'FVM', 'Beslutad', 'komplikation', '-', '-', '28.2.4.5', 135, 'ANMÄRKNING 1: Vid bearbetning av Socialstyrelsens termbank för att strukturera terminologin avseende skador relaterade till hälso- och sjukvård valde man att inte definiera komplikation. I stället hänvisar man till termen skada på patient. Termen komplikation är så väl etablerad i hälso- och sjukvården att begreppet ändå behöver definieras och sättas in i begreppsmodellen.\r\n\r\nANMÄRKNING 2: Svårigheten att definiera komplikation grundar sig på att den inte behöver orsaka skada på patient men kan göra det. Risken för en komplikation kan vara väl känd när en aktivitet ska utföras, och det är tillfredsställande om den inte inträffar. Andra komplikationer kan komma fullständigt överraskande. En komplikation är därför ibland förutsedd, ibland oförutsedd, men den är alltid ett avsteg från processutvecklingen och aldrig en önskad händelse.', '2020-06-10, marel67: Städad.', '-', '-'),
(255, 'komponent definition från Rikstermbanken:	\r\nviss del av något mer komplext', '2020-08-05 14:43:18.000000', 'del av system', '-', 'Informatik VGR', 'Beslutad', 'komponent', '-', '-', '-', 5, '-', 'Detta begrepp behöver ses över.\r\n2020-05-29, karkj: ändrat status till ej påbörjad.\r\n2020-06-23, davte1, ajla: Preliminär definition och status ändrad till preliminär.\r\n2020-08-05, ollka3, magfo: Definitionen kortad. Beslutad', '-', '-'),
(256, '-', '2020-05-06 11:47:47.000000', 'sammansättning av komponenter eller system som definieras med dess integrerande delar', '-', 'Swedish Software Testing Board (reviderad)', 'Beslutad', 'konfiguration', 'the composition of a component or system as defined by  interconnections of its constituent parts', 'configuration', '80.13', 155, '-', '2020-05-06, Karkj, Perha11: Definierat om, beslutat', '-', '-'),
(257, '-', '2020-05-06 11:53:57.000000', 'Inte definierad', '-', '-', 'Publicera ej', 'konfigurering', '-', '-', '80.14', 1, 'Avrådd, se konfiguration.', '2020-05-06, Karkj, Perha11: Se konfiguration, publiceras ej.', '_', '-'),
(258, '-', '2020-05-12 08:31:46.000000', 'säkra genom att förbättra den inre strukturen', '-', 'Svensk ordbok', 'Beslutad', 'konsolidera', '-', '-', '80.15', 135, 'ANMÄRKNING 1:  huvudsakligen abstrakt \r\n\r\nEXEMPEL 1: konsolidera sin makt; ut­nyttja segern och konsolidera ställningarna; ledningens ställning har konsoliderats\r\n\r\nEXEMPEL 2: spec.förstärka den ekonomiska ställningen genom ökning av aktie­kapitalet, om­vandling av kort­fristiga skulder till lång­fristiga m.m.', '2020-05-12, perha11: Preliminärt definierad\r\n2020-05-12, sofan63, karkj, perha11, magfo: Beslutad.', '-', '-'),
(259, 'Kommentar av : Jag önskar en engelsk term, för jämförelse. Kan tex vara Contact type motsvara kontaktorsak? Eller är det snarare att contacttype är typ av kontakt som telefonledes, brevledes, besök etc?', '2020-05-25 09:30:11.000000', 'patientens (5.2.1) eller patientens representants (5.2.4.3) upplevelse av hälsobehov (6.5.3) som anges som motiv för en vårdbegäran (11.3)', '-', 'Contsys SE', 'Beslutad', 'kontaktorsak', '-', 'reason for encounter expressed by the patient', '11.3.4', 135, '-', '2020-05-25, perha11: uppgdaterad\r\n2020-08-19, magfo: önskemål om översättning till engelska(!). I Contsys är kontaktorsak en kort svensk term för \"orsak till vårdbegäran\", engelsk term reason for demand for care. Eftersom det är patienten som anger orsaken. Socialstyrelsen säger att kontaktorsak alltid anges av patienten. Den angivna engelskspråkiga termen pekar inte mot vårdbegäran utan kontakten.', '-', '-'),
(260, 'Allmänbegrepp', '2020-05-06 11:08:13.000000', 'språkligt sammanhang', '-', 'Svensk ordbok', 'Beslutad', 'kontext', '-', '-', '80.16', 135, 'ANMÄRKNING 1: Termen kontext har blivit populär och betecknar användningsområdet för det fenomen som beskrivs. Begreppet patient kan förekomma i skilda kontexter: en patient på väntelista eller en patient på operationsbordet. Det är samma begrepp, men informatiskt kan det behöva hanteras olika.', '2020-05-06, Karkj, Perha11: Justerad och Beslutad!', '-', '-'),
(261, '-', '2020-06-10 15:59:28.000000', 'visuell presentation som är anpassad till visst sammanhang', '-', 'FVM Std', 'Beslutad', 'kontextstyrd vy', '-', '-', '32.4.1', 135, 'ANMÄRKNING 1: En presentation på dataskärm, padda, telefon eller annat medium där sammanhanget styr presentationens utseende och innehåll. Begreppet inkluderar att vyn kan innehålla inmatningsfält så att interaktivitet kan uppnås.', '2020-06-10, marel67: Städad.', '-', '-'),
(262, 'Då det behövs ytterligare en signering på en ordination', '2020-06-09 14:31:03.000000', 'Definieras ej', '-', '-', 'Publicera ej', 'Kontrasignering', '-', 'Cosign', '-', 12, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-06-09, vikee1, perha11: Publiceras ej då  det finns kontrasingering', '-', '-'),
(263, '-', '2020-05-19 13:55:59.000000', 'underteckna jämte en annan person för att bestyrka att dokumentet ifråga överensstämmer med fattat beslut', '-', 'Informatik VGR', 'Publicera ej', 'kontrasignera (dubblett)', '-', 'cosign', '-', 155, 'ANMÄRKNING 1: Styrgruppen har föreslagit definitionen \"bekräftelse att anteckningen överensstämmer med den signerandes uppfattning baserat på beprövad erfarenhet och vetenskaplig grund\". En kontrasignering kan inte ändra en handläggning från att ha varit felaktig till att ha baserat på beprövad erfarenhet och vetenskaplig grund.', '2020-05-19. verwi6, magfo, perha11: Beslutad igen\r\n2020-05-27, vikee1: hittat en dubblett.\r\n2020-05-30, karkj, magfo, perha11: Dubblett, publiceras ej!', '-', 'Föreslagen definition från styrgruppsbeslut: signering av något som någon annan har signerat'),
(264, '-', '2020-06-10 15:56:28.000000', 'tillfälle då hälso- och sjukvårdspersonal (5.2.3.3) engagerar sig i en patient (5.2.1) utan att ha direkt kontakt med patienten (1.1.1)', '-', 'FVM', 'Beslutad', 'korrespondens', '-', '-', '29.7', 135, 'ANMÄRKNING 1: Detta är medlet för indirekt distanskontakt, där patienten inte är direkt deltagande men hens hälsoärende blir föremål för hälso- och sjukvårdspersonalens omsorger.', '2020-06-10, marel67: Städad.', '-', '-'),
(265, 'Förklaring: Implantat, proteser.', '2020-06-10 15:54:59.000000', 'medicinteknisk produkt (3.4.2) som fästs på kroppen eller implanteras som ersättning för kroppsdel', '-', 'FVM', 'Beslutad', 'kroppsmonterad produkt', '-', '-', '27.6.1', 135, 'ANMÄRKNING 1: Gränsen mellan implantat och protes är begreppsmässigt otydlig. En \"konstgjord höftled\" kallas ofta höftprotes fast den är implanterad. Samma gäller hjärtklaffproteser. Begreppsmässigt bör en protes anbringas utanpå kroppsytan (tandprotes, underbensprotes), medan ett implantat förankras i vävnaden (tandimplantat, ledimplantat, klaffimplantat i hjärtat).', '2020-06-10, marel67: Städad.', '-', '-'),
(266, '-', '2020-06-10 15:53:32.000000', 'utsträckning i vilken hälso- och sjukvården (3.1.1) uppfyller krav relaterade till definierade kvalitetsaspekter', '-', 'SIS: EN 15224:2017', 'Beslutad', 'kvalitet inom hälso- och sjukvård', '-', '-', '3.5.1', 135, 'ANMÄRKNING 1: Kvalitet definieras i ISO 9000:2015, 3.6.2, som den \"utsträckning i vilken en uppsättning inneboende egenskaper hos ett objekt uppfyller krav\".', '2020-06-10, marel67: Städad.', '-', '-'),
(267, '-', '2020-06-10 15:51:54.000000', 'koordinerade aktiviteter (23.6.6) för att styra och kontrollera en hälso- och sjukvårdsorganisation (2.2.1) med avseende på kvalitet', '-', '3R Contsys', 'Beslutad', 'kvalitetsledning', '-', '-', '3.5.2', 135, 'ANMÄRKNING 1: I kvalitetsledningsarbetet ingår att främja patientsäkerhet och granska verksamhetens kvalitet. En viktig informationsväg för detta är att följa utvärdering av processer och aktiviteter. \r\n\r\nANMÄRKNING 2: Definitionen i Contsys SE är formellt fel, eftersom den innehåller hela termen, om än delad i ordets två led. Därför används i VGR begreppssystem den definition som gjordes i 3R-arbetet och som är terminologiskt korrekt.', '2020-06-10, marel67: Städad.', '-', 'ledning med avseende på kvalitet (Contsys SE)'),
(268, '-', '2020-06-10 15:49:49.000000', 'del av kvalitetsledning (3.5.2) inriktad mot att uppfylla kvalitetskrav', '-', 'SS-EN-ISO 9000:2015 eller Contsys SE', 'Beslutad', 'kvalitetsstyrning', '-', '-', '3.5.4', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(269, '-', '2020-06-10 15:48:56.000000', 'del av kvalitetsledning (3.5.2) inriktad mot att ge förtroende för att kvalitetskrav kommer att uppfyllas', '-', 'SS-EN-ISO 9000:2015 eller Contsys', 'Beslutad', 'kvalitetssäkring', '-', '-', '3.5.3', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(270, 'Från Skatteverket: skyddad folkbokföring, som har ersatt kvarskrivning\r\n\r\n16 §   En person som av särskilda skäl kan antas bli utsatt för brott, förföljelser eller allvarliga trakasserier på annat sätt, får efter egen ansökan medges att vara folkbokförd på en annan folkbokföringsort än där personen är bosatt (skyddad folkbokföring) om åtgärden med hänsyn till den enskildes förmåga och övriga förutsättningar kan antas tillgodose behovet av skydd.\r\n\r\nSkyddad folkbokföring ska vid flyttning ske på den gamla folkbokföringsorten eller, om det bedöms ge ett bättre skydd, på en annan ort. Skyddad folkbokföring kan också ske utan att personen flyttar om det kan antas ge tillräckligt skydd.\r\n\r\nSkyddad folkbokföring får även medges en familjemedlem som är bosatt tillsammans med den utsatta personen. Lag (2018:684).', '2020-06-25 11:47:37.000000', 'skyddad identitet som innebär att person är folkbokförd på annan ort än där vederbörande är bosatt', '-', 'Folkbokföringslagen 16 § reviderad', 'Beslutad', 'skyddad folkbokföring', '-', '-', '-', 9, 'ANMÄRKNING 1: En person kan få skyddad folkbokföring om det finns särskilda skäl att anta att vederbörande kan bli utsatt för brott, förföljelser eller allvarliga trakasserier.\r\n\r\nANMÄRKNING 2: De gamla adressuppgifterna tas bort och den nya adressen registreras inte i folkbokföringen och sprids därmed aldrig till andra myndigheter. En adress till Skatteverket registreras dit vederbörande får sin post.\r\n\r\nANMÄRKNING 3: Begreppet är underordnat skyddad identitet. Synonymen kvarskriven är obsolet och avråds därför.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, karkj: ändrat status till Ej påbörjad.\r\n2020-06-18, marel67, verwi6, davte1, sofan63:  Definition tillagd. Begreppet kvarskrivning är inlagt som avrådd synonym pga föråldrat begrepp. Flyttad till preliminär.\r\n2020-06-25, karkj, magfo: Definition skriven. Begreppsposten beslutad.', '-', '-'),
(271, '-', '2020-06-10 15:43:22.000000', 'föremål eller person som transporteras', '-', 'VGR', 'Beslutad', 'kydd', '-', '-', '-', 135, '-', '2020-06-10, marel67: Städad.', '-', '-'),
(272, 'FÖRKLARING: En notifikation är varje avisering till hälso- och sjukvårdspersonal att information behöver observeras och bli föremål för beslut om eventuell åtgärd. Larm är en form av notifikation som påkallar extra uppmärksamhet.', '2020-06-23 11:16:44.000000', 'notifikation (32.2.3.4) som förenas med särskild signal', '|39869006 |alarm|', 'FVM', 'Beslutad', 'larm', '-', '-', '32.2.3.4.2', 135, 'ANMÄRKNING 1: Endast vissa typer av larm ska kommuniceras till Lösningen. Se exemplen! \r\n\r\nEXEMPEL 1: Maskinlarm: Medicinteknisk utrustning som larmar för att något är trasigt i utrustningen.Ska kommuniceras till Lösningen om en patient är ansluten till utrustningen.\r\n\r\nEXEMPEL 2: Övervakningslarm: Medicinteknisk utrustning som larmar för att inställda larmgränser passeras på en tillkopplad patient. Ska alltid kommuniceras till Lösningen. \r\n\r\nEXEMPEL 3: Personallarm: Grupp av människor som samtidigt skall larmas till en viss typ av händelse, exempelvis, traumalarm, Stroke larm etc. Ska kommuniceras till Lösningen om larmet inkluderar känd patient. \r\n\r\nEXEMPEL 4: Patientlarm: Patient som vill tillkalla sig uppmärksamhet på enheten. Denna typ av larm består normalt av ringsignal. Den ska kunna kommuniceras till Lösningen (konfigurerbart) för att möjliggöra mätning av tid från signal till svar från personalen och dokumentation att en utförd aktivitet initierats av att patienten påkallat hjälp. \r\n\r\nEXEMPEL 5: Avdelningslarm eller signal: Personal som vill tillkalla annan personal. Ska inte kommuniceras till lösningen. \r\n\r\nEXEMPEL 6: Akutlarm på avdelning: Larm på enhet som kräver omedelbar handläggning. Om larmet gäller en patient (som .t.ex. blivit akut försämrad) ska larmet kommuniceras till Lösningen.\r\n\r\nEXEMPEL 7: Gaslarm: Larm från tryckvakten. Ska kommuniceras till Lösningen om en patient är påverkad av larmet, t.ex. plötsligt bortfall av syretillförsel, som på det sättet tidsstämplas. \r\n\r\nEXEMPEL 8: Brandlarm. Kommuniceras inte till Lösningen.', '2020-06-10, marel67: Städad.\r\n2020-06-23, magfo: SCT-kod tillagd.', 'SCT', '-'),
(273, '-', '2020-06-23 11:22:45.000000', 'lokalisation där larm utlöses', '-', 'Informatik VGR', 'Beslutad', 'larmadress', '-', '-', '-', 2, 'ANMÄRKNING 1: Med larmadress menas den plats där larmet utlöses, inte den plats där det mottas.\r\n\r\nANMÄRKNING 2: Larmadress avser avsändningsplats för alla typer av larm, till exempel patient som ringer på klockan, överfallslarm, brandlarm, larm till 112, apparatlarm från medicinteknisk utrustning. Alla sådana alarm är värdelösa om inte larmmottagaren får reda på exakt var larmets utlöses. \r\n\r\nANMÄRKNING 3: Alarm är termen för den signal som påkallar uppmärksamhet, medan larm är termen för funktionen att påkalla uppmärksamhet. Alarm definieras inte.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-06-14, perha11: jira 821\r\n2020-06-23, karkj, magfo: Definierad och beslutad.', '-', '-'),
