(276, '-', '2020-06-10 08:23:40.000000', 'anteckning om registrerad anknytning till viss vårdcentral (29.8.2)', '-', 'FVM', 'Beslutad', 'listning', '-', '-', '29.8.3', 135, 'ANMÄRKNING 1: Listning är en mekanism som fördelar befolkningen över vårdcentralerna enligt ett system med valfrihet. En patient ska i första hand söka den vårdcentral där hen är listad. I Västra Götalandsregionen kan personer folkbokförda i regionen aktivt välja vårdcentral. De som inte gör ett aktivt val fördelas till en vårdcentral baserat på geografisk närhet.', '2020-06-10, marel67: Städad.', '-', '-'),
