(280, 'adress till en virtuell plats (Källa: VGR)', '2020-05-20 10:53:55.000000', 'adress till en virtuell plats', '-', 'Informatik VGR', 'Beslutad', 'e-adress', '-', '-', '-', 2, 'ANMÄRKNING 1: Kan t.ex. vara e-postadress, telefonnummer eller URL- adress.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-13, Marel67: Flyttad till Prelimär\r\n2020-05-20, annbr113, karkj, magfo, perha11: Termen bytt från logiskadress, Beslutad', '-', '-'),
