(282, '-', '2020-06-10 08:21:08.000000', 'vårdgivarens (25.2.3.1.1) kostnad för tid som en vårdlokal (7.2.9.1) behöver disponeras', '-', 'FVM', 'Beslutad', 'lokalkostnad', '-', '-', '27.5.2.1', 135, 'ANMÄRKNING 1: För de flesta vårdlokaler finns en driftkostnad och en avskrivningskostnad. Om denna räknas ut kan lokalkostnaden för en viss hälso- och sjukvårdsaktivitet beräknas som grund för del av finansieringsbehovet.', '2020-06-10, marel67: Städad.', '-', '-'),
(283, '-', '2020-06-10 08:18:36.000000', 'medicinsk riktlinje (29.2.4.2) som anpassats till lokala förhållanden', '-', 'FVM, utgår från 3R Contsys', 'Beslutad', 'lokalt anpassad riktlinje', '-', '-', '29.2.4.3', 135, 'ANMÄRKNING 1: Inkluderar regionala medicinska riktlinjer men kan också omfatta rekommendationer efter HTA-analys och under ordnat införande.', '2020-06-10, marel67: Städad.', '-', '-'),
(284, '-', '2020-06-10 08:17:19.000000', 'tid som en vårdlokal (7.2.9.1) utnyttjas för en hälso- och sjukvårdsaktivitet (7.2)', '-', 'FVM', 'Beslutad', 'lokaltid', '-', '-', '27.5.2', 135, 'EXEMPEL 1: Salstid vid operationsavdelning, antal vårddygn som används för en enskild patient under ett vårdtillfälle, tid som ett radiologiskt laboratorium behöver reserveras för en undersökning.', '2020-06-10, marel67: Städad.', '-', '-'),
(285, '-', '2020-06-04 10:39:13.000000', '[hälso- och sjukvård] substans eller kombination av substanser som kan ges till människor för att behandla eller förebygga sjukdom (26.4.2.5.3), för att ställa en medicinsk diagnos (26.7) eller för att återställa, korrigera och förändra fysiologiska funktioner', '|763158003 |läkemedel|', 'ISO 11615:2012 (reviderad)', 'Beslutad', 'läkemedel', '-', '-', '3.4.3', 155, '-', '2020-06-03, karkj: Alternativ definition tillagd.\r\n2020-06-04, karkj, magfo: Definitionen justerad. Beslutad.', 'Snomed CT', 'substans eller kombination av substanser som tillhandahålls med uppgift om att den har egenskaper för att förebygga eller behandla sjukdom hos människor eller djur, eller som kan användas på eller tillföras människor eller djur i syfte att återställa, korrigera eller modifiera fysiologiska funktioner genom farmakologisk, immunologisk eller metabolisk verkan eller för att ställa diagnos\r\n\r\nKälla: GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET\r\nSOCIALSTYRELSEN'),
(286, '-', '2020-06-04 10:08:06.000000', 'tillförsel av läkemedel (3.4.3) till kroppen', '-', 'Socialstyrelsens termbank (avseende definitionen; termen ändrad)', 'Beslutad', 'läkemedelsadministrering', '-', '-', '27.2.1.1', 155, 'ANMÄRKNING 1: Socialstyrelsens term är administrering av läkemedel.\r\n\r\nANMÄRKNING 2: Läkemedelsadministrering avser både när patienten ger sig själv ett läkemedel och när hälso- och sjukvårdspersonal tillför läkemedlet.', '2020-05-29, perha11: Lagt in kompletterande information enligt SoS\r\n2020-06-02, magfo: Termposten justerad.\r\n2020-06-04, magfo: Lagt till SoS term som tillåten synonym.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', 'Term enligt Socialstyrelsen: administrering av läkemedel\r\nDefinition: tillförsel av läkemedel till kroppen'),
