(288, '-', '2020-06-04 10:05:23.000000', 'behandlande hälso- och sjukvårdsaktivitet vid vilken läkemedel används', '-', 'Informatik VGR', 'Beslutad', 'läkemedelsbehandling', '-', '-', '27.2.1.3', 155, 'ANMÄRKNING 1: Den initialt rekommenderade definitionen betyder att vårdprocessen bara består av läkemedelsadmninistreringar och inga andra aktiviteter. Den nya gör läkemedelsbehandling till ett begrepp underordnat behandlande hälso- och sjukvårdsaktivitet.\r\n\r\nANMÄRKNING 2: Termen (och definitionen) utesluter tillförsel av läkemedel i utredande syfte (t.ex. kontrastinjektion, belastningsundersökningar).', '2020-06-03, karkj: Definition tagen från begreppssystem 1.0 VGR\r\n2020-06-03, magfo: Alternativ definition tillagd för diskussion.\r\n2020-06-03, magfo: Den alternativa definitionen gjord till huvuddefinition.\r\n2020-06-04, karkj, magfo: Definitionen förfinad. Posten beslutad.', '-', 'vårdprocess (8.2) som består av en eller flera läkemedelsadministreringar (27.2.1.1)'),
(289, '-', '2020-06-10 08:13:58.000000', 'utlämning av läkemedelsvara (27.8.3)', '-', 'FVM enligt beskrivning i Socialstyrelsen (som inte definierar detta begrepp)', 'Beslutad', 'läkemedelsexpediering', '-', '-', '27.2.1.4', 135, 'ANMÄRKNING 1: Om flera läkemedelsvaror av samma läkemedelsprodukt lämnas ut rör det sig om en läkemedelsexpediering omfattande flera expedieringsdelar. Om flera olika läkemedelsprodukter lämnas ut rör det sig om flera läkemedelsexpedieringar.', '2020-06-10, marel67: Städad.', '-', '-'),
(290, '-', '2020-08-13 14:54:47.000000', 'form som läkemedel (3.4.3) förekommer i', '-', 'Socialstyrelsens termbank', 'Beslutad', 'beredningsform', '-', '-', '27.8.1', 155, 'ANMÄRKNING 1:   Exempel  tablett, kapsel, suppositorium, kräm, depotplåster, granulat, lösning, injektionslösning, injektionspulver, salva, inhalationspulver etc.', '2020-06-03, karkj: Definition tagen direkt från Termbanken, kanske behöver förfinas.\r\n2020-06-04, magfo: Lagt till SoS synonym. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.\r\n2020-08-13, helse4, magfo: Term och synonymbytt plats.', '-', '-'),
(291, '-', '2020-06-10 08:12:41.000000', 'läkemedels (3.4.3) påverkan på annat läkemedels (9.1.3) effekt och nedbrytning', '-', 'Medicinsk ordbok, Belfrage Medical AB', 'Beslutad', 'läkemedelsinteraktion', '-', '-', '27.8.8', 135, 'ANMÄRKNING 1: Läkemedelsinteraktion kan yttra sig som läkemedelsbiverkan ( eller komplikation) och utgöra en avvikelse (tillbud eller negativ händelse).', '2020-06-10, marel67: Städad!', '-', '-'),
(292, '-', '2020-06-09 12:20:22.000000', 'kostnad för användning av viss läkemedelsprodukt (27.8.2) i hälso- och sjukvårdsaktivitet (7.2)', '-', 'FVM', 'Beslutad', 'läkemedelskostnad', '-', '-', '27.8.9', 135, 'ANMÄRKNING 1: Läkemedelskostnaden kan räknas per läkemedelsprodukt under hel process, inom aktivitet eller per doseringstillfälle och är en del i beräkningen av hälso- och sjukvårdens finansieringsbehov.', '2020-06-09, marel67: Städad.', '-', '-'),
