(298, 'Läkaren bedömer att föreligger risk för osäker läkemedelshantering. Patienten sköter inte sin medicinering. Läkaren ska i samråd besluta om att ansvar för läkemedelshantering ska övergå till kommunal hälso- och sjukvård.  Exempel på användning Mölndal: Läkare ansvarar för att ta beslut om läkemedelsövertag tillsammans med den enskilde innan remiss för läkemedelsövertag skickas till sjuksköterska inom kommunal hälso- och sjukvård Exempel 2 Sjuksköterskan ansvarar för att  läkemedelsövertag dokumenteras i patientens elektroniska journal och att vårdplan för läkemedelshantering upprättas. Exempel 3. Läkemedelsövertag kan ske helt eller delvis.', '2020-06-12 08:15:59.000000', 'övertagande  av ansvar för läkemedelshantering gällande en patient', '-', 'dP Std FVM upphandling', 'Publicera ej', 'läkemedelsövertag', '-', '-', '-', 13, '-', '2020-06-11, marel67: Dubblett.', '-', '-'),
(299, '-', '2020-06-12 08:18:01.000000', 'övertagande av ansvar för läkemedelshantering gällande en viss patient (5.2.1)', '-', 'FVM', 'Beslutad', 'läkemedelsövertag', '-', '-', '31.2.3.1', 135, 'EXEMPEL 1: Exempel på användning Mölndal: Läkare ansvarar för att ta beslut om läkemedelsövertag tillsammans med den enskilde innan remiss för läkemedelsövertag skickas till sjuksköterska inom kommunal hälso- och sjukvård.\r\n\r\nEXEMPEL 2: Sjuksköterskan ansvarar för att läkemedelsövertag dokumenteras i patientens elektroniska journal och att vårdplan för läkemedelshantering upprättas.\r\n\r\nEXEMPEL 3:. Läkemedelsövertag kan ske helt eller delvis.', '2020-06-11, marel67: Städad.', '-', '-'),
(300, '-', '2020-06-03 16:13:03.000000', 'befogenhet att agera enligt uppdrag', '-', 'FVM', 'Beslutad', 'mandat', '-', '-', '23.8.2', 135, 'Förklaring  Ett mandat är alltid en befogenhet. Men den avgränsas av ett uppdrag och ger ingen befogenhet utanför uppdraget. Den som har mandatet har automatiskt ett ansvar för allt som utförs med stöd av mandatet. En delegering innebär utdelande av mandat, fast i hälso- och sjukvården används inte ordet \"mandat\" på en skriftlig handling där en arbetsuppgift delegeras, utan ordet \"delegering\" får stå för det mandat som delegaten har fått.  \r\nANMÄRKNING 1: Det finns ingen officiell definition av mandat. Detta rotbegrepp är inte definierat i Contsys fast många sorters mandat definieras. I Rikstermbanken återfinns den rekommenderade synonymen befogenhet med definition \"rätt att vidta åtgärd på annans uppdrag\". Källan är svensk-albansk tolkordbok, och till albanska översätts ordet \"mandat\", \"e drejtë\". Det senare uttrycket översätts till svenska höger och rättighet, vilket visar att albanskan i likhet med många andra språk (t.ex. tyska, ungerska, spanska) sätter höger samma som rätt. Mandat är en relativt ny term i svensk hälso- och sjukvård, men som begrepp har det egentligen alltid funnits, och personuppgiftslagen, offentlighets- och sekretesslagen, patientdatalagen och tryckfrihetsförordningen reglerar samtliga på ett eller annat sätt hälso- och sjukvårdspersonalens rättigheter och skyldigheter i förhållande till den enskilda person som har kontakt med vården, både vad avser handlingsfrihet (och -skyldighet) och vad avser hantering av information om personen ifråga. Vid revidering av Contsys bör starkt övervägas att definiera mandate i den engelska versionen. Engelska ordböcker har samma typ av definition av mandate som svenska av mandat: ungefär \"en grupp av personer som represnterar ett område\", dvs den politiska definitionen. En lämplig översättning av den svenska definitionen kunde vara authorization to take action pursuant to assignment. \"Pursuant\" är starkare än \"according\" och bör väljas.   \r\nANMÄRKNING 2: Ett mandat som alltid är implicit eller automatiskt, är det som medföljer en vårdbegäran för egen räkning. Den som utfärdar en sådan vårdbegäran ger mottagaren automatiskt rätt (och skyldighet) att ta del av vårdbegäran och efter eget bedömande agera på det sätt vårdbegäran föranleder. Av det skälet finns inte något särskilt \"mandat att bedöma vårdbegäran\".', '2020-06-03, davte1: Städad.', '-', '-'),
(301, '-', '2020-06-03 16:11:31.000000', 'hälso- och sjukvårdsmandat (11.2) som fördelar rättigheter och skyldigheter att efterfråga utförande av hälso- och sjukvårdsaktiviteter (7.2)', '-', 'Contsys SE', 'Beslutad', 'mandat att framställa vårdbegäran', '-', '-', '11.2.1', 135, 'ANMÄRKNING 1: Vårdmandat som ger hälso- och sjukvårdspersonal rätt att utfärda vårdbegäran (FVM) I FVM har använts \"mandat att begära vård\", vilken är hämtad från SAMBA i stället för den tyngre termen i 3R Contsys \"mandat att framställa vårdbegäran\". Den är också en bättre översättning av den engelska termen \"demand mandate\".    \r\nANMÄRKNING 2: Mandat att begära vård behövs inte för enskild person, som alltid kan framställa vårdbegäran för egen räkning. Detta begrepp behövs för att markera när hälso- och sjukvårdspersonal eller patientens representant har rätt att utfärda vårdbegäran, dvs remiss eller förfrågan.', '2020-06-03, davte1: Städad.', '-', 'mandat att begära vård (FVM i förfrågningsunderlaget).'),
(302, '-', '2020-06-03 16:08:44.000000', 'mandat (23.8.2) antingen utdelat av patient (5.2.1) eller fastställt genom behörighet enligt lag (11.2.9) som tilldelas företrädare (5.2.4.3) för patient (1.1.1) att föra dennes talan', '-', 'FVM', 'Beslutad', 'mandat att företräda patient', '-', '-', '31.2.3.2', 135, 'ANMÄRKNING 1: Om en företrädare ska kunna företräda en patient måste ett mandat finnas. Detta uppstår om företrädaren får sitt uppdrag direkt av patienten eller genom ett myndighetsbeslut enligt lag.', '2020-06-03, davte1: Städad.', '-', '-'),
(303, '-', '2020-06-09 12:11:24.000000', 'Inte definierad', '-', '-', 'Avråds', 'mandat att inhämta patientinformation', '-', '-', '62.7', 135, 'Anmärkning 1 Det finns mandat att kommunicera personlig information 11.2.5. För att inhämta krävs inget separat mandat.', '2020-06-09, marel67: Städad.', '-', '-'),
(304, '-', '2020-06-03 16:08:05.000000', 'hälso- och sjukvårdsmandat (11.2) som anger rättighet att kommunicera dokumenterad personlig information', '-', 'Contsys SE', 'Beslutad', 'mandat att kommunicera personlig information', '-', '-', '11.2.5', 135, 'ANMÄRKNING 1: FVM term: mandat att lämna ut journalhandling vårdmandat) som ger hälso- och sjukvårdspersonal rätt att lämna ut uppgift ur patientjournal (3R Contsys reviderad, avser där termen \"mandat att kommunicera personlig information\"). \r\nANMÄRKNING 2: Patientdatalagen (2008:355) 4 kap. 1 och 4 §§ bestämmer hur hälso- och sjukvårdspersonal ska ha tillgång till patientjournalen. Om hälso- och sjukvårdspersonal som inte har tillgång enligt dessa lagrum behöver information och rekvirerar den ska den som disponerar informationen under förutsättning av mandat för det ställa informationen till förfogande. Om utlämning sker utanför vårdgivarens gräns, antingen till aktör utanför hälso- och sjukvården (5 kap.) eller till annan vårdgivare (6 kap., sammanhållen journal) krävs motsvarande mandat.', '2020-06-03, davte1: Städad + tog bort S ur termen det stod: mandat att kommunicera personlig information S.', '-', '-'),
(305, '-', '2020-06-03 16:00:54.000000', 'hälso- och sjukvårdsmandat (11.2) som fördelar rättigheter och skyldigheter att utföra specifika hälso- och sjukvårdsaktiviteter (7.2)', '-', 'Contsys SE', 'Beslutad', 'mandat för hälso- och sjukvårdsaktivitet', '-', '-', '11.2.3', 135, 'ANMÄRKNING 1: I 3R Contsys finns termfrasen \"mandat att tilldela hälso- och sjukvårdsaktiviteter\" med definition \"vårdmandat att tilldela rättigheter och skyldigheter att utföra specifika hälso- och sjukvårdsaktiviteter\". Eftersom ett mandat i sig för förenat med rättigheter och skyldigheter är den delen av definitionen onödig. Betydelsen av ordet \"tilldela\" i termfrasen är oklar.', '2020-06-03, davte1: Städad.', '-', 'vårdmandat som avser specifik hälso- och sjukvårdsaktivitet (FVM)'),
(306, '-', '2020-06-03 15:58:54.000000', 'hälso- och sjukvårdsmandat (11.2) som fördelar rättigheter och skyldigheter att övervaka och samordna utförande av den vård som beskrivs i mandat för vårdperiod (11.2.2) relaterade till hälso- och sjukvårdsangelägenheter (6.2) ingående i specifika hälso- och sjukvårdssamband (6.6)', '-', 'Contsys SE', 'Beslutad', 'mandat för kontinuitetssamordning', '-', '-', '11.2.4', 135, 'ANMÄRKNING 1: Term enligt FVM: samordningsmandat. Definition: vårdmandat med uppdrag att samordna hälso- och sjukvårdsaktiviteter i syfte att skapa kontinuitet i vården av en patient (FVM). Definitionen enligt 3R Contsys är en god översättning av definitionen i engelskspråkiga Contsys: \"healthcare mandate assigning the right and obligation to monitor and coordinate the delivery of care described in those care period mandates related to healthcare matters linked by specific health threads\". Båda definitionerna är i stort sett lika obegripliga och hänvisar till så många mandatbegrepp att modelleringen blir svår. Självklart ska bara mandaterade aktiviteter samordnas, det behöver inte upprepas i denna definition. \r\n\r\nEXEMPEL 1: Mandat för koordinator, t.ex. teamsjuksköterska, vårdplatssamordnare, distriktssjuksköterska.', '2020-06-03, davte1: Städad.', '-', 'vårdmandat avseende rättigheter och skyldigheter att övervaka och koordinera vård beskriven i de mandat som bemyndigar en vårduppdragsperiod relaterade till hälso- och sjukvårdsangelägenheter ingående i ett hälso- och sjukvårdssamband (3R Contsys). Definitionen enligt 3R Contsys är en god översättning av definitionen i engelskspråkiga Contsys: \"healthcare mandate assigning the right and obligation to monitor and coordinate the delivery of care described in those care period mandates related to healthcare matters linked by specific health threads\". Båda definitionerna är i stort sett lika obegripliga och hänvisar till så många mandatbegrepp att modelleringen blir svår. Självklart ska bara mandaterade aktiviteter samordnas, det behöver inte upprepas i denna definition.'),
(307, '-', '2020-06-03 15:57:20.000000', 'hälso- och sjukvårdsmandat (11.2) som ger befogenhet för en vårdperiod med mandat (10.2.1)', '-', 'Contsys SE', 'Beslutad', 'mandat för vårdperiod', '-', '-', '11.2.2', 135, '-', '2020-06-03, davte1: Städad.', '-', '-'),
(308, '-', '2020-06-03 15:56:59.000000', 'datamängd som innehåller en organisations (3.3.1) centrala data (3.9.1) och som behöver användas av flera system, applikationer och processer (3.6.1)', '-', 'Rikstermbanken eller Skatteverket: Öppna företagsdata 2012', 'Beslutad', 'masterdata', '-', '-', '23.9.2.3', 135, '-', '2020-06-03, davte1: Städad.', '-', '-'),
(309, '-', '2020-06-02 11:16:13.000000', 'indirekt vårdaktivitet där specialistläkare och andra professioner diskuterar patients behandling', '-', 'RCC - Regionalt cancercentrum Väst (reviderad)', 'Beslutad', 'multidisciplinär konferens', '-', '-', '-', 4, 'ANMÄRKNING 1:  Består oftast av läkare från olika specialiteter till skillnad från teamkonferens som oftast är multiprofessionell', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-28, magfo: Begreppet aktiverat, ska utredas.\r\n2020-05-28, marel67, perha11: Definierad, preliminär\r\n2020-06-02, karkj, perha11: Anmärkning tillagd, beslutad!', '-', '-'),
(310, '-', '2020-06-03 15:56:20.000000', 'besked till hälso- och sjukvårdspersonal (5.2.3.3) som utfärdat remiss (11.3.3) att den vidaresänts till annan vårdenhet (25.2.3.1.2)', '-', 'FVM', 'Beslutad', 'meddelande till inremitterande', '-', '-', '31.3.5.2', 135, 'ANMÄRKNING 1: När en vårdenhet inte har rätt vårdutbud för att handlägga en inkommen remiss och den därför vidaresänds till annan vårdenhet meddelas inremitterande detta.', '2020-06-03, davte1: Städad.', '-', '-'),
(311, '-', '2020-08-05 14:40:16.000000', 'struktur för en uppsättning dataelement och deras relationer i syfte att överföras mellan system', '-', 'Informatik VGR, GIP-arbetet', 'Beslutad', 'meddelandeformat', '-', '-', '-', 5, '-', 'Detta begrepp behöver ses över.\r\n2020-05-29 karkj: ändrat status till ej påbörjad.\r\n2020-07-06, vikee1, marel67: Lagt till beskrivning och ändrat status till preliminär.\r\n2020-08-05, ollka3, magfo: Ny definition. Beslutad.', '-', '-'),
(312, 'Förklaring: Medicinsk kunskap är ett abstrakt begrepp som beskriver vad såväl den enskilda hälso- och sjukvårdspersonalen som kollektivet i hälso- och sjukvården vet och behärskar. Detta bygger på lärdom i form av erkänd (evidensbaserad) litteratur, egen med tiden ökande erfarenhet och omedelbara fynd under pågående processer. Den del av den medicinska kunskapen som nedtecknas till råd i hälso- och sjukvårdsverksamheten kallar vi medicinska riktlinjer. Men dessutom finns den i vars och ens huvud, i rutinbeskrivningar, läroböcker. Och icke minst hanteras den i det dagliga samtalet i arbetssituationen, där omvårdnadsfrågor, stödåtgärder samt diagnostiska och terapeutiska överväganden görs av alla yrkesgrupper och i samtal dem emellan.', '2020-06-09 12:09:05.000000', 'samlad erfarenhet, evidens och medicinsk utvärdering', '-', 'FVM', 'Avråds', 'medicinsk kunskap', '-', '-', '62.8', 135, 'ANMÄRKNING 1: Medicinsk kunskap styr all verksamhet i hälso- och sjukvården och har bäring på medicinska riktlinjer, bedömning, planering och mycket annat, varför begreppet inte har tagits med i begreppsmodellen. \r\n\r\nANMÄRKNING 2: Begreppet täcks bl.a. av Contsys kliniskt kunskapsunderlag 9.2.4.', '2020-06-09, marel67: Städad.', '-', '-'),
(313, '-', '2020-06-03 15:54:56.000000', 'utifrån kunskapsunderlag systematiskt framtagna rekommendationer för hälso- och sjukvårdsaktiviteter (7.2) vid specifika hälsotillstånd (6.4)', '-', '3R Contsys reviderad', 'Beslutad', 'medicinsk riktlinje', '-', '-', '29.2.4.2', 135, 'ANMÄRKNING 1: Medicinska riktlinjer kan utgöras av förslag i vetenskaplig artikel, råd och anvisningar från Socialstyrelsen, riktlinjer från specialistförening. Det är också överordnat begrepp till lokalt anpassade riktlinjer.   \r\nANMÄRKNING 2: En publicerad medicinsk riktlinje ska innehålla uppgift om versionsnummer, publiceringsdatum och eventuell giltighetstid.', '2020-06-03, davte1: Städad.', '-', '-'),
(314, '-', '2020-06-03 15:53:42.000000', 'medicinteknisk produkt (3.4.2) som används en gång och sedan kasseras', '-', 'FVM', 'Beslutad', 'medicinteknisk förbrukningsartikel', '-', '-', '27.6.3', 135, 'EXEMPEL 1: Infartskanyl, urinkateter, skalpell.', '2020-06-03, davte1: Städad.', '-', '-'),
(315, '-', '2020-06-03 15:46:40.000000', 'medicinteknisk produkt (3.4.2) med passiv funktion som kan återanvändas', '-', 'FVM', 'Beslutad', 'medicinteknisk materiel', '-', '-', '27.6.2', 135, 'EXEMPEL 1: Peang, rullstol.', '2020-06-03, davte1: Städad.', '-', '-'),
(316, '-', '2020-06-02 13:16:39.000000', 'instrument, apparatur, verktyg, maskin, anordning, implantat, in vitro-reagens eller in vitro-kalibrator, mjukvara, material eller annan liknande eller relaterad artikel, som av tillverkaren är avsedd att enskilt eller i kombination användas för människor för ett eller flera av följande specifika ändamål: ?diagnos (26.7) , prevention, övervakning, behandling eller avhjälpande av sjukdom (26.4.2.5.3) , diagnos (26.7) , övervakning, behandling, avhjälpande av eller som kompensation för en skada (26.4.2.5.4), undersökning, ersättning, modifiering eller stöd för anatomin eller för en fysiologisk process (3.6.1) , stöd för eller upprätthållande av liv, befruktningskontroll, desinfektion av medicinteknisk produkt (3.4.2) , tillhandahållande av information (3.9.5) för medicinska ändamål genom in vitro-undersökning av prover tagna från människokroppen, och som inte fyller sin primära avsedda funktion i eller på människokroppen med farmakologiska, immunologiska eller metaboliska medel, men som stöds i sin funktion med sådana medel\r\n\r\nAlternativ definition     produkt som används för att påvisa, förebygga, övervaka, behandla eller lindra en sjukdom påvisa, övervaka, behandla, lindra eller kompensera en skada eller en funktionsnedsättning, undersöka, ändra eller ersätta anatomi eller en fysiologisk process eller kontrollera befruktning (Socialstyrelsens termbank).', '-', 'ISO 14971:2007, 2.9 eller Contsys SE', 'Beslutad', 'medicinteknisk produkt', '-', '-', '3.4.2', 135, 'ANMÄRKNING 1: Alla underbegrepp till medicinteknisk produkt representerar utrustning som följer lagstiftningen. Förbrukningsartiklar som inte följer lagstiftningen är inte medicintekniska produkter. Läkemedel är inte medicintekniska produkter och följer en egen lagstiftning  \r\nANMÄRKNING 2: Socialstyrelsens definition är baserad på lagen (1993:584) om medicintekniska produkter. Som framgår av såväl definitionen som exemplen är medicintekniska produkter av vitt skilda slag och ingår i begreppssystemet som apparater (materiel), produkter för definitiv applicering (implantat, material utan förutbestämd förbrukningstid) och förbrukningsartiklar (material som är konsumerat i och med att det använts, t.ex. sprutor och kanyler).  \r\nExempel 1: Sprutor, kontaktlinsprodukter, kanyler, infusionsaggregat, pumpar för läkemedelstillförsel, kondomer, hjärt-lungmaskiner, röntgenapparater, EKG-apparater, ergometercyklar i medicinsk användning. Till medicin-tekniska produkter räknas också mjukvara som har samband med produkten, t.ex. EKG-mätningsutrustning, styrprogram för MR-kamera och infusionspump. Eftersom sådan mjukvara förutsätts i större eller mindre utsträckning kunna vara integrerad i ett dokumentationssystem räknas det kärnsystem som upphandlas som medicinteknisk produkt.', '2020-06-02, sofan63, magfo: Termposten justerad.', '-', 'produkt som används för att påvisa, förebygga, övervaka, behandla eller lindra en sjukdom påvisa, övervaka, behandla, lindra eller kompensera en skada eller en funktionsnedsättning, undersöka, ändra eller ersätta anatomi eller en fysiologisk process eller kontrollera befruktning (Socialstyrelsens termbank).'),
(317, '-', '2020-06-03 15:45:19.000000', 'material på vilket data (3.9.1) lagras', '-', 'ISO eller IEC 14776-151:2010 eller Contsys SE', 'Beslutad', 'medium', '-', '-', '3.9.8', 135, 'ANMÄRKNING 1 [VGR] : definitionen i den engelska upplagan EN ISO 13940 är ändrad från texten i ISO eller IEC 14776-151:2010. Den svenska definitionen är en direkt översättning av den engelska texten i EN ISO 13940.  \r\nEXEMPEL 1: En magnetskiva', '2020-06-03, davte1: Städad.', '-', '-'),
(318, '-', '2020-06-03 15:44:15.000000', 'data (3.9.1) som ger information om en eller flera aspekter av data (3.9.1)', '-', 'FVM - Informatikprojektet', 'Beslutad', 'metadata', '-', '-', '23.9.2.7', 135, 'ANMÄRKNING 1: Används för att underlätta spårandet av data.', '2020-06-03, davte1: Städad.', '-', '-'),
