(320, '-', '2020-06-03 15:42:53.000000', 'planerat öppenvårdsbesök (30.2.2.1.1.1.2) på vårdenhet (25.2.3.1.2)', '-', 'Socialstyrelsens termbank, reviderad', 'Beslutad', 'mottagningsbesök', '-', '-', '30.2.2.1.1.1.1', 135, 'ANMÄRKNING 1: Ett mottagningsbesök är alltid planerat och tidbokat. Det bör dock framgå av definitionen utan att man behöver läsa definitionen av akutbesök.', '2020-06-03, davte1: Städad.', '-', '-'),
