(324, '-', '2020-06-03 15:40:45.000000', 'samhällsorgan med egen maktbefogenhet inom visst område', '-', 'Rikstermbanken eller Svensk-albansk tolkordlista', 'Beslutad', 'myndighet', '-', '-', '23.8.4', 135, 'ANMÄRKNING 1: Begreppet tas med med hänsyn till att vårdskador under vissa förutsättningar ska rapporteras till IVO eller annan myndighet (allvarlig läkemedelsbiverkan till Läkemedelsverket).', '2020-06-03, davte1: Städad.', '-', '-'),
