(332, '-', '2020-06-03 15:32:16.000000', 'fenomen som inte är en del av en normal process (3.6.1) men som kan påverka den', '-', 'VGR (förslag till Contsys-revision)', 'Beslutad', 'oavsiktlig händelse', '-', '-', '3.5.6', 135, 'ANMÄRKNING 1: Den svenska översättningen av EN ISO 13940 är \"negativ händelse\", en term som också definieras i termpost 8.2.4. Den engelska termen är unintended event som alltså felöversatts. Därför har termen bytts ut.', '2020-06-03, davte1: Städad.', '-', '-'),
