(334, '-', '2020-06-24 10:55:46.000000', 'uppmärksamhetsinformation avseende förhållande som hälso- och sjukvårdspersonal måste vara medveten om i vården av patient', '-', 'Informatik VGR', 'Beslutad', 'observandum', '-', '-', '-', 155, 'ANMÄRKNING 1: Förhållandet kan innebära såväl riskfaktor som annan viktig information, t.ex. att en patient i sluten vård har en bokad tandläkartid under den förmodade vårdtiden, att patienten ingår i läkemedelsprövning och att patienten av egen övertygelse avböjer blodtransfusion. \r\n\r\nANMÄRKNING 2: Ett vårdtestamente som införts i journalen bör anses som observandum.', '2020-02-17 Perha11; Tillägg för avstämning med RIM\r\n2020-05-29 karkj satt till preliminär definition\r\n2020-06-02, karkj, perha11: Beslutad!\r\n2020-06-24, karkj, magfo: Definitionen reviderad, anmärkningar tillagda. Beslutad.', '-', '-'),
(335, '-', '2020-06-03 15:31:25.000000', 'hälsotillstånd (6.4) som observerats av en hälso- och sjukvårdsaktör (5.2)', '-', 'Contsys SE', 'Beslutad', 'observerat tillstånd', '-', '-', '6.4.1', 135, 'ANMÄRKNING 1: Patient, hälso- och sjukvårdspersonal och annan vårdare är exempel på personer som kan observera ett hälsotillstånd.  \r\nANMÄRKNING 2: Ett observerat tillstånd kan utgöra underlag för en hälsoangelägenhet.  \r\nANMÄRKNING 3: (VGR)  Jamför snomed CTs observerbar företeelse och dess specialiseringar.  \r\nEXEMPEL 1: Ett uppmätt blodtryck, hjärtklappning, kroppsvikt, lunginfiltration på röntgenbild, ett hemoglobinvärde, blek hy.', '2020-06-03, davte1: Städad.', '-', '-'),
(336, '-', '2020-06-03 15:29:52.000000', 'av patienten (5.2.1) upplevt dåligt hälsotillstånd (6.4)', '-', 'FVM', 'Beslutad', 'ohälsa', '-', '-', '26.4.2.5.1', 135, 'ANMÄRKNING 1: Ohälsa används ofta om sjuktal i befolkningen men förekommer även individuellt. Det betyder att individen mår dåligt, sjuk eller inte. Begreppet förekommer ofta om psykiskt lidande men får inte begränsas till detta. Med omsorg om patienten får inte endast missförhållanden som noteras i hälsotillståndet åtgärdas, utan även ohälsa ska hanteras.', '2020-06-03, davte1: Städad.', '-', '-'),
(337, '-', '2020-06-03 15:29:18.000000', 'vårdenhet (25.2.3.1.2) som leds av en områdeschef och är en del av en förvaltning (25.2.3.1.2.1)', '-', 'FVM', 'Beslutad', 'område', '-', '-', '25.2.3.1.2.2', 135, 'ANMÄRKNING 1: Inom en förvaltning kan finnas verksamhetsområden som grupperats i områden. Dessa kan vara administrativa (vanligt vid sjukhus) eller geografiska (primärvården).', '2020-06-03, davte1: Städad.', '-', '-'),
