(341, '-', '2020-06-03 10:52:06.000000', 'beslut av hälso- och sjukvårdspersonal (2.1.3) att hälso- och sjukvårdsaktivitet (7.2) ska utföras', '-', 'Informatik VGR', 'Beslutad', 'ordination', '-', '-', '29.2.9', 44, 'ANMÄRKNING 1: Termbankens definition har frångåtts därför att  1) beslutet kräver mandat, och hälso- och sjukvårdspersonal som fattar ett sådant beslut är därför behörig  2) hälso- och sjukvårdsåtgärd förekommer inte i FVM begreppsmodell men är synonymt med hälso- och sjukvårdsaktivitet. Socialstyrelsen använder en term som är generell inom socialtjänsten och hälso- och sjukvården men inte har anammats av Contsys.  Av Socialstyrelsens exempel framgår att andra än hälso- och sjukvårdspersonal kan utföra det som ordinerats. Därför är det inte en hälso- och sjukvårdstjänst som ordineras.   \r\n\r\nANMÄRKNING 2: Termbankens kommentar: Exempel på ordinationer: läkemedelsbehandling och andra typer av behandlingar, specialkost, fysisk aktivitet. Termen ordination används även om den åtgärd som ordinerats. Den person som ordinerar benämns ordinatör.\r\n\r\nANMÄRKNING 3: Vad som ordineras är en aktivitet inte avsikten att förbättra hälsotillståndet. En hälso- och sjukvårdsaktivitet har i sin definition den avsikten. Därför ges här en avsevärt kortare definition än termbankens.', '2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-03, karkj, magfo: Termposten justerad och beslutad.', '-', 'beslut av behörig hälso- och sjukvårdspersonal som är avsett att påverka en patients hälsotillstånd genom en hälso- och sjukvårdsåtgärd (Socialstyrelsens termbank)'),
(342, '-', '2020-06-02 11:57:19.000000', 'hälsoangelägenhet (6.3) som hälso- och sjukvårdspersonal (5.2.3.3) anger som skäl till ordination (29.2.9)', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'ordinationsorsak', '-', '-', '29.2.9.1', 44, 'ANMÄRKNING 1: Ordinationsorsak är obligatorisk vid läkemedelsordination.', '2020-04-06, vikee1, lagt till avrådd synonym.\r\n2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-02, karkj, perha11: Beslutad!', '-', '-'),
(343, '-', '2020-06-03 15:27:36.000000', 'egenvårdsaktivitet (27.2.4.1) som ordinerats av hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1)', '-', 'Contsys SE', 'Beslutad', 'ordinerad egenvård', '-', '-', '7.2.4', 135, 'ANMÄRKNING 1: hälso- och sjukvårdsaktivitet som legitimerad hälso- och sjukvårdspersonal bedömt att en patient) själv kan utföra (Socialstyrelsens termbank reviderad).', '2020-06-03, davte1: Städad.', '-', 'Socialstyrelsen använder termen hälso- och sjukvårdsåtgärd, som inte finn med i FVMs begreppssystem.'),
(344, '-', '2020-06-03 15:26:38.000000', 'hälso- och sjukvårdstredjepartsaktivitet (7.2.5) ordinerad av hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1)', '-', 'Contsys SE', 'Beslutad', 'ordinerad tredjepartsaktivitet', '-', '-', '7.2.6', 135, '-', '2020-06-03, davte1: Städad.', '-', '-'),
(345, '-', '2020-06-03 00:00:00.000000', 'person (3.3.4) eller grupp av personer (3.3.4) med ansvar, befogenheter och samband för att nå sina mål', '-', 'SS-EN ISO 9000:2015', 'Beslutad', 'organisation', '-', '-', '3.3.1', 135, 'ANMÄRKNING 1: Till termpost: Begreppet organisation innefattar, men är inte begränsat till, egenföretagare, bolag, koncern, firma, företag, myndighet, affärspartner, förbund, välgörenhetsorganisation eller institution, eller delar alternativt kombinationer av dem, oavsett ägarstruktur eller om de är offentliga eller privata.\r\nANMÄRKNING 2: Till termpost: Grupper eller underavdelningar av organisationer kan också ses som organisationer där de för informationsutbytets skull behöver identifieras på detta sätt.\r\nANMÄRKNING 3: Till termpost: I denna Internationella Standard gäller denna definition för alla slags organisationer, oavsett deras legala status.  \r\nANMÄRKNING 4: En organisation behöver inte vara formellt definierad, inte en organisatorisk enhet. Grunden för begreppet är att den grupp av personer som arbetar i organisationen har ett gemensamt mål. En organisation kan bildas och upplösas medan en process pågår.', '2020-06-03, davte1: Städad.', '-', '-'),
(346, '-', '2020-06-03 13:57:14.000000', 'samband mellan de olika delarna i en organisation (3.3.1)', '-', 'Contsys SE', 'Beslutad', 'organisationsstruktur', '-', '-', '3.3.2', 135, '-', '2020-06-03, davte1: Städad.', '-', '-'),
