(350, '-', '2020-06-03 13:54:44.000000', 'förhållande i hälsotillståndet (6.4) som föranleder vårdbegäran (11.3)', '-', 'FVM', 'Beslutad', 'orsak till vårdbegäran', '-', '-', '31.3.4.1', 135, 'ANMÄRKNING 1: Vårdbegäran görs alltid av något skäl som patienten eller företrädare anger i en vårdbegäran för egen räkning eller som hälso- och sjukvårdspersonal anger i en remiss. Orsaken eller orsakerna till vårdbegäran kan var och en kodas enligt Snomed CT eller sammanfattas i diagnosform för att kunna kodas i t.ex. ICF eller ICD 10.', '2020-06-03, davte1: Städad.', '-', '-'),
(351, '-', '2020-06-03 13:53:50.000000', 'person som befinner sig i irreguljär migration. En person som inte är medborgare i EU får uppehålla sig i Sverige maximalt tre månader eller den tid som anges i visum. Därefter krävs uppehållstillstånd. Om personen inte har detta är hen papperslös eller irreguljär migrant. Om personen har sökt asyl är hen inte papperslös, inte heller om asyl avslagits, personen utvisats. Hen är då illegal migrant. Ordet papperslös är en översättning av franska sans papier', '-', 'Bilaga 1 FVM upphandling', 'Beslutad', 'papperslös', '-', '-', '.', 135, '-', 'Inhämtad från bilaga 1 2017-10-24\r\n2020-06-03, davte1: Städad.', '-', '-'),
(352, '-', '2020-06-03 13:49:38.000000', 'hälso- och sjukvårdsaktör (5.2) med en personroll (3.3.6), som söker, erhåller eller har erhållit hälso- och sjukvård (3.1.1)', '-', 'VGR (förslag till Contsys-revidering)', 'Beslutad', 'patient', '-', '-', '5.2.1', 135, '-', '2020-06-03, davte1: Städad.', '-', '-'),
(353, '-', '2020-06-03 13:48:48.000000', 'icke validerad patientinformation (12.5.3.3) som efter validering av hälso- och sjukvårdspersonal (5.2.3.3) räknas som journalhandling (32.2.4)', '-', 'FVM efter text i 3R Contsys', 'Beslutad', 'patientdokumentation att införas i patientjournal', '-', '-', '32.5.3.3.1', 135, 'ANMÄRKNING 1: Patientens eller närståendes eller annan vårdares anteckning som valideras av hälso- och sjukvårdspersonal som kliniskt relevant och då jämställs med journalhandling och inkluderas i patientjournalen.', '2020-06-03, davte1: Städad.', '-', '-'),
(354, '-', '2020-07-29 10:17:58.000000', 'tredjepart inom hälso- och sjukvård (5.2.4) som har personroll (3.3.6) med rätt att fatta beslut för patientens (5.2.1) räkning', '-', 'Contsys SE', 'Beslutad', 'patientens representant', '-', '-', '5.2.4.3', 135, 'ANMÄRKNING 1: I ISO eller TS 21298 är vårdtagaragent den rekommenderade termen för detta begrepp.  \r\n\r\nANMÄRKNING 2: VGR: Beskrivning finns i NI men inte i definitionsform. Där räknas i stället olika typer av företrädare upp, vilka i detta begreppssystem visas som specialiseringar. I upphandlingen av kärnsystem har FVM valt termen företrädare som dels används av NI, dels var den översättning av Contsys som gjordes av 3R-gruppen.  \r\n\r\nANMÄRKNING 3: Varje företrädare ska ha ett uppdrag med befogenhet att företräda patienten, ett mandat. Det grundar sig vanligen på ett samtycke, som är implicit i det att patienten ger företrädaren uppdraget. Det kan också grunda sig på ett myndighetsbeslut om en företrädare är nödvändig (förmyndare för barn där vårdnadshavaren inte kan vara förmyndare) eller patienten motsätter sig att få en företrädare. Myndighetsbeslut grundar sig på gällande lag och är inte ett separat begrepp utan ingår i begreppssystemet som begreppet bemyndigande enligt lag.\r\n\r\nANMÄRKNING 4: I Patientbakgrund är termen företrädare. Den införs därför som tillåten synonym.', '2020-06-03, davte1: Städad.\r\n2020-07-29, magfo: Synonymen företrädare hämtad från Patientbakgrund 2009.', '-', '-'),
(355, '-', '2020-05-25 11:19:41.000000', 'hälsojournal (12.2) som har skapats eller samlats in av patienten (5.2.1), närstående (5.6.4) eller annan vårdare (5.2.4.1) från patient (5.2.1) för att beskriva patientens (5.2.1) hälsotillstånd (6.4)', '-', 'FVM', 'Beslutad', 'patientgenererade hälsodata', '-', '-', '32.2.2.7', 135, 'ANMÄRKNING 1: Detta är sådan information som samman ställs av patienten själv eller någon i närheten. Den samlas i den personliga journalen, och uppgifterna kan valideras för att införas i patientjournalen.', '2020-05-25, perha11: Uppdatrerad', '-', '-'),
(356, '-', '2020-06-04 09:12:37.000000', 'övervakning av en patients tillstånd med stöd av mätvärden, konfigurerbara gränsvärden och notifikation när ett mätvärde är utanför konfigurerad gräns', '-', 'dPStd FVM upphandling', 'Publicera ej', 'patientmonitorering', '-', '-', '-', 14, '-', '2018-01-09, Perha11: Första förslag på definition för vidare utredning av innebörden i begreppet. Åter Dp.\r\n2018-01-10, Perha11: beslutas i Termgruppen\r\n2018-02-09 karkj, förslag 2\r\nInkommen definition som kommer att ändras:\r\nupprepad, planerad och strukturerad inhämtning av patients hälsotillstånd i syfte att studera förändringar över tid.\r\n2020-06-03, davte1: Städad.\r\n2020-06-04, magfo: Dublett. Ändrad till pågår.\r\n2020-06-04, karkj, magfo: Felaktig dublett. Publiceras ej..', '-', '-'),
(357, '-', '2020-06-23 11:46:19.000000', 'löpande registrering av värden avseende en patients hälsotillstånd', '|360152008 |monitorering, aktivitet|', 'Informatik VGR', 'Beslutad', 'patientmonitorering', '-', '-', '-', 155, '-', '2020-05-06, Karkj, Perha11: Beslutad!\r\n2020-06-23, magfo: Lagt till synonym monitorering och referens till SCT.\r\n2020-06-23, karkj, magfo: Ny definition i linje med egenmonitorering. Beslutad.', 'SCT', '-'),
(358, 'Patientnära analyser är de som utförs av vårdpersonal alternativt labpersonal på avdelning eller mottagning inom sjukvården eller kommunal omsorg, men utanför Labmedicin. Detta till skillnad från egentestning som görs av patienten. Innehåller t.ex: \r\nB-Ketoner\r\nBlodgaser\r\nCRP\r\nFeces Hb\r\nGlukos\r\nHb\r\nHbA1c\r\nMononucleos\r\nStrep A\r\nUrintestremsor\r\nTromboelastografi\r\nhttp: eller  eller vardgivare.skane.se eller vardriktlinjer eller laboratoriemedicin eller pna eller', '2020-07-31 17:01:44.000000', 'laboratorieanalys utförd av hälso- och sjukvårdpersonal nära patienten och där analysen blir klar i samband med samma  vårdkontakt', '-', 'dP Std FVM upphandling', 'Beslutad', 'patientnära analys', '-', '-', '-', 135, 'ANMÄRKNING 1: Begreppet är specialisering av patientnära vårdaktivitet.', '2020-06-03, davte1: Städad.\r\n2020-06-26, karkj, vikee1, magfo: bedsideanalys tillagd som synonym\r\n2020-07-30, magfo: Anmärkning tillagd.', '-', '-'),
(359, '-', '2020-06-03 13:43:39.000000', 'öppet gränssnitt där patienten (5.2.1) eller företrädare (5.2.4.3) med autentisering (31.5) och behörighet (31.6) har tillgång till ett urval av dokumentation (23.9.5.1) i hälso- och sjukvårdens (3.1.1) informationssystem', '-', 'dp Std FVM upphandling', 'Beslutad', 'patientportal', '-', '-', '32.2.2.3', 135, 'ANMÄRKNING 1: Patientportal är en allmän beteckning för patientens ingång till invånarens e-hälsotjänster.', '2020-06-03, davte1: Städad.', '-', '-'),
(360, '-', '2020-06-03 13:41:37.000000', 'hälso- och sjukvårdsprocess (8.2) som omfattar alla hälso- och sjukvårdsaktiviteter (7.2), utförda eller ordinerade av hälso- och sjukvårdsutförare (5.2.3), som hanterar identifierade eller specificerade hälso- och sjukvårdsangelägenheter (6.2)', '-', 'Contsys SE', 'Beslutad', 'patientprocess', '-', '-', '8.2.1', 135, 'ANMÄRKNING 1: Patientprocessen är det som i SAMBA visas som kärnprocessen inom hälso- och sjukvården, där patientens hälsotillstånd är förädlingsobjekt. En patientprocess kan inte identifieras om det inte pågår en hälso- och sjukvårdsprocess.', '2020-06-03, davte1: Städad.', '-', 'delprocess inom en vårdprocess i syfte att direkt påverka patientens hälsotillstånd (FVM)'),
