(369, '-', '2020-06-03 13:14:17.000000', 'hälsojournal (12.2) som upprätthålls och underhålls av patienten (5.2.1) eller av patientens representant (5.2.4.3)', '-', 'Contsys SE', 'Beslutad', 'personlig journal', '-', '-', '12.2.2', 135, 'ANMÄRKNING 1: Personlig journal är den neutrala termen i detta begreppssystem. E-hälsomyndigheten försöker lansera namnet Hälsa för mig för ett nationellt hälsokonto. Detta kan bli lagringsplats för personlig journal. Funktionen måste finnas och kan skapas i Kärnsystemet. Den nationella förvaltningen ifrågasätts av Datainspektionen.', '2020-06-03, davte1: Har uppdaterat efter anvisningar på JIRA kortet INFMTK-610.', '-', 'Alternativ definition: hälsojournal som förs av en patient eller av en företrädare (3R Contsys reviderad)'),
