(374, '-', '2020-06-02 13:55:53.000000', 'definierad uppsättning av hälsoförhållanden (2.2.1) i ett befolkningsurval (25.3)', '-', 'FVM', 'Beslutad', 'populationshälsa', '-', 'population health', '-', 135, 'ANMÄRKNING 1: Den mest använda termen är population health. Det finns flera definitioner. Den här formulerade definitionen bygger på studier av flera publikationer i ämnet, där Region Skånes (odaterade) broschyr om upphandlingsprojektet \"Sammanhållen digital vårdmiljö\" använder termen befolkningshälsa. Den av oss föredragna termen populationshälsa har valts eftersom en population på tydligare sätt är ett definierat befolkningsurval än en befolkning. \r\n\r\nANMÄRKNING 2: Populationshälsa skiljer sig från det vedertagna begreppet folkhälsa i huvudsak på två sätt. Det ena är att ett befolkningsurval definieras och avgränsas med en tydlig uppsättning av egenskaper, medan folkhälsa vänder sig till en bred publik. Det andra är att tyngdpunkten i arbete med populationshälsa ligger i studium av befolkningsurvalets hälsotillstånd, medan folkhälsoarbetet mera inriktar sig på aktiviteter och förslag till aktiviteter i avsikt att främja hälsa och förebygga sjukdom i en stor befolkning. Folkhälsoarbete drar emellertid stor nytta av det som görs i populationshälsan, och slutsatser av arbete med populationshälsa kan föranleda riktade aktiviteter som kan inkluderas i begreppet populationshälsa.', 'Inhämtad från modellarbetet och\r\n Termforum 2017-10-30\r\n2020-06-02, verwi6, perha11: Förädlat definitionen, kompletterat med anmärkning, beslutad.', '-', '-'),
(375, 'Inte definierad', '2020-06-02 13:50:30.000000', 'definierad uppsättning av hälsostatus (6.5) i ett befolkningsurval (25.3)', 'Inte definierad', 'FVM', 'Publicera ej', 'populationshälsa', 'Inte definierad', 'Engelsk term: population health', '26.5.4', 1, 'Anmärkning 1     Den mest använda termen är population health. Det finns flera definitioner. Den här formulerade definitionen bygger på studier av flera publikationer i ämnet, där Region Skånes (odaterade) broschyr om upphandlingsprojektet \"Sammanhållen digital vårdmiljö\" använder termen befolkningshälsa. Den av oss föredragna termen populationshälsa har valts eftersom en population på tydligare sätt är ett definierat befolkningsurval än en befolkning.   Anmärkning 2     Populationshälsa skiljer sig från det vedertagna begreppet folkhälsa i huvudsak på två sätt. Det ena är att ett befolkningsurval definieras och avgränsas med en tydlig uppsättning av egenskaper, medan folkhälsa vänder sig till en bred publik. Det andra är att tyngdpunkten i arbete med populationshälsa ligger i studium av befolkningsurvalets hälsotillstånd, medan folkhälsoarbetet mera inriktar sig på aktiviteter och förslag till aktiviteter i avsikt att främja hälsa och förebygga sjukdom i en stor befolkning. Folkhälsoarbete drar emellertid stor nytta av det som görs i populationshälsan, och slutsatser av arbete med populationshälsa kan föranleda riktade aktiviteter som kan inkluderas i begreppet populationshälsa.', '2020-06-02, verwi6, perha11: Dublett, publiceras ej..', 'Inte definierad', '-'),
