(377, '-', '2020-08-05 14:14:59.000000', 'plats angiven i förhållande till referenssystem', '-', 'Informatik VGR', 'Beslutad', 'position', '-', '-', '-', 2, 'ANMÄRKNING 1: En diskussion utifrån skepsis avseende kontextberoende hos detta begrepp utmynnar i att varje kontext (jordytan, ett fotbollslag, en regering, kroppen, universum) kan utgör ett referenssystem. Därför är begreppet allmängiltigt.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-06-01, marel67: Städad.\r\n2020-06-30, davte1 och verwi6: Har lagt in defnitionen från begreppsmodellen. Flyttad till preliminär.\r\n2020-08-05, ollka3, magfo: Beslutas.', '-', '-'),
