(379, '-', '2020-06-01 00:00:00.000000', 'möjligt hälsotillstånd (6.4) som inte obseverats men beskrivs av en person (3.3.4) med roll i hälso- och sjukvård (25.2)', '-', 'VGR', 'Beslutad', 'potentiellt hälsotillstånd', '-', '-', '6.4.2', 1, 'ANMÄRKNING 1: Ett potentiellt hälsotillstånd kan endast uttömmande beskrivas genom användning av en av dess specialiseringar.', '2020-06-01, marel67: Städad.', '-', '-'),
