(381, '-', '2020-06-01 00:00:00.000000', 'hälso- och sjukvårdsverksamhet som utan avgränsning vad gäller sjukdomar (26.4.2.5.3) ålder eller patientgrupper svarar för befolkningens behov av grundläggande medicinsk behandling, omvårdnad, förebyggande arbete och rehabilitering och som inte kräver sjukhusens medicinska och tekniska resurser', '-', 'Socialstyrelsens termbank', 'Beslutad', 'primärvård', '-', '-', '29.8.1', 1, '-', '2020-06-01, marel67: Städad.', '-', '-'),
(382, '-', '2020-06-01 00:00:00.000000', 'grupp av aktiviteter (23.6.6) som samverkar eller påverkar varandra, och som använder underlag för att åstadkomma ett avsett resultat', '-', 'SS-EN ISO 9000:2015 eller Contsys SE', 'Beslutad', 'process', '-', '-', '3.6.1', 1, 'ANMÄRKNING 1: Om det ”avsedda resultatet” av en process kallas utfall, produkt eller tjänst beror på sammanhanget.  \r\n\r\nANMÄRKNING 2: Underlag till en process är vanligen resultat från andra processer. Resultat från en process utgör vanligen underlag till andra processer. \r\n\r\nANMÄRKNING 3: Två eller flera samverkande eller varandra påverkande processer i serie kan också kallas för en process.\r\n\r\nANMÄRKNING 4: Processer i en organisation planeras och utförs vanligen under kontrollerade förhållanden för att tillföra värde.  \r\n\r\nANMÄRKNING 5: En process där överensstämmelse med krav hos det resulterande utfallet inte på ett omedelbart eller ekonomiskt sätt kan verifieras, kallas ofta en ”speciell process”.\r\n\r\nANMÄRKNING 6: Detta är en av de gemensamma termerna och definitionerna för ISO:s standarder för ledningssystem som anges i bilaga SL av Consolidated ISO Supplement till ISO eller IEC Directives, Part 1. Den ursprungliga definitionen har ändrats för att undvika cirkelresonemang mellan process och utfall, och Anm. 1 till och med 5 till termpost har lagts till', '2020-06-01, marel67: Städad.', '-', '-'),
(383, '-', '2020-06-01 00:00:00.000000', 'representation av en process (3.6.1)', '-', 'Contsys SE', 'Beslutad', 'processmodell', '-', '-', '3.6.2', 1, 'ANMÄRKNING 1: En processmodell kan uttryckas grafiskt eller i ett formellt språk.', '2020-06-01, marel67: Städad.', '-', '-'),
