(391, 'Inte definierad', '2020-06-01 09:24:35.000000', '[hälso-och sjukvård]notifikation (32.2.3.4) till hälso- och sjukvårdspersonal (5.2.3.3) eller patient (5.2.1) att viss hälso- och sjukvårdsaktivitet (7.2) ska utföras', '-', 'FVM', 'Beslutad', 'påminnelse', '-', '-', '32.2.3.4.1', 135, 'ANMÄRKNING 1: Påminnelse ska bl.a. göras om behovet att utfärda radiologisk remiss för kontrollundersökning, eftersom en radiologisk avdelning har rätt att vägra ta emot remisser för undersökning långt fram i tiden. För närvarande gäller i Västra Götalandsregionen 13 månader, men principen kan gälla vilken verksamhet som helst och varje tidsintervall som begränsar möjligheten att utfärda remiss. Påminnelse kan självklart användas för varje aktivitet som inte kan sättas i verket genast utan ska initieras vid ett tillfälle framåt i tiden.\r\n\r\nANMÄRKNING 2: För patienten kan en påminnelse avse kommande kontakt med hälso- och sjukvården eller att viss egenvård ska genomföras.', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(392, 'Inte definierad', '2020-08-11 10:01:12.000000', '[läkemedelshantering] handling, utfärdad av förskrivare (3.3.4.3.1), som innebär auktorisation för apotek att expediera en viss läkemedelsvara (6.1.3.3) till en viss patient', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'recept', '-', '-', '29.2.9.2.2', 135, 'ANMÄRKNING 1: Termbanken anger ... läkemedelsprodukt. Men apoteket kommer att expediera läkemedelsvara eftersom den alltid är förpackad. Termbanken anger \"viss person\", men den personen är ju genom att få läkemedel patient, varför definitionen innehåller \"viss patient\".', '2020-09-01, perha11: Uppdaterad!\r\n2020-08-11, karkj, magfo: Person utbytt mot patient.', '-', '-'),
