(399, 'Från Socialstyrelsen om Nationella riktlinjer:\r\nSocialstyrelsens nationella riktlinjer är ett stöd vid prioriteringar och ger vägledning om vilka behandlingar och metoder som olika verksamheter i vård och omsorg bör satsa resurser på. För att följa upp utvecklingen och kvaliteten i vården och omsorgen tar vi fram målnivåer och utvärderingar, med utgångspunkt från de nationella riktlinjerna.\r\nhttps://www.socialstyrelsen.se/regler-och-riktlinjer/nationella-riktlinjer/', '2020-08-05 14:06:35.000000', 'ett stöd som avser vägledning samt prioritering för behandlingar och metoder för verksamheter inom hälso- och sjukvård', '-', '-', 'Pågår', 'regional riktlinje', '-', '-', '-', 1, '-', '2020-06-01, marel67: Städad.\r\n2020-06-23, davte1: Preliminär definition och ändrad status till preliminär.\r\n2020-08-05, ollka3, magfo: Backas till pågår, se JIRA 644,', '-', '-'),
