(403, '-', '2020-05-12 14:38:55.000000', 'vårdbegäran som utfärdas av hälso- och sjukvårdspersonal', '-', 'Informatik VGR', 'Beslutad', 'remiss', '-', '-', '11.3.3', 135, 'ANMÄRKNING 1: Remiss är definierat i Socialstyrelsens termbank men förekommer i hälso- och sjukvårdslagen endast omnämnd som något man förutsätter att läsaren förstår. I NI förekommer termen inte, och i Contsys finns de två engelskspråkiga termerna referral, som översätts till svenska med remiss och betyder begäran om övertagande av vårdansvar, samt request, som betyder beställning av tjänst, något som enligt hävd i svensk hälso- och sjukvård görs med remiss. Request har i 3R Contsys översatts med \"begäran om utförande av vårdaktivitet\". Av Socialstyrelsens termbank framgår inte relationen till vårdbegäran, som vi bedömt väsentlig för att de båda begreppen ska kunna läggas till grund för en informationsmodell. Av det skälet ges en alternativ definition. I Contsys SE betyder remiss endast beställning av tjänst (se också hänvisning)   \r\n\r\nANMÄRKNING 2: Remiss är alltid en handling som kommuniceras vårdenheter emellan. Den remissmottagande vårdenheten kan kräva betalning för tjänsten eller vårdövertagandet. Detta förhållande har inte inkluderats i definitionen av remiss utan behandlas separat.', '2020-05-12, karkj, perha11, magfo: Definitionerna utbytta med Informatik VGR (frn upphandlingen) som rekommenderad och såväl Socialstyrelsens som Contsys som alternativa. Termposten beslutad.', '-', 'vårdbegäran (11.3) där hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1) ber en hälso- och sjukvårdsutförare (5.2.3) att utföra en eller flera hälso-och sjukvårdsutföraraktiviteter (7.2.1) (Contsys)\r\n\r\nhandling som utgör beställning av tjänst eller begäran om övertagande av vårdansvar för en patient (Socialstyrelsens termbank)'),
(404, 'Inte definierad', '2020-06-01 09:15:01.000000', 'besked till patient (5.2.1) att vårdbegäran (11.3) sänts till annan vårdenhet (25.2.3.1.2)', '-', 'FVM', 'Beslutad', 'remissmeddelande till patient', '-', '-', '31.3.5.1', 135, 'ANMÄRKNING 1:  Patienten ska alltid meddelas om vårdbegäran skickas vidare till annan vårdenhet oberoende av orsak. Det kan bero på vårdgaranti eller att den egna vårdenhetens vårdutbud inte är adekvat i förhållande till det som vårdbegäran avser. Om vårdbegäran är för egen räkning underrättas endast patienten; någon inremitterande hälso- och sjukvårdspersonal finns inte.', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(405, 'Inte definierad', '2020-06-01 09:13:58.000000', 'journalutdrag (12.5) som utgör svar på remiss (11.3.3)', '-', 'FVM', 'Beslutad', 'remissvar', '-', '-', '32.5.1', 135, '-', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(406, 'Inte definierad', '2020-06-01 09:12:44.000000', 'aktör som utfärdar vårdbegäran (11.3)', '-', 'FVM', 'Beslutad', 'remittent', '-', '-', '25.2.3.3.1', 135, '-', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(407, 'Inte definierad', '2020-06-01 09:10:28.000000', 'observerat tillstånd (6.4.1) som representerar ett hälsostatusutfall (26.5.2.1)', '-', 'Contsys SE', 'Beslutad', 'resulterande tillstånd', '-', '-', '6.4.1.2', 135, 'ANMÄRKNING 1: (Ur Contsys SE): Ett resulterande tillstånd kan representera utfallet för hälsostatus efter ett enskilt vårdaktivitetselement, ett paket med utredande och eller eller behandlande vårdaktiviteter i en hälso- och sjukvårdsprocess och dessutom utfallet efter en slutförd patientprocess.  \r\n\r\nANMÄRKNING 2: I harmoniseringsarbetet noteras att hälsostatusutfall kursiverats trots att termen inte definierats. I den engelska versionen refererar definitionen till output Health state som i Contsys SE heter hälsostatus som utfall. Detta begrepp avser utfall av en hel process, medan ett resulterande hälsotillstånd anges representera tillståndet också efter enstaka aktiviteter, varför hälsostatusutfall är ett alldeles utmärkt begrepp som i den föreliggande harmoniseringen läggs till i begreppssystemet.  \r\n\r\nEXEMPEL 1: (Ur Contsys SE): Resultat av en vårdprocess, resultat av vårdaktivitet.', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(408, 'Inte definierad', '2020-06-03 10:32:03.000000', 'tillgång som används eller förbrukas medan en process (3.6.1) utförs', '-', 'Contsys SE', 'Beslutad', 'resurs', '-', '-', '3.4.1', 155, 'ANMÄRKNING 1: Inkluderar olika komponenter såsom finansiering, personal, anordningar, fasta inventarier och verktyg samt resurser som el, vatten, bränsle och infrastrukturer för kommunikation. \r\n\r\nANMÄRKNING 2: I resurser ingår sådana som är återanvändbara, förnybara eller förbrukningsbara.', '2020-06-01, perha11: Uppdaterad!\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(409, 'Inte definierad', '2020-06-01 09:05:59.000000', 'förteckning över hälso- och sjukvårdsresurs (7.2.9) vid en vårdenhet (25.2.3.1.2)', '-', 'FVM', 'Beslutad', 'resurskatalog', '-', '-', '27.2.9.1', 135, 'ANMÄRKNING 1: Vårdenhet har sin breda betydelse – från sjukhus eller primärvårdförvaltning till vårdavdelning, laboratorium, BVC. Man måste känna till resurskatalogen när man ska lägga upp en utbudskatalog.', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(410, 'Inte definierad', '2020-06-01 09:02:48.000000', 'driftkostnad för resurs (3.4.1) som inte är förbrukningsartikel (27.6.3)', '-', 'FVM', 'Beslutad', 'resurskostnad', '-', '-', '27.9.3', 135, 'FÖRKLARING: Överordnat begrepp för drift- och kapitaltjänstkostnad för resurser som inte är engångsmaterial och driver kostnad vid sin enda användning.', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(411, 'Inte definierad', '2020-06-01 09:00:45.000000', 'kombination av sannolikheten för en händelse och dess konsekvenser', '-', 'ISO Guide 73:2009 eller Contsys SE', 'Beslutad', 'risk', '-', '-', '3.5.5', 135, '-', '2020-09-01, perha11: Uppdaterad!', '-', '-'),
(412, '-', '2020-06-01 08:59:33.000000', 'potentiellt hälsotillstånd (6.4) som en patient (5.2.1) löper risk att drabbas av', '-', 'Contsys SE', 'Beslutad', 'risktillstånd', '-', '-', '6.4.2.4', 135, 'ANMÄRKNING 1: En progressiv sjukdom kan kräva prioriterade aktiviteter i processen, något som hänsyn ska tas till i den individuella planen. En känd allergi medför hälsorisk, och behandling med det allergiframkallande medlet ska undvikas, vilket också ska beaktas.', '2020-06-01, perha11: Uppdaterad', '-', '-'),
(413, '-', '2020-06-02 11:33:48.000000', 'funktion eller position', '-', 'ISO eller HL7 21731:2006', 'Beslutad', 'roll', '-', '-', '3.3.5', 135, '-', '2020-05-29, marel67: Städad. Låg inne som klar bland \"1970 begreppen\" men jag tyckte definitionen såg lite märklig ut så flyttar den till Preliminär.\r\n2020-06-02, karkj, perha11: Beslutad!', '-', '-'),
(414, 'Inte definierad', '2020-04-28 14:32:15.000000', 'funktion eller position i hälso- och sjukvård (3.1.1) som innehas av person (3.3.4), organisation (3.3.1) eller intressent (3.3.3)', 'Inte definierad', 'VGR', 'Beslutad', 'roll i hälso- och sjukvård', 'Inte definierad', 'Inte definierad', '25.2', 1, '-', '2020-04-28, vikee1: BV, lagt till synonym utförarroll', 'Inte definierad', '-'),
(415, '-', '2020-05-29 00:00:00.000000', 'dataregister (3.9.2) som innehåller sammanfattad information (3.9.5) för hälso- och sjukvårdssamordning och vårdkontinuitet (3.1.2)', '-', 'Contsys SE', 'Beslutad', 'sammanfattad hälso- och sjukvårdsinformation', '-', '-', '12.4', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(416, '-', '2020-05-29 00:00:00.000000', 'datalager innehållande sammanfattande information för koordinering och kontinuitet i vården', '-', 'FVM upphandling Bilaga 1', 'Beslutad', 'sammanfattad hälsoinformation', '-', '-', '-', 1, '-', 'Inhämtad från bilaga 1 2017-10-24\r\n\r\n2020-05-29, marel67: Städad.', '-', '-'),
(417, '-', '2020-05-29 00:00:00.000000', 'elektroniskt system, som gör det möjligt för en vårdgivare (25.2.3.1.1) att ge eller få direktåtkomst till journalutdrag (12.5) hos en annan vårdgivare (25.2.3.1.1)', '-', 'Patientdatalagen (2008:355) 1 kap. 3 §, reviderad (lagens beskrivning omformulerad som terminologisk definition)', 'Beslutad', 'sammanhållen journalföring', '-', '-', '32.3.1', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(418, 'Prioriterad fråga från regionstyrelsen, 2017 ökad samplanering. Samplanering innebär att flera vårdenheter planerar sina resurser tillsammans. Ska kunna ske över flera enheter med deltagare från olika områden och specialiteter (dietist, arbetsterapeut) samplanering på ett helt sjukhus för bokning av resurs. Här används det på samma sätt och upplevs olika beroende på i vilket perspektiv det används.', '2020-05-05 09:24:49.000000', 'Definieras ej', '-', '-', 'Definiera ej', 'samplanering', '--', '-', '-', 7, 'Allmänspråk! Vill man ha mer specifika begrepp får det skapas specifika termer för det syftet .\r\nSe planering.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-04-05, Perha11 BB: Allmänspråk som inte definieras, hänvisning till begreppet planering som finns definierat hos socialstyrelsen.', '-', '-'),
(419, '-', '2020-05-29 00:00:00.000000', 'tillfrågad persons (3.3.4) beslut om att lämna eller inte lämna samtycke (11.2.6)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'samtyckesbeslut', '-', '-', '31.2.6.1', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(420, '-', '2020-05-29 00:00:00.000000', 'förmåga hos patienten (5.2.1) och eller eller patientens representant (5.2.4.3) att ge informerat samtycke (11.2.6) eller uttala misstycke (11.2.7)', '-', 'Contsys SE', 'Beslutad', 'samtyckesförmåga', '-', '-', '11.2.8', 1, 'ANMÄRKNING 1: Om en patient inte har förmåga att själv ta ställning till samtycke kan bemyndigande enligt lag träda i samtyckets ställe. Brist på förmågan leder oftare till att företrädare (patientens representant) behöver utses med eget mandat.', 'förmåga hos patient att ge samtycke (FVM; 3R Contsys reviderad)', '-', 'förmåga hos patient att ge samtycke (FVM; 3R Contsys reviderad)'),
(421, 'Schedule protocol appoinment är ett workflow i PAS-strömmen som WS har svårt att hitta ett bra namn för. Flödet handlar om en bokning som innehåller flera olika aktiviteter som hör ihop t ex smörja in med kräm, låt verka, ta bild, ge återkoppling.', '2020-05-29 00:00:00.000000', '-', '-', '-', 'Pågår', 'schedule protocol appointment', '-', '-', '-', 16, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n\r\n2020-05-29, marel67: Städad\r\n\r\n2020-06-18, marel67: Väntar på ärende i Jira INFMTK-750.', '-', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(422, 'EVAMA', '2020-05-06 10:39:15.000000', 'förmåga att utväxla information mellan datorsystem på ett sådant sätt att mottagande system utan att särskilda åtgärder måste vidtas för att tolka informationens innebörd', '-', 'Wikipedia, reviderad', 'Beslutad', 'semantisk interoperabilitet', '-', '-', '80.12', 155, '-', '2020-05-06, Karkj, Perha11: Beslutad.', '-', 'förmågan att utväxla information mellan datorsystem på ett sådant sätt att mottagande system utan manuell intervention kan tolka informationens innebörd och producera för slutanvändaren användbara resultat (Wikipedia, original)'),
(423, 'Från EVAMA', '2020-05-06 10:36:03.000000', 'läran om betydelsen hos språkliga ut­tryck', '-', 'Svensk ordbok', 'Beslutad', 'semantik', '-', '-', '80.22', 155, '-', '2020-05-06, Karkj, Perha11: Devinierad och beslutad.', '-', '-'),
(424, 'från FVM Upphandling avsnitt 4.4.4', '2020-08-05 13:56:31.000000', 'anordning som påverkas av fysikalisk storhet och som avger en signal vilken beror av storhetens värde', '-', 'Rikstermbanken/	Terminologicentrum TNC: Basord i våra fackspråk 2012, reviderad', 'Beslutad', 'sensor', '-', '-', '-', 22, 'ANMÄRKNING 1: En sensor är en anordning som uppfattar mätvärden i kroppen och har förmåga sända resultatet till en annan anordning som visar aktuellt värde. Det kan vara längd- och viktuppgifter eller elektriska signaler såsom EKG och EEG. Det särpräglade för sensorn är att den fungerar utan att en person hanterar den vid mättillfället.', '2020-05-29, marel67: Städad\r\n2020-07-06, vikee1: Ändrat till status Publiceras Ej och skapat ett kort i Jira https://vgregionit.atlassian.net/browse/INFMTK-990 eftersom det behövs mer kontaext för att kunna göra en definition.\r\n2020-07-30, magfo: Hämtat definition från Rikstermbanken och avslutat JIRA 990\r\n2020-08-05, ollka3, magfo: Liten justering av definitionen, posten beslutad.', '-', '-'),
(425, '-', '2020-05-29 00:00:00.000000', '[hälso- och sjukvård] bekräftelse att innehållet i en anteckning överensstämmer med den signerandes uppfattning', '-', 'FVM', 'Beslutad', 'signering', '-', '-', '-', 1, 'ANMÄRKNING 1: Signeringsansvarig enligt PDL 4 kap. 10§: ”En journalanteckning ska, om det inte finns något synnerligt hinder, signeras av den som ansvarar för uppgiften”. Vi utgår ifrån att lagstiftaren med ”uppgiften” menar den information som journalanteckningen innehåller och inte uppgiften att göra journalanteckning. ”Synnerligt hinder” innefattar möjligheten att om den som skrivit journalanteckningen inte är tillgänglig kan en annan person ta ansvar för anteckningen genom att signera den.', '2020-05-29, marel67: Städad', '-', '-'),
(426, '-', '2020-05-29 00:00:00.000000', 'störning av kroppens struktur och funktion till följd av onormala kroppsinterna fenomen', '-', 'FVM', 'Beslutad', 'sjukdom', '-', '-', '26.4.2.5.3', 1, 'ANMÄRKNING 1: Det finns ingen auktoriserad definition av sjukdom, däremot används \"sjukdom och skada\" som parbegrepp när man vill beskriva att patienten inte mår bra och vad som ska göras åt det. Vi tvingas då definiera dessa båda begrepp som på hyggligt sätt är åtskilda i ICD-10-SE.\r\n\r\nEXEMPEL 1: Autoimmun sjukdom, tumörer, infektioner, hjärt-kärlsjukdom, psykos.', '2020-05-29, marel67: Städad', '-', '-'),
(427, '-', '2020-05-29 00:00:00.000000', 'transport inom sjukhustomt', '-', 'VGR', 'Beslutad', 'sjukhusintern transport', '-', '-', '-', 1, '-', '2020-05-29, marel67: Städad', '-', '-'),
(428, '-', '2020-05-29 00:00:00.000000', 'förbrukningsartikel (3.4.2.4) som inte är medicinteknisk produkt (9.1.1.3)', '-', 'FVM', 'Beslutad', 'sjukvårdsmaterial', '-', '-', '27.9.1', 1, 'EXEMPEL 1: Bandage, tvättmedel.', '2020-05-29, marel67: Städad', '-', '-'),
(429, '-', '2020-05-29 00:00:00.000000', 'sjukvårdsartiklar som kan återanvändas', '-', 'FVM', 'Beslutad', 'sjukvårdsmateriel', '-', '-', '27.9.2', 1, 'EXEMPEL 1: Sänglinne, patientkläder, personalkläder, handdukar.', '2020-05-29, marel67: Städad', '-', '-'),
(430, '-', '2020-05-29 00:00:00.000000', '[hälso- och sjukvård] störning av kroppens struktur och funktion till följd av yttre påverkan', '-', 'FVM', 'Beslutad', 'skada', '-', '-', '26.4.2.5.4', 1, 'ANMÄRKNING 1: Se anmärkning till sjukdom (26.4.2.5.3)! Om kroppens struktur och funktion störs av yttre faktorer kallar vi det skada.\r\n\r\nANMÄRKNING 2: Inom yrkesmedicinen finns fall där gränsdragning mellan skada och sjukdom är svår. Hjärtinfarkt på grund av stress, MS eller Parkinsons sjukdom efter giftexposition: är det skada eller sjukdom? Exakt samma mekanismer i kroppen finns som erkända kroppsinterna processer.\r\n\r\nEXEMPEL 1: Benbrott, förgiftning, arbetsskada i form av reaktion på tungmetallexposition, strålskada.', '2020-05-29, marel67: Städad', '-', '-'),
(431, '-', '2020-05-29 00:00:00.000000', 'lidande, kroppslig eller psykisk skada (26.4.2.5.4) eller sjukdom (26.4.2.5.3) samt dödsfall som drabbar en patient (5.2.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'skada på patient', '-', '-', '28.2.4.3', 1, 'ANMÄRKNING 1: Såväl att en aktivitet utförs som att den (av misstag?) inte utförs kan leda till skada.', '2020-05-29, marel67: Städad', '-', '-'),
(432, '-', '2020-05-29 00:00:00.000000', 'remiss (11.3.3) som begär övertag av vårdansvar (31.2.2.2)', '-', 'FVM', 'Beslutad', 'skriftlig begäran om övertag av vårdansvar', '-', '-', '31.3.2.1', 1, '-', '2020-05-29, marel67: Städad', '-', '-'),
(433, '-', '2020-05-29 00:00:00.000000', 'remiss (11.3.3) som utgör beställning av hälso- och sjukvårdsaktivitet (7.2)', '-', 'FVM', 'Beslutad', 'skriftlig beställning av tjänst', '-', '-', '31.3.3.1', 1, '-', '2020-05-29, marel67: Städad', '-', '-'),
(434, 'Från  RIM, se Skatteverket\r\n\r\nKälla hämtad från: https://www4.skatteverket.se/rattsligvagledning/330543.html och https://www.skatteverket.se/privat/folkbokforing/skyddadepersonuppgifter.4.18e1b10334ebe8bc80001711.html', '2020-06-25 11:37:34.000000', 'döljande av information som kan röja en persons identitet', '-', 'Informatik VGR', 'Beslutad', 'skyddad identitet', '-', '-', '-', 9, 'ANMÄRKNING 1: Det finns tre typer av skyddade personuppgifter, eller skyddad identitet som det också kallas:\r\n- skyddad folkbokföring, som har ersatt kvarskrivning\r\n- sekretessmarkering\r\n- fingerade personuppgifter, som innebär att du får nytt namn och personnummer.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, marel67: Städad\r\n2020-06-18, marel67, verwi6: Definiton, anmärkning och synonym tillagda. Termposten ändrad från skyddad identitet till skyddade personuppgifter. Skyddad identitet som synonym. Flyttas till preliminär.\r\n2020-06-25, karkj, magfo: Helt ny definition formulerad. Skyddad identitet vald som rekommenderad term, skyddade personuppgifter tillåten synonym. Begreppsposten beslutad.', '-', '-'),
(436, 'VI har uppmärksammat när vi går igenom kravmassan att det stycke som handlar om Slutanteckning 5.2.5 inte omfattar vårt behov av sammanfattning av vård. Vi har läst i HSLF-FS 2016:40 så används \"slutanteckning och andra sammanfattningar av genomförd vård\". Epikris nämns inte alls. Därför önskar vi att ni ser över begreppen i vår lista och att Slutanteckning är den term som används som sammanfattning av vård oavsett sluten-. öppen eller kommunal hälso-och sjukvård.  Epikris kan nämnas i anmärkning. http: eller  eller www.socialstyrelsen.se eller Lists eller Artikelkatalog eller Attachments eller 20494 eller 2017-3-2.pdf\r\n\r\nI version 3 utvidgas definitionen såsom framgår i definitionsrutan och täcker därmed öppenvårdsepisoder. Vårdepisod definieras: period under vilken hälso- och sjukvårdsaktiviteter (3.2.1) utförs syftande på ett hälsoförhållande (2.2.1).', '2020-05-29 00:00:00.000000', 'epikris som upprättas när ett vårdtillfälle eller vårdepisod avslutas', '-', 'FVM upphandling', 'Beslutad', 'slutanteckning', '-', '-', '-', 17, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(437, '-', '2020-06-04 15:11:55.000000', 'hälso- och sjukvård (3.1.1) när den ges till patient (5.2.1) vars hälsotillstånd (6.4) kräver resurser som inte kan tillgodoses inom öppen vård (29.8) eller hemsjukvård (29.4)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'slutenvård', '-', '-', '29.5', 1, 'ANMÄRKNING 1: Eftersom det är patientens hälsotillstånd som avgör vilka resurser som behövs har ordet \"tillstånd\" ersatts med ordet \"hälsotillstånd\" i definitionen.', '2020-05-29, marel67: Städad.\r\n2020-06-04, pelho11, magfo: Lagt till synonym heldygnsvård.', '-', '-'),
(438, 'Från VGR Upphandling', '2020-05-06 10:03:52.000000', 'fastställd norm för viss företeelse', '-', 'Svensk ordbok', 'Beslutad', 'standard', '-', '-', '-', 135, 'ANMÄRKNING 1: Termen används även för dokument som är upprättat i konsensus och fastställt av erkänt organ och som för allmän och upprepad användning ger regler eller riktlinjer för aktiviteter eller deras resultat, i syfte att nå största möjliga enighet i ett visst sammanhang, exsempelvis Consys SS-EN ISO 13940:2016.', '2020-05-06, Karkj, Perha11: Definition ändrad enligt SO, anmärkning tillagd. Beslutad.', '-', '-'),
