(441, '-', '2020-05-15 08:56:08.000000', 'innehåll och struktur för en potentiell vårdplan (9.2) som kan återanvändas under specificerade omständigheter', '-', 'Contsys SE', 'Beslutad', 'standardiserad vårdplan', '-', '-', '9.2.3', 1, 'ANMÄRKNING 1: En publicerad standardiserad vårdplan ska innehålla uppgift om versionsnummer, publiceringsdatum och eventuell giltighetstid.', '2020-05-15, magfo, gerpe4, mikwe2, vikee1: Den engelska termen (care pathway) struken. Termposten beslutad.', '-', '[hälso- och sjukvård] vård- och omsorgsplan som på förhand fastlagts utifrån systematiskt framtaget kunskapsunderlag och som beskriver rekommenderade hälso- och sjukvårdsaktivitet för specifika hälsoproblem (Socialstyrelsens termbank, reviderad; Socialstyrelsen skriver sjukvårdsåtgärder)'),
(442, 'Används av sjuksköterska för dokumentation av att standardvårdplan (SVP) används. Om mer än en standardvårdplan används samtidigt öppnas en ny aktivitet för varje standardvårdplan.', '2020-06-18 13:35:03.000000', '-', '-', '-', 'Publicera ej', 'standardiserad vårdplan eller standardvårdplan', '-', '-', '-', 4, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-29, marel67: Städad.\r\n2020-06-18, marel67, verwi6: Termen standardiserad vårdplan ligger redan inne i OLLI och är beslutad. Vi lägger därför denna som publiceras ej.', '-', '-'),
(443, 'Exempel SVF för cancerdiagnoser', '2020-05-15 11:47:13.000000', '-', '-', 'Socialstyrelsen', 'Avråds', 'standardiserat vårdförlopp', '-', '-', '-', 4, 'ANMÄRKNING 1: Begreppet tillkom när man ville skapa förbättrad ordning och flöde vid utredning och behandling av misstänkt elakartad sjukdom. Begreppet har bytts ut mot personcentrerat och sammanhållet vårdförlopp (se denna termpost). Begreppet ställs av.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-15, magfo: Termposten avråds.', '-', '-'),
(444, '-', '2020-05-29 00:00:00.000000', 'konfiguration av lösningen som är specifik och anpassad för kunden, som används som startpunkt vid implementation och som utgår ifrån leverantörens kunskap om sin lösning, erfarenheter från andra installationer samt analys av kundens verksamhet', '-', 'FVM upphandling', 'Beslutad', 'startkonfiguration', '-', '-', '40.1', 1, 'ANMÄRKNING 1: Startkonfigurationen ska föreligga då första implementation för test av lösningen görs och ska vara utgångspunkt för den grundkonfiguration som ska föreligga vid första skarpa driftsättning.', 'Inte definierad\r\n\r\n2020-05-29, marel67: Städad.', '-', '-'),
(445, 'ingår i ett forskningsprojekt. Det kan alla patienter vara. Patient har lämnat samtycke. Påverkar inte ersättning eller avgift.', '2020-05-07 13:59:47.000000', 'patient som medverkar i vetenskaplig studie om hälsoproblem', '-', 'Informatik VGR', 'Beslutad', 'studiepatient', '-', '-', '-', 7, 'ANMÄRKNING 1:  Studiepatienter har ett hälsotillstånd som kontrolleras på en mottagning. När de kallas till extra besök för studien ska ingen patientavgift tas ut.\r\n\r\nANMÄRKNING 2: Jämför med forskningspatient. Forskningspatient behöver inte lida av någon sjukdom, utan kan ingå i ett forskningsprojekt som frisk.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-04, Perha11: Preliminärt definierad.\r\n2020-05-07, magfo: liten justering av definitionen\r\n2020-05-12, karkj, perha11, magfo: Beslutad.', '-', '-'),
(446, 'Från GIP', '2020-08-05 13:49:58.000000', 'BESKRIVNING: [GIP] roll för att styra och förvalta definitioner av t.ex. Informationsspecifikationer eller informationsdomäner', '-', 'Informatik VGR, GIP-arbetet', 'Pågår', 'styrningsroll', '-', '-', '-', 5, '-', 'Detta begrepp behöver ses över.\r\n\r\n2020-05-29, marel67: Städad.\r\n2020-07-06, vikee1, marel67: Lagt till en beskrivning och satt status till Preliminär.\r\n2020-08-05, ollka3, magfo: Känns oklart. Skapar JIRA 1040 för utredning.', '-', '-'),
(447, '-', '2020-05-29 00:00:00.000000', 'tredjepart inom hälso- och sjukvård (5.2.4) som har en organisatorisk roll (3.3.7)', '-', 'Contsys SE', 'Beslutad', 'stödorganisation inom hälso- och sjukvård', '-', '-', '5.2.4.2', 1, 'ANMÄRKNING 1: Vad som avses är en organisation som inte ingår i hälso- och sjukvården men engagerar sig till stöd för verksamheten och direkt eller indirekt ger stöd åt patienterna, eventuellt en viss patient. \r\n\r\nEXEMPEL 1: Frivillig hjälporganisation, en organisation för hemtjänst, en sjukförsäkringsorganisation, driftsorganisation för ett telemedicinsystem, familj.', '2020-05-29, marel67: Städad.', '-', '-'),
(448, '-', '2020-05-29 00:00:00.000000', 'sjukdomsyttring som uppfattas av patienten (5.2.1)', '-', 'Rikstermbanken eller Språkrådets svensk-albanska tolkordlista 2003', 'Beslutad', 'symtom', '-', '-', '26.4.1.3', 1, 'ANMÄRKNING 1: Rikstermbankens hela definition är \"sjukdomsyttring som uppfattas av den sjuke, dvs. ett obehag eller lidande som sjukdomen framkallar; symtom är subjektiva, till skillnad från sjukdomstecken\". Texten efter \"den sjuke\" är snarast en kommentar eller anmärkning. \"Den sjuke\" byts i detta sammanhang mot detta begreppssystems \"patient\".\r\n\r\nANMÄRKNING 2: Enligt SAOL är stavningen symptom likvärdig med symtom. I FVM fastställs stavningen till symtom.', '2020-05-29, marel67: Städad.', '-', '-'),
