(450, 'Från GIP. Behörighet: Tilldelade rättigheter att använda en informationstillgång på ett specificerat sätt. https://www.sambi.se/medlem-i-sambi/ordlista/\r\nav systemansvarig tilldelad rättighet till system\r\nhttp://rikstermbanken.se/visaTermpost.html?id=263163\r\n	\r\nrättighet att ha åtkomst till t.ex. viss information eller vissa lokaler, eller till att utföra vissa åtgärder\r\nhttp://rikstermbanken.se/visaTermpost.html?id=206269', '2020-08-05 13:43:58.000000', 'rättighet att ha åtkomst till viss information och att få utföra specifika uppgifter i ett system', '-', 'Rikstermbanken, Informatik VGR', 'Beslutad', 'systembehörighet', '-', '-', '-', 5, '-', '2020-05-29, marel67: Städad.\r\n2020-06-23, davte1, ajla: lagt förslag till en definition ändrat status till preliminär.\r\n2020-08-05, ollka3, magfo: Definitionen förädlad, posten beslutad.', '-', '-'),
