(452, 'Det krävs att verksamhetschefen analyserar och aktivt tar ställning till vilken information som är nödvändig för en viss tjänst och utifrån detta tilldelar användaren behörighet för åt-komst till patientuppgifter. Verksamhetschefens ansvarsområde utgör grund för behörighets-tilldelning. Olika roller eller kategorier ska identifieras motsvarande olika yrkesgrupper inom verksamhetschefens ansvarsområde som ska utgöra en grundbehörighetstilldelning. Resterande behörigheter identifieras som särskild behörighet', '2020-06-18 10:24:10.000000', 'regionövergripande villkor för behörighetstilldelning, spärr för åtkomst samt regler för kontroll av åtkomst till patientuppgifter.', '-', 'RSK 771-2008', 'Publicera ej', 'särskild behörighet', '-', '-', '-', 135, '-', '2017-12-15: Ok med T&A att det inte definieras.\r\n2017-11-02, Perha11: Allmänspråk, definieras ej.\r\n2017-11-07: Gerd kolla med dP\r\n\r\n2020-05-29, marel67: Städad.\r\n\r\n2020-06-18, marel67, verwi6: Flyttad till definieras ej enligt tidigare kommentar.', '-', '-'),
