(454, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvård (3.1.1) som bedrivs på distans med hjälp av informations- och telekommunikationsteknik', '-', 'Socialstyrelsens termbank', 'Beslutad', 'telemedicin', '-', '-', '29.6', 1, 'ANMÄRKNING 1: Begreppet innefattar all synkron kommunikation med patienten via telefon och digitala medier där båda deltagarna har röst- (och eventuell bild-)kontakt. Om kommunikationen är asynkron, dvs. patient och hälso- och sjukvårdspersonal deltar inte samtidigt (brevväxling på papper, via e-post eller 1177) kallas det korrespondens.', '2020-05-29, marel67: Städad.', '-', '-'),
