(467, '-', '2020-05-29 00:00:00.000000', 'process (3.6.1) för att sortera och prioritera patienter (2.1.1)', '-', 'Svenska akademiens ordlista (app-upplagan)', 'Beslutad', 'triage', '-', '-', '23.5.7', 1, 'ANMÄRKNING 1: Triage innebär att hälso- och sjukvårdspersonal bedömer en patient som första hälso- och sjukvårdstjänst i en klinisk process. Triage är begrepp som i första hand associerar till akutmottagning och ambulans men är inte definitionsmässigt begränsat till dessa.\r\n\r\nANMÄRKNING 2: Ordets etymologi kommer från franskan. Napoleon I införde begreppet när skadade på slagfältet skulle sorteras och prioriteras, långt innan RETTS hade uppfunnits. Han hade tre klasser: hjälplöst skadade att lämnas på slagfältet, i behov av omedelbar transport till sjukvårdsinrättning, med förmåga att själv gå till sjukvårdsinrättning.', '2020-05-29, marel67: Städad.', '-', '-'),
