(474, '-', '2020-05-29 00:00:00.000000', 'resultat av en process (3.6.1)', '-', 'SS-EN-ISO 9000:2015 eller Contsys SE', 'Beslutad', 'utfall', '-', '-', '3.6.5', 1, 'ANMÄRKNING 1: Huruvida utfall från organisationen (3.3.1) är en produkt (3.6.3) eller en tjänst (3.6.4) beror på vilka egenskaper som främst är involverade. Exempelvis är en målning som är till salu hos ett galleri en produkt, medan tillhandahållande av en beställd målning är en tjänst. En hamburgare som köps i en butik är en produkt medan mottagandet av en beställning och serveringen av en hamburgare på en restaurang är en tjänst', '2020-05-29, marel67: Städad.', '-', '-'),
(475, 'hembesök kan härledas via platsen där det utförs (finns i rim)', '2020-06-26 08:42:31.000000', '[hälso- och sjukvård] plats där hälso- och sjukvårdsaktivitet (7.2) utförs', '-', 'Informatik VGR (från Contsys, reviderad)', 'Beslutad', 'utförarplats', 'location where direct healthcare activities are performed (avser point of care och är alltså ett något snävare begrepp)', 'point of care', '-', 7, 'ANMÄRKNING 1: Vid distanskontakt kan utförarplatsen var t ex internet\r\n\r\nANMÄRKNING 2: I Contsys ingår \"direkt vårdaktivitet\" i definitionen av vårdlokal/utförarplats. Det begreppet är inte definierat, och informatik VGR vill inte urskilja vissa aktiviteter som direkta.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-04-28, Perha11 BV: Definierad, Preliminär\r\n2020-04-30, Perha11 BB: Beslutad!\r\n2020-06-26, karkj, mikwi2, vikee1, magfo: Posten reviderad, beslutad.', '-', '-'),
