(480, '-', '2020-05-29 00:00:00.000000', 'bedömning (27.2.7.2.2) av utfallet av en hälso- och sjukvårdsaktivitet (7.2) jämfört med aktivitetsmålet (40.4)', '-', 'FVM efter formulering i 3R Contsys', 'Beslutad', 'utvärdering', '-', '-', '27.2.7.2.3', 1, 'ANMÄRKNING 1: Utvärderingen är en kvalitetskontroll där man bedömer i vilken utsträckning en aktivitet fått önskad effekt.', '2020-05-29, marel67: Städad.', '-', '-'),
