(482, '-', '2020-05-29 00:00:00.000000', 'utvärdering inom hälso- och sjukvård (7.2.7.7) där effekterna av en klinisk process (8.2.1) på ett hälsostatus (6.5) bedöms i förhållande till måltillståndet (6.4.2.2) och eller eller ett hälsotillstånd (6.4) som representerar hälsostatuset som underlag (6.5.1)  eller input', '-', 'FVM', 'Beslutad', 'utvärdering av utfall av klinisk process', '-', '-', '27.2.7.7.2', 1, 'ANMÄRKNING 1: Utöver den utvärdering som definieras i Contsys (7.2.7.7, 7.2.7.7.1) anser FVM det angeläget att utvärdering kan göras på så sätt att utfallet av den kliniska processen ställs mot avsikten med den, vilket ger ett kvalitetsmått.', '2020-05-29, marel67: Städad.', '-', '-'),
(483, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvårdsaktivitetselement (7.2.7) under vilket aspekter av minst ett annat hälso- och sjukvårdsaktivitetselement (7.2.7) utvärderas', '-', 'Contsys SE', 'Beslutad', 'utvärdering inom hälso- och sjukvård', '-', '-', '7.2.7.7', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(484, '-', '2020-07-29 10:49:47.000000', 'uppmärksamhetsinformation om förhållanden som medför allvarligt hot mot patients liv och hälsa och som föranleder särskild signal till hälso- och sjukvårdspersonal', '-', 'Informatik VGR', 'Beslutad', 'varningsinformation', '-', '-', '-', 155, 'ANMÄRKNING 1: Varningsinformation om ständigt föreliggande risk ska antecknas i patientjournal. \r\n\r\nANMÄRKNING 2: Varningsinformation kan också föranledas av plötslig händelse såsom hjärtstopp och ska förmedlas till handläggande hälso- och sjukvårdspersonal på sådant sätt att informationen inte kan förbises, till exempel genom larm.\r\n\r\nANMÄRKNING 3: I Patientbakgrunde används den korta synonymen varning.', '2020-02-17 Perha11; Tillägg för avstämning med RIM\r\n2020-05-29, marel67: Städad.\r\n2020-06--17, vikee1, davte1: Ändrad status till preliminär.\r\n2020-06-24, karkj, magfo: Begreppsposten bearbetad, anmärkningar tillagda. Beslutad.\r\n2020-07-29, magfo: Synonymen varning hämtad från Patientbakgrund 2009, tillagd.', '-', '-'),
(485, 'Råd och instruktioner till invånare främst av hälsofrämjande och sjukdomsförebyggande karaktär. Se Socialstyrelsen https: eller  eller www.socialstyrelsen.se eller globalassets eller sharepoint-dokument eller artikelkatalog eller nationella-riktlinjer eller 2018-6-24.pdf Sid 20 längst ner talar om patientuppgifter trots att kommunikationen borde vara enkelriktad.\r\nWebbaserad intervention är behandling som görs via webben genom film, läsning och besvara frågor, beskriva sina egna upplevelser. Dessa hanteras både automatiskt och manuellt, och personen får återkoppling (vilken kan ske via mejl, chatt eller video).', '2020-05-28 14:55:17.000000', 'förebyggande eller behandlande aktivitet via e-tjänst', '-', 'Informatik VGR', 'Beslutad', 'nätbaserad intervention', '-', '-', '-', 19, '-', '2020-02-13, magfo: Avvaktar kaffestund\r\n2020-05-07, Karkj, Perha11: Majlar Magnus och frågar om kaffet har kallnat!\r\n2020-05-26, ajla, marel67: Magnus svarar i Informatikmail: nätbaserad intervention (av vilka KBT på nätet är ett underordnat begrepp)\r\n2020-05-28, marel67, perha11: Definierad, preliminär\r\n2020-06-02, karkj, perha11: Justerat definitionen, lagt till synonym. Beslutad!', '-', '-'),
(486, '-', '2020-05-29 00:00:00.000000', 'vårdenhet (25.2.3.1.2) som leds av en verksamhetschef och är del av antingen ett område (25.2.3.1.2.2) eller en förvaltning (25.2.3.1.2.1)', '-', 'FVM', 'Beslutad', 'verksamhet', '-', '-', '25.2.3.1.2.3', 1, 'ANMÄRKNING 1: Inom primärvården är verksamheten vanligen en vårdcentral, vid sjukhus ett verksamhetsområde. Detta är den högsta medicinskt ansvariga hälso- och sjukvårdsorganisationen. Ett verksamhetsområde kan vara en del av ett område inom ett sjukhus varvid verksamhetschefen administrativt är underställd en områdeschef. Om sjukhuset inte är indelat i områden är verksamhetschefen direkt underställd förvaltningschefen eller sjukhusdirektören.\r\n\r\nANMÄRKNING 2: Enligt Hälso- och sjukvårdslagen (2017:30) 3 kap. 2 och 3§§ skall det finnas en verksamhetschef där det bedrivs hälso- och sjukvård. Detta är den medicinskt högst ansvariga befattningshavaren. Om verksamhetschefen inte är läkare ska det finnas en medicinskt ledningsansvarig läkare som övertar verksamhetschefens medicinska ansvar.', '2020-05-29, marel67: Städad.', '-', '-'),
(487, '-', '2020-07-01 11:56:10.000000', 'avgränsning utifrån uppsatta kriterier som definierar fält inom verksamhet', '-', 'Informatik VGR', 'Pågår', 'verksamhetsdomän', '-', '-', '-', 5, '-', 'Detta begrepp behöver ses över.\r\n\r\n2020-05-29, marel67: Städad.\r\n\r\n2020-06-18, marel67, verwi6: Flyttad till Preliminär för vidare handläggning.\r\n2020-06-23, davte1, ajla: Lagt till synonym samt gjort den tillåten.\r\n2020-06-24, karkj, magfo: Fråga ställs till migration/IT (Torbjörn Ekfeldt) vad det är för sammanhang.\r\n2020-07-01, devte1, Ajla, vikee1, verwi6: Finns ett kort (883) gällande om informationsdomän är en synonym till detta begreppet. Med kommentar angående mejlet till Torbjörn.', '-', '-'),
(488, '-', '2020-05-13 10:36:13.000000', 'belägenhetsadress som används för verksamhet', '-', 'VGR (SIS-TR 33:2017(sv) reviderad)', 'Publicera ej', 'verksamhetsadress', '-', '-', '-', 2, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-13, Marel67: Flyttad till Preliminär\r\n2020-05-20, annbr113, karkj, magfo, perha11: Tveksamt till behov, publiceras ej.', '-', '-'),
(489, '-', '2020-05-29 00:00:00.000000', 'beslut att vårdbegäran (11.3) ska handläggas vid annan vårdenhet (25.2.3.1.2) än den mottagande', '-', 'FVM', 'Beslutad', 'vidaresändning', '-', '-', '31.3.5', 1, 'ANMÄRKNING 1: Socialstyrelsen använder termen \"avslag\" av vårdbegäran, något som undvikits i SAMBA och senare i NI. En vårdbegäran ska antingen accepteras (vårdåtagande görs) eller hänvisas. I sistnämnda fall ska två eller tre åtgärder vidtas: vårdbegäran sänds vidare till annan vårdenhet, patienten ska meddelas om vad som gjorts, och om det rör sig om en remiss ska inremitterande meddelas vart remissen sänts. \r\n\r\nANMÄRKNING 2: I Socialstyrelsens definition räknas det som hänvisning när egenvård ordineras. Bedömningen att patienten själv ska ta hand om sitt behov av vård är en professionell handling, alltså en hälso- och sjukvårdstjänst. Den ordinationen är avslutning på en vårdprocess som påbörjas med patientens vårdbegäran för egen räkning. Ordination av egenvård föregås alltså av vårdåtagande och är ingen hänvisning.', '2020-05-29, marel67: Städad.', '-', '[i samband med avslag av vårdbegäran eller vid avslut av vårdåtagande] anvisning till annan vårdenhet eller till egenvård (Socialstyrelsens termbank)'),
(490, '-', '2020-05-29 00:00:00.000000', 'förklaring till vidaresändning (31.3.5) som bifogas vårdbegäran (11.3) när den sänds till annan vårdenhet (25.2.3.1.2)', '-', 'FVM', 'Beslutad', 'vidaresändningsningsmissiv', '-', '-', '31.3.5.3', 1, 'ANMÄRKNING 1: När en vårdbegäran vidaresänds ska ett förklarande följebrev bifogas. Termen är vald på bas av betydelsen av missiv. Definition saknas, men Wikipedia skriver: Ett missiv är ett följebrev till en officiell skrivelse. Ursprungligen användes det för dokumentet som förordnade en prästtjänst. Sedan medeltiden har missiv också använts vid kommunikation mellan myndigheter, medan den i modern tid även används som följebrev till mer halvofficiella skrivelser till privatpersoner, som tex en förklarande text till en undersökning. Här redogörs i det fallet bl.a. för undersökningens syfte och varför en person fått exempelvis en enkät i sin hand.', '2020-05-29, marel67: Städad.', '-', '-'),
(491, '-', '2020-05-29 00:00:00.000000', 'bekräftelse att man har tagit del av information', '-', 'FVM', 'Beslutad', 'vidi', '-', '-', '-', 1, 'ANMÄRKNING 1: Vidi bekräftar att man tagit del av Information i t.ex. provsvar, remissvar etc. men inte att man vidtagit några åtgärder. Ska inte förväxlas med vidimering.', '2020-05-29, marel67: Städad.', '-', '-'),
(492, '-', '2020-05-29 00:00:00.000000', 'intygande att en kopia överensstämmer med originalet eller bekräftelse av riktigheten i något', '-', 'FVM', 'Beslutad', 'vidimering', '-', '-', '-', 1, 'ANMÄRKNING: Ska inte förväxlas med vidi.', '2020-05-29, marel67: Städad.', '-', '-'),
(493, 'plats som saknar fysisk lokalisation och nås med informationsteknologisk utrustning (Källa: VGR)', '2020-05-14 10:34:18.000000', 'plats som saknar fysisk lokalisation och nås med informationsteknologisk utrustning', '-', 'Informatik VGR', 'Beslutad', 'virtuell plats', '-', '-', '-', 2, 'ANMÄRKNING 1: T.ex. lagringsplats i cyberrymden, \"molnet\", Google. vgregion.se (men inte VGR).', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-13, Marel67: Flyttad till Preliminär\r\n2020-05-14, karkj, magfo: Anmärkning tillagd. Termposten beslutad.', '-', '-'),
(494, '-', '2020-05-06 09:48:57.000000', '[VGR hälso- och sjukvård] del av vårdkontakt då patient befinner på viss vårdenhet', '-', 'VGR', 'Beslutad', 'vistelse', '-', '-', '-', 135, '-', '2020-02-18 Perha: Kontaktar Per och Markus för hjälp med def\r\n2020-05-06, Perha11, Karkj: Definition justerad, beslutad.', '-', '-'),
(495, 'Används i orders i Millennium och kan då bestå av olika parametrar beroende på vad det är för typ av order eller dess kontext.\r\n\r\nDavid och Sofia:\r\nDe vitala parametrarna består av \r\n\r\nandningsfrekvens \r\n\r\nsyremättnad \r\n\r\ntemperatur \r\n\r\nsystoliskt blodtryck \r\n\r\npulsfrekvens (om patienten är telemetriövervakad ska hjärtfrekvensen användas) \r\n\r\nmedvetandegrad. \r\n\r\n \r\n\r\nFrån <https://www.vardhandboken.se/vard-och-behandling/akut-bedomning-och-skattning/bedomning-enligt-news/oversikt/>  Kl. 14.41, 2020-05-07 \r\n\r\n \r\n\r\nVitalparameter eller vitala tecken är de viktigaste tecknen för bedömning av en persons kroppsfunktion. \r\n\r\nBlodtrycksmätning med blodtrycksmanchett och stetoskop. \r\n\r\nVitalparametrarna kontrolleras rutinmässigt i en medicinsk undersökning när en person söker vård på olika inrättningar, exempelvis i triage, och kan utgöra underlag vid en prioriteringsbedömning eller diagnostisering. \r\n\r\nDe fyra primära parametrarna är puls, blodtryck, andningsfrekvens, och kroppstemperatur. Saturation, blodsockernivå, smärta, tidpunkt i menstruationscykeln eller medvetandegrad anges i vissa situationer som en femte parameter. \r\n\r\n \r\n\r\nFrån <https://sv.wikipedia.org/wiki/Vitalparameter>  Kl. 14.44, 2020-05-07', '2020-06-26 15:49:03.000000', 'fysiologisk parameter till bedömning av patients hälsotillstånd för beslut om prioritering i den kliniska processen', '|118227000 |Vital signs finding (finding)|', 'Informatik VGR', 'Beslutad', 'vitalparameter', '-', 'vitals', '-', 12, 'ANMÄRKNING 1: Vitalparametrarna är sex till antalet. Efter varje parameter anges enhet och förkortning.\r\n•	andningsfrekvens – andetag per minut – AF\r\n•	syremättnad – procent syre i perifert blod – SpO2\r\n•	temperatur – kroppstemperatur, mätmetod ska anges – Temp \r\n•	systoliskt blodtryck – mätmetod ska anges – BT \r\n•	pulsfrekvens – manuell mätning eller om patienten är telemetriövervakad hjärtfrekvens – Puls \r\n•	medvetandegrad – Glasgow coma scale – GCS eller reaction level scale – RLS eller AVPU (förkortningen anger bedömningsdimensionerna, namn på skalan saknas)\r\nAlla vitalparametrar ska bedömas vid varje tillfälle.\r\n\r\nANMÄRKNING 2: Vilken skala för medvetandegrad som ska användas är inte en terminologisk fråga. Vissa skalor får inte användas utan licens.\r\n\r\nANMÄRKNING 3: Vitalparameter är ett samlingsbegrepp för de fysiologiska parametrar som används som underlag för bedömning av patientens dynamiska vårdförlopp vid misstanke om kritisk sjukdom. De vanligast bedömda vitalparametrarna är andningsfrekvens, syremättnad, temperatur, systoliskt blodtryck, pulsfrekvens och medvetandegrad. \r\n\r\nANMÄRKNING 4: Ytterligare parametrar används i speciella sammanhang (tilläggsparametrar).\r\n\r\nANMÄRKNING 5: Termer från Asynja-VISP:\r\nAndningsfrekvens\r\nPOX\r\nPuls\r\nBlodtryck systoliskt\r\nBlodtryck diastoliskt\r\nBlodtrycksmätning läge\r\nKroppstemperaturEKG* Utfört            \r\nKroppsvikt', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-05-07, davidt: Påbörjad definition, revision behövs.\r\n2020-05-08, magfo: Vitalparametrar är en ändlig lista av observationer. För ovanlighetsskull används därför en extensionell definition. En intensionell definition skulle beskriva vad vitalparametrar är bra för men inte begreppets innehåll.\r\n2020-05-14, magfo, karje: Beslutad\r\n2020-05-29, magfo: Anmärkningstext tillagdf, ej redigerad. Sänks till preliminär.\r\n2020-06-02, karkj, perha11: Anmärkning 3 tillagd.\r\n2020-06-04, magfo, vikee1, perha11: Definitionen förädlad, Beslutad!\r\n2020-06-08, magfo: Definitionen fungerar inte, för det vacklar vilka parametrar som ingår. En intensionell definition ska skapas.\r\n2020-06-23, karkj, magfo: Omfattande definitionsarbete, där den extensionella definitionen bytts mot en intensionell. Beslutad.\r\n2020-06-24, magfo: termer från Asynja- Visp införda.\r\n2020-06-26, vikee1: definitionen är för bred. Det behöver framgå att det är de viktigaste parametrarna det är tal om.\r\n2020-08-23, magfo: Det är just så man inte får skriva, aldrig värdeord i en definition. Utredning med beslutsförslag klart, kopplas till JIRA1030.\r\n2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Beslutad.', 'SCT', '-'),
(496, '-', '2020-05-28 11:48:41.000000', 'utskrivningsrapport (12.5.3.1) som sammanfattar en vårdperiod med mandat (10.2.1)', '-', 'Contsys SE + (term) information inom SU', 'Beslutad', 'vård- och läkemedelsberättelse', '-', '-', '12.5.3.2', 135, 'Anmärkning 1  Inom Västra Götalandsregionen är detta obligatorisk information till patienten.\r\n\r\nAnmärkning 2 Begreppet får inte ges termen utskrivningsmeddelande som avser Samordnad individuell plan.', '2020-02-13 magfo Förslag inkommet föranleder öndring av rekommenderad term, medan tidigare term ändras till att vara synonym\r\n2020-05-28, perha11: Uppdaterad!', '-', 'klinisk rapport som lämnas till patienten när ett vårdtillfälle avslutas och som innehåller information om patientens hälsotillstånd och vilka aktiviteter som utförts under vårdtid (FVM)'),
(497, '-', '2020-05-29 00:00:00.000000', 'dokumenterad plan som beskriver planerade insatser eller åtgärder inom vård och omsorg', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vård- och omsorgsplan', '-', '-', '29.1', 1, 'ANMÄRKNING 1: Begreppet är övergripande för hälso- och sjukvården och socialtjänsten. Inom hälso- och sjukvård används termen aktivitet i stället för insats och åtgärd, och denna term införs när begreppet specialiseras till hälso- och sjukvård.', '2020-05-29, marel67: Städad.', '-', '-'),
(498, '-', '2020-05-29 00:00:00.000000', 'förlopp av hälso- och sjukvårdsaktiviteter (7.2) som utgör underlag för innehållet i standardiserad vårdplaner (9.2.3)', '-', 'Contsys SE', 'Beslutad', 'vårdaktivitetsförlopp', '-', '-', '9.2.4.2', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(499, '-', '2020-05-29 00:00:00.000000', 'önskat resultat av en eller flera hälso- och sjukvårdsaktiviteter (7.2), betraktat som ett delmål för att uppnå ett specifikt hälsomål (9.2.5)', '-', 'Contsys SE', 'Beslutad', 'vårdaktivitetsmål', '-', '-', '9.2.6', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(500, '-', '2020-05-29 00:00:00.000000', 'tidsintervall under vilket hälso- och sjukvårdsaktiviteter (7.2) utförs för en patient (5.2.1)', '-', 'Contsys SE', 'Beslutad', 'vårdaktivitetsperiod', '-', '-', '10.2.2', 1, '-', '-', '-', '-'),
(501, '-', '2020-05-29 00:00:00.000000', 'person (3.3.4) som deltar i vården av en patient (5.2.1)', '-', 'FVM', 'Avråds', 'vårdaktör', '-', '-', '62.1', 1, 'ANMÄRKNING 1: SLL MedTerm definition: aktör som har yrkesansvar eller studerar för att få ta yrkesansvar inom hälso- och sjukvården. Den definitionen gör termen synonym med hälso- och sjukvårdspersonal, varför den strukits ur detta dokument.   \r\n\r\nANMÄRKNING 2: I egenvård räknas även patienten som vårdaktör.', '2020-04-03, Perha11: Avrådd men publiceras för att hänvisa till hälso- och sjukvårdsaktör.\r\n2020-05-29, marel67: Städad.', '-', '-'),
(502, '-', '2020-05-29 00:00:00.000000', 'uppdrag att omhänderta en patient (5.2.1) för hälso- och sjukvård (3.1.1) med befogenhet att utnyttja tillgängliga behövliga resurser (3.4.1) samt skyddapatienten (5.2.1) mot vårdskador (28.2.4.3.2)', '-', 'FVM', 'Beslutad', 'vårdansvar', '-', '-', '31.2.2.2', 1, 'ANMÄRKNING 1: Vårdansvar refereras bland annat i Socialstyrelsens definition av remiss. Det följer mandatet att vårda patienten. Begreppet tillförs i VGR FVM modell av detta skäl.', '2020-05-29, marel67: Städad.', '-', '-'),
(503, '-', '2020-05-29 00:00:00.000000', 'vårdbegäran (11.3) som avser den egna personen (3.3.4)', '-', 'FVM', 'Beslutad', 'vårdbegäran för egen räkning', '-', '-', '31.3.6', 1, 'ANMÄRKNING 1: Det finns ingen officiell källa till definition av detta begrepp, men i NI förklaras det med att det är en begäran som en person gör för att själv få hälso- och sjukvård. I Contsys finns i stället begreppet \"vårdbegäran för första vårdkontakt\", vilket i praktiken är när en person ber att få träffa hälso- och sjukvårdspersonal första gången. Det är osannolikt att hälso- och sjukvårdspersonal utfärdar sådan vårdbegäran eftersom kontakt med patienten i så fall redan startat processen och det inte rör sig om en första vårdkontakt. Men patienten ska också ha möjlighet att under pågående process ta initiativ till en ny vårdkontakt, som då inte är en förstakontakt men däremot görs som vårdbegäran för egen räkning. \r\n\r\nANMÄRKNING 2: Vårdbegäran för egen räkning utfärdas av patienten själv eller patientens representant.', '2020-05-29, marel67: Städad.', '-', '-'),
(504, '-', '2020-05-12 14:29:41.000000', 'begäran om erhållande av hälso- och sjukvård', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdbegäran', '-', '-', '11.3', 135, 'Vet ej vad detta är:  I enlighet med resonemanget om vårdgivare eller hälso- och sjukvårdsutförare är termen vårdgivaraktivitet ändrad till hälso-och sjukvårdsutföraraktivitet.  Anmärkning 1     Detta är ett rotbegrepp som ska kunna instansieras. Normalt sett kommer emellertid den som utfärdar vårdbegäran att kunna identifieras, antingen patienten själv (vårdbegäran för egen räkning) eller hälso- och sjukvårdspersonal (remiss). Vem som utfärdar vårdbegäran framgår av specialiseringarna. Hälso- och sjukvård kan också utföras utan att vårdbegäran gjorts. En vårdbegäran ställs alltid till en hälso- och sjukvårdsorganisation. En förfrågan till hälso- och sjukvårdspersonal handläggs av mottagaren i dennes roll som anställd av en vårdgivare och vid en vårdenhet. I informationsmodellen visas med attribut exakt på vilken specialiseringsnivå av hälso- och sjukvårdsorganisation som mottagandet sker.  Anmärkning 2      Bedömning av en vårdbegäran leder till endera av två beslut. Om vårdbegäran uppenbarligen hamnat fel (resurser saknas, vårdbegäran är feladresserad) är nästa steg hänvisning. Alternativet är att vårdbegäran accepteras, vilket leder till vårdåtagande. Därigenom tas ansvar för handläggning av det som begärs i vårdbegäran. Se vårdåtagande!', '2020-05-12, karkj, perha11, magfo: Socialstyrelsens definition gjord till den rekommenderade, Contsys märkt som alternativ.', '-', 'begäran om utförande av hälso-och sjukvårdsutföraraktivitet (7.2.1) som uttrycks av en hälso- och sjukvårdsaktör (5.2)\r\n\r\n(Contsys SE. I enlighet med resonemanget om vårdgivare eller hälso- och sjukvårdsutförare är termen vårdgivaraktivitet ändrad till hälso-och sjukvårdsutföraraktivitet.)');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(505, '-', '2020-05-29 00:00:00.000000', 'bedömning inom hälso- och sjukvård (7.2.7.4) under vilken hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1) med beaktande av en patients (5.2.1) hälsobehov (6.5.3) fastställer behovsbestämda hälso- och sjukvårdsaktiviteter (7.2)', '-', 'Contsys SE', 'Beslutad', 'vårdbehovsbedömning', '-', '-', '7.2.7.5', 1, 'ANMÄRKNING 1: Contsys SE anger \"behovsbestämd\" kursiv, men den termen är inte definierad, inte heller tillsammans med hälso- och sjukvådsaktiviteter.', '2020-05-29, marel67: Städad.', '-', '-'),
(506, '-', '2020-05-29 00:00:00.000000', 'vårdenhet (25.2.3.1.2) med mottagningsverksamhet inom primärvård (29.8.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdcentral', '-', '-', '29.8.2', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(507, '-', '2020-05-29 00:00:00.000000', 'dygn eller del av dygn under ett vårdtillfälle (30.2.4.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårddag', '-', '-', '30.2.1.2', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(508, '-', '2020-05-29 00:00:00.000000', 'administrativt avgränsad hälso- och sjukvårdsorganisation (5.2.3.1) som är del av en vårdgivare (25.2.3.1.1)', '-', 'FVM', 'Beslutad', 'vårdenhet', '-', '-', '25.2.3.1.2', 1, 'ANMÄRKNING 1: Vårdenheten är den administrativt avgränsade enheten, det man brukar kalla organisatorisk enhet. Avgränsningen av en vårdenhet beslutas av vårdgivaren eller enligt dess delegationsordning. En vårdgivare utför inte hälso- och sjukvård, utan det görs vid vårdenheterna, av vilka en vårdgivare måste ha minst en. En hälso- och sjukvårdspersonal är anställd hos vårdgivaren men arbetar vid vårdenheten.\r\n\r\nANMÄRKNING 2: Att termbankens definition inte används som huvuddefinition beror på att den saknar koppling till vårdgivare. En vårdenhet arbetar alltid under ett ansvar som åvilar vårdgivaren.\r\n\r\nEXEMPEL 1: Sjukhus, primärvårdförvaltning, vårdcentral, vårdavdelning, laboratorium.', '2020-05-29, marel67: Städad.', '-', 'organisatorisk enhet som tillhandahåller hälso- och sjukvård (Socialstyrelsens termbank)'),
(509, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvårdsrelaterad period (10.2) under vilken hälso- och sjukvårdsaktiviteter (7.2) utförs för att hantera en hälsoangelägenhet (6.3) som identifierats av hälso- och sjukvårdsprofessionell aktör (5.2.3.3.1)', '-', 'Contsys SE', 'Beslutad', 'vårdepisod', '-', '-', '10.2.6', 1, 'ANMÄRKNING 1: För det första hanterar vi bara det som är hälsorelaterat. För det andra är en period i detta sammanhang alltid ett tidsbegrepp, en tidsperiod. Det är viktigt att det är aktiviteterna som knyter ihop episoden, inte kontakterna. För det tredje används termen hälsoangelägenhet på annat ställe i FVM begreppssystem, och hälsoförhållande omfattar såväl hälsoproblem som förhållanden som inte utgör problem men ändå kan föranleda vårdbegäran. För det fjärde kan hälsoförhållandet identifieras även av den som inte har formell hälso- och sjukvårdskompetens. hälsorelaterad tidsperiod under vilken hälso- och sjukvårdsaktiviteter utförs syftande på en hälsoangelägenhet identifierad av en person med formell hälso- och sjukvårdskompetens (3R Contsys) period under vilken hälso- och sjukvårdsaktiviteter utförs syftande på ett hälsoförhållande (FVM utgående från definition i 3R Contsys) \r\n\r\nEXEMPEL 1: Alla synundersökningar under många år för att en person ska få och få behålla flygcertifikat. En serie vaccinationer, som kan behöva upprepas med flera års mellanrum. Två (eller flera) vårdprocesser inkluderande vårdtillfällen för cancer, som under första processen \"botas\", dvs avslutas med att patienten friskförklaras och släpps från kontrollrutin men där den andra (och följande) processer föranleds av recidiv. Regelbundna kontroller för diabetes. Penicillinkur mot halsfluss, där vårdepisoden består av de upprepade egenvårdsaktiviteterna då patienten efter ordination äter sina antibiotikadoser till dess rätt dosantal uppnåtts och episoden är slut. Sista exemplet är en specialisering med termen egenvårdsperiod.', '2020-05-29, marel67: Städad.', '-', 'samtliga vårdkontakter med en patient för ett visst hälsoproblem (Socialstyrelsens termbank)'),
(510, 'öppen, sluten och hem från fvmee', '2020-05-19 11:05:30.000000', 'BESKRIVNING: Vårdform kan vara öppenvård, slutenvård, ambulanssjukvård eller hemsjukvård. \r\n\r\nVårdform kan även syfta på vård enligt vissa lagrum t ex Lagen om Psykiatrisk Tvångsvård (LPT) och Lagen om Rättspsykiatrisk vård (LRV) .', '-', 'Informatik VGR', 'Beslutad', 'vårdform', '-', '-', '-', 7, 'ANMÄRKNING 1: Termen vårdform finns med på socialstyrelsens diagram med begrepp för vårdkontakt som en etikett för öppen-, sluten- och hemsjukvård samt telemedicin.', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-04-28, Perha11: Utredning av begreppets definition, Jira 453\r\n2020-05-13, verwi6, perha11: Preliminär beskrivning\r\n2020-05-19, magfo, karkj, perha11: Anmärkning 1 tillagd, Beslutad.', '-', '-'),
(511, '-', '2020-05-15 08:43:51.000000', 'sekvens av hälso- och sjukvårdsaktiviteter (7.2) som föranleds av en patients (5.2.1) hälsotillstånd (6.4)', '-', 'FVM', 'Beslutad', 'vårdförlopp', '-', '-', '28.2.1.1', 1, '-', '2020-05-15, magfo, vikee, mikwi2, gerpe4: Ändrat definitionen från \"föranletts\" till \"föranleds\". Beslutad.', '-', '-'),
(512, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvårdsorganisation (5.2.3.1) som är juridisk person eller enskild näringsidkare', '-', 'VGR', 'Beslutad', 'vårdgivare', '-', '-', '25.2.3.1.1', 1, 'ANMÄRKNING 1: Vårdgivare är alltid en organisation, kan aldrig vara en person. I ett enmansföretag är vårdgivaren firman och inte ägaren, fast ägaren är ensam agerande. Tillägget enskild näringsidkare (som inte är juridisk person) är nödvändigt, eftersom detta också är en firma som kan vara vårdgivare, där den ende ägaren till firman är hälso- och sjukvårdspersonal men inte kan definieras som vårdgivare annat än i sin näringsutövning.\r\n\r\nANMÄRKNING 2: Begreppet vårdgivare definieras här eftersom det har olyckligt hamnat på en plats i Contsys som inte stämmer med svensk lag. Där har termen hälso- och sjukvårdsutförare valts, tveklöst en tung term särskilt i sammansättningar, men det är alltid specialiseringar av det begreppet som instansieras. Begreppet vårdgivare är centralt i svensk lagstiftning och måste därför definieras korrekt. Definitionen i hälso- och sjukvårdslagen gör klart att vårdgivare alltid producerar hälso- och sjukvård. Definitionen i Socialstyrelsens termbank inkluderar ansvar för att hälso- och sjukvård tillhandahålls inom myndighetens jurisdiktion (t.ex. inom ett landstings geografiska område). Den definitionen överensstämmer med patientsäkerhetslagen (2010:659) och patientdatalagen (2008:355), båda 1 kap. 3§. Därmed inkluderas vad som i hälso- och sjukvårdslagen menas med huvudman: 2 kap. 2§ Med huvudman avses i denna lag det landsting eller den kommun som enligt lagen ansvarar för att erbjuda hälso- och sjukvård. Inom en huvudmans geografiska område kan en eller flera vårdgivare bedriva verksamhet. Se termposten huvudman.', '2020-05-29, marel67: Städad.', '-', '1: statlig myndighet, landsting, kommun, annan juridisk person eller enskild näringsidkare som bedriver hälso- och sjukvårdsverksamhet (hälso- och sjukvårdslagen SFS 2017:30, 2 kap. 3§) \r\n\r\n2: statlig myndighet, landsting och kommun i fråga om sådan hälso- och sjukvårdsverksamhet som myndigheten, landstinget eller kommunen har ansvar för (offentlig vårdgivare) samt annan juridisk person eller enskild näringsidkare som bedriver hälso- och sjukvårdsverksamhet (privat vårdgivare) (Socialstyrelsens termbank)'),
(513, '-', '2020-06-23 10:40:59.000000', 'situation när hälso- och sjukvårdspersonal engagerar sig i patient', '-', 'Informatik VGR - Skåne', 'Beslutad', 'hälso- och sjukvårdskontakt', 'contact in the course of which healthcare activities are delivered to a subject of care in her or his presence’. (källa:  EN 13940–1:2007 Contsys)\r\n\r\nEXAMPLES Face to face contact with a GP, telephone contact, telemedicine contact.', 'encounter', '-', 155, 'ANMÄRKNING 1: Utredning 2020-06-16 av T Lundmark, M. Fogelberg: I arbetet med att översätta encounter till svenska har gjorts en begreppsanalys med förslag till svensk term på detta begrepp och de närmast underordnade. Cerner önskar översätta till vårdkontakt, vilket inte stämmer med betydelsen av encounter. I såväl Socialstyrelsens definition i termbanken som i Contsys, som VGR använder i begreppssystem 1.0, deltar såväl patient som hälso- och sjukvårdspersonal i en vårdkontakt. För att tillgodose alla typer av encounter såsom det används i Millennium behövs ett begrepp som inkluderar tillfällen då hälso- och sjukvårdspersonal engagerar sig i en patient (till exempel genom att läsa eller skriva journal, utfärda remiss, ta del av provsvar) utan att patienten är närvarande. \r\n\r\nTillsammans med Skåne beslutades att detta begrepp skulle ges termen hälso- och sjukvårdskontakt med synonymen kontakt. Detta har införts i OLLI: hälso- och sjukvårdskontaktkontakt situation när hälso- och sjukvårdspersonal engagerar sig i patient. Om också patienten är närvarande motsvarar begreppet det som definierats i VGR 1.0: vårdkontakt/direkt vårdkontakt, samspel mellan en patient (5.2.1) och en eller flera hälso- och sjukvårdspersonal (5.2.3.3).  Synonymen direkt vårdkontakt har använts för att stryka under det faktum att vårdkontakten inkluderar patienten.  Om ingen patient deltar i kontakten kallas den indirekt vårdkontakt: indirekt vårdkontakt: hälso- och sjukvårdskontakt som endast hälso- och sjukvårdspersonal deltar i. Termen finns inte i Socialstyrelsens termbank men är i Contsys synonym till vårdkontakt, som förutsätter patientens medverkan (på engelska contact respektive healthcare contact). \r\n\r\nTermen encounter finns i Contsys endast som synonym till contact period, översatt till svenska vårdkontaktperiod med synonym vårdmötesperiod. I Snomed CT finns indirekt kontakt (indirect encounter) som bland annat omfattar e-postkontakt med tredjepart inom hälso- och sjukvård men även direkt kontakt med patienten i form av brev, telefon och digital länk. Det synes inte finnas något gemensamt sätt att beteckna de funktioner som Cerner Millennium implementerar under beteckningen encounter, varför vi sett det nödvändigt att frångå Contsys synonymi mellan vårdkontakt och hälso- och sjukvårdskontakt. \r\n\r\nVårdkontakt kan specialiseras så att team- och gruppbesök inkluderas. \r\n\r\nPå bas av denna redovisning föreslås i linje med vad som överenskommits vid möte med Skåne 2020-06-15 de begreppsposter som redovisas ovan med de relationer som framgår av modellen. Synonymen hälso- och sjukvårdskontakt till vårdkontakt i begreppssystem VGR 1.0 föreslås strykas i den begreppsposten.', '2020-03-30, Perha11: Lagt till utlänsk term\r\n2020-05.18, magfo; Ändrat term och definition enligt överenskommelse med Skåne.\r\n2020-05-19, magfo, karkj, perha11: Synonym tillagd, anmärkning 3 tillagd, Beslutad.\r\n2020-06-04, magfo, vikee1: Lagt till synonym kontakt och satt synonymen vårdkontakt till avråds.\r\n2020-06-08, marel67: Flyttas till pågår tills det diskuterats på projektstyrningsmötet fredag 12/6.\r\n2020-06-09, karkj, magfo: Synonymen vårdkontakt tas bort och definieras enligt VGR begreppssystem med alternativ definitionsom underordnat begrepp till hälso- och sjukvårdskontakt, se begreppsposten vårdkontakt. Beslutad.\r\n2020-06-18, karkj, magfo: I särskild ordning föreslås att hälso- och sjukvårdskontakt blir eget begrepp, och att termen stryks som synonym till vårdkontakt i VGR 1.0. Posten därför preliminär i avvaktan på styrgruppsbeslut.\r\n2020-06-23, karkj, magfo: Beslutad.', '-', '-'),
(514, '-', '2020-05-29 00:00:00.000000', 'vårdaktivitetsperiod (10.2.2) under vilken en vårdkontakt (10.2.2.1.1) sker', '-', 'Contsys SE', 'Beslutad', 'vårdkontaktperiod', '-', '-', '10.2.2.1', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(515, '-', '2020-05-29 00:00:00.000000', 'samordning av åtgärder i en hälso- och sjukvårdsprocess (8.2) i avsikt att undvika avbrott i processen.', '-', 'Contsys SE (revisionsförslag till ISO)', 'Beslutad', 'vårdkontinuitet', '-', '-', '3.1.2', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(516, '-', '2020-06-26 08:44:26.000000', 'plats där direkta hälso- och sjukvårdsaktiviteter (7.2) utförs', '-', 'Contsys SE', 'Publicera ej', 'vårdlokal', 'location where direct healthcare activities are performed (avser point of care och är alltså ett något snävare begrepp)', 'point of care', '7.2.9.1', 1, 'ANMÄRKNING 1: Plats avser patientens geografiska lokalisation, inte det område på patientens kropp som behandlas.', '2020-05-29, marel67: Städad.\r\n2020-06-26, karkj, mikwe2, vikee1, magfo: Begreppsposten utförarplats beslutad, vårdlokal görs till avrådd synonym och avskrivs som eget begrepp.', '-', '-'),
(517, '-', '2020-05-29 00:00:00.000000', 'förälder eller av domstol särskilt utsedd person (3.3.4) som har att utöva vårdnaden om ett barn (23.3.4.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdnadshavare', '-', '-', '25.2.4.3.3', 1, 'ANMÄRKNING 1: Ett barn ska alltid ha en eller två vårdnadshavare. Om detta stadgar föräldrabalken. Det är vanligen föräldrarna men kan också vara endera av dem om de är ogifta eller skilda (6 kap. 3 §). Om ingendera föräldern är vårdnadshavare förordnas särskild sådan (en eller två, samma lagrum). Vårdnadshavare är vanligen förmyndare för barnet, men det kan förekomma att särskild förmyndare förordnas (10 kap. 2 och 3 §§).', '2020-05-29, marel67: Städad.', '-', '-'),
(518, '-', '2020-05-29 00:00:00.000000', 'uppsättning vårdaktivitetsperioder (10.2.2) under vilka en hälso- och sjukvårdsutförare (5.2.3) har mandat (23.8.2) att utföra de hälso- och sjukvårdsaktiviteter (7.2) som krävs för att tillgodose specificerade hälsobehov (6.5.3)', '-', 'Contsys SE', 'Beslutad', 'vårdperiod med mandat', '-', '-', '10.2.1', 1, 'ANMÄRKNING 1: Contsys refererade term vårdgivare är bytt mot hälso- och sjukvårdsutförare', '2020-05-29, marel67: Städad.', '-', '-'),
(519, 'Inte definierad', '2020-04-14 17:03:50.000000', 'dynamisk, individuellt anpassad plan som inkluderar identifierade behovsbestämda hälso- och sjukvårdsaktiviteter (7.2) , hälsomål (9.2.5) och vårdaktivitetsmål (9.2.6) som är relaterade till en eller flera specificerade hälsoangelägenhet (6.3) i en hälso- och sjukvårdsprocess (8.2)', '-', 'Contsys SE', 'Beslutad', 'vårdplan', 'dynamic, personalized plan including identified needed healthcare activity, health objectives and healthcare goals, relating to one or more specified health issues in a healthcare process\r\n\r\nNOTE 1 A care plan may be recorded in one or more health records.\r\n\r\nNOTE 2 A care plan could be subdivided from different perspectives by different constraints. One example is uniprofessional care plan, for example, a nursing care plan with the constraint of only one specific healthcare professional involved. Other examples of specific constraints for a care plan are: care plan to address one health issue, one health condition, one contact, one clinical process, healthcare activities to be performed by one healthcare provider, etc.\r\n\r\nNOTE 3 Care plans are reviewed repeatedly during a healthcare process, each review based on a new healthcare needs assessment.\r\n\r\nNOTE 4 The healthcare activities in a care plan follow a life cycle. Examples of statuses of such a life cycle are: ‘planned’, ‘performed’, ‘cancelled’, etc.; all of these statuses are included in the care plan.\r\n\r\nNOTE 5 In EN 13940–1:2007 programme of care was the preferred term for this concept. \r\n\r\nEXAMPLE A care plan for retinopathy in diabetics by video-retinoscopy, which involves the GP and an ophthalmologist and implies specific mobile equipment (video-retinoscope) with a camera.', 'care plan, healthcare plan', '9.2', 1, 'Amärkningar från Consys SE:\r\n\r\nANM. 1 En vårdplan kan registreras i en eller flera hälsojournaler.\r\n\r\nANM. 2 En vårdplan kan delas in i underavdelningar utifrån olika perspektiv beroende på olika avgränsningar. Ett exempel är en yrkesspecifik vårdplan, till exempel en omvårdnadsplan där endast en specifik typ av hälso- och sjukvårdsprofessionell aktör deltar. Andra exempel på specifika avgränsningar för en vårdplan är: vårdplan inriktad på en enskild hälsoangelägenhet, ett enskilt hälsotillstånd, en enskild vårdkontakt, en enskild klinisk process, hälso- och sjukvårdsaktiviteter som ska utföras av en enskild vårdgivare, osv.\r\n\r\nANM. 3 Vårdplaner revideras upprepade gånger under en hälso- och sjukvårdsprocess, och varje revidering är baserad på en ny vårdbehovsbedömning.\r\n\r\nANM. 4 Hälso- och sjukvårdsaktiviteterna i en vårdplan går igenom en livscykel. Exempel på status i en sådan livscykel är: \"planerad\", \"utförd\", \"inställd\", osv., och alla dessa statusar ingår i vårdplanen.\r\n\r\nANM. 5 I EN 13940–1:2007 var ”programme of care” den rekommenderade engelska termen för detta begrepp.\r\n\r\nEXEMPEL En vårdplan för retinopati hos diabetiker genom videoretinoskopi, med deltagande av allmänläkaren och en ögonläkare och användning av specifik mobil utrustning (videoretinoskop) med en kamera.', '2020-04-14, Perha11: Lagt till engelsk term och definition och svenska anmärkningar från Contsys SE', '-', 'vård- och omsorgsplan som beskriver hälso- och sjukvård för en enskild patient (Socialstyrelsens termbank)'),
(520, '-', '2020-05-29 00:00:00.000000', 'ligg- eller sittplats på vårdenhet (25.2.3.1.2) som kan användas för vård och behandling', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdplats', '-', '-', '27.7', 1, 'ANMÄRKNING 1: Det finns inget i Socialstyrelsens definition som binder en vårdplats till sluten vård. Den kan alltså utnyttjas om en patient under en kort vistelse på sjukhuset behöver ligga ner. Begreppet avser alltså den fysiska platsen och inte resurs som ska användas i sluten vård. Detta ingick i en tidigare definition som ändrades till nuvarande 2011.', '2020-05-29, marel67: Städad.', '-', '-'),
(521, '-', '2020-05-29 00:00:00.000000', 'relation mellan patient (5.2.1) och den hälso- och sjukvårdspersonal (5.2.3.3) som deltar i vården av patienten (5.2.1)', '-', 'FVM', 'Beslutad', 'vårdrelation', '-', '-', '31.2.2.3', 1, 'ANMÄRKNING 1: Vårdrelation är en förutsättning för att hälso- och sjukvårdspersonal ska få ta del av patientjournalen och är en förutsättning för vårdmandat.', '2020-05-29, marel67: Städad.', '-', '-'),
(522, '-', '2020-05-29 00:00:00.000000', 'anpassat kliniskt kunskapsunderlag (9.2.4)', '-', 'Contsys SE', 'Beslutad', 'vårdriktlinje', '-', '-', '9.2.4.1', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(523, '-', '2020-05-29 00:00:00.000000', 'skada på patient (28.2.4.3) som hade kunnat undvikas om adekvata åtgärder hade vidtagits vid patientens (5.2.1) kontakt med hälso- och sjukvården (3.1.1)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdskada', '-', '-', '28.2.4.3.2', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(524, '-', '2020-05-29 00:00:00.000000', 'patientens (5.2.1) dokumenterade vilja avseende hälso- och sjukvårdstjänster (8.2.6) som ska avstås eller särskilt önskas i livets slutskede', '-', 'FVM', 'Beslutad', 'vårdtestamente', '-', '-', '32.2.2.4', 1, 'ANMÄRKNING 1: Vårdtestamentet ska införas i patientjournalen. Det är patientens möjlighet att föreskriva vilka aktiviteter som ska avstås i livets slutskede såsom respiratorbehandling och hjärt-lungräddning liksom om särskild behandling önskas för t.ex. smärt- och ångestlindring.', '2020-05-29, marel67: Städad.', '-', '-'),
(525, '-', '2020-05-29 00:00:00.000000', 'tid under vilken ett vårdtillfälle (30.2.4.1) äger rum', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdtid', '-', '-', '30.2.1.1', 1, '-', '2020-05-29, marel67: Städad.', '-', '-'),
(526, '-', '2020-05-29 00:00:00.000000', 'vårdkontakt (10.2.2.1.1) i sluten vård (29.5)', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vårdtillfälle', '-', '-', '30.2.4.1', 1, 'ANMÄRKNING 1: Vårdtillfälle är en del av en process. I Contsys intresserar man sig bara för processen och talar om perioder, t.ex.aktivitetsperiod, vårdkontaktperiod, klinisk processperiod, vårduppdragsperiod, vilka alla är definierade, men ingen av dem är kopplade till begreppet sluten vård. Sluten vård förekommer inte alls i Contsys men är ett lagligt definierat begrepp i Sverige (hälso- och sjukvårdslagen 2 kap, 4 §, patientlagen 3 kap. 2 b §), varför förhållanden kopplade till sluten vård måste analyseras.', '2020-05-29, marel67: Städad.', '-', '-'),
(527, '-', '2020-05-29 00:00:00.000000', 'roll (3.3.5)inom hälso- och sjukvård (3.1.1) som kan tilldelas ett eller flera mandat för vårdperiod (11.2.2)', '-', 'VGR (förslag till Contsys-revidering)', 'Beslutad', 'vårdutförare', '-', '-', '5.2.3', 1, 'ANMÄRKNING 1: Vårdutförare kan inkludera både hälso- och vårdutförare med särskild behörighet och andra som deltar i tillhandahållandet av hälso- och sjukvård. \r\n\r\nANMÄRKNING 2: Denna internationella standard inkluderar endast två specialiseringar av vårdutförare. Avsikten med detta är inte att utesluta möjligheten till andra specialiseringar. Inom lagstiftningsområden där andra typer av hälso- sjukvårdsaktörer ingår i begreppet vårdutförare får de nödvändiga specialiseringarna läggas till.\r\n\r\nANMÄRKNING 3: Enligt denna definition är organisationer som endast har ansvar för finansiering. betalning eller ersättning för tillhandahållandet av hälso- och sjukvård inte vårdutförare, utan anse för ändamålet med denna Internationella Standard vara hälso- och sjukvårdstredjeparter.', '-', '-', '-'),
(528, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvårdspersonal (5.2.3.3) som innehar behörighet eller legitimation inom hälso- och sjukvård (3.1.1) som är giltig inom ett specificerat juridiskt sammanhang', '-', 'VGR (förslag till contsys-revision)', 'Beslutad', 'vårdutförare med särskild behörighet', '-', '-', '5.2.3.3.1', 1, 'ANMÄRKNING 1: Behörigheten för en vårdutförare med särskild behörighet ger rätt att tillhandahålla hälso- och sjukvård oberoende av roll i en hälso- och sjukvårdsorganisation. \r\n\r\nANMÄRKNING 2: VGR : I contsys är behörighet enligt lag definierad och avser en behörighet att agera utan samtycke (se den termposten, 11.2.9)   \r\n\r\nANMÄRKNING 3: VGR: Särskild behörighet kan även inkludera att arbeta på delegation. Det vill säga utökad mandat som uppdrag.  \r\n\r\nEXEMPEL 1: Allmänläkare, överläkare, fysioterapeut, tandläkare, sjuksköterska, röntgenläkare, osv.', '2020-05-29, marel67: Städad.', '-', '-'),
(529, 'Från Gip', '2020-05-29 00:00:00.000000', 'Inte definierad', '-', '-', 'Definiera ej', 'vårdverksamhet', '-', '-', '-', 5, '-', 'Detta begrepp behöver ses över.\r\n2020-04-28, Perha11 BV: Hänvisat till begreppet hälso- och sjukvård', '-', '-'),
(530, '-', '2020-05-29 00:00:00.000000', 'acceptans av ett hälso- och sjukvårdsmandat (11.2) av den hälso- och sjukvårdsaktör (5.2) som tilldelas det', '-', 'Contsys SE', 'Beslutad', 'vårdåtagande', '-', '-', '11.2.10', 1, 'ANMÄRKNING 1: Beslutet fattas av hälso- och sjukvårdspersonal men binder normalt sett en vårdenhet till att handlägga. Ett vårdåtagande kan leda till mycket kort handläggning av det som önskas i vårdbegäran. T.ex. kan egenvård rekommenderas, vilket är en ordination förenad med kliniskt ansvarstagande och som avslutar vårdåtagandet. En lång vårdprocess kan startas av vårdåtagandet. Inom radiologin används termen berättigandebedömning, vilket är en hälso- och sjukvårdstjänst som innefattar att endera 1)den begärda undersökningen initieras 2)beslut tas att genomföra en annan undersökning 3)att undersökningen avstås och remissen besvaras Samtliga dessa alternativ innebär en klinisk bedömning under ansvar och görs inom ramen för ett vårdåtagande som i alternativ 3 avslutas med remissvaret.', '2020-05-29, marel67: Städad.', '-', 'beslut av mottagande vårdenhet att acceptera vårdbegäran (Socialstyrelsens termbank)'),
(531, '-', '2020-05-29 00:00:00.000000', 'registrerad behörighet (31.6) som tilldelats en person (3.3.4) och som ger personen (1.1) behörighet (6.4.5) att inneha eller utöva specifika roller (3.3.5) inom hälso- och sjukvården (3.1.1)', '-', 'Contsys SE', 'Beslutad', 'yrkesbevis inom hälso- och sjukvård', '-', '-', '5.2.3.3.1', 1, 'ANMÄRKNING 1: Behörigheten styrks vanligen av bevisför att vederbörande har fått eller håller på att få de nödvändiga kvalifikationerna, den relevanta utbildningen och färdighetsträningen.  Anmärkning 2     Den officiella behörigheten för hälso- och sjukvårdsprofessionell aktör utgör grunden för den hälso- och sjukvårdsprofessionella aktörens officiella skyldigheter och rättigheter.  Exempel 1     Examens- eller utbildningsbevis, legitimation (till exempel legitimerad sjuksköterska).', '2020-05-29, marel67: Städad.', '-', '-'),
(532, '-', '2020-05-29 00:00:00.000000', 'åtgärd som resulterar i en eller flera deltagares skyldighet att följa en regel eller uppfylla ett avtal', '-', 'ISO 12967-1:2009 eller Contsys SE', 'Beslutad', 'åtagande', '-', '-', '3.8.1', 1, 'ANMÄRKNING 1: Det eller de verksamhetsobjekt som deltar i utförande av ett åtagande kan vara parter eller agenter som agerar företrädare för en eller flera parter. När en åtagande gjorts av en agent är det huvudmannen som blir förpliktigad.', '2020-05-29, marel67: Städad.', '-', '-'),
(533, '-', '2020-05-29 00:00:00.000000', 'kod för statistik avseende hälso- och sjukvårdsaktiviteter (7.2)', '-', 'FVM', 'Beslutad', 'åtgärdskod', '-', '-', '27.3', 1, 'ANMÄRKNING 1: Klassifikation av vårdåtgärder.', '2020-05-29, marel67: Städad.', '-', '-'),
(534, 'Avser när en vårdkontakt sammanfattas med KVÅ-koder som används för DRG gruppering, rapportering till Socialstyrelsen m m.', '2020-03-24 11:26:33.000000', '[hälso- och sjukvård] kodning för beskrivning av aktiviteter i hälso- och sjukvård', '-', 'VGR', 'Beslutad', 'åtgärdskodning', '-', '-', '-', 10, '-', '2020-02-28, Perha11: Inflyttad från Nybeställning\r\n2020-03-20, Perha11: klinisk kodning tillagd som avrådd synonym\r\n2020-03-24, BB: Klar!', '-', NULL),
(535, 'Personal kan ha ett schema som man önskar (kallas tydligen för önskeschema i arbetslivet)', '2020-05-12 14:47:47.000000', 'schema som innehåller hälso- och sjukvårdspersonals önskemål om förläggning av arbetstid', '-', 'Informatik VGR', 'Beslutad', 'önskeschema', '-', '-', '-', 7, '-', '2020-02-27, Perha11: Inflyttad från Nybeställning\r\n2020-04-28, Perha11 BV: Kan tas bort!\r\n2020-05-05, PErha11, Marel67: Åter Martin för utredning.\r\n2020-05-07, Marel67, flyttad till preliminär\r\n2020-05-08, magfo: lagt till \"förläggning av\" i definitionen. Det är inte arbetstiden utan hur den ska förläggas som önskas.\r\n2020-05-12, karkj, perha11, magfo: Beslutad.', '-', '-'),
(536, '-', '2020-05-29 00:00:00.000000', 'hälso- och sjukvård (3.1.1) när den ges till patient (5.2.1) vars hälsotillstånd (6.4) medger att aktuell vårdinsats förväntas kunna avslutas inom ett begränsat antal timmar', '-', 'Socialstyrelsens termbank, reviderad', 'Beslutad', 'öppenvård', '-', '-', '29.8', 1, 'Anmärkning 1     Eftersom det är patientens hälsotillstånd som avgör hur snabbt den aktuella vården kan avslutas har ordet \"tillstånd\" ersatts med ordet \"hälsotillstånd\" i definitionen.', '2020-05-29, marel67: Städad.', '-', '-'),
(537, '-', '2020-05-28 00:00:00.000000', 'öppenvårdskontakt (30.2.2.1.1.1) som innebär fysiskt möte mellan patient (5.2.1) och hälso- och sjukvårdspersonal (5.2.3.3)', '-', 'FVM byggt på Socialstyrelsens termbank.', 'Beslutad', 'öppenvårdsbesök', '-', '-', '30.2.2.1.1.1.2', 1, 'Anmärkning 1     Eftersom termen \"öppenvårdskontakt\" införts i FVM används denna i stället för den definitionsliknande term som finns i termbanken. Se 5.1.1!', '-', '-', '-'),
(538, 'Inte definierad', '2020-05-28 00:00:00.000000', 'vårdkontakt (10.2.2.1.1) i öppen vård (29.8)', '-', 'FVM, bygger på Socialstyrelsens termbank', 'Beslutad', 'öppenvårdskontakt', '-', '-', '30.2.2.1.1.1', 1, 'ANMÄRKNING 1:  I termbanken är termen \"vårdkontakt i öppen vård\" vilket är mer av definition än term. Vård förekommer två gånger i termen, och därför har termen gjorts om till ett ord, varefter termbankens term används som definition.', 'Inte definierad', '-', '-'),
(539, 'Sjukvårdspersonal som sköter provtagning (blod, urin, vätskor, hudskrap) kan vara sköterska eller särskild behörig undersköterska.\r\n\r\nprovtryckning fr LM ws', '2020-03-30 15:16:45.000000', 'fysisk person som utför provtagning', '-', 'Socialstyrelsen', 'Beslutad', 'provtagare', '-', '-', '-', 20, '-', '2020-03-30, Perha11; Definition hämtad från Sos.', '-', '-'),
(540, 'Inte definierad', '2019-12-10 14:14:24.000000', '\"person (3.3.4) som patienten uppger sig ha en nära relation till\r\n\r\nAlternativ definition     person som den enskilde anser sig ha en nära relation till (Socialstyrelsens termbank) \"', 'Inte definierad', 'Inte definierad', 'Beslutad', 'närstående', 'Inte definierad', 'Inte definierad', '5.2.2', 1, 'Anmärkning 1     Contsystermen närstående är homonym i det svenska sammanhanget. Socialstyrelsen skiljer mellan närstående (se Socialstyrelsens definition) och anhörig som är nära släkt. Också i svensk lag vacklar dessa begrepp, men Socialstyrelsens termbank gör det naturligt att man i Sverige skiljer mellan dessa begrepp. Därför inkluderas termposten anhörig i begreppssystemets komplettering (se den termposten). \r\n\r\nAnmärkning 2     Termposten är en översättning av Contsys\r\n EN next of kin som förklaras i Wikipedia som en \"\"person\'s closest living blood relative\"\". Detta är stadfäst i Förenta staternas och en del andra länders lagstiftning, varvid termen borde översättas \"\"anhörig\"\". I andra länder, som exempel nämns Storbritannien, finns ingen lagstadgad definition, och där används termen också när blodsband inte föreligger. Det danska ordet pårørende förklaras i Dansk ordbog: \"\"person som tilhører den nærmeste familie eller på anden måde er nært knyttet til en person der er syg, har været ude for en ulykke el.lign\"\". Pårørende är alltså i allt väsentligt detsamma som Contsys närstående eller next of kin.\"', 'Inte definierad', 'Inte definierad', NULL),
(542, 'När en SSK lägger en \"order\" i Millennium skall \"kommunikationstyp\" \r\nFinns muntlig ordination vs. muntlig beställning. Finns även aspekten ordination vs. läkemedelsordination.', '2020-06-16 15:34:28.000000', '-', '-', '-', 'Publicera ej', 'muntlig ordniation', '-', '-', '-', 22, '-', '2020-03-30, Perha11: TIllskriver beställare om mer information.\r\n2020-05-14, Verwi6, Perha11: Åter beställare för komplettering. Jira-kort 547. Publiceras ej\r\n2020-06-16, vikee1: Har klarmarkerat jira-kortet då detta är något som hängt med sedan FSR och inte aktuellt just nu.', '-', '-'),
(543, 'ordet \'powerplan\' verkar inte översatt tills svenska än. Vad ska det heta? (hänger i viss mån ihop med frågan: var är det?)', '2020-05-14 14:53:41.000000', '-', '-', '-', 'Publicera ej', '(Powerplan) / vårdplan / paket /ordinationspaket ?', '-', 'Powerplan', '-', 23, '-', '2020-03-31, BB: Sätts upp på Trello B017.6 för diskussion med Skåne\r\n2020-05-14, verwi6, perha11: till beslut Skåne, Jira 563\r\n2020-05-27, vikee1: sätter denna till publiceras ej. PowerPlan är ett namn hos Cerner som inte ska översättas. Vi kommer istället översätta termen \"Order Set\".', '-', '-'),
(545, 'En funktionalitet i Millennium som populeras med \"Pick list\", rutiner, läkemedel och operationskort, bland annat. \r\nPreference card är \"hela receptet för operation\".\r\n\r\nVi har inte jättebra koll på exakt vad det innebär just nu och inga goda förslag heller, förutom preferenskort.. men det är nog inte helt adekvat. Detta är vad Jonas, Maria och Anna säger: \r\n\r\nTill alla ingrepp ska vi skapa preferenskort ett kort per surgical area (i min värld är surgical area = operationsavdelning men tror att det kan vara Op 1 och 2 på tex SÄS om vi bestämmer oss för lägga ihop dem i en surgical area väl?). I dessa prefenskort ingår picklist med artiklar/utrustning och ev a även andra saker/önskemål osv som kan skrivas i fritext.\r\n\r\nDock gick bara ett prefkort per opavd och ingrepp\r\n\r\n​ Det är därför vi måste lägga så mycket tid på våra ingrepp... Jag tror också att segment man vill ha med eller inte ha med i intraopdok och värden som ska populera fält (som opläge tex) kopplas på ingreppen, inte på prefenskorten.\r\n\r\n​Sue duckar så fort jag ställer frågan vad hon menar med surgical area​, när jag frågat do you mean operation area/operation ward/operation department så har hon alltid svarat ja...\r\n\r\n..men ffa för att kunna flytta patienterna lätt, annars får de boka om hela operationen har jag för mig', '2020-05-12 11:19:54.000000', '-', '-', '-', 'Publicera ej', '(preference card)', '-', 'preference card', '-', 25, '-', '2020-03-31, BB: Lägger till på Trello B017.6 För vidare utredning med Skåne\r\n2020-05-12, verwi6, perha11: Sätts som Publiceras ej, kort i Jira, vgregionit.atlassian.net/browse/INFMTK-532\r\n\r\n2020-07-03, vikee1: Detta begrepp kan bli aktuellt längre fram, men ärendet i Jira sätts som klart. Så får det skapas ett nytt senare om det blir aktuellt.', '-', '-'),
(546, 'När man som läkare vill konsultera en annan läkare lägger man en konsultremiss.', '2020-03-30 15:49:05.000000', 'vårdkontakt där patienten bedöms av hälso- och sjukvårdspersonal från annat medicinskt verksamhetsområde (klinik/basenhet/motsvarande) och där vårdansvaret kvarstår hos remitterande hälso- och sjukvårdspersonal', '-', 'Socialstyrelsen', 'Beslutad', 'konsultation', '-', '-', '-', 26, '-', '2020-03-30, Perha11: Vald term konsultation från Sos ersätter konsultationsremiss som blir synonym', '-', '-'),
(547, 'Information om vad patienten jobbar med, alkohol vanor, utbildning mm. \r\n\r\nSynonym - Patientbakgrund', '2020-07-28 13:58:51.000000', 'inte definierad', '-', '-', 'Pågår', 'social bakgrund', '-', '-', '-', 27, '-', '2020-03-30, Perha11: Pelle kollar vidare på denna.\r\n2020-03-31, BB: Skapar kort i Trello, B022 Patientbakgrund för vidare utredning av SOKI angående en övergripande funktion om hur vi dokumenterar patientbakgrund. Lägger kortet på Sara.\r\n2020-05-14, verwi6, perha11: Jira 552 - utredning kring patientbakgrund till Sara\r\n2020-07-28, magfo: Ärendet förs till JIRA 552.', '-', '-'),
(548, 'Sjukdomsärftlighet, t.ex. finns det historia av hjärtproblem i släkten.\r\nKommentar från A´nna Ben Shabat: I mPage så finns komponenten Histories. Skåne har översatt denna till Historik. Komponenten har underrubrikerna socialt, ärftlighet, åtgärder, graviditet, diagnoser och hälsoproblem. Ser att akutströmmen redan har lagt in termen familjehistorik, vet dock inte om termen har samma innehåll men mPage och namnen på rubrikerna i denna behöver diskutera i Shared documentation forum.', '2020-07-28 13:59:51.000000', '-', '-', '-', 'Pågår', 'familjehistorik (patientbakgrund)', '-', '-', '-', 28, '-', '2020-03-31, BB: Skapar kort i Trello, B022 Patientbakgrund för vidare utredning av SOKI angående en övergripande funktion om hur vi dokumenterar patientbakgrund. Lägger kortet på Sara.\r\n2020-05-14, verwi6, perha11: Jira 552 - utredning kring patientbakgrund till Sara\r\n2020-07-28, magfo: Ärendet förs till JIRA 552.', '-', '-'),
(549, 'När det kommer in provsvar efter att patienten går hem, är det en lista som har reda på vilka patienter det gäller.\r\n\r\nTermen översattes från engelska \"Result callback\".', '2020-07-08 13:24:34.000000', 'inte definierat', '-', '-', 'Publicera ej', 'uppringning vid provsvar', '-', 'result callback', '-', 29, '-', '2020-03-31, BB: Till Trello B017.6 Skåne  för vidare utredning av funktionalitet.\r\n2020-05-14, verwi6, perha11: till beslut Skåne, Jira 561\r\n2020-07-08, vikee1: Ändrat status till Publiceras ej och klarmarkerat Jira-kortet.', '-', '-'),
(550, 'Rubrik i patientjournalen där man samlat information kring tvångsåtgärder som ordinerats patienten. Ex. bälting, tvångsbehandling, m.fl.', '2020-05-14 15:15:52.000000', 'Inte definierat', '-', '-', 'Publicera ej', 'tvångsåtgärder', '-', '-', '-', 30, '-', '2020-03-31, BB: Trellokort B023 för vidare utredning\r\n2020-05-14, verwi6, perha11: Jira 182, inte aktuell, Publiceras ej\r\n2020-05-14 , vikee1: Inkommet under FSR ej längre aktuellt.', '-', '-'),
(551, 'Circulator - ett begrepp som används och som i Operationsströmmen benämner som \"cirkulerande salspersonal\" eller \"pass på sal\"/ \"pass\". Icke steril personal som vanligtvis är ussk eller ssk.\r\n\r\nCirkulerande salspersonal kan vara antingen en undersköterska eller en operationssjuksköterska som befinner sig utanför salen och servar det sterila teamet inne på salen samt löser av för raster.\r\nhttps://www.diva-portal.org/smash/get/diva2:622443/FULLTEXT01.pdf', '2020-08-05 13:20:52.000000', 'undersköterska och sjuksköterska som befinner sig utanför operationssalen och assisterar det sterila teamet inne på operationssalen', '-', 'Informatik VGR', 'Beslutad', 'cirkulerande salspersonal', '-', 'circulator', '-', 31, 'ANMÄRKNING 1: Cirkulerande salspersonal kan även agera som avlösare vid raster.\r\n\r\nEtt examensarbete vid Mittuniversitetet april 2013, Trafikflödet in och ut ur operationssalen: Omfattning och orsaker - en observationsstudie, anger att cirkulerande salspersonal begränsas till \"undersköterska och opertionssjuksköterska som befinner sig utanför operationssalen och assisterar det sterila teamet inne på operationssalen\". SME i SoKI, FVM, påpekar att det kan vara anestesisjuksköterska eller annan sjuksköterska likaväl.', '2020-03-31, BB: Är detta något som påverkar funktionaliteten i M? Kan det var ambulerande personal som menas? Cirkulator är på svenska en apparat inom livsmedelhantering. Trellokort B024 > åter beställare.\r\n\r\n2020-05-25, perha11: till publiceras ej i väntan på utredning. Jira 651\r\n\r\n2020-07-03, vikee1: preliminärt definierad.\r\n2020-07-30, magfo: \"eller\" bytt mot \"och\" i definitionen\r\n2020-08-05, ollka3, magfo: Beslutat.\r\n2020-08-19, magfo: Defionitionen ändrad så att den nämner alla sjuksköterskor och inte endast operationssjuksköterskor.', '-', '-'),
(552, 'Drainage är översätt till drän i Millenium. Soki reagerar och önskar att det kallas dränage. \r\nSnomed CT påvisar att drän är biomedicinsk utrustning ocg dränage är en metod (ex dränage av njure). Vad gäller? \r\nhttps://browser.ihtsdotools.org/?perspective=full&conceptId1=32712000&edition=MAIN/SNOMEDCT-SE/2019-11-30&release=&languages=sv,en', '2020-03-31 11:52:55.000000', 'avledande av vätska från sår, hålrum eller abscess', '-', 'Medicinsk orbok.se', 'Beslutad', 'dränage', 'diversion of fluid from wound, abscess or cavity', 'drainage', '-', 32, 'Anmärkning: Dränage kan inte förkortas till drän som är en biomedicinsk utrustning för metoden dränage.', '2020-03-31, BB: Definierad o klar!', '-', '-'),
(553, 'Vården som mamman får efter förlossning', '2020-05-04 15:11:37.000000', 'postpartumfasen efter förlossning', '-', 'VGR', 'Publicera ej', 'pospartumfas', '-', 'Inte definierad', 'Inte definierad', 33, 'Detta definieras på olika sätt på olika ställen inom vården.', '2020-04-06, vikee1, definieras ej.\r\n2020-04-07, ajla, ändring på term och definierad tillsammans med mödravård.\r\n2020-05-04, Perha11,: Publiceras ej efter kontakt med Gertrud och ajla. blir synonym till  postpartum.', '-', '-'),
(554, 'En lång period efter förlossningen (0-12 veckor efter).', '2020-05-04 15:12:53.000000', 'BESKRIVNING: Perioden från förlossning till ca 12 veckor efter förlossning, kvinnans läkningsprocess, återhämtning efter förlossning. Olika tidsdefinitioner finns till detta begrepp.', 'SCTID: 86569001', 'Informatik VGR', 'Beslutad', 'postpartum', '-', '-', '-', 34, 'ANMÄRKNING 1: Synonymnen puerperium syftar på period mellan förlossningen och 6-8 veckor efter förlossningen. (Källa: Medicinsk ordbok.se)', '2020-04-06, vikee1, preliminär definierat.\r\n2020-04-07, ajla, definierat tillsammans med WS Mödravård\r\n2020-04-30, Peerha11 BB: Justerad och godkänd.\r\n2020-05-04, Perha11,: Efter kontakt med Gertrud o Ajla, kompletterar med synonymen postpartumfas och sätter puerperium som avrådd sysnonym.', 'Snomed CT', '-'),
(555, 'Blodkompontent en term som finns i operationsmodul - Ordinationer. Vad betyder det?\r\n\r\nCerner hade skrivit Blodkomponent och Blodprodukt på olika ställen, men i samma modul. Så jag, plus några till i strömmen, var frågande om det var någon skillnad på de både och i sådana fall vad som var skillnaden. Labbströmmen var med på en session och tyckte med att det var konstigt  och menade på att det borde stå blodkomponent. Det jag tror kan vara viktigt att se över skillnaderna mellan begreppen och om det är olika, definiera när det ena begreppet ska användas eller inte.', '2020-05-12 11:29:00.000000', 'Inte definierad', 'Inte definierad', 'Inte definierad', 'Publicera ej', 'blodkomponent', 'Inte definierad', 'Inte definierad', 'Inte definierad', 35, 'Blodkomponenter framställs vid blodcentraler ur helblod från friska blodgivare eller direkt från givare via aferesteknik, det vill säga cellerna koncentreras genom centrifugeringsteknik under pågående tappning. Patienten undersöks för blodgruppsserologisk bestämning före transfusionen.\r\nKälla: Vårdhandboken', '2020-04-06, vikee1, lagt till anmärkning för vidare definition. Har även fyllt i kontext med ytterligare input från Viktoria.\r\n2020-05-12, verwi6, perha11: SAtt som Publiceras ej i väntan på reaktion från Viktoria.', 'Inte definierad', '-'),
(556, 'tillförsel av en hög dos av ett läkemedel för att snabbare nå terapeutisk koncentration i blodet.', '2020-03-05 14:39:00.000000', 'tillförsel av en hög dos av ett läkemedel för att snabbt nå terapeutisk koncentration i blodet', 'Inte definierad', 'Medicinskordbok', 'Beslutad', 'bolusdos', 'Inte definierad', 'Inte definierad', 'Inte definierad', 36, 'Inte definierad', '2020-04-06, vikee1, definierad.', 'Inte definierad', '-'),
(557, 'Term bör ändras men fanns i millnium under FSR. \r\n\r\nKontext: Läkemedelpåsen. Infusionsvätska, den IV-påsen i ordnings som ska administreras.', '2020-05-12 14:18:25.000000', '-', '-', '-', 'Publicera ej', 'påse nr', '-', '-', '-', 37, '-', '2020-04-06, vikee1, skickat mail till David och bett om mer input.\r\n2020-05-12, verwi6: Lagt in i Jira, https://vgregionit.atlassian.net/browse/INFMTK-535. Satt som publicera ej.\r\n2020-07-03: vikee1: Klarmarkerat kortet i Jira och låter begreppet stå som publiceras ej.', '-', '-'),
(558, 'Batchnummer på läkemedel.', '2020-06-24 13:40:35.000000', '-', 'Inte definierad', 'Inte definierad', 'Publicera ej', 'partinummer', 'Inte definierad', 'Inte definierad', 'Inte definierad', 38, 'Inte definierad', '2020-04-06, vikee1, skickat mail till David och bett om input från WS Läkemedel.\r\n2020-04-06, verwi6: lagt upp i Jira, https://vgregionit.atlassian.net/browse/INFMTK-534 . Satt på publicera ej. Avvaktar om det fortfarande är aktuellt.\r\n2020-06-24, magfo: Denna termpost ersätts av batchnummer där termen går in som synonym..', 'Inte definierad', '-'),
