(561, 'Information till patienten som förklarar varför patienten har ordinerats läkemedlet.', '2020-06-02 12:01:12.000000', 'avsikt med ordinerad behandling förklarad för patient', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'behandlingsändamål', '-', '-', 'Inte definierad', 41, 'ANMÄRKNING 1: Detta är den behandlingsorsak som anges för patienten (ställer vissa språkliga krav på formuleringen) medan ordinationsorsak är den formella utgångspunkten för ordinationen på fackspråk.', '2020-04-06, vikee1, lagt till begreppet som en avrådd term till ordinationsorsak.\r\n2020-06-02, sofan63, magfo: Termposten justerad, återväckt då det är ett separatbegrepp skilt från ordinationsorsak.\r\n2020-06-02, karkj, perha11: Beslutad!', '-', '-'),
(562, 'När en läkare fått en konsultremiss kan hen fylla i \"consul notes\".', '2020-03-06 08:37:00.000000', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'consult note', 'Inte definierad', 'Inte definierad', 'Inte definierad', 42, 'Inte definierad', '2020-04-06, vikee1, inte aktuellt i dagsläget.', 'Inte definierad', '-'),
(563, 'Operation/Akut\r\n\r\nÖversättningsfel, borde heta anamnese eller patientberättlese, sjukdomshistoria.', '2020-03-06 09:36:00.000000', '-', '-', '-', 'Definiera ej', 'ordinationskommentar', '-', '-', '-', 43, '-', '2020-04-06, vikee1, överlåtes till SME att bestämma vad det ska heta.', '-', '-'),
(564, 'Behövs översättas till svenska. Syftar på förifylld ordinationsmall som gör att man inte behöver fylla i alla detaljer vid en läkemedelsordination.', '2020-06-04 10:35:35.000000', 'förifylld mall som standardiserar ordination av läkemedel', '-', 'Informatik VGR', 'Beslutad', 'ordinationsmall', '-', 'order sentence', '-', 44, 'ANMÄRKNING 1: Syftar på förifylld ordinationsmall som gör att man inte behöver fylla i alla detaljer vid en läkemedelsordination´och därmed ökar effektivitet och medicinsk säkerhet i verksamheten.', '2020-04-06, vikee1, preliminär definierad\r\n2020-04-28, Perha11 BB: Faststält begrepp.\r\n2020-06-03, karkj: ändrat status till pågår. Tycker inte definitionen stämmer. Ordinationsmall gäller väl inte bara förskrivning?\r\n2020-06-04, karkj, magfo: Definitionen justerad. Beslutad.', '-', '-'),
(565, 'När en patient ska flyttas till en annan avdelning/enhet fyller läkaren i en daganteckning i journalen. Vissa säger att man måste fylla i en epikris vid förflyttning, medans andra säger att man inte behöver det.', '2020-03-06 12:13:00.000000', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'daganteckning', 'Inte definierad', 'Inte definierad', 'Inte definierad', 45, 'Inte definierad', '2020-04-06, vikee1, föreslås term för detta när WS Med Dok designar detta.', 'Inte definierad', '-'),
(566, 'För läkemedel: Halt av aktiv substans.', '2020-06-03 10:24:45.000000', 'halt av aktiv substans i läkemedel', '-', 'Socialstyrelsens termbank, reviderad', 'Beslutad', 'läkemedelsstyrka', '-', '-', '-', 46, 'ANMÄRKNING 1: Styrkan kan uttryckas som mängd per avdelad dos, volymenhet eller viktenhet beroende på läkemedelsform, t.ex. 500 mg per tablett, 20 mg/ml eller 1mg/g.\r\nUppgiften om styrka som anges på läkemedelsförpackningen är en del av identifikationen av läkemedelsprodukten och används vid kommunikation om läkemedlet.\r\nFör läkemedel med aktiva substanser som är föreningar (salter), kan uppgiften om styrkan på förpackningen avse olika former av den aktiva substansen. Den kan exempelvis baseras på styrkan för hela föreningen eller på den aktiva delen i föreningen (eng. active moiety). När uppgiften ska användas för beräkningar är det viktigt att känna till vad den avser i det specifika fallet.\r\nKombinationsläkemedel innehåller flera aktiva substanser och har en styrka för var och en av dessa.\r\n\r\nANMÄRKNING 2: Socialstyrelsen använder termen styrka. Det synes öka exaktheten om man skriver ut läkemedelsstyrka och accepterar styrka som synonym.', '2020-04-06, vikee1, preliminärt definierad\r\n2020-04-28, Perha11 BB:  Definition uppdaterad och beslutad.\r\n2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '(i läkemedel:) halt av en aktiv substans (SoS)'),
(567, 'Mängd av ett visst läkemedel med en given styrka.', '2020-06-04 09:54:14.000000', 'mängd av visst läkemedel med angiven styrka', '-', 'GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET SOCIALSTYRELSEN (reviderad)', 'Beslutad', 'läkemedelsdos', '-', '-', '-', 47, 'ANMÄRKNING 1: Mängden uttrycks med ett exakt värde (t.ex. 2 tabletter; 2 ml) eller ett intervall (t.ex. 2–3 tabletter).', '2020-04-06, vikee1, preliminärt definierad\r\n2020-04-28, Perha11 BB: Klar!\r\n2020-06-03, karkj: Lagt till ordet visst i definitionen enligt GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET\r\nSOCIALSTYRELSEN\r\nÄndrat status till Preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', '-'),
(568, 'En utlokaliserad patient. När en patient tillhör en annan enhet när det är platsbrist på den ursprungliga enheten som patienten tillhör.', '2020-04-28 12:35:00.000000', 'patient som vårdas på annan vårdenhet än den som har medicinskt ansvar för patienten', '-', 'Socialstyrelsens termbank, reviderad', 'Beslutad', 'utlokaliserad patient', '-', '-', '-', 48, 'Anmärkning 1 (Socialstyrelsen):  Innebörden i begreppet medicinskt ansvar måste tolkas lokalt utifrån vårdgivarens organisatoriska förutsättningar.\r\n\r\nEn patient räknas inte som utlokaliserad när det är medicinskt motiverat att vårda på annan vårdenhet, t.ex. kirurgisk vård på barnavdelning, isoleringsvård, vård på akutvårdsenhet och intensivvård.', '2020-04-06, vikee1, preliminärt definierad\r\n2020-04-28, Perha11 BB: Beslutad!', '-', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(569, 'När en patient läggs in på två vårdavdelningar samtidigt. Ett ex är när psykiatrin om patienten vårdas med vårdintyg men ligger på IVA eller geriatrik.', '2020-03-24 12:00:57.000000', 'patients registrerade vistelse på olika slutenvårdsenheter vid samma tidpunkt', '-', 'VGR', 'Beslutad', 'parallella vårdtillfällen', '-', '-', '-', 49, 'Exempel: När en dömd patient inom psykiatrin behöver medicinsk sluten vård kan patienten inte skrivas ut från psykiatrin men måste kunna ha ett samtidigt slutenvårdstillfälle inom en annan specialitet.', '2020-03-10, BB: definition påbörjad\r\n2020-03-24, BB: Enligt Per Sjöli Ska det inte heta dubbelt vårdtillfälle. Rätt term är parallellt vårdtillfälle  Definition uppdaterad.', '-', NULL),
(570, 'overdue task - svensk översättning i millennium idag är förfallna uppgifter. Syftar till utdelningslistan och \"förfallna uppgifter\". T ex en patient skulle få ett läkemedel kl 12, kl 13 anses uppgiften vara \"overdue\" och blir röd.', '2020-03-10 14:55:00.000000', 'uppgift som vid avsedd tidpunkt ännu inte utförts', '-', '-', 'Beslutad', 'försenad  uppgift', '-', 'overdue task', '-', 50, '-', '2020-03-10, BB: Definierad', 'Inte definierad', NULL),
(571, 'Dokumenterar hur väl patienten tar sina läkemedel, finns flera konfigurerar bara kodverk under denna funktionaliteten tex: tar inte, tar fortfarande ej enligt ordination, under utredning, tar fortfarande enligt ordiniation mfl. Detta visas under Mpage senare som en kommentar. Det finns ett till kodverk som visar vem som är som heter informationskälla: här är det exempelvis patient…\r\n\r\ncompliance\r\n\r\nmått på vävnads elasticitet. 2. patientens förmåga att följa ordination.\r\n\r\nFöljsamhet är en term som används i egenskap nr 1 inom tillex lungmedicin och beskriver en lungas förmåga att vidga sig /resp dra ihop sig beroende på andetagets storlek. Används också inom kardiologi när man talar om hjärtats förmåga. Ofta översätts in termen utan man anv det engelska uttrycket. \r\n\r\nI betydelse nr 2 så är det viktigt att följsamhet omfattar all ordination. Tänk råd om rökstopp, eller att jag ordinerar patienten att röra armen 10 ggr per dag för att få upp rörlighet i axeln, eller att man tar ett läkemedel enligt instruktion. Dvs rör inte bara läkemedelsbehandling.', '2020-08-05 11:39:57.000000', 'patients förmåga och vilja att följa ordination', '405078008 |följsamhetsbeteende|', 'Svensk MeSH (reviderad)', 'Beslutad', 'följsamhet', 'voluntary cooperation of the patient in taking drugs or medicine as prescribed. This includes timing, dosage, and frequency\r\n\r\nKälla: MeSH', 'Medication Compliance', '-', 51, 'ANMÄRKNING 1: Innefattar även information om patient följer ordination gällande dos, tidpunkt och frekvens.\r\n\r\nANMÄRKNING 2: följsamhet avser alla ordinationer, även t.ex. att inte röka, att böja knät 10 gånger per dag, att sova minst 7 timmar/natt, att inte peta sig i näsan. Den utländska termen avser specialiseringen avseende läkemedel, vilken inte görs på svenska.\r\n\r\nANMÄRKNING 3: Det valda Snomedbegreppet mostsvarar i detalj det begrepp som definieras här. I Snomed framgår ett underordnat begrepp: läkemedelsföljsamhet och under det följsamhet avseende ordinerade läkemedel. Varken i Snomed eller i föreliggade begreppspost skiljer man mellan oförmåga att följa ordination och ovilja att göra det. Det avgör hur man ska möta problemet, men först får problemet identifieras.', '2020-04-06, vikee1, mailat David om mer input.\r\n2020-05-12, verwi6: Lagt in i Jira, https://vgregionit.atlassian.net/browse/INFMTK-536. Satt som publicera ej.\r\n2020-07-03, vikee1: Lagt till kontext från Jira.\r\n2020-07-06, vikee1, marel67: Preliminärt definierad.\r\n2020-07-29, magfo: Ny definition och anmärkningar. Avskrivs i JIRA 536.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT', '-'),
(572, 'Vanligt engelskt uttryck för att hantera anläggningsresursrser, t ex fastigheter', '2020-03-24 10:35:51.000000', 'process inom organisation för att förvalta tjänster som stöder kärnverksamheten\r\n\r\nAnmärkning: I VGR:s begreppssystem 1.0  finns begreppet\r\n\r\n hantering av hälso- och sjukvårdsresurs ( 7.2.9.3)\r\n\r\nDefinitionen:  aktivitet (23.6.6) för att leda och styra tillgången på och användning av de hälso- och\r\nsjukvårdsresurser (7.2.9) som krävs för att utföra hälso- och sjukvårdsaktivitet (7.2)\r\n\r\nKälla Contsys SE.\r\n\r\nResursstyrning blir en generalisering till  hantering av hälso- och sjukvårdsresurs som ej finns i modell (3.4, Resurser).', '-', 'SS_EN 15221-1 2006, reviderad', 'Beslutad', 'resursstyrning', '-', 'facility management', '-', 37, '-', '2020-03-10, BB: Inkommet Slacksmål\r\n2020-03-24, BB: Klar!', '-', NULL),
