(577, 'Behöver översättas!\r\n\r\nEn popup ruta som dyker upp när man ordinerar läkemedel. Idetta fallet morfin.\r\nMeddelande i Millenium: \"This patient is missing tjeh following required documentation. Please document prior to placing an order. Click \'Document\' below to open the height, weight and allergies Power forum. Height not documentet. Sosing weight not documented. (Missa sista meddelandet)\"\r\n\r\nInträffar ofta när systemet behöver ha information som saknas.', '2020-03-10 10:22:15.000000', 'notifikation om att viss information måste dokumenteras', '-', '-', 'Beslutad', 'påminnelse om dokumentation', '-', 'dicern alert', '-', 56, 'Exempel: innan ordination kan utföras', '2020-03-10, BB: Förslag till definition', 'Inte definierad', NULL),
