(579, '-', '2020-07-27 11:46:23.000000', 'trådlös överföring av mätdata', '-', 'Svenska akademiens ordlista', 'Beslutad', 'telemetri', '-', '-', '-', 58, 'ANMÄRKNING 1: Telemetri används ofta för patientmonitorering av hjärtfunktionen men har en betydelse också utanför det sammanhanget.', '2020-03-11, Magnus F: Termen kom upp i FSR, där det visar sig att det finns en term \"hjärtövervakning\" i Skåne. Våra SME:er protesterade och ville ha termen telemetri, vilket är rimligt. Den är specialisering av den redan definierade termen patientmonitorering.\r\n2020-03-12, Perha11: Telemetri är ju ett brett begrepp som kan användas för olika typer av övervakning, inte bara hjärta även om jag kan tänka mig att det är vanligast.\r\n2020-05-12, verwi6, perha11:  TElemetri är ett bredare begrepp än hjärtövervakning. Kan termen ändra till hjärtmonitorering?\r\n2020-05-27, verwi6, perha11: Jira 689\r\n2020-06-09, karkj, magfo: Anmärkning tillförd avseende patientmonitorering av hjärtfunktionen, Posten beslutad.\r\n2020-07-27, magfo: definitionen justerad, posten beslutad.', '-', '-'),
(580, '\"No visitors\" är översatt fel till inga besökare detta är HÅRDKODAT! PAS-strömmen och Akutströmmen menar att det ska stå sekretess på denna termen. \r\n\r\nKontexten är att kan vara att patienten har en skydda identitet och detta måste kunna markeras under en registrering. Detta markeras i en rullista med Ja eller Nej.', '2020-07-07 15:30:16.000000', 'inte definierad', '-', '-', 'Publicera ej', '(no visitors)', '-', 'no visitors', '-', 59, '-', '2020-03-12, Perha11: \"Flyttat\" term till utlänsk term, tas upp med Skåne, kort B017.6\r\n2020-05-12, verwi6, perha11: till beslut med Skåne, Jira 177.\r\n2020-07-07, vikee1, davte1: Sätts till Publiceras ej baserat på input från PAS.', '-', '-'),
