(583, 'Hemläkemedel bör läggas in i ordlistan att vi avråder från denna term och hänvisa till den term som bestämts i samråd med Skåne.', '2020-06-25 11:23:50.000000', 'läkemedel som patient eller tredjepart inom hälso- och sjukvård har administrerat fram till dess hälso- och sjukvårdskontakt inleds', '-', 'Informatik VGR', 'Beslutad', 'läkemedel, förskrivna och receptfria', '-', 'home medication', '-', 62, '-', '2020-03-12, BB: Ersatte termen hemläkemedel men patientadministrerat läkemedel , lägger home medication som utlänsk term och  hemläkemedel som avrådd synonym.\r\n\r\n2020-03-27, vikee1: Ändrat status till pågående då beslut om översättning tillsammans med Skåne ej tagits ännu. Trollo B017.1.\r\n2020-05-14, perha11, verwi6: Beslut med Skåne kort , 560 Jira .\r\n2020-05-15, vikee1: Lägger detta till kortet Home Medication i Jira istället https://vgregionit.atlassian.net/browse/INFMTK-457\r\n2020-06-24, magfo: Av Skåne och VGR godkänd term införd. Definitionen kompletterad.\r\n2020-06-25, karkj, magfo: Definitionen reviderad. Beslutad.', '-', '-'),
(584, 'Ett begrepp som är översatt i patient översiktssidan under smärta delen. Heter det farmakologisk behandling i detta avseende? Eller vad säger man? Finns olika sätt att behandla smärta!', '2020-05-25 14:52:22.000000', '-', '-', '-', 'Publicera ej', 'Farmakologisk behandling', '-', 'Inte definierad', '-', 63, '-', '2020-04-06, 13:37:15: David och Martin. Är detta en synonym till läkemedelsbehandling?  Läkemedelsbehandling finns i vårdhandboken, se länk: https://www.vardhandboken.se/vard-och-behandling/lakemedelsbehandling/\r\n\r\n2020-05-25, perha11: Sätts till Publiceras ej. Behövs ej.', '-', '-'),
(585, 'kirurgiska drän i postop patientsöversikt - men vad är egentligen kirurgiska drän? och vad är det för skillnad mellan kirurgiska drän, drän och dränage (som jag tidigare skrivit in här)', '2020-05-25 14:48:41.000000', '-', '-', 'Inte definierad', 'Publicera ej', 'kirurgiska drän', '-', '-', '-', 64, '-', '- 2020-04-06, 13:23:25; David och Martin: Vi behöver mer klinisk kompetens för att utreda detta begreppet då vi inte hittar någon tydlig beskrivning mer än att drän är materialet och dränage är metoden. Detta går att hitta  i FAQDesign.\r\n2020-05-25, perha11: Bedömer att vi inte behöver detta begrepp i OLLI. Sätt till Publiceras ej i väntan på att ev aktualiseras. Inget kort.', '-', '-'),
(586, 'Final dose i doskalkylatorn. Översätts idag till sista dos i millennium. Eventuellt kan total dos passa bättre. Hårdkodat begrepp som behöver diskuteras med Skåne.', '2020-05-14 14:11:10.000000', 'Inte definierad', '-', '-', 'Publicera ej', '(final dose)', '-', 'final dose', '-', 65, '-', '2020-03-12, Perha11: Flyttat term till utlänsk term.\r\n2020-03-24, BB: Lägger till detta på Trellokort B017.5\r\n2020-03-30, Perha11: Ajla tar kortetet med Sofia.\r\n2020-05-14, verwi6, perha11: Kort i Jira 459, för avstämning med Skåne.\r\n2020-06-14, perha11: Dubblett, publiceras ej', '-', '-'),
(587, 'vikt, Läkemedelsdosering men kan det lika gärna heta ordinationsvikt? vad säger man?', '2020-04-21 14:23:30.000000', '-', 'Inte definierad', '-', 'Publicera ej', 'vikt, läkemedelsdosering', '-', '-', '-', 66, '-', '2020-04-06, vikee1, det finns ett kort i Trello (Vikt) som behandlar detta.\r\n2020-04-21, Perha11: Hänvisning till ordinationsvikt. Sätts till Publiseras Ej.', 'Inte definierad', '-'),
(588, 'Mätvärde benämns i modulen interaktiv vy - men vad är skillnaden mellan vitalparametrar och mätvärde?', '2020-03-12 12:03:00.000000', '_', 'Inte definierad', 'Inte definierad', 'Pågår', 'mätvärde', 'Inte definierad', 'Inte definierad', 'Inte definierad', 67, 'Inte definierad', '2020-08-15, magfo: Viktoria tycker att denna term inte ska definieras eftersom vi har \"mätvärden och vitalparametrar\" och hon undrar vad skillnaden är. Den är jättestor! Det finns vitalparametrar som inte är mätvärden, och de flesta mätvärdenär inte vitalparametrar. Vi måste få ett regionalt beslut om den uttömmande listan över vitalparametrar. Det finns källor som räknar upp fem, men ingenstans finns beslut. Begreppsposten återförs till pågår.', 'Inte definierad', '-'),
(589, 'Intake/ Output översätts till Intag/ Utsöndring gällande intag av vätska och förlust av vätska. Är det en bra översättning?', '2020-03-24 10:11:10.000000', '-', '-', '-', 'Publicera ej', '(Intake / Output)', '-', 'Intake / Output', '-', 68, '-', '2020-03-12, Perha11: Här behövs mer fakta.  Vad handlar det om, vad säger SME. Åter beställare!\r\n2020-03-24, BB: Tillsskrivit beställare om mer information.\r\n2020-05-06, verwi6, perha11: Ersätts av andra begrepp.', '-', '-'),
(590, 'PostOp IVA Snabba Vy är en översättning på ett band i iView. Översättningen bör ses över', '2020-03-12 12:10:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'PostOp IVA Snabba Vy', 'Inte definierad', 'Inte definierad', 'Inte definierad', 69, 'Inte definierad', '2020-04-07, vikee1, avvaktar en bättre översättning av Millennium.', 'Inte definierad', '-'),
(591, 'Åtgärdssteg eller tidstyper? \r\nMillenium kallar det åtgärdssteg och det är dokumentation som ssk gör för de steg man är i operationen. Ex. 1 - salstart, 2  patienttid start. osv. \"times sets the event\"\r\nTidstyper beskriver och registrerar hur lång tid en delmoment i operationen har tagit och tidstyperna i Orbit grundar sig från VGR(SPOR/SFAI) och SPOR.\r\nHär tänker jag att vi behöver ha ett getöga på för vad det ska kallas och att det står lika i flera olika strömmar. Är åtgärdssteg rätt översättning? Nyttjar ekonomi informationen som registreras och vilken term använder de sig av då? Skickar med en bild så får ni se hur det ser ut i systmetet.', '2020-05-14 14:12:59.000000', '-', '-', '-', 'Publicera ej', 'åtgärdssteg', '-', '-', '-', 70, '-', '2020-04-07, vikee1, finns ett kort i Trello som behandlar detta: https://trello.com/c/GVW2xAfu\r\n2020-05-14, Verwi6, perha11: Årer beställare för komplettering. Jira-Kort 548. Publiseras ej!', '-', '-'),
(592, 'Kirurgiskt fallnummer är en översättning i Millenium (skåneversion) som visar operationens nummer. I Orbit kallas det idag behandlingsnummer. Jag anser att det är en sådär bra översättning som behövs ses över.', '2020-05-25 14:57:14.000000', '-', '-', '-', 'Publicera ej', 'Kirurgiskt fallnummer', '-', '-', '-', 71, 'Föreslagen term: behandlingsnummer(Orbit).', '2020-04-06,14:00:10. David och Martin: föreslagen definition och ny term.\r\n\r\n2020-05-25, perha11: Sätts till Publiceras ej, termen  behandlingsnummer definieras ej.', '-', 'unik identifierare som hänvisar till en specifik operation'),
(593, 'Funktionalitet:\r\nEtt formulär som heter förregistrering men verksamhetsexperterna föreslog \"formulär för inkommande patient\" eftersom förregistrering inte reflekterar de förväntningarna som finns på förregistrering. Eftersom \r\ndenna funktionen fungerar som en post-it lapp men att den inte följer med i patientens journal. Den kommer finnas med om man söker upp den och kan läsa utanför journalen.\r\n\r\nKontext:\r\nFormulär för inkommande patienter fylls i vid inringande ambulans, polis eller mottagning i primärvård.\r\n\r\nWorkflow är från Skåne men det kommer att skapas ett eget workflow i VGR.', '2020-06-23 09:24:28.000000', '[Millennium FirstNet] anteckning med information om en eller flera patienter som beräknas komma till akutmottagning', '-', 'Informatik VGR', 'Beslutad', 'föranmälan', '-', 'Pre-arrival', '-', 72, 'ANMÄRKNIING 1:  Föranmälan används när patient (eller flera patienter) är på ingående till akuten till exempel från olycksplats eller i akut dåligt skick och ambulanspersonal vill förvarna utan att garantera patientns identitet. På det sättet kan traumarum/akutrum förberedas innan man vet vilken person det är som kommer. Självklart kan detta användas för att dimensionera mottagandet och t.o.m bidra till beslut om stabsläge eller förstärkningläge.', '2020-04-16, Perha11: Termen verka ok men behöver mer för en definition som är precis. Tillskriver beställare.\r\n2020-04-30, Perha11 BV: Termen benämner hela begreppet och behöver inte definieras.\r\n2020-06-17, vikee1, davte1: Eftersom översättning av den engelska termen har gjorts till ett allmänbegrepp har vi valt att ge det en beskrivning av dess funktionalitet i Millennium istället för en definition.\r\n2020-06-23, karkj, magfo: Begreppsposten kompletterad, definition fastställd. Beslutad.', '-', '-'),
(594, 'Är en procedur som görs inom kardiologi.\r\nKommer vara en order i Millennium.\r\nDen engelska termen är: Head up tilt test (HUTT)', '2020-05-27 14:51:52.000000', '-', '-', '-', 'Publicera ej', 'tippbrädetest', '-', '-', '-', 73, '-', '2020-04-16, Perha11:  Utredningsmetod? Tillskriver beställare, tveksamt om vi ska ha med specifika metoder i OLLI.\r\n2020-05-27, verwi6, perha11: Publicera ej i vänta på återaktualisering.', '-', '-'),
(595, 'Frekvenser/Frequencies \r\nTidsintervall mellan administreringstillfällen av samma läkemedelsprodukt. \r\nt ex  2 ggr/dag, 3 ggr/dag, morgon, eftermiddag, till natten, var 3:e månad osv.\r\n\r\nrekommenderad term (NI):  Doseringsintervall', '2020-06-04 09:53:30.000000', '[läkemedel] tid för administrering av läkemedel', '-', 'Informatik VGR', 'Beslutad', 'administreringstillfälle', '-', '-', '-', 74, 'ANMÄRKNING 1: Socialstyrelsen använde doseringsintervall (rekommenderad term) synonymt med administreringsintervall (tillåten term) med definitionen: tidsintervall mellan administreringstillfällen av samma läkemedelsprodukt.\r\n\r\nVGR väljer att använda tillfälle istället för intervall eftersom administreringen inte alltid sker med jämna mellanrum (intervall).', 'Begreppsmodell Ordination (när den blir gjord)\r\n\r\n2020-04-07, vikee1, definierad.\r\n2020-04-09, Perha11, BB: Term och definition ändrad utifrån diskussion med Sofia från strömmen.\r\n2020-05-05, Perha11, Karkj: Definitionen justerad, anmärkning tillagd, beslutad.\r\n2020-05-29, perha11: Tillför information från \"Helens dokument\". Preliminär.\r\n2020-06-04, karkj, magfo: Definitionen kortad. Beslutad.', '-', 'Socialstyrelsen anger \r\nTermen: administreringstillfälle\r\nBeskrivning i begreppsmodell: Tillfälle då ett läkemedel tillförs kroppen'),
(596, 'Anestesibedömning är namnet på formulär/protokoll i Millenium. Det efterfrågas ett bättre begrepp då momentet innehåller bedömning och ordination av anestesi. Förslag: Ordiniation av anestesi.', '2020-05-14 14:16:52.000000', 'Inte definierat', '-', '-', 'Publicera ej', 'anestesibedömning', '-', '-', '-', 75, '-', '2020-04-07, vikee1, skapat ett Trello-kort för detta https://trello.com/c/zhaKRJ2E\r\n2020-05-14, verwi6, perha11: Åter beställare för komplettering. Jira-kort 196, Publiseras ej!', '-', '-'),
(597, 'Ett test som görs genom att låta patienten dricka vatten för att se om patienten kan svälja ordentligt.', '2020-03-18 15:39:00.000000', 'test för att se om patienten kan svälja ordentligt', 'Inte definierad', 'Snomed CT', 'Beslutad', 'bedömning av sväljfunktion', 'Inte definierad', 'Inte definierad', 'Inte definierad', 76, 'Länk till begreppet i Snomed CT:\r\n https://browser.ihtsdotools.org/?perspective=full&conceptId1=62001000052101&edition=MAIN/SNOMEDCT-SE/2019-11-30&release=&languages=sv,en', '2020-04-07, vikee1, definierad', 'Inte definierad', '-'),
(598, 'Utskrivningsklar och Utskrivningsklardatum används inom processen Samverkan vid utskrivning från sluten hälso- och sjukvård Lag (2017:612).\r\nFörvillande och blandas ihop med Utskrivningsdatum.\r\n\r\nEnligt hävd har det sagts att Utskrivningsklar är ett medicinskt beslut om när patienten inte längre behöver slutenvårdens resurser.\r\nDock är det inte säkert att patienten är klar för utskrivning, då det kan krävas insatser av kommunen och/eller primärvård innan patienten kan gå hem.\r\nHemgångsklar skulle vara ett bra begrepp för när patienten verkligen kan gå hem.\r\nDessa processer hanteras inom FVM av Primärvård, men hör mer hemma i Medicinsk och vårddokumentation.', '2020-03-19 07:59:00.000000', 'patient som av behandlande läkare inte längre bedöms behöva sluten vård', 'Inte definierad', 'Socialstyrelsens termbank', 'Beslutad', 'utskrivningsklar', 'Inte definierad', 'Inte definierad', 'Inte definierad', 77, 'Ej att förväxlas med begreppet hemgångsklar.', '2020-04-07, vikee1, definierad', 'Inte definierad', '-'),
(599, 'Processen Samverkan vid utskrivning från sluten hälso- och sjukvård Lag (2017:612).\r\n\r\nEnligt hävd har det sagts att Utskrivningsklar är ett medicinskt beslut om när patienten inte längre behöver slutenvårdens resurser.\r\nDock är det inte säkert att patienten är klar för utskrivning, då det kan krävas insatser av kommunen och/eller primärvård innan patienten kan gå hem.\r\nHemgångsklar skulle vara ett bra begrepp för när patienten verkligen kan gå hem.\r\nDessa processer hanteras inom FVM av Primärvård, men hör mer hemma i Medicinsk- och Vårddokumentation.', '2020-03-19 08:01:00.000000', 'då alla förutsättningar finns på plats för en säker utskrivning till hemmet', 'Inte definierad', 'VGR', 'Beslutad', 'hemgångsklar', 'Inte definierad', 'Inte definierad', 'Inte definierad', 78, 'Hemmet kan i detta fall utgöras av ett boende tillhandahållet av kommunen.', '2020-04-07, vikee1, definierad', 'Inte definierad', '-'),
(600, 'stöttning/hjälp ist för assistans (cerner term)\r\n\r\nI primärvården så reagerade det relativt kraftigt på termen \"assistans behov\" under \"Alla bedömningar - ADL\", SMEer vill hellre se ett ord såsom \"stöttning\" \"hjälp\" då en patient behöver hjälp/stöttning vid exempelvis förflyttning. Något som någon annan har mött på?', '2020-05-19 10:54:22.000000', 'hjälp att lösa upp­gift', '-', 'Svensk ordbok (reviderad)', 'Beslutad', 'assistans', '-', '-', '-', 79, '-', '2020-03-19, BB:  Åter till Olle via Slack för fortsatt utredning till enat begrepp. Behövs en ytterligare informatisk utredning - skapa Trello-kort https://trello.com/c/BEqVEXor\r\n2020-05-14, verwi6, perha11: Preliminärt definierat\r\n2020-05-19, karkj, perha11:  Beslutad.', '-', '-'),
(601, 'När man vill avsluta/ta bort sonden vill man ange orsak. Ett befintligt val i det vi tittar på är \"indikation saknas\", men det är ju dubbeltydigt. Dvs indikation för att ha sonden saknas eller det saknas en rimlig indikation för att ta bort sonden. Diskussionen leder till att motsvarande uppgift återkommer i många olika situationer - dvs frågan är en generell beskrivning för \"avslutad behandling\"', '2020-03-19 13:49:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Ta bort sond/ ange orsak', 'Inte definierad', 'Inte definierad', 'Inte definierad', 80, 'Inte definierad', '2020-04-07, vikee1, skapat ett kort i Trello, https://trello.com/c/wDaWzHhD', 'Inte definierad', '-'),
(602, 'Duration hur länge en ordination ska ges till en patient önskar Cerner som har hårdkodat det och inte kan ändra. Den användningen är felaktig. Se behandlingslängd.\r\n\r\nDCW: Pharmnet Inpatient', '2020-08-08 21:45:47.000000', 'den tid som något varar', '-', 'FASS, LIF ordlista 2008, reviderad (kortad)', 'Beslutad', 'duration', 'period of time that something lasts\r\n\r\nKälla: Medicinsk ordbok.se', 'duration', '-', 81, 'ANMÄRKNING 1: exempel effekt av en läkemedelsdos.', '2020-03-31, BB: Definierad och klar. Synonym varaktighet tillagd.\r\n2020-08-08, magfo: definitionen ädrad enligt FASS.', '-', '-'),
(603, 'definition av avdelning saknas och är intressant när man bygger operationanmälan i Millenium.', '2020-03-24 09:39:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'avdelning', 'Inte definierad', 'Inte definierad', 'Inte definierad', 82, 'Avdelning är en synonym till begreppet enhet.', '2020-04-07, vikee1, definieras ej då det anses vara en synonym till begreppet enhet.', 'Inte definierad', '-'),
(604, 'En första bedömning av patienten (en form av triage i luckan). Sjuksköterskan/kanslisten gör en snabb undersökning på patienten innan triagering för att se om patienten ska in på akuten eller skickas någon annanstans. På barnakuten används detta framförallt för att skilja på patienter som kommit fel, de slussas vidare till en annan mottagning. För vuxna så används detta dels för att slussa vidare patienter som kommit fel men även när triageringsprocessen tar för lång tid.', '2020-06-09 11:11:24.000000', 'initial utredande aktivitet som syftar till att styra patient till adekvat process', '-', 'Informatik VGR', 'Beslutad', 'förstabedömning', '-', '-', '-', 83, 'ANMÄRKNING 1: En inledande bedömning av patienten som görs enligt vissa kriterier. Kan göras  utan att prover tas. Baserat på allmäntillstånd, smärta, vakenhetsgrad etc kan personalen avgöra om patienten  t ex kan skickas vidare till primärvården i stället för att tas om hand på akuten eller vice versa.\r\n\r\nANMÄRKNING 2: Begreppet omfattar den första bedömningen av en vårdbegäran, t ex remissbedömning.\r\n\r\nANMÄRKNING 3: Förstabedömningen kan leda till att patienten återgår hem, att triage ska utföras eller att akuta åtgärder omedelbart sätts in.', '2020-04-07, vikeen1, definierat begreppet.\r\n2020-06-09, karkj, magfo, perha11: Bearbetad, förädlad, omdefinierad och beslutad!', '-', '-'),
(605, '-', '2020-03-24 11:43:36.000000', 'tillstånd som är den huvudsakliga anledningen till en vårdkontakt, fastställd vid vårdkontaktens slut', '-', 'Socialstyrelsen termbank, reviderad', 'Beslutad', 'huvuddiagnos', '-', '-', '-', 11, 'Anmärkning: När diagnos rapporteras till Socialstyrelsen vid avslut av vårdtillfälle ska en diagnos markeras som huvuddiagnos.\r\n\r\nTillhör kapitel 26 i begreppssystemet 1.2', '[‎2020-‎03-‎24, BB: Tillagt, definierat och klart.', '-', NULL),
(606, '-', '2020-03-24 11:46:25.000000', 'annat tillstånd än huvuddiagnos som blivit föremål för bedömning, utredning eller behandling under en vårdkontakt', '-', 'Socialstyrelsen termbank', 'Beslutad', 'bidiagnos', '-', '-', '-', 11, '-', '2020-03-24, BB: skapat begreppet och fullbordat ärendet.', '-', '-'),
(607, 'Är ett begrepp som används olika av verksamheter, på Östra heter det primär team bedömning (PTB) i Kungälv heter det läkartriage. Ett alternativt förslag är primärbedömning. Då PTB innefattar att hela teamet ska delta fast oftast är det endast en läkare som utför bedömningen. Innebär att en läkare gör en snabb bedömning i stället för att en triagering utförs. Man tar därför inte alla vital parametrar innan patienten träffar läkaren och patienten får därför inte någon prioriteringsgradering. Vitalparametrarna tas samtidigt som läkaren träffar patienten. Detta ska gå fort och max 15 minuter inklusive administrerande uppgifter. Tanken med denna processen är att vinna tid och slippa utföra onödiga aktiviteter som provtagning.\r\n\r\nMagnus tyckte att spotcheck skulle vara underordnat detta begrepp då det också är en första bedömning. Se spotchek för kontext.', '2020-06-16 10:59:37.000000', 'initial bedömning av patient som söker med vårdbegäran', '-', 'Informatik VGR', 'Beslutad', 'primärbedömning', '-', '-', '-', 84, 'ANMÄRKNING 1: Begreppsbyrån har utrett terminologin kring primärbedömning med alla dess synonymer såsom PTB och spotcheck. Primärbedömning framstår som ett överordnat begrepp avseende den allra första bedömningen som någon gör av en patient. I beskrivning av synonymerna framgår att ett team kan göra primärbedömning. En hastig okulärbesiktning kan också vara primärbedömning. En primärbedömning görs alltid efter vårdbegäran, d v s patienten söker spontant eller efter hänvisning.\r\n\r\nANMÄRKNING 2: Begreppsbyrån har funnit minst tre underordnade begrepp som alla fyller krav på primärbedömning: de utgör den allra första bedömningen och de syftar till att den fortsatta handläggningen ska följa en fastställd plan. De tre begreppen är förstabedömning, teambedömning och triage.', '2020-04-07, vikee1, skapat ett kort i Trello, https://trello.com/c/fwc2t7WF\r\n2020-05-14, vervi6, perha11: åter till beställare för vidare utredning, Jira: 550, Publiceras ej!\r\n2020-06-16, karkj, magfo: definitionen förädlad, begreppsposten beslutad.', '-', '-'),
