(612, 'vårdnivå efter operation (postoperativ vårdplats) \r\n-postop, postop nattplats, IVa, enskilt övervakningsrum, intermediärvårdplatser. \r\n(det finns olika timintervaller för postop plats - vissa går efter bara några timmar).', '2020-05-14 10:18:06.000000', 'intensitet i hälso- och sjukvård som tillhandahålls', '-', 'Terminologifrämjandet, reviderad', 'Beslutad', 'vårdnivå', '-', '-', '-', 89, 'ANMÄRKNING 1: Kan användas i olika sammanhang, t.ex. efter operation.\r\n\r\nANMÄRKNING 2: Snomed CT har inte begreppet vårdnivå men anger 397711004 |lika och jämförbar vårdnivå erbjuds oberoende av vårdgivare| \r\n\r\nExempel 1: intensivvård, intermediärvård, enskilt övervakningsrum', '2020-05-14, verwi6, perha11: Sätter preliminar som provskott.\r\n2020-05-14, karkj, magfo: Källan rättad. En hänvisning till SCT tillagd. Termposten beslutad.', '-', '-'),
(613, 'Kan vi döpa våra ”hjälpdokument” till läkare & sjuksköterska till behandlingsföreskrift? Det kommer att innehålla en del medicinska riktlinjer om t.ex. när man bör dosreducera & vilka läkemdel som ska ges om patienten t.ex. går upp i vikt under behandlingen eller om urinen får lågt pH. Dessutom innehåller en behandlingsföreskrift ofta lite kort information om specifika biverkningar, kontroller som ska tas före &/eller under behandlingen & annat som läkare & ssk behöver uppmärksamma.', '2020-05-25 15:42:27.000000', '-', '-', '-', 'Publicera ej', 'behandlingsföreskrift', '-', '-', '-', 90, '-', '2020-04-16, Perha11: Tillskriver beställare och pekar på begreppen kunskapsunderlag, vårdriktlinje, lokalt anpassad riktlinje och medicinsk riktlinje som finns i vårt begreppssystem. Dessa har relationer till begreppet vårdplan. Dessa begrepp borde täcka behovet?\r\n\r\n2020-05-25, perha11: Sätts till publiceras ej. Anser att vi har tillräckligt med begrepp för ämnet och ett pågående arbete med  flera.', '-', '-'),
(614, 'I Onkologi har vi \"problem history\" som är inte i multi-swedish och kan beskrivas som \"problem history\" att det både var tidigare sjukdomar & ingrepp, som en operation, eller ett brutet ben, högt blodtryck osv.', '2020-05-27 14:50:11.000000', '-', '-', '-', 'Publicera ej', 'problem history', '-', '-', '-', 91, '-', '2020-04-08, Marel67, Kontaktat beställaren för vidare hantering\r\n2020-04-30, Perha11 BV: Kan utredas tillsamman med Patientbakgrund, Trello kort B022\r\n2020-05-27, verwi6, perha11: Publiceras ej i väntan på ny information eller aktualisering', '-', '-'),
