(617, 'Efterfrågas en definition av begreppet träning i förhållande till behandling.\r\n\r\nFörslag på definition:\r\nmetodiska försök att förbättra någon färdighet genom särskilt anpassade övningar', '2020-05-25 15:18:14.000000', '-', '-', '-', 'Definiera ej', 'träning', '-', '-', '-', 94, '-', '2020-04-08, Verwi6: åter till beställaren för förtydligande av begreppskontext\r\n2020-05-25, perha11: Allmänbegrepp, DEfinieras ej.', '-', 'KOMMENTAR 1: Allmänbegrepp som inte definieras'),
(618, 'H&P (history & physical) används i Millenium och översätts (enligt SME+Soki) till anamnes och status eller hälsoinformation. Anamnes kan vara bra att få definierat.', '2020-05-12 14:22:08.000000', 'patientens beskrivning av sitt hälsotillstånd', '-', 'Informatik VGR', 'Beslutad', 'anamnes', '-', '-', '-', 95, '-', '2020-04-09, Perha11, BB: Preliminär definition från Medicinsk ordbok. se. Trello-kort  https://trello.com/c/BjEFTem för vidare bestämning .\r\n2020-05-12, verwi6, perha11: till beslut.\r\n2020-05-12, karkj, perha11, magfo: Definitionen reviderad, termposten beslutad.', '-', '-'),
