(620, 'I startdomänen från Skåne står det trackingshell borde ha ett svenskt namn som patienttavla men detta får beslutas. Finns fler begrepp som inte är översatta korrekt infusion therapy, infusion therapy check out - De här kanske måste vara egna term?', '2020-05-28 14:04:58.000000', 'inte definierat', '-', '-', 'Publicera ej', 'patienttavla', '-', 'tracking doard', '-', 97, '-', '2020-03-31, Perha11: Till diskussion med Skåne, kort b017.6.\r\n2020-05-14, verwi6, perha11,: till beslut med Skåne. Jira: 178\r\n2020-05-28, marel67, perha11: Efterfrågar mer information om funktionen för att kunna definiera begrepper. Lagt till den svenska termen patienttavla. Publiceras ej i väntan på ny information.', '-', '-'),
(621, 'Står i startdomänen från Skåne behöver översättas till svenska till eventuellt \"besökstid i längd?\" detta behöver beslutas', '2020-05-27 14:56:34.000000', '-', '-', '-', 'Publicera ej', '(LOS - length of stay)', '-', 'LOS - length of stay', '-', 98, '-', '2020-04-16, Perha11 BB: Till Trellokort  Bo17-6 https://trello.com/c/q8JbkM8G, Samarbete Skåne\r\n2020-05-27, verwi6, perha11: Publiceras ej i väntan på återaktualisering', '-', '-'),
(622, 'vet ej vad detta begrepp innebär står i Iview i Millennium som en del av vikt\r\n\r\nKontext: \r\n\r\nIdealvikt: I VGR så används idealvikt för att uppskatta en patients vikt.\r\n\"Då de flesta läkemedel vi använder på IVA har en fördelningsvolym som i första hand omfattar den\r\nfettfria delen av kroppsmassan. Det är då olämpligt att använda sig av den vägda patientvikten för\r\natt dosera läkemedel. Det kan ge en betydande överdosering av läkemedel med ökad biverkningsrisk\r\nsom följd. Det samma gäller både för ventilation och nutrition\". -\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/13848/Idealvikt%20-\r\n%20ber%C3%A4kning.pdf?a=false&guest=true (2020-04-02 tid: 15:21)\r\nEnligt en rutin från VGR så tar man patientens längd och subtraherar den med 100 cm för att få\r\npatientens idealvikt, dvs. om en patient är 175 cm lång är idealvikten 75 kg. Vid kraftigt överviktiga\r\npatienter så används uppskattad idealvikt, Idealvikt används i situationer när:\r\n• Vid all dosering av läkemedel i Clinisoft som doseras i dos per vikt.\r\n• När man programmerar pumparna för kontinuerlig tillförsel av läkemedel efter dosprotokoll.\r\n• Vid dosering av nutrition, men där måste man även ta hänsyn till patientens nutritionsstatus\r\nnär de läggs in på IVA (se separat riktlinje nutrition)\r\n• När vi skriver in patient i Philipskåpet.\r\nKällor:\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/13848/Idealvikt%20-\r\n%20ber%C3%A4kning.pdf?a=false&guest=true (2020-04-02 tid: 15:21)\r\nhttps://narkosguiden.se/book/intravenos-anestesi/ (2020-04-02 tid: 15:27)\r\n\r\n2020-04-15, Perha11; Jämför doseringsvikt', '2020-04-21 15:13:50.000000', '-', 'Inte definierad', '-', 'Publicera ej', 'idealkroppsvikt', '-', '-', '-', 99, '-', '2020-04-07, vikee1, Finns ett kort i Trello på detta. https://trello.com/c/8K0YkrAd\r\n2020-04-14, marel67 Uppdatering av kontext utifrån information i trellokort\r\n2020-04-21, Perha11: Lägger begreppet som synonym till doseringsvikt, väljer  Status publiseras ej', 'Inte definierad', '-'),
(623, 'Detta begrepp finns i Interaktiv vy. Vi skulle tro att man menar ursprungslängd och då  vill vi ändra detta begrepp då äldre patienter krymper med ålder och en del äldra patienter blir framåtlutande\r\n\r\nI onkologi har vi en översättning av \"usual height\" till \"normal längd\". SME och SOKI tycker det är fel och behöver ett nytt översättning, men tyvärr hade dem inte någon förslag.\r\n\r\nI grunden är det längste längden man har varit, eftersom längden kan minskar under cancer behandling och ålder.', '2020-08-05 13:13:20.000000', 'största kroppslängd som uppmätts hos person', '-', 'Informatik VGR', 'Beslutad', 'maximilängd', '-', '-', '-', 100, 'ANMÄRKNING 1: Diskussion som förekommit: Är \"ursprunglig kroppslängd\" ett bättre alternativ som term för detta begreppet? Normallängd känns mer som att det är ett medianvärde av en större grupp av människors medellängd, t.ex. medianvärdet av hur långa människor är i ett land.', '2020-04-16, Perha11, BB: Tillskriver beställare om mer information.\r\n2020-05-14, verwi6, perha11:  Jira-kort 545 till Liam. Publiceras  ej\r\n2020-06-10, marel67, verwi6: begreppet finns redan inlagt i olli (normallängd). Ligger under publiceras ej. Finns även kort i jira, 545. Flyttat till pågår.\r\n2020-06-11, perha11: Flyttat in text i kontext handläggning från dubblettbegrepp.\r\n2020-06-23, davte1, ajla. Gjort en preliminär definition och skrivit en anmärkning. Flyttat begreppet till preliminär.\r\n2020-06-23, karkj, magfo:  Begreppsutredningen inte klar. Brev till Mia Delin. Posten ändras till pågår.\r\n2020-06-23, magfo: term och definition skrivna\r\n2020-08-05, ollka3, magfo: Beslutad.\r\n2020-08-11, karkj, magfo: Anmärkningen ändrad.', '-', '-'),
(624, 'Detta begrepp står i interaktiv vy i Millennium\r\nvi tror detta är doseringsvikt och behöver översättas rätt', '2020-06-18 11:35:19.000000', '[läkemedelsdosering] kroppsvikt som utgör underlag för läkemedelsordination', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'ordinationsvikt', '-', '-', '-', 101, 'Anmärkning 1: Ordinationsvikt kan vara patientens uppmätt kroppsvikt, en uppskattad vikt i en akut situation, alternativ en medveten justerad vikt, så kallad torrvikt eller idealvikt. \r\n\r\nAnmärkning 2: För barn ska man utföra en rimlighetskontroll enligt rutin, barnet ska vägas på nytt för att säkerställa att registrerade värden inte är för gamla.', '2020-04-07, vikee1: Finns ett kort i Trello kring detta. https://trello.com/c/8K0YkrAd\r\n2020-04-15, Perha11: Kolla även kroppsvikt och målvikt\r\n2020-04-21, Perha11: Skapa definition och anmärkningar. Lagt idealkroppsvikt som tillåten synonym. Sätt som preliminär bedömning.\r\n2020-04-28, Perha11 BB: Beslutad!\r\n2020-06-14, karkj, perha11: Åter för definition, def fel. Preliminär\r\n2020-06-18, karkj, magfo: Fastställd.', 'Inte definierad', '-'),
(625, 'En bedömningsskala som används i Interaktiva vyn , för att bedöma puls, blodtryck andningsfrevens, temperatur vilken skala rekommenderar VGR att vi ska använda för detta.', '2020-03-26 11:10:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'EWS ( NEWS)', 'Inte definierad', 'Inte definierad', 'Inte definierad', 102, 'Inte definierad', '2020-04-07, vikee1, NEWS är definierat redan. Det är inte upp till informatik att besluta om VGR ska använda NEWS eller inte.', 'Inte definierad', '-'),
(626, 'Står inte översatt  i interaktiva vyn så som man säger i vården PICC line eller PICC line kateter', '2020-03-26 11:11:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'PICC kateter', 'Inte definierad', 'Inte definierad', 'Inte definierad', 103, 'Inte definierad', '2020-04-07, vikee1, kort skapat i Trello till WS om de inte kan göra konfigurationen av detta själva.\r\nhttps://trello.com/c/NLqDhww7', 'Inte definierad', '-'),
