(628, 'definition:\r\ntidsavsnitt ofta avgränsat på grundval av övergångar i något förlopp\r\n\r\nKälla: Svensk Ordbok 2009', '2020-03-26 14:30:00.000000', 'tidsavsnitt ofta avgränsat på grundval av övergångar i något förlopp', '-', 'Svensk Ordbok 2009', 'Beslutad', 'period', '-', '-', '-', 105, '-', '2020-03-26, vikee1: Lagt till begrepp, PDL-arbetet', '-', '-'),
(629, 'definition:\r\n\r\nflerfaktorsautentisering\r\n\r\nKälla: IDG IT-ordlista\r\n\r\nKommentar: autentisering (identitets­kontroll) med krav på minst två former av information. Man kan till exempel ha lösenord, smartkort och biometrisk autentisering att välja mellan. \r\n\r\nexempel: Siths-kort (tjänsteid), mobilt bankid', '2020-03-26 14:32:00.000000', 'flerfaktorsautentisering', '-', 'IDG IT-ordlista', 'Beslutad', 'stark autentisiering', '-', '-', '-', 106, 'autentisering (identitets­kontroll) med krav på minst två former av information. Man kan till exempel ha lösenord, smartkort och biometrisk autentisering att välja mellan. \r\n\r\nExempel: Siths-kort (tjänsteid), mobilt bankid', '2020-03-26, vikee1: Lagt till begreppet från PDL-arbetet', '-', '-'),
