(634, '-', '2020-03-27 13:58:07.000000', 'hälso- och sjukvård (3.1.1) som bedrivs på distans med hjälp av informations- och telekommunikationsteknik', '-', 'Socialstyrelsens termbank', 'Beslutad', 'telemedicin', '-', '-', '29.6', 1, 'Anmärkning 1:\r\n\r\nBegreppet innefattar all synkron kommunikation med patienten via telefon och digitala medier där båda deltagarna har röst- (och eventuell bild-)kontakt. Om kommunikationen är asynkron, dvs. patient och hälso- och sjukvårdspersonal deltar inte samtidigt (brevväxling på papper, via e-post eller 1177) kallas det korrespondens.', '2020-03-27, Perha11: Lagt in begreppet från begreppsmodell Tid', '-', '-'),
(635, 'SMEr önskar ha detta som alternativ att välja på vart patienten ska vårdas efter operation. \r\n\r\n\r\n\"På IMA tar vi dygnet runt emot patienter direkt från Intensivakuten och andra avdelningar som är i behov av fortsatt avancerad vård. Våra vanligaste patienter är de med akut medicinska, infektiösa och kirurgiska sjukdomstillstånd.\" (taget från Karolinska.se)', '2020-04-28 10:48:06.000000', 'vårdmetod och omvårdnadsåtgärder för patient med ett vårdbehov som inte kan tillgodoses på vårdavdelning utan att intensivvårdens fulla behandlings- och övervakningsmöjligheter krävs', '183000004', 'Informatik VGR', 'Beslutad', 'intermediärvård', '-', '-', '-', 108, '-', '2020-04-09, Perha11, BB: Definition skapad utifrån interna VGR-dokument och Snomed CT. Det sammansatta begreppet intermediärvårdavdeling definieras inte.\r\n2020-04-28, Perha11 BB: Definition reviderad, Beslutad.', 'Snomed CT', '-'),
