(637, 'I MPages \"draind and tube\" komponent, står det \"infoga\"  när man sätter in en slang under huden för att ger medicin. Till synes står det i Melior som \"datum(in)\" när slangen sätts in, och \"datum(ut)\" när det tas bort.', '2020-03-31 11:58:00.000000', 'Inte definierat', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'infoga', 'Inte definierad', 'Inte definierad', 'Inte definierad', 109, 'Inte definierad', '2020-04-07, vikee1, begreppet definieras ej.', 'Inte definierad', '-'),
