(640, 'K.förvaltningen vill skapa ett kodverk för remisser och deras status under olika tillfällen under en vårdbegäran.\r\n\r\nEx preliminärt besvarad remiss av en AT-läkare, en ST-läkare ska kolla igenom den innan den uppfattas som helt besvarad.', '2020-05-25 14:59:52.000000', 'frågeställning har besvarats preliminärt och svarande enhet har för avsikt att skicka ytterligare \r\nkompletterande svar', 'Inte definierad', 'Informatik VGR', 'Publicera ej', 'preliminärt besvarad', '-', '-', '-', 112, '-', '2020-04-07, vikee1, definierat.\r\n2020-04-21, Perha11: Källa saknas, status pågår > åter Viktor\r\n2020-05-05, Perha11, Karkj: Åter för utredning, Jirakort 471, mailat kodverk/Lai\r\n2020-05-25, perha11: Sätts till Publiceras ej i väntan på utredning. Jira 471', 'Inte definierad', '-'),
(641, 'K.förvaltningen ska skapa ett kodverk om de olika status en remiss kan ha i en vårdbegäran. \r\n\r\nExempel: Delvis besvarad remiss på labb. 4/10 labbprover utförda och bedömda.', '2020-04-07 11:15:00.000000', 'frågeställning har besvarats delvis och svarande enhet har för avsikt att skicka ytterligare svar', 'Inte definierad', 'Inera, kodverksförvaltning', 'Beslutad', 'delvis besvarad', '-', '-', '-', 113, '-', '2020-04-07, vikee1, definierat.', 'Inte definierad', '-'),
(642, 'Välfärdsteknologi, välfärdsteknik, digitalisering, egenmonitorering, e-tjänst, hjälpmedel, digitala hjälpmedel, förskrivare, ordinatör, ordination osv.....', '2020-04-09 13:54:00.000000', '-', '-', '-', 'Publicera ej', 'Välfärdsteknik och välfärdsteknologi i relation till medicinteknisk produkt och personligt förskrivna hjälpmedel', '-', '-', '-', 114, '-', '2020-04-09, Perha11: Skickar mail till beställaren med frågor om vad hon vill med sin framställan. \r\nJenny svarar att hon vill ha allt! Får instruktion, begreppet tas bort.', '-', '-'),
(643, 'Premedicinering sker innan patient opereras, ska ej förväxlas med morgonmedicin. Premedicinering dokumenteras i operationsmodulen och där dokumenteras det som \"premedicinering given\" innan patient genomgår ett ingrepp. Begreppet som bör finnas i läkemedelsmodulen men operationsströmmen vill kunna bocka in om premedicinering har givits till patient.', '2020-08-13 14:39:59.000000', 'läkemedelsbehandling inför operation och medicinsk undersökning i syfte att hindra subjektiva och objektiva komplikationer', '-', 'Läkemedelsverket: Ordlista | 2016, reviderad i betydande grad', 'Beslutad', 'premedicinering', 'administration of sedatives prior to surgery or examination\r\n\r\nKälla: Medicinsk ordbok.se', 'premedication', '-', 115, 'ANMÄRKNING 1: Subjektiv komplikation kan vara illamående och oro etc., objektiv komplikation kan vara bradykardi och kräkning etc. Behandlingen syftar till att minska patientens obehag såsom smärta och oro (vilket Läkemedelsverkets definition inskränker sig till) samt vegetativa symtom som kan skada patienten såsom kräkning och hjärtarytmi.\r\n\r\nANMÄRKNING 2: Premedicinering ordineras alltid som del av anestesi.', '2020-04-09,  Perha11: Definition hämtad från läkemedelsverket. Klart!\r\n2020-08-11, karkj, magfo: Definitionen ändrad för att bredda begreppet.\r\n2020-08-13, helse4, magfo: Anmärkning 2 tillagd.', '-', '-'),
(644, 'Målvikt: Målvikt är torrvikt vare sig under eller övervikt. En referenspunkt som man siktar mot.\r\nSynonym för Dialys(Kommentar trellokort). Målvikt är en vikt som man strävar efter att nå genom\r\natt minska eller öka sin kroppsvikt.\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/3340/Indikationer%20f%c3\r\n%b6r%20operation%20av%20v%c3%a4vnads%c3%b6verskott%20p%c3%a5%20buk.pdf?a=false&gue\r\nst=true (2020-04-02 tid: 15:12)', '2020-04-28 11:08:02.000000', 'vikt som eftersträvas genom att minska eller öka kroppsvikten', 'SCTID: 390734006', 'Informatik VGR', 'Beslutad', 'målvikt', '-', 'target weight', '-', 116, '-', '2020-04-15, Perha11: Preliminärt definierad, inkl SCTID\r\n2020-04-28, Perha11 BB: Juaterad, beslutad!', 'Snomed CT', '-'),
(645, 'Torrvikten är den vikt vid vilken patienten har en normal mängd vatten i kroppen.\r\n\r\nhttps://www.vardhandboken.se/katetrar-sonder-och-dran/dialys/dialys-peritonealdialys/omvardnad/', '2020-04-14 10:53:09.000000', '[dialys] patients kroppsvikt med normal mängd vatten i kroppen', '-', 'Vårdhandboken, reviderad', 'Beslutad', 'torrvikt', '-', '-', '-', 117, 'Kommentar 1: Patientens torrvikt bestäms med hjälp av blodtrycksmätning, lungröntgen, anamnes och klinisk observation. (enligt Vårdhandboken.se)', '2020-04-15, Perha11: Preliminär definition föreslagen.\r\n2020-04-28, Perha11 BB: Justerad och beslutad', '-', '-'),
(646, 'Från trellokort:\r\n\r\nKroppsvikt: En människa eller djurs personliga vikt.\r\n\r\nKällor:\r\nBeräkning görs utifrån Kroppsvikt (angiven ordinationsvikt). Beräkning kan ske per dygn på en eller\r\nflera tillfällen eller per dos, med olika beräkningsenheter beroende på läkemedlets styrkeenhet.\r\nLäkemedel med en styrkeenhet som inte går att tolka beräknas endast med ml eller st.\r\nhttps://styrdadokument2.regionhalland.se/docs/2E1BF850-1B3E-4474-A1E6-\r\n98992BE8C8AC.pdf?hash=1584680514', '2020-06-18 11:22:32.000000', 'kroppens fysiska massa', 'SCTID: 27113001', 'Informatik VGR', 'Beslutad', 'kroppsvikt', '-', 'body weight', '-', 118, 'ANMÄRKNING 1: Kroppens fysiska massa kan anges enligt olika metoder för olika ändamål. Den kan vara uppmätt, men den kan också vara uppskattad eller angiven. Vid läkemedelsdosering och processtyrning kan vikt utan beräknad fettmassa anges (\"lean body mass\"), och speciellt i samband med dialys och hjärtsviktsbehandling talas om torrvikt, där överskott av vätska räknats bort eller har drivits ut.', '2020-04-15, Perha11: Preliminär definition skapad, kompletterad med SCTID.\r\n2020-04-28, Perha11 BB: Synonym tillagd. Beslutad!\r\n2020-06-18, karkj, magfo: Definitionen ändrad, anmärkning tillagd. Beslutad.', 'Snomed CT', '-'),
(647, 'på vilket sätt ett läkemedel tillförs kroppen, t ex buckalt, oralt, rektalt. \r\n\r\nEngelsk term i millennium: Routes \r\n\r\nsynonym: administreringsväg?', '2020-06-04 09:48:18.000000', '[läkemedel] metod, inklusive väg , ställe på kroppen och eventuell medicinteknisk produkt, för att tillföra patient läkemedel.', 'SCTID: 447487007| method of drug administration |', 'Informatik VGR, bearbetning av Socialstyrelsens anmärkning', 'Publicera ej', 'metod för läkemedelsadministrering', '-', 'method of drug administration', '-', 119, 'ANMÄRKNING 1: Socialstyrelsens anmärkning till begreppet administreringssätt:\r\n\r\nEtt läkemedels administreringssätt, dvs. hur läkemedlet ska administreras, kan beskrivas med olika uppgifter. Vilken information som är nödvändig skiljer sig från fall till fall. För en strukturerad beskrivning kan följande uppgifter kombineras:\r\n\r\nAdministreringsväg, dvs. den väg i kroppen som ett läkemedel tar för att nå ett målorgan. Det kan exempelvis komma in oralt (via munnen) eller intravenöst (i ven).\r\n\r\nAdministreringsställe, dvs. den kroppsdel eller kroppsstruktur där läkemedlet administreras, t.ex. munhåla, skuldra, lår. Ibland är administreringsstället detsamma som det målorgan som läkemedlet ska påverka, t.ex. ögat för ögondroppar.\r\n\r\nPrecisering av administreringsställe, som kan förtydliga informationen om ett angivet administreringsställe. Exempel: vänster, höger, nedre, övre.\r\n\r\nAdministreringsmetod, dvs. den metod som används för att tillföra läkemedlet till kroppen, t.ex. infusion eller injektion.\r\n\r\nMedicinteknisk produkt vid läkemedelsadministrering, t.ex. pump, sond, nebulisator. Se definition av medicinteknisk produkt.\r\n\r\nKommentar 1: \r\n\r\nAdministrering innebär att patienten tillförs läkemedlet direkt till skllnad från överlämnande då patienten eller tredje part administrerar läkemedlet.\r\n\r\nANMÄRKNING 2: Socialstyrelsen anger termen administreringsmetod med anmärkningen \"Administreringsmetod, dvs. den metod som används för att tillföra läkemedlet till kroppen, t.ex. infusion eller injektion.\"', 'Begreppsmodell: Ordination - när den blir till....\r\n\r\n2020-04-15, Perha11: använder Snomed CT:s term, preliminärt definierad fritt efter Sos. Termen administreringssätt blir tillåten sysnonym.\r\n2020-05-05, Perha11, Karkj: Definition justera, Beslutad!\r\n2020-05-29, perha11:  kompletterat anmärkning med text från \"Helens dokument\"\r\n2020-06-04, karkj, magfo: Publiceras ej. Är semantiskt identisk med administreringsmetod som är synonym till administrationssätt.', 'Snomed CT', '-'),
(648, 'Vanliga definitionen på term som används runt regionen:\r\nEtt brev där patient skriver tillsammans med sin barnmorska under graviditeten, som sen ges till förlossningen, där patienten uttrycker sina önskemål om hur den vill föda. Kan vara smärtlindringsönskan, bada i badkar, musik etc. \r\n\r\nSamma term används i vissa delar av regionen men betyder:\r\nBrevet som barnmorskan skickar till förlossningen där informationen kan vara \"känslig\", ex. VIB-barn, Aurora patient eller andra saker som man inte vill skriva i journalen.\r\n\r\n(VIB = very important baby, foster som man har övervakat extra noga pga ex mamman har någon psykisk sjukdom, missbrukare, tidigare fått sina barn omhändetagna, etc)', '2020-04-28 11:19:20.000000', 'brev med patientönskemål (11.2.11) som patient (5.2.1) lämnas till hälso- och sjukvårdspersonal (5.2.3.3) på vårdenhet (25.2.3.1.2) inför förlossning.', '-', 'Informatik VGR', 'Beslutad', 'förlossningsbrev', '-', '-', '-', 120, 'Anmärkning 1: Jämför förlossningsplan.', '2020-04-16, Perha11, BB: Preliminär definition skapad utifrån 1177.\r\n2020-04-28, PErha11 BB: Beslutad!', '-', '-'),
(649, 'Benämning på ett urval av olika boendeformer', '2020-05-05 11:51:34.000000', 'olika sätt/former att bo', '-', 'Informatik VGR', 'Beslutad', 'boendeform', '-', '-', '-', 9, 'Exempel:  vanligen bostadstyp och ägandeförhållande  men även särskilda boendeformer som t ex äldreboende , gruppboende m fl', '0202-04-16, Perha11, BB: Preliminär definition\r\n2020-05-05, Perha11, Karkj: Definition justerad, beslutad.', '-', '-'),
(650, 'ordination utfärdad av läkare som omfattar läkemedel som sjuksköterska får ge utan att kontakta läkare.', '2020-05-07 11:37:45.000000', 'läkemedelsinformation enligt generellt direktiv som sjuksköterska får administrera utan att kontakta läkare', '-', 'Informatik VGR utifrån Socialstyrelsen HSLF-FS 2017:37', 'Beslutad', 'generell ordination', '-', '-', '-', 121, 'HSLF-FS 2017:37 Socialstyrelsens föreskrifter och allmänna råd om ordination och hantering av läkemedel i hälso- och sjukvården\r\n\r\n6 kap. Generella direktiv om läkemedelsbehandling\r\n\r\n6 § Endast läkare får utfärda generella direktiv om läkemedelsbehandling.\r\nEtt generellt direktiv ska vara skriftligt och innehålla uppgifter om\r\n1. läkemedelsnamn eller aktiv substans,\r\n2. läkemedelsform,\r\n3. läkemedlets styrka,\r\n4. dosering,\r\n5. maxdos,\r\n6. administreringssätt,\r\n7. indikationer och kontraindikationer, och\r\n8. antalet tillfällen som läkemedlet får ges utan att en läkare kontaktas.\r\nGenerella direktiv om läkemedelsbehandling ska utfärdas restriktivt och omprövas återkommande.', '2020-04-17, Perha11 BB: preliminär definierat enligt socialstyrelsen > referensmodell läkemedel\r\n2020-05-07, Karkj, Perha11: Justerad och beslutad', '-', '-'),
(651, 'Hur man hanterar saker under ex. förlossning, amning etc', '2020-04-28 10:55:15.000000', 'förmåga att hantera ett problem eller en svårighet på ett adekvat och konstruktivt sätt', '-', 'Informatik VGR, fritt från Psykologilexikon, Natur o kultur', 'Beslutad', 'copingförmåga', '-', '-', '-', 122, '-', '2020-04-15, Perha11: Skapat preliminar def från Psykologilexiken, Natur o Kultur\r\n2020-04-28, Perha11 BB: Beslutad!', '-', '-'),
(652, 'Barn (foster) som man har extra mycket koll på under graviditeten.', '2020-08-03 09:38:42.000000', 'vård- och omsorgsplan som beskriver aktiviteter som den enskilde har behov av från både hälso- och sjukvård och socialtjänst och som tagits fram genom samordnad vård- och omsorgsplanering', '-', 'Socialstyrelsen termbank, reviderad', 'Beslutad', 'samordnad individuell plan', '-', '-', '-', 123, 'ANMÄRKNING 1: Målet med SIP är att ha en planering vid psykosociala riskgraviditeter. Målgruppen är gravida med fysisk/psykisk/social problematik, missbruk, funktionshinder eller gravida som bedöms ha behov av extra stöd kan bli aktuella som SIP. JIRA 200.', '2020-04-15, Perha11: Beställaren tillskriven om mer fakt.\r\n2020-05-27, verwi6, perha11: Förslag till definition, Preliminär.\r\n2020-05-28, karkj, perha11: Term ändrad, synonym tillagd. Beslutad!\r\n2020-06-25, karkj, magfo: Termen är absolut inte acceptabel eftersom den är på främmande språk. Förkortningen VIB ger inte heller någon som helst association, hela begreppsposten måste omarbetas.\r\n2020-08-03, gerpe4, ollka3, magfo: Anmärkningen förlängd, JIRA 200 refereras.\r\n2020-08-24, magfo: Definition hämtad från Socialstyrelsens termbank, termen SIP önskas av mödravården, men i OLLI fastställs ingen akronym, utan den rekommenderas som synonym.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Besluta.', '-', '-'),
(653, 'Mottagning med primärvårdsakut, röntgen och lab. Där kan också finnas annan specialiserad vård.\r\n\r\nKommer från David, Mats har gett honom kontexten.', '2020-07-30 19:13:57.000000', 'förstärkt primärvårdsakut med tillgång till röntgen och specialistkompetens', '-', 'Informatik VGR', 'Beslutad', 'närakut', '-', '-', '-', 124, '-', '2020-04-15, verwi6. Skickat frågan vidare till Annika, som har skickat vidare det till Stig Wejstål och Annelie Karling. \r\n\r\n2020-04-15, vervi6. Fått svar från Annelie: att Närakuten är Primärvårdens men är placerade i anslutning till slutenvårdens akutmottagning och är en form av akutmottagning med lättare sjukdomar och skador. Skapades för att avlasta akutmottagningar. Men det kan nog vara lite flytande mellan dessa begrepp. Om det finns definierat så finns nog det rätta svaret inom Närhälsans organsiation.\r\n2020-04-30, Perha11 BV: DEfinierad efter kontakt med Närhälsans Informationsavdelning. Beslutad!\r\n2020-07-30, magfo: Ändrat jourcentral till primärvårdsakut i definitionen eftersom jourcentraler bara definieras av Närhälsan.', '-', '-'),
(654, 'primärvårdsakut är det överordnade begreppet för jourcentral och närakut.\r\n\r\nAkutströmmen har valt att använda detta begrepp men jourcentral och närakut ingår i detta begrepp.\r\n\r\n\r\nÄr en akutmottagning inom primärvården. Under detta begreppet kan vi hitta andra termer som jourcentral, primärvårdsakut och närakut.', '2020-08-05 13:09:23.000000', 'mottagning för oplanerade besök i primärvården', '-', 'Informatik VGR', 'Beslutad', 'primärvårdsakut', '-', '-', '-', 110, 'ANMÄRKNING 1: primärvårdsakuter är i första hand jourcentraler. Om de förstärks med speciell utredningsteknik, till exempel röntgen, kallas de närakut.', '2020-04-15, verwi6. Skickat frågan vidare till Annika, som har skickat vidare det till Stig Wejstål och Annelie Karling\r\n2020-04-15, verwi6. Från Annelie: Om det finns definierat så finns nog det rätta svaret inom Närhälsans organisation.\r\n2020-04-30, Perha11 BV: Avråds efter kontakt med Närhälsans Informationsavdelning.\r\n2020-07-06, davte1 och verwi6: Då det finns behov av detta begreppet i akutströmmen så behöver detta redas i lite mer. Begrepp satt till pågår och skapat JIRA kortet -991, status ändrad till Pågår.\r\n2020-07-30, magfo: Definition och anmärkning skrivna.\r\n2020-08-05, ollka3, magfo: Beslutad.', '-', '-'),
(655, 'vårdcentral som är öppen på kvällstid och/eller helger och som bedrivs enligt KoK-boken', '2020-04-30 13:32:35.000000', 'kvälls- och helgöppen mottagning i Närhälsan', '-', '-', 'Beslutad', 'jourcentral', '-', '-', '-', 126, 'ANMÄRKNING 1: Jourcentral är ofta gemensamt bemannar av flera av Närhälsans vårdcentraler', '2020-04-15, verwi6. Skickat frågan vidare till Annika, som har skickat vidare det till Stig Wejstål och Annelie Karling\r\n\r\n2020-04-15, verwi6. Från Annelie: Jourcentral är egentligen vårdcentralernas förlängda öppettider på kvällar och helger som de har krav på sig utifrån vårdavtalen men  som de kan samarbeta om i form av gemensamma jourcentraler. \r\nMen det kan nog vara lite flytande mellan dessa begrepp. Om det finns definierat så finns nog det rätta svaret inom Närhälsans organsiation.\r\n2020-04-30, Perha11 BV:  Definition justerad, Anmärkning tillagd. Beslutad!', '-', '-'),
(656, 'Ecchymoses (ECCHYMOSIS).\r\nEcchymosis\r\nEkkymos\r\nSvensk definition\r\nAnsamling av blod i huden, vilken visar sig som en mer eller mindre oregelbunden, ej upphöjd, blåaktig eller lilaaktig fläck.\r\nEngelsk definition\r\nExtravasation of blood into the skin, resulting in a nonelevated, rounded or irregular, blue or purplish patch, larger than a petechia., källa: https://mesh.kib.ki.se/term/D006406/hematoma', '2020-04-16 11:11:18.000000', 'Hänvining till Snomed CT', 'SCTID: 77643000', '-', 'Beslutad', 'ekkymos', '-', '-', '-', 127, '-', '2020-04-16, Perha11 BB: Hänvining till Snomed CT', 'Snomed CT', '-'),
(657, 'Hematoma\r\nHematom\r\nBlodutgjutning i något organ, hålrum eller vävnad. källa: https://mesh.kib.ki.se/term/D006406/hematoma', '2020-04-16 11:15:25.000000', 'Se Snomed CT', 'SCTID: 385494008', '-', 'Beslutad', 'hematom', '-', '-', '-', 128, '-', '2020-04-16, Perha11 BB: Hänvining till Snomed CT', 'Snomed CT', '-'),
(658, 'Purpura ( Sökte på petekier)\r\nHudblödning\r\nSvensk definition\r\nRödlila eller rödbrun missfärgning som lätt ses genom epidermis och beror på blödning i den underliggande vävnaden. När storleken på missfärgningen är över 2-3 cm kallas det i allmänhet för ekkymos.\r\nEngelsk definition\r\nPurplish or brownish red discoloration, easily visible through the epidermis, caused by hemorrhage into the tissues. When the size of the discolorization is >2-3 cm it is generally called Ecchymoses (ECCHYMOSIS). källa: https://mesh.kib.ki.se/Mesh/search/?searchterm=petekier', '2020-04-16 11:14:58.000000', 'Se Snomed CT', 'SCTID: 423902002', '-', 'Beslutad', 'purpura', '-', '-', '-', 129, '-', '2020-04-16, Perha11, BB: Hänvining till Snomed CT, Synonym petekier', 'Snomed CT', '-'),
(659, 'Finns i modellen Tid i bereppssystemet.', '2020-04-28 11:13:17.000000', 'planerat öppenvårdsbesök (30.2.2.1.1.1.2) som inte äger rum på vårdenhet (25.2.3.1.2) eller i patientens ordinarie boende', '-', 'Informatik VGR', 'Beslutad', 'besök utanför mottagning', '-', '-', '-', 9, '-', '2020-04-15, Perha11: Periminärt definierad\r\n2020-04-28, Perha11 BB: Beslutad!', '-', '-'),
(660, 'familjehem\r\n(inom socialtjänsten:) enskilt hem som på uppdrag av socialnämnden eller motsvarande tar emot barn och ungdomar för stadigvarande vård och fostran eller vuxna för vård och omvårdnad och vars verksamhet inte bedrivs yrkesmässigt\r\n\r\nkälla Termbanken', '2020-04-15 16:11:49.000000', '[inom socialtjänsten] enskilt hem som på uppdrag av socialnämnden eller motsvarande tar emot barn och ungdomar för stadigvarande vård och fostran eller vuxna för vård och omvårdnad och vars verksamhet inte bedrivs yrkesmässigt', '-', 'Socialstyrelsens termbank', 'Beslutad', 'familjehem', '-', '-', '-', 130, '-', '2020-04-15, Perha11: Klar!', '-', '-'),
(661, 'eng Time out\r\n\"Time Out\" innebär att man konfererar med samtliga inblandade om fortsätt handläggning', '2020-05-12 10:11:45.000000', '[hälso- och sjukvård] verifieringsrutin inför beslut om vidare aktiviteter', '416393001 |åtgärdspaus|', 'Informatik VGR', 'Beslutad', 'åtgärdspaus', '-', 'procedure time out', '-', 131, 'ANMÄRKNING 1: Exempelvis under förlossningen när HoS-personal gör ett avbrott i behandling för att bestämma om man ska fortsätta med vaginal förlossning eller ska övergå till kejsarsnitt.\r\n\r\nANMÄRKNING 2: Blodstillningspaus innan ett operationssnitt sluts.', '2020-05-12, vikee1: preliminärt definierad med hjälp av Snomed CT.\r\n2020-05-12, karkj, perha11, magfo: Definitionen omskriven, anmärkning tillagd, termposten beslutad.', 'Snomed CT', '-'),
(662, 'En förlossningsplan är ett brev där du skriver ner dina förväntningar till vårdpersonalen.\r\nPersonalen på förlossningsavdelningen kan titta på din journal från barnmorskemottagningen i datorn. I journalen har barnmorskan skrivit ner lite vad ni pratat om inför förlossningen.', '2020-04-30 14:59:02.000000', 'sammanställning av patientönskemål (11.2.11)  som förs in i hälsojournal (12.2) inför förlossning', '-', 'Informatik VGR', 'Beslutad', 'förlossningsplan', '-', '-', '-', 132, 'ANMÄRKNING 1: Jämför förlossningsbrev', '2020-04-22, perha11: Tillskriver beställare om förtydligande: Skillnad mellan förlossningsplan och förlossningsbrev?\r\n2020-04-30, Perha11: Beslutad, anmärkning tillagd.', '-', '-'),
(663, '-', '2020-05-26 09:31:17.000000', 'plan som upprättas för den enskildes behov av insatser från regional hälso- och sjukvård och från kommun inklusive socialtjänsten', '-', 'SFS (2019:973, kap 16 4 §  ) Lag om ändring i hälso- och sjukvårdslagen (2017:30) (reviderad)', 'Beslutad', 'samordnad individuell plan', '-', '-', '-', 133, 'ANMÄRKNING 1:  Planen ska upprättas om regionen eller kommunen bedömer att den behövs för att den enskilde ska få sina behov tillgodosedda och om den enskilde samtycker till det. Arbetet med planen ska påbörjas utan dröjsmål.\r\n\r\nANMÄRKNING 2: Planen ska, när det är möjligt, upprättas tillsammans med den enskilde. Närstående ska ges möjlighet att delta i arbetet med planen, om det är lämpligt och den enskilde inte motsätter sig det. Av planen ska det framgå:\r\n   1. vilka insatser som behövs,\r\n   2. vilka insatser som respektive huvudman ska svara för,\r\n   3. vilka åtgärder som vidtas av någon annan än regionen eller kommunen, och\r\n   4. vem av huvudmännen som ska ha det övergripande ansvaret för planen. Lag (2019:973).n,', '2020-04-21, PErha11: DEfinition påbörjad, synonym tillagd\r\n2020-05-25, perha11: Preliminärt definierad\r\n2020-05-26, karkj, perha11: Definition  justerad, beslutad', '-', '-'),
(664, 'ROS - Råd och stödmöte\r\nSamverkan mellan mödra- och barnhälsovården, socialtjänsten och psykiatrin. \r\nNär man kallar skall det kortfattat och sakligt framgå vari problemet ligger. Kvinnan skall vara införstådd med syftet och skall ha gett sitt medgivande', '2020-05-14 10:09:48.000000', 'LSS-insats som ges av expert till person avseende råd med anledning av problem och livsbetingelser', '395094003 | Emotional and psychosocial support and education (regime/therapy) |', 'Socialstyrelsens termbank', 'Beslutad', 'rådgivning och annat personligt stöd', '-', '-', '-', 134, 'ANMÄRKNING 1: Rådgivning och annat personligt stöd ges som LSS-insats av bl.a. kurator, psykolog, dietist, sjukgymnast, talpedagog, logoped, arbetsterapeut eller förskolekonsulent.\r\n\r\nANMÄRKNING 2: Rådgivning och annat personligt stöd innebär enligt LSS expertstöd av rådgivande och allmänt stödjande art som ställer krav på särskild kunskap om problem och livsbetingelser för människor med stora och varaktiga funktionsnedsättningar.\r\n\r\nANMÄRKNING 3: Enligt Jirakort 200 avser detta begrepp bara barn, vilket Socialstyrelsens definition inte säger något om.', '2020-05-13, Marel67, Karkj: Uppdaterat till preliminär. Har ändrat till Socialstyrelsens rekommenderade term och lagt till råd och stöd som tillåten synonym och ROS som avrådd synonym. Har även hittat, vad jag tror är, en motsvarighet i SNOMED CT. Vi har lagt in termbankens anmärkning som beskrivning istället för definition.\r\n2020-05-14, karkj, magfo: Definition tillagd, beskrivningen flyttad till anmärkning. Termposten beslutad.', 'SNOMED CT', '-'),
(665, 'A reflex that is seen in normal newborn babies, who automatically turn the face toward the stimulus and make sucking (rooting) motions with the mouth when the cheek or lip is touched. The rooting reflex helps to ensure successful breastfeeding.\r\n\r\nSCT: Sökreflex', '2020-05-26 10:26:13.000000', 'spädbarnsreflex som hjälper barnet att hitta mammans bröstvårta', '18601007 | sökreflex |', 'Rikshandboken barnhälsovård', 'Beslutad', 'sökreflex', '-', 'rooting reflex', '-', 136, 'ANMÄRKNING 1: Om man rör spädbarnets kind kommer det att automatiskt att vända huvudet mot den berörda kinden', '2020-04-29, karkj: e-post  till Ajla för mer information kring begreppet och förslag på svensk term.\r\n2020-05-26, ajla, marel67: Beskrivning och SNOMED ID tillagt. Flyttad till preliminär.\r\n2020-05-26, karkj, perha11: Definition skapad, anmärkning tillagd, engelsk definition struken då den beskrev både sök- och sugreflex. Källa ändrad. Beslutad!', 'SNOMED CT', '-'),
(666, 'Förslag på definition utifrån det underlag som vi fick från Namn- och begreppsgruppen.\r\n\r\nplats och funktion vid en vårdenhet dit patienterna vänder sig för att få hjälp av personal med att anmäla sin ankomst och betala för besöket om betalning inte skett på annat vis. Oftast innebär detta en disk med ett öppningsbart glasparti.\r\n\r\nDetta är ett begrepp som Viktor och Magnus gått igenom materialet från Namn- och begreppsgruppen och godkänt deras förslag om att använda termen \"reception\". Termen ska användas vid skyltning på exempelvis sjukhus.', '2020-05-07 11:23:22.000000', '[hälso- och sjukvård] plats och funktion vid vårdenhet där patient anmäler sin ankomst och kan få annan service', '-', 'Informatik VGR', 'Beslutad', 'reception', '-', '-', '-', 137, 'ANMÄRKNING 1: Här kan betalning för besöket ske om den inte skett på annat vis. En reception är bemannad med personal.', '2020-05-07, verwi6, marel67: Definierat som preliminärt.\r\n2020-05-07, Karkj,, Perha11: Justerad och beslutad', '-', '-'),
(667, 'Förfrågan från Namn- och begreppsgruppen om begreppet KBT på nätet.\r\n\r\nMagnus har gått igenom materialet från Namn- och begreppsgruppen. Viktor har även bollat frågan med Mats som meddelade att det är termen \"KBT på nätet\" som används i regionen idag. Vår rekommendation är därför att använda termen \"KBT på nätet\".\r\n\r\nFörslag på definition:\r\n\r\nE-tjänsten där KBT (kognitiv beteendeterapi) ges till patient via nätet istället för genom fysiska träffar/samtal.\r\n\r\nBegreppet som söks ska beskriva e-tjänsten kognitiv beteendeterapi, KBT där KBT ges till patient via nätet istället för genom fysiska träffar/samtal.   \r\nDet är själva behandlingen/terapin som är tillgänglig i webbform och som avses, inte bara information om KBT som finns att hitta på nätet. I de senare fallen används helt enkelt begreppet Kognitiv beteendeterapi eller KBT i sin enkelhet utan adderande begrepp som ”på nätet” ”i webbform” ”digitalt” etc. Att informationen finns på nätet behöver inte skrivas ut lika lite som det behöver skrivas ut på en anslagstavla eller på ett papper att informationen är på anslagstavlan eller på pappret. \r\nKrav på ett ersättningsbegrepp \r\nBegreppet ska utgå från invånarens perspektiv och förståelse. \r\nBegrepp som inte ska förekomma är de med svårförståeliga förkortande prefix eller suffix som t ex:  \r\niKBT \r\neHälsa  \r\nInte heller behövs påpekandet om det är digitalt eller analogt t ex  \r\nDigitala vårdmöten  \r\nKBT är i sig visserligen en förkortning men är sedan länge ett etablerat och välkänt uttryck som till och med antas mer förståeligt för invånare och patienter än det fulla namnet ”Kognitiv beteendeterapi”  \r\nEtablerade namn som inte innehåller kryptiska suffix eller prefix utan till exempel heter Mitt vårdmöte ska inte ändra namn.  \r\nEngelska ska inte heller förekomma i namnet, tex ”KBT online” eftersom det inte är inriktat mot engelskspråkig målgrupp \r\n \r\nOmvärldsanalys \r\nDen nationella förvaltningen för stöd och behandling använder sig av ”KBT på nätet”. \r\nPå 1177 förekommer båda uttrycken ”KBT på nätet” och KBT via internet”: \r\n\r\nBegreppet omfattar inte: \r\nDet är själva behandlingen/terapin som är tillgänglig i webbform som avses, inte bara information om KBT som finns att hitta på nätet. I de senare fallen används helt enkelt begreppet Kognitiv beteendeterapi eller KBT i sin enkelhet utan adderande begrepp som ”på nätet” ”i webbform” ”digitalt” etc. Att informationen finns på nätet behöver inte skrivas ut lika lite som det behöver skrivas ut på en anslagstavla eller på ett papper att informationen är på anslagstavlan eller på pappret.', '2020-05-07 11:18:26.000000', 'e-tjänst där kognitiv beteendeterapi ges till patient', '-', 'Informatik VGR', 'Beslutad', 'KBT på nätet', '-', '-', '-', 138, '-', '2020-05-07, verwi6, marel67: Definierat som preliminär.\r\n2020-05-07, Karkj, Perha11: Justerad och beslutad', '-', '-'),
(668, 'Könssjukdom\r\nEngelska: sexually transmitted disease\r\nförkortning som primärvård använder STI (vedertagen)\r\n\r\nBB:  STD (Sexually transmitted disease) är en vanlig förkortning inom vissa delar av sjukvården', '2020-05-07 11:13:19.000000', 'sexuellt överförd infektionssjukdom', '8098009 | sexuellt överförda infektionssjukdomar |', '1177.se', 'Beslutad', 'könssjukdom', '-', 'Sexually transmitted infectious disease', '-', 139, 'ANMÄRKNING 1:  Vissa könssjukdomar ingår i smittskyddslagen', '2020-05-05, PErha11, Marel67.: Preliminärt definierad\r\n2020-05-07, Karkj, Perha11,: Justerad och beslutad', 'Snomed CT', '-'),
(669, 'avses läkemedel som ges vid ett enstaka behandlingstillfälle. \r\n\r\nKan vara ordination generellt, inte bara läkemedel (karkj)', '2020-08-05 11:57:07.000000', 'ordination (29.2.9) vid enstaka tillfälle', '-', 'Informatik VGR', 'Beslutad', 'tillfällig ordination', '-', '-', '-', 140, 'ANMÄRKNING 1: Tillfällig ordination finns ej definierad som begrepp. Däremot finns ordination definierat i VGR Begreppssystem 1.0. med ursprungskälla Socialstyrelsens Termbank, reviderad av VGR.\r\n\r\nANMÄRKNING 2: Termbankens definition har reviderats därför att\r\n1) beslutet kräver mandat, och hälso- och sjukvårdspersonal som fattar ett sådant beslut är därför behörig 2) hälso- och sjukvårdsåtgärd förekommer inte i FVM begreppsmodell men är synonymt med hälso- och sjukvårdsaktivitet i hälso- och sjukvårdsdomänen. Socialstyrelsen använder en term som är generell inom socialtjänsten och hälso- och sjukvården men inte har anammats av Contsys.\r\nAv Socialstyrelsens exempel framgår att andra än hälso- och sjukvårdspersonal kan utföra det som ordinerats. Därför är det inte en hälso- och sjukvårdstjänst som ordineras.\r\nAlternativ definition beslut av behörig hälso- och sjukvårdspersonal som är avsett att påverka en patients hälsotillstånd genom en hälso- och sjukvårdsåtgärd (Socialstyrelsens termbank)\r\nAnmärkning 2 Termbankens kommentar:\r\nExempel på ordinationer: läkemedelsbehandling och andra typer av behandlingar, specialkost, fysisk aktivitet.\r\nTermen ordination används även om den åtgärd som ordinerats.\r\nDen person som ordinerar benämns ordinatör.\r\n29.2.9.1', '2020-04-29, karkj: Kompletterat med information inför beslut.\r\n2020-04-30, Perha11 BB: Åter till pågår, Dår diskuteras med medicinsk sakkunniga.\r\n2020-05-27, verwi6, perha11: Preliminär\r\n2020-06-04, karkj, magfo: Sätts till pågår. Skriver till Sofia och frågar hur ärendet uppkom. Obs att begreppsposten är rörig och blandar ihop med begreppet ordination. \r\n2020-06-14, karkj, perha11: Jira-820\r\n2020-07-28, magfo: Flyttad till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad,', '-', '-'),
(670, 'Alla ställningstaganden som rör vård och behandling, förhållningsregler enligt smittskyddslagen (2004:168) samt slutanteckningar och andra sammanfattningar av genomförd vård ska signeras av den som svarar för uppgiften.\r\nVårdgivaren får besluta om undantag från kravet på signering, frånsett avseende\r\n1. väsentliga ställningstaganden om vård och behandling,\r\n2. förhållningsregler enligt smittskyddslagen (2004:168), eller\r\n3. slutanteckningar eller andra sammanfattningar av genomförd vård.', '2020-05-19 13:54:00.000000', 'påföra signatur i syfte att styrka riktighet och säkerställa spårbarhet', '-', 'Socialstyrelsens termbank', 'Beslutad', 'signera', '-', '-', '-', 141, 'Anmärkning 1: Socialstyrelsens termbank hänvisar till Socialstyrelsens föreskrifter (SOSFS 2008:14) \r\n\r\nAnmärkning 2: Patientdatalagen (2008:355), 3 kap. 10§:\r\n ”En journalanteckning ska, om det inte finns något synnerligt hinder, signeras av den som ansvarar för uppgiften”.\r\n \r\nAnmärkning 3:Alla ställningstaganden som rör vård och behandling, förhållningsregler enligt smittskyddslagen (2004:168) samt slutanteckningar och andra sammanfattningar av genomförd vård ska signeras av den som svarar för uppgiften.\r\nVårdgivaren får besluta om undantag från kravet på signering, frånsett avseende\r\n1. väsentliga ställningstaganden om vård och behandling,\r\n2. förhållningsregler enligt smittskyddslagen (2004:168), eller\r\n3. slutanteckningar eller andra sammanfattningar av genomförd vård.', 'Informationsmodell: 12 - Informationshantering\r\n \r\n2020-04-27, Perha11: Hämtat definition från SoS, Lagt till 3 anmärkningar.\r\n2020-04-29, karkj: ändrat form på termen till verb\r\n2020-05-07, Karkj, Perha11,: Justerad och beslutad\r\n2020-05-19, Magfo, verwi6, perha11: Beslutad i enlighet med styrgruppen, oförändrad.', '-', '-'),
