(673, '-', '2020-06-08 14:08:10.000000', 'bekräftelse att man har tagit del av information', '-', 'Informatik VGR', 'Publicera ej', 'vidi', '-', '-', 'Inte definierad', 141, 'ANMÄRKNING 1: Vidi bekräftar att man tagit del av Information i t.ex. provsvar, remissvar etc. men inte att man vidtagit några åtgärder.', '2020-04-27, Perha11: Lägger till Källa: Informatik VGR, Klarmarkerar begreppet.\r\n2020-04-28, ajla: Lägger till rekommenderad synonym och anmärkning\r\n2020-05-15, Magfo, Verwi6, Perha11: Synonym och anmärkning 2 borttagen.\r\n2020-06-08, perha11:  Dubblet, publiceras ej.', '-', '-'),
