(676, 'Tid och datum när läkemedlets sätts in (påbörjas)', '2020-05-07 10:56:12.000000', '[Läkemedel] påbörjande av behandling med ett visst läkemedel som beslutats av behörig hälso- och sjukvårdspersonal', 'Inte definierad', 'Socialstyrelsens Termbank - reviderad', 'Beslutad', 'insättning', '-', '-', '-', 143, 'ANMÄRKNING 1: Insättning av behandling ska anges med datum och ev tidpunkt', '2020-05-04, ajla: preliminärt definierad\r\n2020-05-07, Karkj, Magfo, Perha11,: Justerad och beslutad', '-', '-'),
