(678, 'Om patienten tar ansvar för sin medicinering själv. Markeras som ja eller nej i millenniums ordinationsdetaljer.', '2020-04-28 11:27:16.000000', 'ordinerad egenvård (7.2.4) där patienten ansvarar för tillförsel av läkemedel till kroppen', 'SCTID: 2254250006|självadministrering av läkemedel|', 'Informatik VGR', 'Beslutad', 'självadministrering', '-', 'self-administration of medication', '-', 145, '-', 'Modell: 7: Hälso- och sjukvårdsaktivitet\r\n\r\n2020-04-27, Perha11:  Term från Snomed CT, förslag till definition men inspiration av Snomed och Sos\r\n2020-04-28, Perha11 BB: Beslutad!\r\n2020-05-12, vikee1: rättad felstavning i termen.\r\n2020-05-12, perha11: Term justerad', 'Snomed CT', 'Enligt Snomed CT: metod där patienten själv ansvarar för tillförsel av läkemedel'),
(679, 'Lista för familjerelationer, Behövs ett gemensamt begrepp. Avser förälders partner som inte har juridisk position som förälder men ofta har en föräldraroll.\r\nÄr detta ett vedertaget begrepp idag eller skall vi ha annan benämning?', '2020-05-05 14:37:25.000000', 'person som inte är förälder till viss person men gift/sam­bo med vederbörandes mor eller far', 'SCTID: 74128007', 'Svensk ordbok (reviderad)', 'Beslutad', 'styvförälder', '-', '-', '-', 146, '-', '2020-05-05, PErha11, Marel67: Preliminärt definierad, Term ändrad från bonusförälder som blev synonym\r\n2020-05-07, Karkj, Magfo, Perha11: Beslutad', 'Snomed CT', '-'),
(680, 'Exempel: Sjuksköterska som tar hand om en viss patientgrupp (KOL, diabetes, hjärtsvikt etc).\r\nExempel: Kontaktsjuksköterska inom cancervård.', '2020-07-29 11:38:27.000000', 'hälso- och sjukvårdspersonal som har regelbunden kontakt med patient', '-', 'Informatik VGR', 'Beslutad', 'fast vårdkontakt', '-', '-', '-', 8, 'ANMÄRKNING 1: Kan jämföras med kontaktsjuksköterska\r\nExempel 1: Sjuksköterska som tar hand om en viss patientgrupp (KOL, diabetes, hjärtsvikt etc).\r\nExempel 2: Kontaktsjuksköterska inom cancervård\r\n\r\nANMÄRKNING 2: Detta är samma begrepp som Ansvarig i Patientbakgrund 2009. Den termen för till som avrådd synonym. (Begreppet fast vårdkontakt tillkom 2014 i patientlagen 2014:821.)', '2020-04-28, ajlja: Fyllt på med information\r\n2020-04-28, Perha11 BB: Justerad och beslutad!\r\n2020-07-29, magfo: Synonymen Ansvarig läggs till från Patientbakgrund 2009 men avråds.', '-', '-'),
(681, 'Exempel: Handläggande distriktsläkare i primärvården.', '2020-06-02 13:47:28.000000', 'läkare i primärvården som utgör fast vårdkontakt (10.2.2.1.1) för patient (5.2.1)', '-', 'Informatik VGR', 'Publicera ej', 'fast läkarkontakt', '-', '-', '-', 18, 'ANMÄRKNING 1: Vårdcentralen ska erbjuda sina listade patienter en fast läkarkontakt. Patienter som är multisjuka och/eller har ett kontinuerligt vårdbehov ska prioriteras. Den fasta läkarkontakten ska vara\r\nden läkare som personen så långt som möjligt får träffa vid besök för sin grundsjukdom och den ska samordna vården mellan olika vårdenheter.', '2020-04-28; ajla: fyllt på information\r\n2020-04-29, karkj ändrat status till preliminär\r\n2020-04-30, Perha11: Kompletterat med anmärkning, beslutad.\r\n2020-06-02, verwi6, perha11: Dubblett, publiceras ej', '-', '-'),
(682, 'Där det bedrivs hälso- och sjukvårdsverksamhet ska det finnas någon som svarar för verksamheten (verksamhetschef). \r\n\r\nOm verksamhetschefen inte är en läkare med specialistkompetens, ska ledningsuppgifterna fullgöras av en särskilt utsedd chefsöverläkare (MAL) eller, i fråga om smittskydd, av en befattningshavare som har förordnats med stöd av 5 kap. 24 § smittskyddslagen. \r\n\r\nI kommunal vård och omsorg är det inte verksamhetschef som har det övergripande ansvaret då det förekommer medicinskt ansvarig sjuksköterska, MAS och medicinskt ansvarig för rehabilitering, MAR då detta ansvar fördelas enligt lagar och föreskrifter.', '2020-05-19 14:33:38.000000', 'person som ansvarar för verksamhet där det bedrivs hälso- och sjukvård', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'verksamhetschef', '-', '-', '-', 112, 'ANMÄRKNING 1:(Hälso- och sjukvårdslagen (2017:30), 4 kap, § 2-3)\r\n\r\n2§ Där det bedrivs hälso- och sjukvårdsverksamhet ska det finnas någon som svarar för verksamheten (verksamhetschef).\r\n\r\nRegeringen eller den myndighet som regeringen bestämmer får meddela föreskrifter om ansvar och uppgifter för verksamhetschefen.\r\n\r\n3 §   Ansvaret för ledningsuppgifter i fråga om psykiatrisk tvångsvård samt isolering enligt 5 kap. 1 och 3 §§ smittskyddslagen (2004:168) ska utövas av en chefsöverläkare. Denne ska ha specialistkompetens.\r\n\r\nOm verksamhetschefen inte är en läkare med specialistkompetens, ska ledningsuppgifterna fullgöras av en särskilt utsedd chefsöverläkare eller, i fråga om smittskydd, av en befattningshavare som har förordnats med stöd av 5 kap. 24 § smittskyddslagen.', '2020-04-28, ajla: Fyllt i information\r\n2020-04-30, Perha11: Omdefinierad och beslutad.\r\n2020-05-19, PErha11, verwi6, Magfo: Definitionen justerad.', '-', '-'),
(683, '-', '2020-04-30 11:35:16.000000', 'legitimerad hälso- och sjukvårdspersonal som prioriterar och beslutar om medicinska åtgärder', 'Inte definierad', 'Socialstyrelsens Termbank', 'Beslutad', 'medicinsk ansvarig', '-', '-', '-', 8, 'ANMÄRKNING 1: Kan vara medicinsk ansvarig sjuksköterska (MAS),  medicinsk ansvar rehabilitering (MAR) eller medicinsk ansvarig läkare (MAL)\r\n\r\nANMÄRKNING 2: MAL biträder verksamhetschef som inte är läkare.\r\nVerksamhetschefen har alltid det samlade ledningsansvaret men får uppdra åt annan att fullgöra enskilda ledningsuppdrag, till exempel medicinskt ledningsansvar när Verksamhetschef ej är läkare.', '2020-04-28; ajla: Fyllt på med information\r\n2020-04-30, Perha11 BB: Godkänd!', '-', '-'),
(684, '-', '2020-04-30 11:33:16.000000', 'legitimerad läkare som prioriterar och beslutar om medicinska åtgärder', '-', 'Socialstyrelsens termbank (reviderad)', 'Publicera ej', 'medicinsk ansvarig läkare', '-', '-', '-', 8, 'ANMÄRKNING: Det ska finnas en medicinsk ansvarig läkare som bistår verksamhetschefen när verksamhetschefen inte är läkare. Verksamhetschefen har alltid det samlade ledningsansvaret men får uppdra åt annan att fullgöra enskilda ledningsuppdrag.', '2020-04-28, ajla: Fylla på med information\r\n2020-04-30, Perha11 BB: Justerad o beslutad\r\n2020-07-29, magfo: Detta är en dubblett till medicinskt ansvarig läkare (det blev dubbelt pga sannolik felskrivning: medicinsk ansvarig läkare - vi får hoppas att läkare alltid är medicinska). Begreppet ställs av, publiceras inte. Kan eventuellt raderas helt.', '-', '-'),
(685, '-', '2020-04-30 11:12:48.000000', 'sjuksköterska med särskilt medicinskt ansvar för hälso- och sjukvård i kommunal verksamhet', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'medicinskt ansvarig sjuksköterska', '-', '-', '-', 8, '-', '2020-04-28, ajla: Fyllt i information\r\n2020-04-30, Perha11 BB:  Justerad o beslutad', '-', '-'),
(686, '-', '2020-05-19 14:55:25.000000', 'hälso- och sjukvårdspersonal som har medicinskt ansvar för rehabilitering i kommunal verksamhet', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'medicinskt ansvarig för rehabilitering', '-', '-', '-', 8, 'ANMÄRKNING 1: Finnes huvudsakligen inom kommunal verksamhet.\r\n\r\nANMÄRKNING 2: Kan vara arbetsterapeut, fysioterapeut eller sjuksköterska', '2020-04-28; ajla: Fyllt på med information\r\n2020-04-30, Perha11 BB: Justerad och beslutad.\r\n2020-05-19, verwi6, perha11, magfo: Definition justerad.', '-', '-'),
(687, '-', '2020-05-19 14:41:51.000000', 'specialistkompetent läkare med ledningsuppgifter enligt hälso-och sjukvårdslagen vid verksamhetsområde med myndighetsutövning', 'Inte definierad', 'Vårdhandboken, reviderad', 'Beslutad', 'chefsöverläkare', '-', '-', '-', 8, 'ANMÄRKNING 1: Verksamhetschefen har alltid det samlade ledningsansvaret men får uppdra åt annan att fullgöra enskilda ledningsuppdrag, till exempel medicinskt ledningsansvar. \r\nInom områden med myndighetsutövning finns krav på verksamhetschefens särskilda kompetens. Exempel på det är psykiatrisk tvångsvård då verksamhetschefen ska vara läkare med specialistkompetens – chefsöverläkare. I annat fall ansvarar annan särskilt utsedd chefsöverläkare för dessa ledningsuppgifter (HSL). Ex psykiatrisk tvångsvård.', '2020-05-04, ajla: Fyllt i information om begreppet. Preliminärt, Begreppssystem - modell 5 (Hälso- och sjukvårdsaktörer)\r\n2020-05-07, Magfo, Karkj, Perha11: Åter till Pågår, Magnus diskutera Mats\r\n2020-05-12, verwi6, perha11: Definition justerad. Preliminär\r\n2020-05-14, karkj, magfo: epostfrågat Mats L.\r\n2020-05-19, magfo, verwi6, perha11: Definitionenförädlad, beslutad!', '-', '-'),
(688, '-', '2020-05-07 10:15:20.000000', 'vårdyrke för läkare med roll att utöva tillsyn inom hälso- och sjukvård', '-', 'Informatik VGR', 'Beslutad', 'chefsläkare', '-', '-', '-', 8, 'ANMÄRKNING 1: Begreppet chefsläkare är inte definierat i lag eller föreskrift. Chefsläkaren är oftast en kliniskt erfaren läkare med chefserfarenhet och lokal kännedom. Chefsläkare ansvarar för handläggning av vårdskador.\r\n\r\nChefsläkare svarar för frågor angående medicinsk säkerhet och anmälningsärenden, t ex lex Maria- och andra IVO-ärenden.\r\n\r\n\r\nANMÄRKNING 2: VGR har beslutat att termen ska vara chefläkare (utan binde-s)', '2020-04-29, karkj: Lagt till en beskrivning istället för definition då det inte går att hitta definition i kända källor.\r\n2020-05-07, Karkj, Magfo, Perha11: Justerad och beslutad.', '-', '-'),
(689, 'ordination av läkemedel som ges vid behov och som alltid ska innehålla en tidsram för att indikera maxdosen per dygn.', '2020-05-05 14:21:08.000000', 'Ej definierad', '-', '-', 'Publicera ej', 'vid behov', '-', '-', '-', 147, '-', '2020-05-05, Perha 11, Marel67: Skriver till Sofia och frågar om hon syftar på generell ordination.\r\n2020-05-12, sofan63, karkj, perha11, magfo: termen införd som synonym till vidbehhovsordination. Publiceras ej.', '-', '-'),
(690, 'Första läkemedelsdos ska ges omedelbart (inställningstid är nutid).  Anges i ordinationens ordinationsdetaljer.', '2020-05-12 11:34:02.000000', '-', '-', '-', 'Definiera ej', 'första dos omedelbart', '-', '-', 'Inte definierad', 148, '-', '2020-05-12, vikee1: efter diskussion med Sofia och Magnus har vi valt att inte definiera detta begrepp då det anses självförklarande.', '-', '-'),
(691, 'Inte definierad', '2020-05-07 10:36:28.000000', 'förskriven medicinteknisk produkt som syftar till att kontrollera, bibehålla eller förbättra ett medicinskt tillstånd', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'hjälpmedel för vård och behandling', '-', '-', '-', 149, 'ANMÄRKNING 1: Exempel på hjälpmedel för vård och behandling är antidecubitusmadrass, cpap, handortos, insulinpump, nutritionspump, ståstöd, tappningskateter och tensapparat. Ordet ”avsedd” syftar på tillverkarens avsikt.\r\n\r\nANMÄRKNING 2: Ett hjälpmedel för vård och behandling är avsett att kunna användas utan hälso- och sjukvårdsutbildning', '2020-04-30, Perha11 BV: Definiterad enligt SoS, Preliminär.\r\n2020-05-07, Magfo, Karkj, PErha11: Justerad och beslutad', '-', '-'),
(692, 'ordination som hänvisar till ordinationskommentar/anvisning eftersom det inte går att tydliggöra detaljer. Ska användas så lite som möjligt.', '2020-05-14 10:52:08.000000', 'ordination som inte följer reguljärt ordinationsschema utan ges genom separat instruktion till patient', '-', 'Informatik VGR', 'Beslutad', 'särskild ordination', '-', '-', '-', 150, '-', '2020-05-13, Marel67, Karkj: Bytt term från enligt särskild ordination till särskild ordination. Rådfrågar Magfo i BB.\r\n2020-05-14, karkj, magfo: Definition skriven. Termposten beslutad.', '-', '-'),
