(696, 'yta inom rum.\r\n\r\nKälla: FVM\r\nAnmärkning: Del av rum är en yta inom ett rum som är mindre än rummet.', '2020-05-04 11:50:41.000000', 'yta inom rum', '-', 'FVM', 'Beslutad', 'del av rum', '-', '-', '-', 153, 'ANMÄRKNING 1: del av rum är en yta inom ett rum som är mindre än rummets totala yta.', '2020-05-04, verwi6: Satt på preliminär, men borde kanske varit på klar. Suttit med Pelle och definierat.\r\n2020-05-07, Karkj, Magfo, Perha11: Beslutad', '-', '-'),
(697, '-', '2020-06-15 11:46:25.000000', 'något som är installerat och som har varaktighet till byggnad eller del därav', '-', 'FVM', 'Publicera ej', 'installation', '-', '-', '-', 2, 'ANMÄRKNING 1:  Installation är fast installerad till byggnaden medan utrustning är flyttbar utan särskilda åtgärder. Utrustning kan vara ansluten med till exempel en stickpropp medan en installation kräver att en elektiker frigör ......', '2020-05-04, verwi6: Fått kommentar från masterdata, så denna behöver kollas igenom. \r\nInstallation borde inkludera medicinteknisk utrustning. \r\nSkillnaden – installationen står fast medans det som är utrustning flyttar på sig. \r\nEn installation kräver en försörjning ex el, vatten. Annars kanske det är en fast utrustning. Finns också lös utrustning. Lös utrustning vara ex säng. Fast kan vara hyllor. Vissa saker kan vara både utrustning och installation. – Installerad (fast) utrustning kontra lösutrustning (går att röra sig men kanske inte tanken), mobil utrustning menad att röra sig. Installation kan behövas ha kvar också. Fastighets installation? Utrustning kan vara i tre olika former.\r\n2020-05-06: verwi6, perha11: Skickar tillbaka detta till masterdata för en runda till.\r\n2020-06-04, magfo, perha11: Jira 725\r\n\r\n2020-06-14, karkj,perha11: Publiceras ej i väntan på ev  aktualisering.', '-', '-'),
(698, '2020-05-04, verwi6: Fått kommentar från masterdata, så denna behöver kollas igenom. \r\nUtrustning: Vad menas med ett specifikt syfte? Kan det handla om tid? Medicinteknik? Installation är kopplat till byggnadens drift i denna definition. Installation – går inte bara att dra ut en kontakt och rulla iväg. \r\nUtrustning kan också vara flera produkter. Sammansatt. Instrument kan vara ett ytterligare begrepp. Utrustning i ett visst sammanhang. Lös/fast utrustning. \r\nInstallation borde inkludera medicinteknisk utrustning. \r\nSkillnaden – installationen står fast medans det som är utrustning flyttar på sig. \r\nEn installation kräver en försörjning ex el, vatten. Annars kanske det är en fast utrustning. Finns också lös utrustning. Lös utrustning vara ex säng. Fast kan vara hyllor. Vissa saker kan vara både utrustning och installation. – Installerad (fast) utrustning kontra lösutrustning (går att röra sig men kanske inte tanken), mobil utrustning menad att röra sig. Installation kan behövas ha kvar också. Fastighets installation? Utrustning kan vara i tre olika former.', '2020-06-15 11:45:07.000000', 'material avsett att assistera i ett specifikt syfte.', '-', 'FVM', 'Publicera ej', 'utrustning', '-', '-', '-', 2, '-', '2020-05-06: verwi6, perha11: Skickar tillbaka detta till masterdata för en runda till.\r\n2020-06-04, magfo, perha11: Jira: 727\r\n\r\n2020-06-14, karkj,perha11: Publiceras ej i väntan på ev  aktualisering.', '-', '-'),
