(703, 'PATIENT STATED WEIGHT\r\n Used to capture the number the patient\'s states that they weigh. Should only be used in emergent situations when a weight cannot be obtained by other means.', '2020-06-18 11:33:41.000000', 'av patient eller närstående meddelad kroppsvikt', 'SCTID: 784399000 |kroppsvikt meddelad av patienten själv|', 'Informatik VGR', 'Beslutad', 'uppgiven kroppsvikt', 'body weight as reported by individual', 'self reported body weight', '-', 158, '-', '2020-05-11, Perha11, Davte1: Preliminärt definierat, Snomed CT-term,\r\n2020-05-14, magfo, karkj: Beslutad\r\n2020-06-18, karkj, magfo: Synonymen ändrad. Definitionen ändrad. Beslutad.', 'Snomed CT', '-'),
(704, 'Det vanligaste termen är förlust men även elimination används. Man söker efter ett övergripande begrepp för \"avseende vätskebalans\". I diskussion kring detta begreppet är kontexten när en patient förlorar vätska. Ett exempel är \"per spiratio\" när man förlorar vätska via luftvägarna och från huden.', '2020-05-19 11:42:18.000000', 'normalt avgivande av kroppsvätska', 'SCTID: 251840008 |fluid output|', 'Informatik VGR', 'Beslutad', 'vätskeutsöndring', '-', 'fluid output', '-', 159, 'EXEMPEL 1: urin eller svettning', '2020-05-06, verwi6, perha11: Definierat som preliminär.\r\n2020-05-07, magfo: fråga till Helène m denna och andra liknande termposter.\r\n2020-05-19, magfo, karkj, perha11: definitionen förädlad, beslutad!', 'Snomed CT', '-'),
(705, 'Operation använder sig av begreppet blåsscanning (istället för bladderscan). \r\n\r\nhttps://www.vardhandboken.se/vard-och-behandling/basal-och-preventiv-omvardnad/blasovervakning-vid-sjukhusvard/ultraljudsundersokning-med-portabel-blasscanner/\r\n\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/42393/Bladderscan%20-%20Åtgärdskort%20för%20blåsscanning%20och%20blåstappning,%20SÄS.pdf?a=false&guest=true', '2020-05-19 10:52:23.000000', 'ultraljudsundersökning av urinblåsans fyllnad', '-', 'Informatik VGR', 'Beslutad', 'blåsskanning', '-', '-', '-', 160, 'ANMÄRKNING 1: I det terminologiska arbetet har stavning med c förekommit. Termen ska stavas med k.', '2020-05-07, verwi6, marel67: Kontaktat beställare angående vilken begrepp som är beslutat, står olika i OLLI och i slack. Oklart vilket begrepp som är beslutat.\r\n2020-05-15, magfo: I termen har c bytts mot k. Definition tillförd. Termposten preliminär.\r\n2020-05-15, vikee1: Finns ett kort i Jira kopplat till denna termpost. https://vgregionit.atlassian.net/browse/INFMTK-539\r\n2020-05-19, karkj, perha11:  Beslutad.', '-', '-'),
