(707, '-', '2020-06-02 10:00:47.000000', 'förlust av kroppsvätska som inte är normal utsöndring', 'SCTID: 251846002', 'Informatik VGR', 'Beslutad', 'vätskeförlust', '-', 'fluid loss', '-', 155, 'EXEMPEL 1: blodförlust, andning.', '2020-05-06, verwi6, perha11: Definierad som preliminär.\r\n2020-05-07, magfo: Alla vätskebalanstermer måste diskuteras med Helène så att nuvarande terminologi ändras så litet som möjligt. Brev skrivet till Helène.\r\n2020-05-27, verwi6, perha11: åter till preliminär\r\n2020-06-02, karkj, perha11: Beslutad!', 'Snomed CT', '-'),
