(711, 'datum för uppföljning av den ordinerade läkemedelsbehandlingen.', '2020-06-03 10:30:48.000000', '[hälso- och sjukvård] utvärdering av behandling', '-', 'Informatik VGR', 'Beslutad', 'uppföljning', '-', '-', '-', 162, 'ANMÄRKNING 1: Uppföljning görs vid en uppföljande kontakt som inträffar vid en uppföljningstidpunkt. Eftersom uppföljning är en aktivitet tidssätts den i systemet och uppföljningstidpunkten framgår utan att det begreppet definieras separat,\r\n\r\nANMÄRKNING 2: Socialstyrelsen anger en separat term uppföljning (läkemedelsbehandling) som avser att följa upp resultatet av en läkemedelsbehandling. Den är precis samma uppföljning som i denna begreppspost, och det kan möjligen utredas om detta begrepp ska kallas läkemedelsuppföljning och vara ett begrepp underordnat uppföljning.', '2020-05-12 sofan63, karkj, perha11, magfo: Begreppet analyserat och termen ändrad från uppföljningsdatum till uppföljning med kommenterande anmärkning. Termposten beslutad.\r\n2020-06-02, magfo: Termposten backad till preliminär, för vi måste ta ställning till SoS uppföljning (läkemedelsbehandling). Se anmärkning 2!\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
