(713, 'Duration på engelska. Syftar på läkemedelsbehandlingens längd.', '2020-08-07 16:41:27.000000', 'varaktighet för ordinerad behandling', '-', 'Informatik VGR', 'Beslutad', 'behandlingslängd', '-', 'duration', '-', 164, '-', '2020-05-12, karkj, sofan63, perha11, magfo: Termposten beslutad.\r\n2020-06-02, sofan63, magfo: Termposten justerad: obestämd artikel borttagen ur definitionen.\r\n2020-08-07, magfo: Pinsam upptäckt att synonymen duration också är definierad för eget begrepp. Den tas bort från denna begreppspost.', '-', '-'),
(714, 'justera dosen under kontrollerade former.', '2020-05-14 09:49:41.000000', '1) justera koncentration av en lösning genom att tillsätta standardlösning med känd koncentration\r\n2) fastställa effektiv läkemedelsdos genom stegvis ändring av dosen med observation av behandlingseffekt', '117007006 | Titration method (procedure) |', 'Rikstermbanken (	KemDok.se), Informatik VGR', 'Beslutad', 'titrera', '-', '-', '-', 165, 'ANMÄRKNING 1: Termen är homonym.', '2020-05-13, Marel67, Karkj: Flyttad till preliminär.\r\n2020-05-14, karkj, magfo: Antecknat att termen är homonym, tillagt definition av andra betydelsen. Termposten beslutad.', 'SNOMED CT', '-'),
(715, 'justera läkemedelsdos under kontrollerade former.', '2020-05-13 11:00:00.000000', '-', '-', '-', 'Publicera ej', 'titrering', '-', '-', '-', 166, '-', '2020-05-13, Marel67, Karkj: Vänligen se titrera.', '-', '-'),
(716, 'Förkortningen N/A (not applicable) används i Millennium som alternativ i vallistor. eftersom det är skillnad på \"inte tillämplig\" och \"inte tillgänglig\" \"ingen uppgift\" och inte kan inte översättas till en direkt svensk term, och N/A täcker upp för alla de alternativen, anses vara godkänt vid användning i Millennium.\r\n\r\nwiki: N/A är en engelsk förkortning och betyder not applicable (\"inte tillämplig\") eller not available (\"inte tillgänglig\" eller \"finns inte\", i betydelsen \"ingen uppgift\"). Förkortningen används ofta i svarsformulär, faktatabeller med mera.\r\nFörkortningen kan skrivas n/a eller N/A, och förekommer allt oftare även i svenska texter.\r\n\r\nkontext:\r\nI Millennium grundar det sig på att man kan använda modulen för gruppbehandling till ett stort antal olika syften, vissa bör dokumenteras i andra fall är syftet mer övergripande så att det inte är aktuellt att använd t ex ämne för gruppbehandlingen, så i vissa fall betyder det annat, i andra icke aktuellt. Detta styrs ju ibland av typ av gruppbehandling så har man valt en viss typ så är det inte aktuellt att dokumentera ämne i andra fall är det ett annat ämne.\r\nAtt lägga in alla tre syftena ovan för sig gör ju vallistan betydligt längre.\r\nNågon form av typ, kategori kommer att framgå i journal i vilket fall. Valen har ingen möjlighet till fritext.', '2020-05-14 09:39:59.000000', 'saknar information', '-', 'Informatik VGR', 'Beslutad', 'inte tillämplig', '-', 'not applicable', '-', 167, 'ANMÄRKNING 1: N/A är en engelsk förkortning och betyder not applicable (\"inte tillämplig\") eller not available (\"inte tillgänglig\" eller \"finns inte\", i betydelsen \"ingen uppgift\"). Förkortningen används ofta i svarsformulär, faktatabeller med mera.\r\nANMÄRKNING 2: Förkortningen kan skrivas n/a eller N/A, och förekommer allt oftare även i svenska texter.', '2020-05-13, Marel67, Karkj: Överenskommet i Slack att använda förkortningen N/A. Saknar definition.\r\n2020-05-14, karkj, magfo: Term och synonym är skiftade, definition skriven. Termposten beslutad.', '-', '-'),
(717, '-', '2020-05-12 13:48:26.000000', 'övervaka en maskins eller en patients tillstånd med stöd av mätvärden', '-', 'IDG:s IT-ordlista', 'Beslutad', 'monitorera', '-', '-', '-', 11, 'ANMÄRKNING 1: Monitorering av en patient görs med sensorer som avläser patientens puls, blodtryck och annat mätbart. Ordet är en försvenskning av engelska to monitor. Man kan ofta lika gärna säga övervaka, bevaka, kontrollera eller använda andra ord med liknande betydelse. (IDG:s IT-ordlista).\r\n\r\nANMÄRKNING 2:  Observation och övervakning av en patient som utförs av en person är inte monitorering.', '2020-05-07, magfo: Fört in begreppet för utredning, är överordnat en rad monitoreringsbegrepp.\r\n2020-05-11, Perha11, Davte1: Preliminärt definierad\r\n2020-05-12, karkj, prha11, magfo: Anmärkning 2 tillagd. Termposten beslutad.', '-', '-'),
