(720, '2020-05-08, magfo: fört in termposten som används i bariatrisk säng. Det finns en tillverkare av \"bariatriska sängar\", men orden bariatrisk och bariatrik är inte med i SO, SAOL eller SAOB. Termen ska förbjudas och sammansättningar ska gölras med obesitas som är den i Sverige (och resten av världen) använda termen. Det finns en nederländsk webbplats: https://www.bariatrischcentrum.nl/ som talar kallar sig Bariatrisch centrum men redan i sin rubrik förklarar det med \"Behandelscentrum voor overgewicht en obesitas\". På tyska hittar man i DocCheck Flexikon texten: Bariatrisch bedeutet \"die medizinische Behandlung des Übergewichts (Bariatrie) betreffend\". Således betyder inte baiatrisk säng något som man förvarar obesa patienter i utan en säng där man behandlar dem.', '2020-06-11 11:31:49.000000', 'åtgärder för viktminskning hos patienter med fetma', '-', 'Svensk MeSH', 'Beslutad', 'bariatri', 'activities related to weight reduction in patients with obisity\r\n\r\nNOTE 1: Treatment methods include diet; exercise; behavior modification; medications; and bariatric surgery.', 'bariatrics', '-', 58, 'ANMÄRKNING 1: Behandlingsmetoderna omfattar diet, fysisk aktivitet, beteendeförändringar, medicinering och kirurgisk behandling', '2020-06-09, vikee1, perha11: Preliminärt definierad\r\n2020-06-11, karkj, magfo perha11: Beslutad!', '-', '.'),
(722, 'Rensa inställningar är en funktion där man återställer vad som visas i Mpage arbetsflöde, dvs alla flikar i sido meyn till vänster. Här kan den enskilde personen välja ordning på flikarna och bestämma vilka flikar som ska visas eller döljas. Det ska konfigureras grundinställningar som är samma för alla, innan man gör sin vy personlig. När man trycker på rensa inställningar återställs alla flikarna till ursprunglig ordning dvs till grundinställningarna. \r\n\r\nVerksamhetsexperterna gillad inte termen rensa inställningar för denna funktionen. Behov av ny term.', '2020-06-08 11:32:11.000000', '[Millennium] -', '-', '-', 'Publicera ej', 'rensa inställningar', '-', '-', '-', 169, '-', '2020-05-26,  verwi6, marel67: Denna term är hårdkodad och under utredning tillsammans med Skåne. Kort i JIRA: 538\r\n2020-06-04, perha11, magfo: Ärendet klart SDF-VGR, ligger hos Cerner.\r\n2020-06-08 karkj JIRA 538 avslutas. Publiceras ej i OLLI. Ändrat status.', '-', '-'),
