(725, '-', '2020-05-12 15:34:40.000000', 'ordination som avser läkemedelsbehandling där patienten själv får bedöma behovet och doseringen inom givna ramar beroende på omständigheterna', '-', 'Socialstyrelsens termbank', 'Beslutad', 'vidbehovsordination', '-', '-', '-', 4, 'ANMÄRKNING 1: Intag och dosering vid vidbehovsordination styrs av t.ex. tidsaspekt, villkor eller behov.\r\n\r\nANMÄRKNING 2: I vissa sammanhang kan det vara en annan person än patienten själv som gör bedömningen, t.ex. en sjuksköterska eller anhörig.\r\n\r\nANMÄRKNING 3: Vidbehovsordination gäller oftast läkemedel men termen används även om andra åtgärder, såsom behovsstyrt intag av kosttillägg och sondnäring.', '2020-05-12, vikee1, preliminärt definierad.\r\n2020-05-12, sofan63, karkj, perha11, magfo: beslutad', '-', '-'),
