(728, '-', '2020-06-23 09:16:15.000000', 'hälso- och sjukvårdskontakt som endast hälso- och sjukvårdspersonal deltar i', '-', 'Informatik VGR', 'Beslutad', 'indirekt vårdkontakt', '-', '-', '-', 173, 'ANMÄRKNING 1: Utredning 2020-06-16 av T Lundmark, M. Fogelberg: I arbetet med att översätta encounter till svenska har gjorts en begreppsanalys med förslag till svensk term på detta begrepp och de närmast underordnade. Cerner önskar översätta till vårdkontakt, vilket inte stämmer med betydelsen av encounter. I såväl Socialstyrelsens definition i termbanken som i Contsys, som VGR använder i begreppssystem 1.0, deltar såväl patient som hälso- och sjukvårdspersonal i en vårdkontakt. För att tillgodose alla typer av encounter såsom det används i Millennium behövs ett begrepp som inkluderar tillfällen då hälso- och sjukvårdspersonal engagerar sig i en patient (till exempel genom att läsa eller skriva journal, utfärda remiss, ta del av provsvar) utan att patienten är närvarande. \r\n\r\nTillsammans med Skåne beslutades att detta begrepp skulle ges termen hälso- och sjukvårdskontakt med synonymen kontakt. Detta har införts i OLLI: hälso- och sjukvårdskontaktkontakt situation när hälso- och sjukvårdspersonal engagerar sig i patient. Om också patienten är närvarande motsvarar begreppet det som definierats i VGR 1.0: vårdkontakt/direkt vårdkontakt, samspel mellan en patient (5.2.1) och en eller flera hälso- och sjukvårdspersonal (5.2.3.3).  Synonymen direkt vårdkontakt har använts för att stryka under det faktum att vårdkontakten inkluderar patienten.  Om ingen patient deltar i kontakten kallas den indirekt vårdkontakt: indirekt vårdkontakt: hälso- och sjukvårdskontakt som endast hälso- och sjukvårdspersonal deltar i. Termen finns inte i Socialstyrelsens termbank men är i Contsys synonym till vårdkontakt, som förutsätter patientens medverkan (på engelska contact respektive healthcare contact). \r\n\r\nTermen encounter finns i Contsys endast som synonym till contact period, översatt till svenska vårdkontaktperiod med synonym vårdmötesperiod. I Snomed CT finns indirekt kontakt (indirect encounter) som bland annat omfattar e-postkontakt med tredjepart inom hälso- och sjukvård men även direkt kontakt med patienten i form av brev, telefon och digital länk. Det synes inte finnas något gemensamt sätt att beteckna de funktioner som Cerner Millennium implementerar under beteckningen encounter, varför vi sett det nödvändigt att frångå Contsys synonymi mellan vårdkontakt och hälso- och sjukvårdskontakt. \r\n\r\nVårdkontakt kan specialiseras så att team- och gruppbesök inkluderas. \r\n\r\nPå bas av denna redovisning föreslås i linje med vad som överenskommits vid möte med Skåne 2020-06-15 de begreppsposter som redovisas ovan med de relationer som framgår av modellen. Synonymen hälso- och sjukvårdskontakt till vårdkontakt i begreppssystem VGR 1.0 föreslås strykas i den begreppsposten.', '2020-05-13, perha11, verwi6: Satt som preliminär.\r\n2020-05-14, karkj, magfo: Definition ändrad, termposten beslutad.\r\n2020-05-14, perha11: lagt till andra anmärkningen. Åter till preliminär\r\n2020-05-18, magfo: ändrat överordnat begrepp till hälso- och sjukvårdskontakt.\r\n2020-05-19, karkj, perha11: Beslutad.\r\n2020-05-28, karkj, perha11, magfo: Definitionen ändrad, termposten beslutad\r\n2020-06-09, magfo: Begreppsposten analyserad, identisk med hälso- och sjukvårdskontakt varför begreppet ställs av.\r\n2020-06-16, magfo: Efter diskussion i begreppsbyrån, med Skåne och arbetsmöte med Torsten Lundmark återinförs begreppet med ny definition. Preliminärt.\r\n2020-06-18, karkj, magfo: Anmärkning tillförd från utredningsunderlaget Lundmark - Fogelberg.\r\n2020-06-23, karkj, magfo: Beslutad.', '-', '-'),
