riod, översatt till svenska vårdkontaktperiod med synonym vårdmötesperiod. I Snomed CT finns indirekt kontakt (indirect encounter) som bland annat omfattar e-postkontakt med tredjepart inom hälso- och sjukvård men även direkt kontakt med patienten i form av brev, telefon och digital länk. Det synes inte finnas något gemensamt sätt att beteckna de funktioner som Cerner Millennium implementerar under beteckningen encounter, varför vi sett det nödvändigt att frångå Contsys synonymi mellan vårdkontakt och hälso- och sjukvårdskontakt. \r\n\r\nVårdkontakt kan specialiseras så att team- och gruppbesök inkluderas. \r\n\r\nPå bas av denna redovisning föreslås i linje med vad som överenskommits vid möte med Skåne 2020-06-15 de begreppsposter som redovisas ovan med de relationer som framgår av modellen. Synonymen hälso- och sjukvårdskontakt till vårdkontakt i begreppssystem VGR 1.0 föreslås strykas i den begreppsposten.', '2020-05-13, perha11, verwi6: Definierad som preliminär.\r\n2020-05-14, karkj, magfo: Ny definition, termposten beslutad.\r\n2020-05-18, magfo: Ändrat överordnat begrepp till hälso- och sjukvårdskontakt.\r\n2020-05-19, karkj, perha11: Beslutad.\r\n2020-06-09, magfo: Begreppsutredning gjord. Posten preliminär.\r\n2020-06-18, karkj, magfo: Anmärkning tillagd om utredning Lundmark - Fogelberg.\r\n2020-06-23, karkj, magfo: Beslutad.', '-', 'hälso- och sjukvårdskontakt som patient deltar i (Informatik VGR)\r\n\r\nkontakt mellan patient och hälso- och sjukvårdspersonal då hälso- och sjukvård utförs (Socialstyrelsens termbank)'),
(730, 'Om någon aktivitet/ordination inte kan genomföras vad kan vi ha för gemensam/generell beskrivning av detta-. Diskussion utgår från : Lavemang oväntat resultat ersätts av Lavemang går ej att genomföra? Vad kan vi ha för generell term för att en ordination/aktivitet inte kan genomföras?', '2020-06-02 10:18:23.000000', 'ange att planerad åtgärd inte utförts', '416237000 | åtgärd inte utförd |', 'Informatik VGR', 'Beslutad', 'åtgärd inte utförd', '-', 'procedure not done', '-', 116, '-', '2020-05-13, Marel67: Inlagd från Jirakort INFMTK-203. Ursprungligen från Gertrude.\r\nhttps://vgregionit.atlassian.net/secure/RapidBoard.jspa?rapidView=117&modal=detail&selectedIssue=INFMTK-203&search=203\r\n2020-05-28, marel67, perha11: Definierad, preliminär\r\n2020-06-02, karkj, perha11: Justerad, beslutad!', 'SNOMED CT', '-'),
(731, '-', '2020-05-19 11:29:46.000000', 'i samråd med patient föreskriven aktivitetsföljd, registrering av aktivitetsutfall och ändringar i hälsotillstånd som kan bidra till beslutsstöd genom ändring av föreskrift om aktiviteter', '-', 'Informatik VGR', 'Beslutad', 'personcentrerat sammanhållet vårdförlopp', '-', 'care pathway, clinical pathway', '-', 173, 'ANMÄRKNING 1: Termen betecknar ett generellt använt begrepp som överensstämmer med det som på engelska betecknas care pathway, som inte ska översättas på något annat sätt. Det får inte förväxlas med beteckningen på regeringsuppdraget Personcentrerat och sammanhållet vårdförlopp. En detalj är att vi i termen uteslutit ordet \"och\" som inte tillför något i begreppsbeteckningen.', '2020-05-15, magfo, gerpe4, mikwe2, vikee1: Översättning av care pathway genomförd enligt terminologisk metodik. Termposten beslutad.\r\n2020-05-19, magfo, karkj, perha11: Definitionen förädlad, beslutad.', '-', '-'),
