(733, 'alla typer av  parenteral tillförsel av läkemedel.', '2020-08-13 14:19:46.000000', 'tillförsel av läkemedel genom injektion och infusion', '738984000 |Parenteral (intended site)|', 'Informatik VGR', 'Pågår', 'parenteral läkemedelsbehandling', '-', 'iv set', 'Inte definierad', 175, 'ANMÄRKNING 1: Begreppet innebär att läkemedel tillförs på annat sätt än till tarmen. Inkluderar intraokulärt, intraperitonealt m.fl.\r\n\r\nANMÄRKNING 2: Snomedbegreppet inkluderar inte intravenös tillförsel!!\r\n\r\nANMÄRKNING 3: Inkluderar inte tillförsel via tarmen (piller, sirap, l-DOPA-gel som instilleras i tolvfingertarmen).', '2020-07-28, magfo: Förslag till definition och term införda.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.\r\n2020-08-13, helse4, magfo: Enligt Helène är begreppet begränsat till tillförsel direkt i blodbanan, dvs intravenöst, Då stämmer millenniumtermen, men vi har inte någon häftig kökslatinsk term för subkutan och intramuskulär injektion.\r\n2020-08-18, helse4, karkj, sofan63, magfo: Definitionen ändrad.\r\n2020-08-25, davte1, sofan63: Verksamhetsexperter säger att definitionen inte stämmer överens med vad som menas. Ändrade status till pågår. Behövs revidering och ytterligare utredning.', 'Snomed CT (stämmer inte helt)', '-'),
