(739, 'En granskning och bedömning av läkaren i realtid.', '2020-05-28 11:45:38.000000', 'metod för kartläggning av en patients samtliga ordinerade och använda läkemedel i syfte att säkerställa en korrekt och aktuell läkemedelslista', '182836005 | läkemedelsgenomgång |', 'Vårdhandboken', 'Publicera ej', 'läkemedelsgenomgång', '-', '-', '-', 180, 'ANMÄRKNING 1: Det är dessutom en metod för analys, omprövning och uppföljning av en patients hela läkemedelsanvändning i syfte att upptäcka, åtgärda och förebygga läkemedelsrelaterade problem (LRP).\r\n\r\nANMÄRKNING 2: Det finns två olika läkemedelsgenomgångsmodeller, enkel läkemedelsgenomgång och fördjupad läkemedelsgenomgång.', '2020-05-26, marel67: Begrepp definierat. SNOMED CT begrepp tillagt. Flyttat till preliminärt.\r\n2020-05-28, karkj, perha11, magfo: Enkel och fördjupad läkemedeksgenomgång är införda i OLLI, läkemedelsgenomgång utan attribut finns inte som begrepp och ställs därför av.', 'SNOMED CT', '-'),
(740, '(Patient Controlled Analgesia)\r\nSmärtlindring, utan förlust av medvetandet, med hjälp av smärtstillande medel som ges genom självadministrering. Syftet med tekniken är patienten ska styra sin smärtlindring och direkt kunna få läkemedel vid upplevd smärta.  Brukar förkortas PCA. I definitionen kan inte tas med frasen om bibehållet medvetande.', '2020-05-28 11:25:45.000000', 'självdosering av smärtstillande medel', '241716000 | Patient controlled analgesia (procedure) |', 'Svensk MeSH reviderad', 'Beslutad', 'patientstyrd smärtlindring', '-', 'Patient Controlled Analgesia', '-', 181, 'ANMÄRKNING 1: I definitionen kan inte anges att patienten behåller medvetandet, för överdosering är fullt möjlig med medvetandeförlust som komplikation. Alltså är texten från MeSH ändrad.', '2020-05-27, verwi6, marel67: Begrepp definierat. SNOMED CT begrepp inlagt. Synonym tillagd. Flyttad till Preliminär.\r\n2020-05-28, karkj, perha11, magfo: Definitionen avkortad, anmärkning tillagd. Beslutad. Synonymen avrådd (förkortning ska normalt inte användas ens som synonym).', 'SNOMED CT', '-'),
(741, 'Vid sökning på tolk fick vi inte relevant träff.\r\nTolk är en person/roll som översätter svenska till annat språk.', '2020-05-28 10:00:39.000000', 'person som yrkesmässigt ut­för över­sättning', '40570005 | tolk |', 'SO', 'Beslutad', 'tolk', '-', 'Interpreter', '-', 182, 'ANMÄRKNING 1: Översättningen utförs huvudsakligen muntligt\r\nANMÄRKNING 2: Tolkning innebär också att förstå och uttrycka kulturella skillnader', '2020-05-27, verwi6, marel67: Begrepp definierat. SNOMED begrepp inlagt. Flyttad till Preliminär.\r\n2020-05-28, karkj, perha11: Anmärkning 2 tillagd. Beslutad', 'SNOMED CT', '-'),
(742, 'när en patient kommer från primärvården och läggs in direkt på avdelning i slutenvård, ibland kommer patienten via akutmottagningen och in på avdelning.', '2020-06-16 11:29:51.000000', 'patient som skrivs in i slutenvård utan att passera akutmottagning', '-', 'Informatik VGR', 'Beslutad', 'direktinskrivning', '-', '-', '-', 183, 'ANMÄRKNING 1: Syftet är att minska oplanerade transporter och undvikbar väntan på akuten och därmed minska belastningen på akutmottagningen.\r\n\r\nANMÄRKNING 2: Begreppet innefattar också de fall då en patient återinskrivs efter tidigare vårdtillfälle utan kontakt med öppenvårdsmottagning vid sjukhuset eller primärvården. Kallas vanligen öppen retur. \r\n\r\nANMÄRKNING 3: Exempel på direktinskrivning är om en patient söker på vårdcentralen och man därifrån kommer överens med en vårdavdelning om direktinskrivning.', '2020-06-10, marel67, verwi6: Definition och anmärkning tillagd, flyttad till preliminär.\r\n2020-06-11, karkj, magfo perha11: åter Pågår,  Jira 812\r\n2020-06-16, karkj, magfo: definitionen förädlad, begreppsposten beslutad.', '-', '-'),
(743, 'Vid titrerbar läkemedelsbehandling anger läkaren målvärden för behandlingen. Ex vis blodsocker ska ligga mellan 6-8 mmol/L och sjuksköterskan styr infusionen av insulin mot dessa riktvärden.\r\n\r\nParkinsson patienten får L-DOPA och behandlingen styrs mot målvärden i en bedömningsmall\r\n\r\nSmärtpatienten ska ha VAS < 3 då är detta ett målvärde', '2020-08-05 11:50:51.000000', 'värde på parameter som eftersträvas under behandling', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'målvärde', 'Inte definierad', 'Inte definierad', 'Inte definierad', 184, 'ANMÄRKNING 1: Parametervärde kan vara läkemedelskoncentration, kroppstemperatur, syremättnad, kroppsmassa, andningsfrekvens, labbvärde.', '2020-07-28, magfo: Förslag till definition och anmärkning skrivna.\r\n2020-08-05, ollka3, sofan63, magfo:Beslutad.', 'Inte definierad', '-'),
(744, 'En definierad behandling och bakomliggande ordination styrs med hjälp av uppsatta, på förhand definierade behandingsmål', '2020-07-31 18:25:47.000000', '[hälso- och sjukvård] behandling styrd genom utvärdering av upprepade provtagningar och kliniska observationer som ställs i relation till behandlingsmål definierade i en ordination', '-', 'Informatik VGR', 'Beslutad', 'målstyrd behandling', '-', '-', '-', 184, 'ANMÄRKNING 1: labbproverna kan återspegla funktion hos inre organ eller läkemedelskoncentration. Andra  parametrar kan hämtas från kliniska observationer som andningsfrekvens, hudfärg.\r\n\r\nANMÄRKNING 2: Kontrollerad nutrition vid avhjälpande av kakexi och anorexi följs med vägning av patienten (men också blodprover som ska påvisa eventuell acidos).\r\n\r\nANMÄRKNING 3: Målstyrd behandling för lätt tanken till läkemedelsbehandling men är ett generiskt begrepp som avser alla behandlande hälso- och sjukvårdsaktiviteter.', '2020-07-28, magfo: Ärendet i sin helhet överfört till JIRA 1034 för samråd med beställaren.\r\n2020-07-31, magfo: Uppdatering med fråga till Helène.\r\n2020-08-18, helse4, karkj, sofan63, magfo: Definitionen förädlad.', '-', '-'),
(745, 'Ett eller flera ingående läkemedel i en på förhand uppsatt ordinationsplan med definierad indikation och mot ett mål', '2020-08-05 11:49:44.000000', 'förteckning över planerade och gjorda ordinationer', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'ordinationsplan', 'Order Plans allow a user to create a custom set of orders that can be ordered at the same time. They are useful for treating specific conditions or for treatments that involve multiple orders.', 'order plans', 'Inte definierad', 186, 'ANMÄRKNING 1: Ordinationsplnen förtecknar alla ordinationer som planeras samt gjorda och utförda ordinationer. Se https://wiki.cerner.com/display/Ambulatory/Order+Plans\r\n\r\nANMÄRKNING 2: Observera att den engelskspråkiga termen står i pluralis enligt Cerners ordlista medan den svenska termen ska stå i singularis.\r\n\r\nANMÄRKNING 3: Ordinationsplan får inte inskränkas till läkemedel.\r\n\r\nANMÄRKNING 4: Ett eller flera ingående läkemedel i en på förhand uppsatt ordinationsplan med definierad indikation och mot ett mål', '2020-07-28, magfo: Definition, anmärkningar och utredning i Cerner glossary gjord.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', 'Inte definierad', '-'),
(746, 'När ett läkemedel som satts  in behöver monitoreras avseende blod/plasma koncentration för att veta hur stor mängd av aktiv substans som ska ges vid nästa tillfälle. Ex vissa typer av Antibiotika, epilepsiläkemedel mfl', '2020-07-29 11:43:56.000000', 'mätning av relativ mängd av ett ämne i en lösning eller blandning', '702942001 |koncentration|', 'Rikstermbanken, reviderad', 'Beslutad', 'koncentrationsbestämning', '-', '-', '-', 237, 'ANMÄRKNING 1: Bestämning av läkemedelskoncentration i blod kan behövas för att bestämma nästa dos. De flesta blodprover ger som svar koncentrationen av ett ämne i blod/serum/plasma. Koncentrationsbestämningar görs också i andra kroppsvätskor.', '2020-07-28, magfo: koncentrationsbestämning är en vårdaktivitet som enligt denna begreppspost syftar till att  bestämma läkemedelskoncentration. Men andra typer av koncentrationer kan också bestämmas, t.ex. antikroppar. Detta begrepp får inte definieras för snävt, och begreppet läkemedelskoncentration bör tillföras.\r\n2020-07-29, magfo: Förslag till definition skrivet.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT (avser tekniken, inte resultatet)', '-'),
(747, 'Eng förkortning för patient controlled analgesia. \r\nVi vill anv svensk term som patientstyrd smärtbehandling', '2020-05-27 10:01:35.000000', '-', '-', '-', 'Publicera ej', 'PCA', '-', '-', '-', 188, '-', '2020-05-27, verwi, marel67: Förkortning tillagd som synonym till patientstyrd smärtlindring. Flyttad till Publicera ej.', '-', '-'),
(748, 'Att ett läkemedel ges utanför tarmsystemet direkt i blodbanan', '2020-06-04 10:27:34.000000', 'tillförd utanför mag-tarmkanalen', '738984000 |parenteral|', 'Informatik VGR', 'Beslutad', 'parenteral', '-', '-', '-', 189, 'Socialstyrelsen redovisar inte adjektivet parenteral men anger parenteral nutrition med synonym intravenös nutrition. Snomed CT har för begreppet parenteral ingen definition (axiom) men anger som underordnade begrepp intraokulär, intraperitoneal och subkutant men inte intravenös!', '2020-05-27, verwi6, marel67: Kort skapat i JIRA, 676. Flyttad till pågår.\r\n2020-06-04, karkj, magfo: Begreppsposten bearbetad och beslutad.', 'Snomed CT', '-'),
(749, 'följsamhet till ett givet mål\r\n\r\nObs finns inom lungfysiologi och kärlverksamhet som ett uttryck för vävnades eftergivlighet (lungfysiologi) i termen följsamhet till tryckadaptation', '2020-08-05 11:40:54.000000', '[hälso- och sjukvård] mått på vävnads elasticitet', '-', 'Informatik VGR', 'Beslutad', 'compliance', '-', 'compliance', '-', 190, 'EXEMPEL 1: Mått på töjbarheten hos en kammare, som t ex en lunga (lungtänjbarhet) eller urinblåsan. Tänjbarheten anges som volymförändring per tryckenhetsförändring.', '2020-07-06, vikee1, marel67: Preliminärt definierad.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad, se också JIRA 536.', '-', '-'),
(750, 'förteckning  över produktval\r\n\r\nDe val av upphandlade produkter som finns \r\n\r\nBehöver definieras i kontexten läkemedelsförteckning som beskriver de fysikaliska och kemiska egenskaperna utöver rena produktnamn. Se MesH Karolinska Institutet', '2020-07-28 10:23:51.000000', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'läkemedelskatalog', 'Inte definierad', 'Inte definierad', 'Inte definierad', 1, 'Inte definierad', '2020-07-28, magfo: Utred tillsammans med läkemedelsförteckning på JIRA 1033.', 'Inte definierad', '-'),
(751, 'Förteckning över allt relaterat till en substans oavsett om det är upphandlat eller ej, interaktioner, biverkn kemi m m\r\n\r\nLMV ansvarar för regelverket kring läkemedelsförteckningen. en sorts produktresumé. Vad ska vi luta oss mot?', '2020-07-28 10:09:10.000000', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'läkemedelsförteckning', 'Inte definierad', 'Inte definierad', 'Inte definierad', 1, 'Inte definierad', '2020-07-28, magfo: Början till begreppsanalys, se JIRA 1033!', 'Inte definierad', '-'),
(752, 'Från  PDL', '2020-06-02 10:56:21.000000', 'personuppgifter som är kopplade till en patient och har relevans utöver den enskilda vårdkontakten', '-', '-', 'Pågår', 'patientnivådata', '-', 'patient level data', '-', 2, 'EXEMPEL 1:  allergier, implantat, kroniska diagnoser', '2020-05-26, verwi6, perha11: Nyupplagd\r\n2020-05-28, marel67, perha11: Definierad, preliminär\r\n2020-06-02, karkj, perha11: Åter till Jira 463, Pågår.', '-', '-'),
(753, 'Från PDL', '2020-06-02 10:56:49.000000', 'samlingsbegrepp för personuppgifter som är kopplade till en vårdkontakt/period av sammanhängande vårdkontakter', '-', 'Informatik VGR', 'Pågår', 'vårdkontaktsdata', '-', 'encounter data', '-', 2, '-', '2020-05-26, verwi6, perha11: Nyupplagd\r\n2020-05-28, marel67, perha11: Definierad, preliminär\r\n2020-06-02, karkj, perha11: Åter till Jira 463, Pågår.', '-', '-'),
(754, '-	Utrustningen som mäter syresättning perifert skiljer sig åt. Vi har en mängd olika MT-utrustning i regionen som mäter detta. \r\n-	Vad PV står för kan nog vara bra att klargöra, så det inte blir missförstånd i kontexten. \r\n-	Vi har en parkerad fråga kring detta ( Vårddokumentation). Den ena är om det ska heta syremättnad och det andra om det ska heta saturation. Vi behöver nog ha konsensus kring detta mellan arbetsströmmarna för ett konsekvent sätt att benämna detta på. \r\n\r\nPV:s ursprungsfråga:\r\nMina SMEEr studsade på \"perfier syremattnad PV\" där pv antas vara för primärvård. Dels eftersom det är samma utrustring som på sjukhus samt att de inte känner sig bekväma med \"perfier syremättnad\" någon som har sprungit på något liknande?', '2020-07-28 15:09:34.000000', 'syreinnehåll i perifert blod', '-', '-', 'Beslutad', 'perifer syremättnad', '-', '-', '-', 193, 'ANMÄRKNING 1: JIRA 864 säger\r\n\r\nSyremättnad är samma som saturation. Den kan vara central eller perifer. Det vi mäter är oftast perifer, dvs perifer syremättnad. På vem man gör det och vilka mojänger som använmds är terminologiskt ointressant men kliniskt av vital betydelse. Begreppet perifer syremättnad får inte begränsas till viss metod. POx eller pulsoximetri är alltså en metod att mäta perifer syremättnad, och metoden POx ger ett värde som vi kan uppfatta som perifer syremättnad. Termen perifer syremättnad får aldrig beteckna en mätmetod.', '2020-06-18: marel67, verwi6. Flyttad till pågår. Kort i jira skapats, 864.\r\n2020-07-28, magfo: Skrivit definition.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(756, 'Behöver en definition av termen eftersom det kan används i flera strömmar.\r\n\r\nDet är kopplad till tillväxt av barn.\r\n\r\nLite bakgrund finns här \r\n\r\nSitting height is a measure of the upper segment of the body including the trunk, neck, and head heights. The difference between sitting height and standing height offers an accurate estimate of leg length, or subischeal height. Because the hip joint is difficult to locate precisely, this estimation proves much easier than a direct measurement of leg length.\r\n\r\nSitting height is determined by measuring the distance from the sitting surface to the top of the head using a wall-mounted Harpenden stadiometer and a seat sufficiently\r\nhigh so that the participant’s thighs are in horizontal position. \r\n\r\nhttps://healthabc.nia.nih.gov/sites/default/files/ahgtcomb.om1_0.pdf', '2020-06-18 09:46:54.000000', 'avstånd från topp av huvud till stödyta som person sitter upprätt på', '248335006 | längd i sittande |', 'Informatik VGR', 'Beslutad', 'längd i sittande', 'the distance from the vertex of the head to the supporting surface on which a person is sitting erect\r\n\r\nKälla: Marriam-Webster', 'Sitting height', '-', 195, 'ANMÄRKNING 1: Används för uträkning av funktionell benlängd, dvs skillnaden mellan längd i stående och längd i sittande ger ett standardiserat mått på benlängden.\r\n\r\nANMÄRKNING 2: Definitionen är en översättning av definition i ett verk av Marriam-Webster.\r\n\r\nANMÄRKNING 3: Synonymen sitthöjd avråds, då termen kan uppfattas som avståndet mellan sittyta och golv. Se Jira 805.', '2020-06-10, marel67, verwi6: Utländsk definition inlagd. Skapat kort för ytterligare utredning. Flyttad till pågår. Kort 805\r\n\r\n2020-06-16, marel67: Förslag på svensk definition tillagd. Synonym tillagd. Flyttad till Preliminär för att få bollen i rullning.\r\n\r\n2020-06-18, karkj, magfo: Begreppsposten fastställd.', 'SNOMED CT', '-'),
(757, 'Behov att förtydliga ordet paramedicinsk personal - vad innebär det?\r\n Ordet paramedicinare används ofta för yrkesgrupper som arbetsterapeuter , fysioterpeuter m fl.  Det är viktigt att de yrkesgrupper som det är ett samlingsnamn för anser det vara en lämplig term. Hittar  inte en tydlig beskrivning av ordet på Socialstyrelsens hemsida, men det förkommer inbakat i olika texter.  Vi kan lägga in det i Ollie för att det skall finnas beskrivet som begrepp.\r\n\r\nEnligt Mesh:\r\nSvensk definition\r\nPersoner med speciell utbildning och legitimation för hälso- och sjukvårdsrelaterade arbetsuppgifter.\r\nEngelsk definition\r\nHealth care workers specially trained and licensed to assist and support the work of health professionals. Often used synonymously with paramedical personnel, the term generally refers to all health care workers who perform tasks which must otherwise be performed by a physician or other health professional.', '2020-06-09 11:39:13.000000', 'Definieras ej! Se anmärkning.', '-', '-', 'Avråds', 'paramedicinsk personal', '-', '-', '-', 196, 'ANMÄRKNING 1: Paramedicinsk personal eller paramedicinare har kommit att bli en jargongmässig beteckning på en rad yrken inom hälso- och sjukvården där läkare och som regel sjuksköterskor, undersköterskor och skötare inte inkluderas. I första hand har man syftat på arbetsterapeuter och fysioterapeuter, men en rad andra yrken bör då inkluderas, till exempel psykologer, logopeder, ortoptister, kuratorer, dietister, optiker och ortopedtekniker. Att klumpa ihop alla dessa värdefulla kompetenser är nedlåtande, och varje yrke ska använda sin egen beteckning oavsett om det är ett legitimerat yrke, en skyddad yrkestitel eller företrädare för annan funktion i hälso- och sjukvårdens verksamhet.', '2020-06-09, karkj, magfo: Begreppsposten avstyrd en gång för alla!', '-', '-'),
