(760, '-', '2020-05-28 11:51:38.000000', 'redogörelse för vilka läkemedelsförändringar som gjorts under ett vårdtillfälle', '-', 'RMR läkemedel, läkemedelsgenomgång och läkemedelsberättelse', 'Beslutad', 'läkemedelsberättelse', '-', '-', '-', 155, 'ANMÄRKNING 1: Läkemedelsberättelse överlämnas till alla patienter oavsett ålder vid utskrivning från sjukhus tillsammans med en aktuell läkemedelslista och vidarebefordras till nästa vårdutförare samma dag.', '2020-05-28, karkj, perha11, magfo: Begreppsposten skapad och beslutad.', '-', '-'),
(762, 'katalognummer är en översättning som finns i modulen för materialhantering, och är enligt Cerner unikt nummer på förpackningen som skannas in. SME undrade vad det stod för och därför behöver det kanske redas i. Eventuellt kan det vara översättningen som behöver ändras...', '2020-06-18 09:40:14.000000', '-', '-', '-', 'Pågår', 'katalognummer', '-', '-', '-', 197, '-', '2020-06-18, marel67, verwi6: Flyttat till pågår. Upplagd i jira för utredning. Kort 865.', '-', '-'),
(764, 'information om en persons kroppslängd\r\n\r\n/Det finns kroppsvikt men saknas motsvarande genomgång av kroppslängd. (Gertrud)/', '2020-06-04 10:47:40.000000', 'avståndet från undersida av häl till huvudets överkant', '-', 'Wikipedia (reviderad)', 'Beslutad', 'kroppslängd', '-', '-', '-', 199, '-', '2020-06-03, karkj: preliminär definition tillagd.\r\n2020-06-04, karkj, magfo: Definitionen justerad, posten beslutad.', '-', '-'),
(765, 'Begreppen behöver förtydligas.', '2020-06-24 11:13:46.000000', 'intyg som utfärdas av läkare om att en person har avlidit', '-', 'Informatik VGR', 'Beslutad', 'dödsbevis', '-', '-', '-', 200, 'ANMÄRKNING 1: I Rikstermbanken definieras dödsbevis som en handling som intygar dödsorsaken, vilket är fel (se dödsorsaksintyg).', '2020-05-29, karkj: Delat upp begreppen till två. Lagt upp dödsorsaksintyg som ny termpost. Ej påbörjad.\r\n2020-06-24, vikee1, davte1: Preliminärt definerat.\r\n2020-06-24, karkj, magfo: Definitionen rättad. Anmärkning tillagd. Beslutad.', '-', '-'),
(766, '.', '2020-07-06 15:09:16.000000', '-', '.', '.', 'Publicera ej', 'dödsorsaksintyg', '.', '.', '-', 127, '.', '2020-05-29, karkj: Flyttat över denna termpost till egen term.\r\n2020-07-06, vikee1, marel67: Detta är en dubblett och sätts till Publiceras Ej.', '.', '.'),
(773, 'Från läkemedelsströmmen', '2020-06-04 09:38:01.000000', 'kroppsdel eller kroppsstruktur där läkemedel tillförs', '-', 'Informatik VGR', 'Beslutad', 'administreringsställe', '-', '-', '-', 20, 'ANMÄRKNING 1: Anmärkning till termpost administreringssätt i Socialstyrelsens termbank:\r\nAdministreringsställe, dvs. den kroppsdel eller kroppsstruktur där läkemedlet administreras, t.ex. munhåla, skuldra, lår. Ibland är administreringsstället detsamma som det målorgan som läkemedlet ska påverka, t.ex. ögat för ögondroppar.', '2020-05-29, perha11: Tillagd\r\n2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', '-'),
(774, 'Från läkemedelsströmen', '2020-08-13 14:07:18.000000', 'väg in i kroppen som läkemedel tar för att nå målorgan', '-', 'Informatik VGR', 'Beslutad', 'administreringsväg', '-', '-', '-', 20, 'ANMÄRKNING 1: Anmärkning till termpost administreringssätt i Socialstyrelsens termbank:\r\nAdministreringsväg, dvs. den väg i kroppen som ett läkemedel tar för att nå ett målorgan. Det kan exempelvis komma in oralt (via munnen) eller intravenöst (i ven).', '2020-05-29, Perha11: Nyupplagd\r\n2020-06-04, karkj, magfo: Beslutad.\r\n2020-08-13, helse4, magfo: In tillagt i definitionen', '-', '-'),
(775, 'Läkemedelsströmmen', '2020-08-05 11:27:42.000000', 'hälsoförhållande som föranleder hälso- och sjukvårdsaktivitet', '-', 'Informatik VGR', 'Beslutad', 'behandlingsorsak', '-', '-', '-', 20, 'ANMÄRKNING 1: till termpost ordinationsorsak i termbanken:\r\nVid läkemedelsordinationer kan två typer av ordinationsorsaker dokumenteras: behandlingsorsaker och ändringsorsaker.\r\nEn behandlingsorsak är skälet till den läkemedelsbehandling som ordineras. Exempel på behandlingsorsaker är olika hälsotillstånd, som huvudvärk, hjärtflimmer och blåsor i munnen.\r\n\r\nBeskrivning i begreppsmodell: En behandlingsorsak är en typ av ordinationsorsak.\r\nExempel på behandlingsorsaker:\r\n- ett hälsotillstånd som man vill behandla med läkemedel, till exempel muntorrhet, epigastriskt obehag, svår oro.\r\n- ett risktillstånd som man vill förebygga med läkemedel, till exempel kardiovaskulär primärprevention, osteoporos med hög risk för fraktur\r\nen aktivitet som ska utföras med hjälp av läkemedel, till exempel diagnostisk radiografi med kontrastmedel', '2020-05-29, perha11: Nyupplagd med alternativ definition från SoS\r\n2020-06-02, sofan63, magfo: Termposten justerad.\r\n2020-06-02, karkj, perha11: Satt som avrådd. Se Ordinationsorsak.\r\n2020-06-03, magfo: Andra definitionen flyttad till \"annan definition\".\r\n2020-06-04, magfo: Ändrad till preliminär eftersom det är ett av två underordnade begrepp till ordinationsorsak.\r\n2020-06-30, davte1: Ändrade till preliminär då den stod kvar som ej påbörjad.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', 'hälsoangelägenhet (6.3) som hälso- och sjukvårdspersonal (5.2.3.3) anger som skäl för behandling'),
(776, 'Används i Surginet som rubrik där man har möjlighet att välja vilken nivå av vård som krävs efter operation. Det hette förut vårdnivå men var missvisande då vissa trodde att det stod för Länssjukvård, Regionsjukvård osv. \r\n\r\nNågra av valmöjligheterna som finns inom Postoperativ vårdplats är: postop, IVA, postop över natten, hemavdelning.', '2020-08-05 11:22:09.000000', 'vårdplats avsedd för vård av patient efter kirurgiskt ingrepp', '-', 'Informatik VGR', 'Beslutad', 'postoperativ vårdplats', '-', '-', '-', 207, '-', '2020-07-02, davte1: Är en synonym till vårdnivå, ska postoperativ vårdplats tillåtas som en synonym till vårdnivå?\r\n2020-07-28, magfo: Skrivit definition.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(777, 'I ambulatory använder vi denna översättning för \"patient communication preference\"\r\n\r\nDetta betyder sättet som en patient önskar att bli kontaktad via. Om någon är döv så kan de föredra att få ett mail över ett telefonsamtal etc. I primärvården används somsagt “föredraget kommunikationssätt”.', '2020-08-05 11:21:33.000000', 'teknik som patient önskar att vårdutförare ska använda vid utväxling av information', '428330008 |föredraget kommunikationssätt|', 'Informatik VGR', 'Beslutad', 'föredragen kontaktväg', '-', '-', '-', 208, 'ANMÄRKNING 1: Synonymen \"kommunikationssätt\" kan likaväl föra tanken till föredraget språk, dövtecken etc. Av sammanhangsbeskrivningen framgår att det avser den teknik som patienten föredrar i kontakt med vårdutföraren: telefon/brev/e-post/röksignal/semaforering/morse.', '2020-06-30, davte1 och verwi6: Skapat kort i Jira 961 för mer kontext.\r\n2020-07-01, davte1, verwi6, ajla, vikee1: Lagt till kontext till definition.\r\n2020-07-28, magfo: Diskuterar kring betydelse, föreslagit definition och ändrad term, infört anmärkning.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT', '-'),
(778, 'Översatt \"accompanied by\"', '2020-06-30 14:35:14.000000', '-', '-', '-', 'Pågår', 'medföljande vid besök', '-', '-', '-', 209, '-', '2020-06-30: davte1 och verwi6: Skapat kort i JIRA 962 för mer kontext.', '-', '-'),
(779, '-', '2020-06-04 09:32:42.000000', 'metod för att tillföra kroppen läkemedel', '|447487007|metod för läkemedelsadministrering|', 'Informatik VGR', 'Beslutad', 'administreringssätt', '-', '-', '-', 58, 'ANMÄRKNING 1: Anmärkning till termpost administreringssätt i Socialstyrelsens termbank:\r\nEtt läkemedels administreringssätt, det vill säga hur läkemedlet ska administreras, kan beskrivas med olika uppgifter. Vilken information som är nödvändig skiljer sig från fall till fall.', '2020-06-02, magfo: Termposten startad.\r\n2020-06-03, magfo: Definition skriven. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Begreppsposten administreringsmetod publiceras ej utan termen blir synonym till administreringssätt. Beslutad.', 'Snomed CT', '-'),
(780, '-', '2020-06-04 09:29:11.000000', 'sätt att tillföra läkemedel till kroppen', '-', 'Informatik VGR', 'Publicera ej', 'administreringsmetod', '-', '-', '-', 4, 'ANMÄRKNING 1: Anmärkning till termpost administreringssätt i Socialstyrelsens termbank:\r\nAdministreringsmetod, dvs. den metod som används för att tillföra läkemedlet till kroppen, t.ex. infusion eller injektion.', '2020-06-02, sofan63, magfo: Termposten startad.\r\n2020-06-03, magfo: Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Teknik bytt mot sätt i definitionen. Beslutad.\r\n2020-06-04, karkj, magfo: Publiceras ej. Termen blir synonym till administreringssätt.', '-', '-'),
(781, '-', '2020-06-02 11:32:54.000000', 'uppgift om dos och administreringstillfällen', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'läkemedelsdosering', '-', '-', '-', 4, 'ANMÄRKNING 1: Administreringstillfällen används i stället för dos och periodicitet som SoS anger.', '2020-06-02, sofan63, magfo: Termposten införd.\r\n2020-06-03, karkj: Anser att den är klar.', '-', '-'),
(782, '-', '2020-06-04 09:27:30.000000', 'ändring av läkemedelsdosering som sjuksköterska beslutar om utifrån angiven förutsättning i \r\nordination', '-', 'Informatik VGR', 'Beslutad', 'dosjustering', '-', '-', '-', 4, 'ANMÄRKNING 1: Text hos Socialstyrelsen: Justering av dosering som sjuksköterska gör utifrån de i en ordination givna mål- och mätvärden. Den som ordinerar bestämmer en initial dosering samt de mål- eller mätvärden som ska ligga till grund för dosjusteringen\r\n\r\nANMÄRKNING 2: Definitionen skapad ur en beskrivning i Socialstyrelsens Slutrapport 2019: Gemensamma termer, begrepp och informationsstruktur inom läkemedelsområdet', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03 , karkj: Lagt till ett förslag på ny (ändrad) definition att diskutera inför beslut.\r\n2020-06-03, magfo: Tagit Karins definition med ordet \"aktuell\" struket. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', '-'),
(783, '-', '2020-06-04 09:25:02.000000', 'läkemedel med viss läkemedelsform och styrka som tillverkas på apotek eller verksamhet med särskilt tillstånd för ett visst tillfälle för viss patient, viss vårdenhet, visst djur eller viss djurbesättning', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'extemporeberedning', '-', '-', '-', 4, 'ANMÄRKNING 1: Termbanken anger \"viss sjukvårdsavdelning\", en av termbanken själv avrådd term som nu byts mot gällande term \"vårdenhet\".', '2020-06-02, sofan63, magfo: Termposten införd.\r\n2020-06-03, karkj: status ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', '-'),
(784, '-', '2020-06-04 05:26:57.000000', 'ordinerat läkemedel som beretts inför läkemedelsadministrering', '-', 'Informatik VGR', 'Beslutad', 'iordningsställt läkemedel', '-', '-', 'Inte definierad', 4, '-', '2020-06-02, sofan63, magfo: Termposten införd.\r\n2020-06-03, karkj: Lagt till ett nytt förslag på definition under alternativ definition. Bytt ut ordet färdigställts till färdigberetts.\r\n2020-06-04, magfo: Bytt rekommenderad definition till den som karkj föreslår. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Definitionen förkortad. Beslutad.', '-', '-'),
(785, '-', '2020-06-04 09:21:56.000000', 'benämning på läkemedelsprodukt', '-', 'Informatik VGR', 'Beslutad', 'läkemedelsnamn', '-', '-', '-', 4, 'ANMÄRKNING 1: Under utredning hos Socialstyrelsen.\r\n\r\nANMÄRKNING 2: En läkemedelsprodukt är \"namngivet läkemedel (3.4.3) med viss styrka och läkemedelsform (27.8.1)\", dvs substansen som packas för att distribueras. En läkemedelsvara är \"läkemedelsprodukt (27.8.2) med viss förpackningsstorlek och av viss förpackningstyp\". Förpackningens typ och storlek ska inte påverka läkemedelsnamnet, endast det förpackningen innehåller, dvs läkemedelsprodukten. Läkemedelsformen eller beredningsformen (synonymer, den första rekommenderad) är den form läkemedlet förekommer i, t.ex. tablett, lösning, stolpiller, aerosol. Av dessa begrepp avseende läkemedel är det alltså läkemedelsprodukten som ska förses med namn.', '2020-06-02, sofan63, magfo: Termposten införd, måste utredas före definition.\r\n2020-06-03 karkj, Lagt till en anmärkning.\r\n2020-06-03, magfo: Definition formulerad, utredning gjord som anmärkning 1, posten ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.', '-', '-'),
(786, '-', '2020-08-13 13:58:26.000000', 'hälsotillstånd hos patient som önskas uppnås genom läkemedelsbehandling', '-', 'GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET (SOCIALSTYRELSEN), reviderad', 'Beslutad', 'mål för läkemedelsbehandling', '-', '-', '-', 4, 'ANMÄRKNING 1: Mål med läkemedelsbehandlingen ska dokumenteras vid en fördjupad läkemedelsgenomgång enligt 11 kap. 14 § i HSLF-FS 2017:37. Det är inte en obligatorisk uppgift vid läkemedelsordination men dokumenteras om det behövs för en god och säker vård i enlighet med 3 kap. 6 § patientdatalagen.\r\nEn läkemedelsbehandling kan vara en av flera åtgärder i en behandlingsplan där målet med läkemedelsbehandlingen är ett delmål för att nå ett övergripande mål med behandlingen.\r\nMål med läkemedelsbehandling ska inte förväxlas med Behandlingsändamål.', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03, karkj, magfo: Termposten beslutad.\r\n2020-08-13, helse4, magfo: Justerad definition som är mera allmängiltig.', '-', '-'),
(787, '-', '2020-06-03 10:02:14.000000', 'jämförelsevärde för storhet', '-', 'GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET (SOCIALSTYRELSEN), reviderad', 'Beslutad', 'måttenhet', '-', '-', '-', 4, 'ANMÄRKNING 1: Storhet avser egenskap som kan mätas eller beräknas, till exempel längd, vikt eller volym. Måttenheten för längd kan exempelvis vara centimeter och måttenheten för volym kan vara liter.\r\nExempel där en läkemedelsprodukts styrka anges med måttenheter: Oral lösning 0,5 mg/ml\r\nExempel där dos uttrycks med en måttenhet: Oral lösning 2 ml', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03, karkj, magfo: Termposten justerad.', '-', '-'),
(788, 'Begreppet har tagits upp i läkemedelsströmmen men fungerar där även om definitionen är allmän.', '2020-06-03 10:00:36.000000', 'kvantitativ omfattning av resurs', '-', 'GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET (SOCIALSTYRELSEN, reviderad)', 'Beslutad', 'mängd', '-', '-', '-', 4, '-', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(789, '-', '2020-06-03 10:35:03.000000', 'person behörig att ordinera hälso- och sjukvårdsaktivitet', '-', 'Socialstyrelsens termbank reviderad', 'Beslutad', 'ordinatör', '-', '-', '-', 4, 'ANMÄRKNING 1: -åtgärd byts mot -aktivitet,', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(790, '-', '2020-06-03 09:58:16.000000', 'förekomst i tiden av fenomen som upprepas', '-', 'Informatik VGR', 'Beslutad', 'periodicitet', '-', '-', '-', 4, 'ANMÄRKNING 1: Förlopp som karakteriseras av att samma tillstånd återkommer med jämna mellanrum. Exempel: 1 tablett 2 gånger om dagen eller en inhalation var sjätte timme.\r\nBegreppet har i det här fallet en friare tolkning, och innefattar även engångsdoser och dosering enligt villkor: 1 tablett som en engångsdos; 1–2 tabletter vid behov. (Socialstyrelsen)\r\n\r\nANMÄRKNING 2: Socialstyrelsens tillägg om engångsdos är konstig. En period kräver minst två förekomster, så det Socialstyrelsen beskriver kan inte anges som annat än engångsdos. Mellanrummen behöver inte vara lika.', '2020-06-02, sofan63, magfo: Termposten skapad.\r\n2020-06-03, karkj, magfo: Termposten justerad.', '-', '-'),
(791, '-', '2020-06-03 09:53:12.000000', 'kompletterande information om administreringsställe i syfte att öka exakthet av aktivitet', '-', 'Informatik VGR', 'Beslutad', 'precisering av administreringsställe', '-', '-', '-', 58, 'ANMÄRKNING 1: Anmärkning till termpost administreringssätt i Socialstyrelsens termbank:\r\n\r\nPrecisering av administreringsställe, som kan förtydliga informationen om ett angivet administreringsställe. Exempel: vänster, höger, nedre, övre.\r\n\r\nDefinitionen utvunnen ur Socialstyrelsen beskrivning i GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET', '2020-06-02, magfo: Termposten slapad.\r\n2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(792, 'I Socialstyrelsens skrivelse GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET anges att begreppeet är under utredning. Om vi ska definiera det måste det delas i två begrepp, eftersom en avdelad dos är lätt att förstå, medan presentationenhet är helt obegripligt. Låter som det som en läkemedelsförsäljare visar upp i anslutning till en lunchbjudning.', '2020-06-03 09:25:18.000000', '-', '-', '-', 'Publicera ej', 'presentationsenhet/avdelad dos', '-', '-', '-', 58, '-', '2020-06-02, sofan63, magfo: Termposten skapad utan någon åtgärd.\r\n2020-06-03, karkj, magfo: Begreppet är tveksamt, publiceras ej, men begreppet avdelad dos skapas.', '-', '-'),
(793, 'dosering baserad på kroppsvikten', '2020-06-04 10:14:12.000000', 'dosering baserad på patients kroppsvikt', '-', 'Informatik VGR', 'Beslutad', 'viktbaserad dosering', '-', '-', '-', 210, '-', '2020-06-03, karkj, magfo: Begreppet pausas för diskussion med Helène.\r\n2020-06-04, karkj, magfo: Definition formulerad. Beslutad.', '-', '-'),
(794, '-', '2020-06-04 14:36:16.000000', 'händelse när vårdtillfälle avslutas', '-', 'Socialstyrelsens termbank (reviderad)', 'Beslutad', 'utskrivning från slutenvård', '-', '-', '-', 7, '-', '2020-06-03, marel67: Inlagt för att jag inte hittade utskrivning i OLLI. Flyttad till Preliminär.\r\n2020-06-04, magfo, perha11: Definitionen justerad. Beslutad!', '-', '-'),
(795, 'En funktion i Millenium som läkare använder för att starta ett \"event\"(händelse) i LaunchPoint modulen. När läkaren använder denna funktionen så registreras en tidstämpel när hen har besöker patienten sista gången.\r\n\r\nHänger i hop med funktionen Träffat Läkare, se det begreppet.', '2020-06-03 09:49:40.000000', '-', 'Inte definierad', '-', 'Publicera ej', 'slutför träffat läkare', 'Inte definierad', 'Inte definierad', '-', 211, 'ANMÄRKNING 1: I Millennium finns på främmande språk många ställen där det står \"complete\" i arbetsflödena och man översatt (?) till svenska \"slutför\" när man menar \"gjort\", \"genomfört\" eller något liknande. Därför är översättningsförsöket felaktigt, men begreppsposten synes vara onödig.', '2020-06-02, karkj, magfo: Termposten avställd.', 'Inte definierad', '-'),
(796, 'Träffat läkare är varje gång läkaren går till patienten, detta kan göras flertal ggr under vårdkontakten. Detta är en funktionalitet i Millenium: När HoS Personalen anger träffat läkare startas ett event som gör en tidsstämpel när läkaren går till patienten. Funktionaliteten ligger i akutens LaunchPoint.\r\n\r\nDetta begreppet hänger ihop med begreppet slutför träffat läkare,', '2020-06-03 09:39:00.000000', '-', 'Inte definierad', '-', 'Publicera ej', 'träffat läkare', '-', 'Met a Doctor', 'Inte definierad', 212, '-', '2020-06-02, karkj, magfo: Termposten avställd, avser genomförd kontakt och borde struktureras bättre,', 'Inte definierad', '-'),
(797, '-', '2020-06-10 11:42:47.000000', 'läkemedelsdos i beredningsform för läkemedelsadministrering', '-', 'Informatik VGR', 'Beslutad', 'avdelad dos', '-', '-', '-', 155, 'ANMÄRKNING 1: Ingen extern definition kan spåras upp, men begreppet bör hållas avskilt från det som Socialstyrelsen kallar presentationsenhet/avdelad dos.\r\n\r\nANMÄRKNING 2: avdelad dos förekommer inte i Snomed CT.', '2020-06-02, karkj, magfo: Termposten justerad.\r\n2020-06-04, karkj, magfo: Förtydligande i definition. Beslutad.\r\n2020-06-10, karkj, magfo: Förtydligande i definition. Beslutad.', '-', '-'),
(798, 'I Launchpoint finns det en \"tracking board\" som är en patient översikt, i \"tracking board\" så finns det två stycken kolumner med rubriken patientinformation. Verksamhets experterna behöver hjälp med att namnge och skilja dessa två begrepp åt. Förslag från verksamhetsexperter till den första rutan med patientinformation är: \"patient\" eller \"patient-ID\", i denna rutan visas patientens namn, personnummer. Det kommer visas symboler för händelser t.ex. allergi, besökt läkare mm. I den andra rutan som heter patientinformation visas det diagnoser och kommentarer från läkare, möjligtvis kommentarer från sjuksköterskor. Tanken är att man ska använda sig av kommentarerna för att ange om det finns en plan för patienten.', '2020-07-06 10:48:11.000000', '-', '-', '-', 'Publicera ej', 'patientinformation', '-', '-', '-', 213, '-', '2020-06-30, davte1 och verwi6: Skapat kort på Jira 963 för mer kontext.\r\n2020-07-06, marel67, vikee1: Satt status till Publiceras Ej. Behövs en diskussion hur detta ska hanteras.', '-', '-'),
(799, 'I Millenium heter detta \"Tidigare åtgärder\", i vården heter det tidigare operationer. Verksamhetsexperter förslår termen \"Tidigare medicinska ingrepp\". Detta är en rubrik i akutens förslag på läkaranteckningar. Under denna rubriken kommer läkaren att dra in alla tidigare gjorda ingrepp på patienten och kommer att dra in alla diagnoser in i anteckningarna. Detta borde ägas av Physdoc men är det som läkarna i akuten vill ha.', '2020-08-05 11:19:47.000000', 'behandlande hälso- och sjukvårdsaktivitet som genomförts före aktuell vårdkontakt', '387713003 |kirurgisk åtgärd| + 410513005 |tidigare|', 'Informatik VGR', 'Beslutad', 'tidigare medicinskt ingrepp', '-', '-', '-', 214, 'ANMÄRKNING 1: Detta är en rubrik i läkaranteckningar som finns i Millenium. Här kommer personalen att se alla tidigare gjorda ingrepp och diagnoser som finns på berörd patient.', '2020-06-30, davte1 och verwi6: Har skrivit en beskrivning och satt status som preliminär.\r\n2020-07-29, magfo: Satt in term från Patientbakgrund 2009: operationer; som avrådd synonym. Patientbakgrundsbegreppet är alltså helt täckt. Numerus i termen ändrat till singularis.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT', '-'),
(800, 'Knapp som leder till en lista med namn på personal, personalens initialer, hur många patienter de är tilldelade, vilken roll de har mfl. Man kan även tilldela patienter till personal i denna listan och skriva kommentarer. Är kopplad till kortet om från Skåne begrepp och \"Tracking board/Översikts tavla/Patient Shell\" på Jira,', '2020-07-02 08:20:08.000000', '-', '-', '-', 'Pågår', 'översiktslista', '-', 'Tracking board/Översikts tavla/Patient Shell', '-', 215, '-', '2020-07-02, davte1: Se Skånekortet i Jira 178 då Trackingboard kanske är en synonym till detta begreppet.', '-', '-'),
(801, 'Rubrik för funktionen där man skriver in sina initialer, dessa initialer är kopplade till en användare i systemet och visas i launchpoint, b.la. för att se vilka i personalen som har tilldelat sig till en patient och där med har vårdansvar för patienten.', '2020-08-05 11:17:37.000000', 'BESKRIVNING: Är en rubrik i Launchpoint som finns i Millenium. Här skriver personalen in sina initialer som är kopplad till en unik användare. Detta används t.ex. för att se vilka i personalen som har tilldelat sig till en patient och där med har vårdansvar för patienten.', '-', 'Informatik VGR', 'Pågår', 'visningsnamn', '-', '-', '-', 216, 'Ska detta begrepp få en annan term?', '2020-06-30, davte1: Har skrivit en beskrivning till begreppet, gjort en anmärkning och flyttat begreppet till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Ändrat till pågår och fört till JIRA 1039.', '-', '-'),
(802, '-', '2020-06-03 10:13:40.000000', '[hälso- och sjukvård] skäl till ändrad ordination', '-', 'GEMENSAMMA TERMER, BEGREPP OCH INFORMATIONSSTRUKTUR INOM LÄKEMEDELSOMRÅDET (reviderad)', 'Beslutad', 'ändringsorsak', '-', '-', '-', 155, 'ANMÄRKNING 1: Från Socialstyrelsen inhämtas: Vid läkemedelsordinationer kan två typer av ordinationsorsaker dokumenteras: behandlingsorsaker och ändringsorsaker.\r\nEn ändringsorsak är skälet till en ändring av läkemedelsbehandlingen. Exempel på ändringsorsaker är läkemedelsbiverkning och bristande effekt av ett läkemedel. Utsättning av läkemedelsbehandling betraktas som en form av ändring.\r\nBeskrivning i begreppsmodell:\r\nEn ändringsorsak är en typ av ordinationsorsak. Ändringsorsaker kan vara omständighet som beror på läkemedelsbehandlingen eller annan omständighet.\r\nExempel på ändringsorsaker:\r\nbiverkning, överkänslighetsreaktion, bristande effekt, på patientens initiativ.\r\n\r\nANMÄRKNING 2: Begreppet är generellt inom hälso- och sjukvård men anges av Socialstyrelsen bara inom läkemedelsbehandling.', '2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(803, 'Detta är namnet på ett formulär som fylls i efter triagering, innan hette formuläret \"Triageinformation övrigt\". Här fyller man i smärtskalor, om patient ramlat(fallrisk), skörhet, oro psykisk ohälsa.', '2020-08-05 11:10:42.000000', '[Millennium Akutmottagning] BESKRIVNING:  Namn på formulär som fylls i efter triagering. Här fyller man t.ex. i smärtskalor, graviditet, levnadsvanor, psykisk ohälsa, vaccinationsprogram (för barn).', '-', 'Informatik VGR', 'Pågår', 'övrig ankomstinformation', '-', '-', '-', 217, '-', '2020-07-06, vikee1, marel67, davte1: Lagt till beskrivning och satt status till Preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Oklart vad det egentligen gäller och om det kan vara användbart utanför akutmottagningsverksamheten. Utreds som JIRA 1038.\r\n2020-08-19, magfo och davte1: Tog bort läkemedel ur beskrivningen.', '-', '-'),
(804, '-', '2020-06-03 10:22:07.000000', 'utvärdering av läkemedelsbehandling', '-', 'Informatik VGR', 'Beslutad', 'läkemedelsuppföljning', '-', '-', '-', 155, 'ANMÄRKNING 1: Socialstyrelsen använder termen uppföljning (läkemedelsbehandling). Informatik VGR anser det avsevärt tydligare om en term omfattar ett ord och inte förutsätter att ett ord inom parentes ska medfölja i termfrasen.\r\n\r\nANMÄRKNING 2: Uppföljning kan göras när som helst under behandlingen. även när den avslutats.', '2020-06-03, karkj, magfo: Termposten beslutad.', '-', '-'),
(805, 'Frågeställning snarare än beskrivning; vad särskiljer heldygnsvård och slutenvård? Eller är det samma sak men olika begrepp?', '2020-06-04 15:12:54.000000', 'Definieras ej', '-', '-', 'Publicera ej', 'heldygnsvård', '-', '-', '-', 218, '-', '2020-06-04, magfo, perha11:  Definieras ej, publiseras EJ! Tillagd som avrådd synonym på slutenvård', '-', '-'),
(806, 'detta kan behövs redas i -vad är en gruppinskrivning? \r\nFörslag (men även en frågeställning om det är rätt förslag) \r\nNär en grupp av patienter, ex med diagnosen bröstcancer. Skrivs in samtidigt och får information av ex sjuksköterska och sjukgymnast. \r\n\r\nDavid:\r\n\"grupp = en samling av individer med något gemensamt\" (från wikepedia)\r\nse även: inskrivning i slutenvård\r\nEller är detta begreppet en synonym till socialstyrelsens gruppbesök (se nedan):\r\n\"gruppbesök - öppenvårdsbesök där fler än en patient samtidigt möter hälso- och sjukvårdspersonal\"', '2020-08-05 11:01:47.000000', 'inskrivning för vårdkontakt som utförs på en samling av individer', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'gruppinskrivning', '-', '-', '-', 219, '-', '2020-06-30, davte1: Lagt till mer kontext, tror detta begreppet måste genomgå ytterligare utredning. Har skrivit en definition, samt en alternativ definition och flyttat till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Utvidgat definitionen till alla typer av vårdkontakter - det finns exempel på gruppinskrivning på mödravårdscentral. Beslutad.', 'Inte definierad', 'ANMÄRKNING 1: Kan gälla inskrivning för gruppterapi. Det finns exempel på gruppinskrivning för behandling av hjärtrytmstörning där gruppen får information samtidigt.'),
(807, '-', '2020-08-11 09:14:11.000000', '[läkemedelsbehandling] uppgift om dos och periodicitet', '-', 'Socialstyrelsens termbank', 'Publicera ej', 'dosering', '-', '-', '-', 58, 'ANMÄRKNING 1: Socialstyrelsens termbank skriver: Källa till definition	3 kap. 1 § Socialstyrelsens föreskrifter och allmänna råd (HSLF-FS 2017:37) om ordination och hantering av läkemedel i hälso- och sjukvården\r\n\r\nExempel på doseringar: 1 tablett 2 gånger om dagen; en inhalation var sjätte timme; 1 tablett som en engångsdos, 1–2 tabletter vid behov.', '2020-06-03, magfo: Begreppsposten skapad, satt till preliminär.\r\n2020-06-04, karkj, magfo: Beslutad.\r\n2020-08-11, karkj, magfo: Fel, fel, fel! Detta är en synonym till läkemedelsdosering.', '-', '-'),
(808, '-', '2020-06-04 09:15:43.000000', 'ordinerat läkemedel som är berett för administrering', '-', 'Informatik VGR', 'Beslutad', 'iordningställt läkemedel', '-', '-', '-', 58, 'ANMÄRKNING 1: Definitionen utgår från termposten i Socialstyrelsens termbank avseende iordningsställande av läkemedel.', '2020-06-03, magfo: Begreppsposten skapad.\r\n2020-06-03, magfo: Definition skriven. Ändrad till preliminär.\r\n2020-06-04, karkj, magfo: Liten ändring i definitionen. Beslutad.', '-', '-'),
(809, 'Behov av begrepp för att beskriva hud. Frågan kom upp i samband med IPOC översättning.\r\nKan Snomed begreppet 181469002 |hud, som helhet| vara samma som hudkostym. Har lagt frågan i vår Snomedchatt och hoppas att Anna kan stämma av om hon tycker det.', '2020-06-09 08:54:14.000000', 'kroppens totala hudbeklädnad', '181469002 |hud, som helhet|', 'Informatik VGR', 'Beslutad', 'hudkostym', '-', '-', '-', 220, 'ANMÄRKNING 1: Kroppens största organ', '2020-06-04, pelho11, magfo: Inledande försök till definition.\r\n2020-06-09, karkj, magfo, perha11: Beslutad!', 'Snomed CT', '-'),
(810, 'Patienten sköter läkemedlet själv utan insyn och ansvar. Patienten tar läkemedlet när patienten själv vill utan inblandning av hälso-och sjukvårdspersonal.  Tex en tjej läggs in för utredning om sköldkörteln och ska ställas in på Levaxin. Den ordinerar man och adm. Men så står hon på p-piller och det tar  man inte upp i behandlingen, det sköter patienten själv. Man kan skriva i listan att hon har det men man gör inget aktivt med den aktiviteten.', '2020-08-05 10:55:48.000000', 'markering att patient under vårdtillfälle på eget ansvar utför aktivitet som inte ordineras', '-', '-', 'Beslutad', 'sköter själv', '-', '-', '-', 221, 'EXEMPEL: Patient läggs in för utredning om sköldkörteln, ordineras och administreras Levaxin. Patienten tar sedan tidigare p-piller och fortsätter ta detta under vårdkontakten. Hälso- och sjukvårdspersonalen kan notera att patienten tar p-piller men har ingen aktiv medverkan i administreringen av dessa.\r\n\r\nANMÄRKNING 1: Begreppsposten har uppkommit avseende administrering av läkemedel men gäller alla aktiviteter som inte ordineras och som patienten utför själv.', '2020-07-06, vikee1, marel67, davte1: Skapat kort i Jira, https://vgregionit.atlassian.net/browse/INFMTK-993. Vi behöver mer input gällande ansvar för läkemedel som patient \"sköter själv\".\r\n2020-07-28, magfo: Definition skriven.\r\n2020-08-05, ollka3, sofan63, magfo: Definitionen justerad så att begreppet inte bara avser läkemedel. Beslutad.', '-', '-'),
(811, '[Millennium] Target dose - måldos eller fastställd dos?  i kontexten vid en viktbaserad dosering.  Det är  dosen verksam substans per kroppsparametermått, t.ex. vikt, hudyta eller kreatininklearence', '2020-06-10 09:28:38.000000', 'läkemedelsmängd som ska ställas i förhållande till kroppsparameter för uträkning av fastställd dos', '-', 'Informatik VGR', 'Beslutad', 'måldos', '-', '[Millennium] target dose', '-', 222, 'ANMÄRKNING 1: Kroppsparameter definieras separat och omfattar kroppsvikt av olika typ, kroppsyta, kreatininclearance och andra laboratorievärden, ålder, kön med flera. Vanligen väljs en kroppsparameter att användas vid beräkningen. Med känt värde på vald kroppsparameter kommer uträkningen att leda till en fastställd dos. Algoritmen för uträkning är egentligen bara ett bråk där måldosen är täljare och kroppsparametern nämnare.', '2020-06-10, karkj, magfo: Ett försök till definition gjort, krävde för förståelse en lång anmärkning. Sätts till preliminär för att det ska hända något.\r\n2020-06-11, helse4, karkj, magfo perha11: Beslutad! Ska kompletteras med Cerner-definition Jira: 648', '-', '-'),
(812, 'Jirakort 604 m.fl.', '2020-06-11 10:27:34.000000', 'dos uträknad som måldos dividerad med vald kroppsparameter', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'beräknad dos', '-', '-', '-', 223, 'ANMÄRKNING 1: måldos/vald kroppsparameter = beräknad dos. Olika algoritmer och kroppsparametrar används beroende på sammanhanget för att utifrån måldos (t.ex. mg/kg kroppsvikt) beräkna dos. Den kommer att justeras till en fastställd dos för att stämma med avdelade doser.', '2020-06-09, magfo justerat efter diskussion med helse4, sofan63, davte1, magfo\r\n2020-06-10, karkj, magfo: Definition och anmärkning skrivna, posten preliminär.\r\n2020-06-11, helse4, karkj, magfo perha11: Beslutad!', '-', '-'),
(813, '-', '2020-08-05 10:50:32.000000', 'patientmonitorering med trådlös överföring av registrerad signal', '-', 'Informatik VGR', 'Beslutad', 'telemetriövervakning', '-', '-', '-', 12, 'ANMÄRKNING 1: telemetri används oftast för hjärtövervakning, men begreppet är tekniskt och hjärtat kan inte vara med i definitionen.', '2020-06-09, magfo: Lagt till begreppet enligt Jirakort 689.\r\n2020-07-27, magfo: Definition och anmärkning skrivna, se också KIRA 689.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(814, 'Inte definierad', '2020-06-11 11:49:05.000000', 'kroppsvikt utöver det förväntade i förhållande till övriga fysiska parametrar till följd av onormalt stor ansamling av fett i kroppen', 'SCTId: 414916001 |fetma|', 'Svensk MeSH', 'Beslutad', 'fetma', 'body weight that is grossly above the acceptable or desirable weight, usually due to accumulation of excess fats in the body / Svensk MeSH', 'obesity', '-', 155, 'ANMÄRKNING 1: Fetma brukar definieras som BMI över 30.', '2020-06-09, vikee1, perha11: preliminärt definierad\r\n2020-06-11, karkj, magfo perha11: Beslutad!', 'Snomed CT', '-'),
(816, '-', '2020-06-30 10:52:10.000000', 'läkemedelsdos som utifrån beräknad dos anpassats till administrering i avdelade doser', '-', 'Informatik VGR', 'Pågår', 'normaliserad dos', 'A dosing unit, such as mg or kg, which adjusts the calculated medication dose prescribed based on a patient\'s physical attributes, such as weight or body surface area.', '[Millennium] normalized dose', '-', 155, 'ANMÄRKNING 1: När en dos beräknas som måldos delat med vald kroppsparameter kan resultatet vara omöjligt att administrera som tillgängliga avdelade doser (t.ex. 3,84 tabletter). Då avrundas dosen till jämnt antal tabletter (4 st).', '2020-06-10, karkj, magfo: Ett försök till definition gjort, krävde för förståelse en lång anmärkning. Sätts till preliminär för att det ska hända något.\r\n2020-06-11, helse4, karkj, magfo perha11: Beslutad!\r\n2020-06-30, magfo: Upptäckt att normalized dose är det vi kallat beräknad dos. Termposten måste uppdateras!', '-', '-'),
(817, '-', '2020-06-15 11:40:12.000000', 'läkemedelsdos som beslutats utifrån beräknad eller normaliserad dos', '-', 'Informatik VGR', 'Beslutad', 'fastställd dos', '-', '[Millennium] final dose', '-', 155, 'ANMÄRKNING 1: När en läkemedelsdos räknats ut som måldos/kroppsparameter kan den fastställas för administrering om den dosen är möjlig att administrera som ett helt antal avdelade doser. I andra fall kommer den normaliserade dosen att fastställas.', '2020-06-10, karkj, magfo: Ett försök till definition gjort, krävde för förståelse en lång anmärkning. Sätts till preliminär för att det ska hända något.\r\n2020-06-11, helse4, karkj, magfo perha11: Beslutad!\r\n2020-06-15, helse4, sofan63, davte1,magfo: Synonymen slutlig dos tillagd.', '-', '-'),
(818, '-', '2020-06-11 10:36:18.000000', 'storhet för egenskap eller funktion hos kroppen', '-', 'Informatik VGR', 'Beslutad', 'kroppsparameter', '-', '-', '-', 155, 'ANMÄRKNING 1: Kroppsparametrar kan vara konstanta eller variera. \r\n\r\nANMÄRKNING 2: Mått på kroppsparametrar kan användas för beräkning av beroende variabler', '2020-06-11, karkj, magfo, perha11:  Preliminär\r\n2020-06-11, helse4, karkj, magfo perha11: Beslutad!', '-', '-'),
(819, '-', '2020-06-11 11:35:46.000000', 'säng för patienter med stor kroppsvikt', '-', 'Informatik VGR', 'Beslutad', 'bariatrisk säng', '-', '-', '-', 155, '-', '2020-06-11, karkj, magfo perha11: skapad och beslutad!', '-', '-'),
(820, 'GIP gänget vill reda ut skillnaden mellan skyddad identitet och skyddade personuppgifter. \r\n\r\nDet finns tre typer av skyddade personuppgifter, eller skyddad identitet som det också kallas:\r\nskyddad folkbokföring, som har ersatt kvarskrivning\r\nsekretessmarkering\r\nfingerade personuppgifter, som innebär att du får nytt namn och personnummer.', '2020-06-12 08:18:00.000000', '-', '-', '-', 'Publicera ej', 'skyddade personuppgifter', '-', '-', '-', 237, '-', '2020, marel67, verwi6, davte1, sofan63: Flyttas till Publiceras ej. Dubblett!', '-', '-'),
(821, 'Huvudregeln om sekretess innebär att uppgifter i den offentliga hälso- och sjukvården om en patients hälsotillstånd eller andra personliga förhållanden inte får lämnas ut, om det inte står klart att uppgiften kan röjas utan att patienten eller någon närstående lider men (25 kap 1§ offentlighets- och sekretesslagen, OSL).\r\n\r\nPID-gänget vill reda ut vilka olika sekretess som finns, ex sjukvårdssekretess.\r\n\r\n25 kap 1§ offentlighets- och sekretesslagen, OSL):\r\n1 §   Sekretess gäller inom hälso- och sjukvården för uppgift om en enskilds hälsotillstånd eller andra personliga förhållanden, om det inte står klart att uppgiften kan röjas utan att den enskilde eller någon närstående till denne lider men. Detsamma gäller i annan medicinsk verksamhet, exempelvis rättsmedicinsk och rättspsykiatrisk undersökning, insemination, befruktning utanför kroppen, fastställande av könstillhörighet, abort, sterilisering, omskärelse och åtgärder mot smittsamma sjukdomar.\r\n\r\nFörsta stycket gäller inte om annat följer av 7, 8 eller 10 § eller 26 kap. 6 §.\r\n\r\nFör uppgift i en allmän handling gäller sekretessen i högst sjuttio år. Lag (2012:459).\r\n\r\nSocialstyrelsen:\r\nförbud att i offentlig verksamhet röja uppgifter muntligen eller genom utlämnande av allmän handling', '2020-07-27 17:51:13.000000', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'sekretess', 'Inte definierad', 'Inte definierad', 'Inte definierad', 238, 'Inte definierad', '2020-07-27, magfo: Kopplat ärendet till JIRA 1032 och 177.', 'Inte definierad', '-'),
(822, 'Funktion i millennium som handlar om tilläggsuppgifter som kan läggas till för att dokumenteras i samband med administration av läkemedel. Exempelvis kan det handla om att ta puls i samband med administrering av digoxin. Andra exempel på tilläggsuppgifter kan vara blodtryck, temperatur, självadministering, blodsocker etc. \r\n\r\n\r\n\r\nKort på JIRA:\r\nhttps://vgregionit.atlassian.net/browse/INFMTK-817', '2020-07-01 10:30:44.000000', '-', '-', '-', 'Pågår', 'tilläggsuppgifter', '-', '-', '-', 239, '-', '2020-07-01, verwi6: Sofia har lagt upp ett kort i Jira för fortsatt utredning. Kort på JIRA:\r\nhttps://vgregionit.atlassian.net/browse/INFMTK-817', '-', '-'),
(823, 'läkemedel är ej administrerat', '2020-07-27 17:32:16.000000', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'not given', 'Inte definierad', 'Inte definierad', 'Inte definierad', 240, 'Inte definierad', '2020-07-27, magfo: Även om termen är ett verb i perfekt particip fungerar det som adjektiv och är svårdefinierat. Ska diskuteras i Begreppsbyrån. Betydelsen är klar: att ett läkemedel inte administrerats.', 'Inte definierad', '-'),
(824, 'Termen används i avtalskatalogen. \r\n\r\nSynonymer: antidecubitusmadrass, trycksårsmadrass', '2020-07-27 17:31:43.000000', 'madrass som fördelar kroppens tyngd så att trycksår undviks', '-', 'Informatik VGR', 'Beslutad', 'tryckavlastande madrass', '-', '-', '-', 241, '-', '2020-07-02, davte1: Behöver det här verkligen definieras då det är en medicintekniskprodukt? Väljs tryckavlastningsmadrass som term känns det som att den i sig är tillräckligt beskrivande. Funderingar?\r\n2020-07-27, magfo: Definition skriven, synonymer införda.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(825, '[‎2020-‎06-‎16 16:38]  Gertrude Petersson:  \r\nI samband med session om förberedelse inför olika åtgärder på en mottagning eller avdelning där det krävs litet förberedelser ( som dukning eller sedering) kom det upp en diskussion om vad det skall kallas. I dag används den engelska översättning av procedure \"procedur\". Vårt förslag blev behandlande/ utredande/ diagnostiskt åtgärd.  SME tycker det blev omständigt och föreslog  ordet ingrepp istället.\r\n\r\nFrån SoS:\r\nÅtgärder i hälso- och sjukvården innebär patientinriktade insatser (handlingar) som huvudsakligen utförs i ett utredande, behandlande eller förebyggande syfte. En medicinsk kroppsundersökning, till exempel att lyssna på hjärta eller lungor på en patient, är en utredande åtgärd. Operativa ingrepp, som blindtarmsoperation eller starroperation, är exempel på behandlande åtgärder. Stöd för att sluta röka är en förebyggande åtgärd.', '2020-07-28 14:15:57.000000', '-', '-', '-', 'Publicera ej', 'åtgärd', '-', '-', '-', 242, '-', '2020-07-02, davte1: (Jira 979): Skapat JIRA kort för mer utredning av ärendet.\r\n2020-07-28, magfo: Begreppet ställs av och termen införs som synonym till hälso- och sjukvårdsaktivitet. JIRA 979 klarmarkeras.', '-', '-'),
(826, 'Ordet Lägesändringsschema känns som det mest moderna ordet för det som i \"vanligt\" tala kallas \"vändschema\". Vändschema och Tryckavlastande schema skulle kunna vara synonymer. Se Vårdhandboken\r\n\r\nFrån vårdhandboken:\r\nEn vanlig tidsgräns som anges för lägesförändring för stillaliggande patienter är två till tre timmar. Ett lägesändringsschema (vändschema, tryckavlastningsschema) ska användas när lägesändring planeras och utvärderas för både stillaliggande och stillasittande personer.', '2020-08-10 11:58:48.000000', 'schema med planerade tidpunkter då hälso- och sjukvårdspersonal ska lägesändra patient', '-', 'Informatik VGR, Vårdhandboken', 'Beslutad', 'lägesändringsschema', '-', '-', '-', 243, '-', '2020-07-03, davte1: Tillagd kontext, skrivet en definition och ändrat status till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: vändschema tillagt som tillåten synonym (djupt rotad), posten beslutad.\r\n2020-08-10, karkj, magfo: Obestämd artikel borttagen ur definitionen.', '-', '-'),
(827, 'volym av ett visst läkemedel', '2020-07-03 11:18:31.000000', 'Definieras ej.', '-', 'Informatik VGR', 'Definiera ej', 'volym', '-', '-', '-', 244, '-', '2020-07-03, davte1: Tror inte detta är en term som behöver definieras, volym är ett vedertaget och en allmän storhet.', '-', '-'),
(828, '-', '2020-06-18 11:43:53.000000', 'kroppsvikt som utgör underlag för beräkning av läkemedelsdos', '-', 'Informatik VGR', 'Beslutad', 'doseringsvikt', '-', '-', '-', 155, 'ANMÄRKNING 1: Doseringsvikt är en specialisering av ordinationsvikt och används när enskilda doser ska beräknas. Ordinationsvikten används också för att fastställa dostillfällen, olika doser vid olika tillfällen med mera.', '2020-06-18, karkj, magfo: Begreppsposten skapad och beslutad.', '-', '-'),
(829, 'Se Jira epik 861 ärende 802!', '2020-07-06 14:36:03.000000', '-', '-', '-', 'Publicera ej', 'hälsoplan', '-', '-', '-', 58, '-', '2020-06-18, magfo: Begreppsposten startad.\r\n2020-07-06, vikee1, marel67: Sätts till Definieras ej då det är en dubblett.', '-', '-'),
(830, 'Begrepp i order sentence och är en nivå i multum. \r\nPrimär synonym nivå är generiskt namn – här finns ingen information alls om vilken styrka och koncentration just detta läkemedlet har.  primär synonym är t ex paracetamol. \r\n\r\nBehöver diskuteras huruvida detta ska synas på OLLIS utsida eller enbart på insidan?  \r\n\r\nse bild:\r\nhttps://vgregion-my.sharepoint.com/:i:/r/personal/loufe2_vgregion_se/Documents/Arbetsmaterial%20Informatik/Team%202/L%C3%A4kemedel/synonymer%20multum.jpg?csf=1&web=1&e=eapbhh \r\n\r\nmagfo: ovanstående länk leder till VGR namngrupp (Linn Riedl) där det inte finns något om synonymläkemedel.', '2020-07-27 17:25:50.000000', '[läkemedel] namn på generisk substans', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'primärsynonym', 'Inte definierad', 'Inte definierad', 'Inte definierad', 245, 'ANMÄRKNING 1: i primärsynonymen ingår inte styrka.', '2020-07-27, magfo: Skapat JIRA 1031 om alla begrepp som har med synonym att göra.\r\n2020-08-18, karkj, sofan63, magfo: Mellanslag i termen borttaget, definition skriven.', 'Inte definierad', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(831, 'synonym namn återfinns i order sentence. \r\nNamnet utifrån synonym typ (t ex M-nivå är läkemedlet som går att ordinera uppbyggt: paracetamol 500 mg tablett (oralt)) dvs. -> generiskt namn | styrka | dosform | (administreringssätt)\r\n\r\n \r\nse bild: https://vgregion-my.sharepoint.com/:i:/r/personal/loufe2_vgregion_se/Documents/Arbetsmaterial%20Informatik/Team%202/L%C3%A4kemedel/synonymer%20multum.jpg?csf=1&web=1&e=Kd1JuY \r\n\r\nmagfo: ovanstående länk leder till VGR namngrupp (Linn Riedl) där det inte finns något om synonymläkemedel.', '2020-07-27 17:24:43.000000', 'namn under vilket läkemedelsprodukt presenteras', 'Inte definierad', 'Informatik VGR', 'Preliminär', 'synonymnamn', 'Inte definierad', 'Inte definierad', '-', 246, 'ANMÄRKNING 1: Synonymnamn kan vara generiskt produktnamn eller namn på handelsvara. Obs att det inte rör sig om läkemedelsvara som är förpackad läkemedelsprodukt för distribution.', '2020-07-27, magfo: Skapat JIRA 1031 om alla begrepp som har med synonym att göra.\r\n2020-08-18, karkj, sofan63, magfo: Försök till definition och anmärkning.', 'Inte definierad', '-'),
(832, 'Återfinns i order sentence. \r\nBeskriver den typ av synonym som läkemedel som går att ordinera är uppbyggda kring, t ex  M- synonym. \r\n\r\n\r\nse bild: https://vgregion-my.sharepoint.com/:i:/r/personal/loufe2_vgregion_se/Documents/Arbetsmaterial%20Informatik/Team%202/L%C3%A4kemedel/synonymer%20multum.jpg?csf=1&web=1&e=zbUY85\r\n\r\nmagfo: ovanstående länk leder till VGR namngrupp (Linn Riedl) där det inte finns något om synonymläkemedel.', '2020-07-27 17:22:34.000000', 'typ av beteckning på avdelad dos av läkemedelsprodukt', 'Inte definierad', 'Inte definierad', 'Preliminär', 'synonymtyp', 'Inte definierad', 'Inte definierad', 'Inte definierad', 247, 'ANMÄRKNING 1: Beteckning är generiskt namn (M) eller handelsnamn på läkemedelsprodukt (N) med styrka. Val av synonymtyp ger visst synonymnamn.\r\n\r\nANMÄRKNING 2: Val av synonymtyp ger visst synonymnamn.', '2020-07-27, magfo: Skapat JIRA 1031 om alla begrepp som har med synonym att göra.\r\n2020-08-18, karkj, sofan63, magfo: Preliminär definition skriven', 'Inte definierad', '-'),
(833, 'läkemedel som inte finns i läkemedelskatalogen och som ordineras genom fritext.', '2020-08-10 11:57:53.000000', 'läkemedel vilkets namn måste skrivas i klartext vid ordination', '-', 'Informatik VGR', 'Avråds', 'fritextläkemedel', '-', '-', '-', 248, 'ANMÄRKNING 1: Detta avser läkemedel som inte finns i förkonfigurerad lista.', '2020-07-27, magfo: Definition skriven.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.\r\n2020-08-10, karkj, magfo: Nä, det här går inte. Alla läkemedel skrivs i klartext men dessa väljs inte från lista. Definieras inte. Det är en datatyp.', '-', '-'),
(834, 'Funktion är ett objekt i KIV, som skapas och används för att identifiera arbetsuppgifter eller resurser kopplat till den Verksamhet som bedrivs på en Enhet eller lägre enhetsnivå, exempelvis en patientadministrativ Process (team) eller förfinad ekonomisk uppföljning inom en Enhet. En eller flera funktioner kan kopplas till nivå 5 (enhet) och 6 (underenhet)', '2020-06-23 09:54:39.000000', '[KIV] arbetsuppgift och resurs kopplat till verksamhet som bedrivs på enhet', '-', 'informatik VGR', 'Beslutad', 'funktion', '-', '-', '-', 249, 'ANMÄRKNING1: Funktion är ett objekt i KIV, som skapas för att identifiera arbetsuppgifter eller resurser på en verksamhet.', '2020-06-23, verwi6: Preliminär definition skapad. Flyttat till preliminär.\r\n2020-06-23, karkj, magfo: Definitionen förädlad. Begreppsposten beslutad.', '-', '-'),
(835, 'Sjukhus som geografisk plats är oftast inte en del av förvaltningens organisatoriska nivå. I vissa sammanhang finns behov av att ange vid vilken geografisk plats en Verksamhet bedrivs, sjukhus finns därför som ett attribut i KIV som kopplas till nivå 5 (enhet).', '2020-06-23 09:49:13.000000', 'samling av organisatoriskt samordnade vårdenheter vid vilken förmåga att bedriva specialiserad hälso- och sjukvård finns', '-', 'Informatik VGR', 'Beslutad', 'sjukhus', '-', '-', '-', 250, 'ANMÄRKNING 1: Sjukhus som geografisk plats är oftast inte en del av förvaltningens organisatoriska nivå. I vissa sammanhang finns behov av att ange vid vilken geografisk plats en Verksamhet bedrivs, sjukhus finns därför som ett attribut i KIV som kopplas till nivå 5 (enhet).', '2020-06-23, verwi6: preliminärt definierad. Flyttad till preliminärt.\r\n2020-06-23, karkj, magfo: Definition förädlad. Begreppsposten beslutad.', '-', '-'),
(836, 'Är en bedömningsskala som används vid undersökning av medvetandegrad. \r\n\r\nFrån wikipedia:\r\nGlagow coma scales (GCS) är ett system för skattning av vakenhet som utarbetades 1974 på Glasgows universitet. En poängsumma fås fram genom att summera värden för ögonöppning, verbalt svar och motorsvar. Poängsumman kan man graderas från maximalt 15 (fullt vaken) till lägst 3 (djupt medvetslös). Glasgowskalan är väl etablerad internationellt, men ögonöppning och verbalt svar kan vara svåra att poängsätta om en patient är intuberad eller har skador i ögonregionen.\r\n\r\nFrån glasgow coma scale: https://www.glasgowcomascale.org/downloads/GCS-Assessment-Aid-Swedish.pdf\r\n\r\nFörkorttas GCS och detta kommer att användas inom akutströmmen som en förkortning.', '2020-08-05 10:35:40.000000', 'bedömningsinstrument (32.2.3.1) som används vid undersökning av medvetandegrad', '-', '-', 'Beslutad', 'glasgow coma scale', '-', '-', '-', 251, '-', '2020-06-23, davte1: kopplade  förkortningen GCS som synonym till begreppet.\r\n2020-07-03, davte1: Skrivit preliminär definition, alternativ definition och ändrad status till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad. Utredning om vilka skalor som ska användas finns på JIRA 1037.', '-', 'metod som används vid undersökning av medvetandegrad'),
(837, 'Begreppet avser adressering av virtuell plats, dvs med URL, URI, OID, eventuellt telefonnummer, e-postadress.', '2020-08-05 10:31:50.000000', 'adress till en virtuell plats', '-', 'Informatik VGR', 'Pågår', 'logisk adress', '-', '-', '-', 58, 'ANMÄRKNING1: Kan t.ex. vara URL eller telefonnummer.', '2020-06-23, magfo: införd\r\n2020-06-30, davte1 och verwi6. Har lagt in definition från begreppsmodellen. Flyttat till preliminär.\r\n2020-08-05, ollka3, sofan63, magfo: Återförd till pågår för diskussion med Annika B. JIRA 152.', '-', '-'),
(838, '-', '2020-06-24 10:28:51.000000', '[hälso- och sjukvård] förhållande som ökar sannolikhet att få sjukdom eller skada', '|80943009 |Risk factor (observable entity)|', 'Rikstermbanken, reviderad', 'Beslutad', 'riskfaktor', '-', '-', '.', 155, '-', '2020-06-24, karkj, magfo: Beslutad.', 'SCT', '-'),
(839, '-', '2020-06-24 11:41:32.000000', 'utlåtande av läkare om sjukdoms- eller skadeförlopp som lett till döden', '-', 'Informatik VGR', 'Beslutad', 'dödsorsaksintyg', '-', '-', '-', 155, 'ANMÄRKNING 1: I dödsorsaksintyget ska anges den \"terminala dödsorsaken\" som ofta inte är densamma som huvuddiagnos för det vårdtillfälle då patienten avled. Ofta kan tillkommande hälsoproblem under vårdtillfället vara det som leder till döden, vilket inte ska ändra diagnoskodning men måste anges i rätt ordningsföljd i dödsorsaksintyget.\r\n\r\nANMÄRKNING 2: Observera att dödsorsaksintyg inte får förväxlas med dödsbevis (se den begreppsposten).', '2020-06-24, karkj, magfo: Begreppsposten skapad och beslutad.', '-', '-'),
(840, 'Kommer från migrationsgänget och handlar om den väntelista som en patient står på när denne väntar på att få en tidsbokning för vårdkontakt.', '2020-08-05 10:31:15.000000', 'information om patients väntan på vårdkontakt', '-', 'Informatik VGR', 'Beslutad', 'väntelistepost', '-', '-', 'Inte definierad', 12, '-', '2020-06-30, vikee1, magfo: Preliminärt definierad.\r\n2020-08-05, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(841, '-', '2020-08-05 10:29:52.000000', 'grafisk information om barns tillväxt över tid', '-', 'Informatik VGR', 'Beslutad', 'tillväxtkurva', '-', '-', 'Inte definierad', 12, 'ANMÄRKNING 1: Rutinmässiga mätningar av vikt, längd och huvudomfång görs på BVC.\r\nANMÄRKNING 2: Tillämpas ofta i form av ett grafiska diagram.', '2020-06-30, vikee1, magfo: Preliminärt definierad.\r\n2020-08-05, ollka3, sofan63, magfo: Definitionen tillförs ordet \"grafisk\". Posten beslutad.', '-', '-'),
(842, 'Sekretessmarkering är en form av skyddad identitet men inte lika starkt skydd. Personens uppgifter sekretessmarkeras och får då inte lämnas ut rutinmässigt.\r\n\r\nEn sekretessmarkering är den lägre graden av skyddade personuppgifter. En sekretessmarkering är en administrativ åtgärd som gör det svårare för andra att ta del av dina personuppgifter i folkbokföringsregistret. Sekretessmarkeringen omfattar alla dina personuppgifter.\r\n\r\nEn sekretessmarkering fungerar som en varningssignal för Skatteverket och andra myndigheter om att en prövning ska göras innan uppgifterna om dig lämnas ut. Det är alltså ingen absolut sekretess. En sekretessmarkering är en administrativ åtgärd som motsvarar hemligstämpeln på ett dokument.\r\n\r\nVem kan få sekretessmarkering?\r\nSkatteverket kan registrera en sekretessmarkering om det finns risk för att du utsätts för brott, förföljelse eller allvarliga trakasserier.\r\n\r\nNär kan du inte få sekretessmarkering?\r\nDu kan inte få sekretessmarkering för att du till exempel inte vill synas på internet eller har drabbats av id-kapning.\r\n\r\nhttps://skatteverket.se/privat/folkbokforing/skyddadepersonuppgifter.4.18e1b10334ebe8bc80001711.html?q=skyddad+identitet', '2020-08-10 11:47:03.000000', '[skatteverket] administrativ åtgärd som gör det svårt att ta del av personuppgifter', '-', 'Skatteverket reviderad', 'Beslutad', 'sekretessmarkering', '-', '-', '-', 155, 'ANMÄRKNING 1: Personuppgifterna i folkbokföringsregistret. Sekretessmarkeringen omfattar alla personuppgifter.', '2020-06-25, karkj, magfo: Begreppsposten skapad.\r\n2020-07-06, davte1 och verwi6: Skrivt definition och ändrat status till preliminär.\r\n2020-08-04, ollka3, sofan63, magfo: Beslutad, liten avkortning till förtydligande av definitionen.\r\n2020-08-10, karkj, magfo: Sammanhang Skatteverket tillagt.', '-', '-'),
(843, 'Information från polisen om fingerade personuppgifter:\r\nOm du är utsatt för särskilt allvarlig brottslighet och hotas till liv, hälsa eller frihet kan du få fingerade personuppgifter. Det innebär att du får nya identitetsuppgifter, till exempel ett nytt namn och nytt personnummer.\r\n\r\nOm du får fingerade personuppgifter tas din gamla identitet bort ur folkbokföringsregistret, även ditt personnummer. Det innebär även att du måste flytta till en ny, hemlig ort.\r\n\r\nDet är komplicerat att leva med fingerad identitet. Det innebär bland annat att du måste börja ett helt nytt liv, vilket kan påverka din livskvalitet. Skyddet används enbart i undantagsfall, som en sista utväg efter att andra mindre omfattande åtgärder prövats.\r\n\r\nFör frågor om fingerade personuppgifter, kontakta polisen.\r\n\r\nFingerade personuppgifter enligt LFP innebär att en person blir registrerad i folkbokföringen med andra personuppgifter än de verkliga. Någon koppling mellan de gamla och nya uppgifterna finns inte.\r\n\r\nFrån Skatteverket:\r\nDet är Polismyndigheten som fattar beslut om att tilldela någon fingerade personuppgifter när andra skyddsåtgärder inte är tillräckliga. Personer som önskar att få fingerade personuppgifter ska därför hänvisas dit. Polismyndigheten ska meddela Skatteverket vilka fingerade uppgifter som ska registreras i folkbokföringen och hur länge de ska gälla.\r\nhttps://www4.skatteverket.se/rattsligvagledning/edition/2017.7/330546.html\r\n\r\nLag om fingerande personuppgifter:\r\nhttps://www.riksdagen.se/sv/dokument-lagar/dokument/svensk-forfattningssamling/lag-1991483-om-fingerade-personuppgifter_sfs-1991-483', '2020-08-05 10:16:51.000000', 'personuppgifter som ändrats av polismyndigheten för att skydda en individ när brott hotar dennes liv, hälsa eller frihet', '-', 'Informatik VGR, Polismyndigheten, Skatteverket, reviderad', 'Beslutad', 'fingerade personuppgifter', '-', '-', '-', 155, 'ANMÄKRNING1: Detta är ett skydd som utförs av polisen till individer som är utsatt för särskilt allvarligt brott och hotas till liv, hälsa eller frihet. När polisen godkänner en individs ansökan om fingerade personuppgifter kan detta leda till att individen får nya identitetsuppgifter, till exempel ett nytt namn och nytt personnummer. När detta infaller så tas individens gamla identitet bort ur folkbokföringsregistret, även det föregående personunummret. Individen behöver även flytta till en ny hemlig ort. Fingerade personuppgifter fungerar som en sista utväg och används endast i undantagsfall.', '2020-06-25, karkj, magfo: Begreppsposten skapad.\r\n2020-07-03, davte1: Preliminär definition, utökad kontext, status ändrad till preliminär och skrivet en anmäkrning.\r\n2020-08-04, ollka3, sofan63, magfo: Liten avkortning i definitionen (värdeord strukna), beslutad.', '-', '-'),
(844, 'Fråga Magnus (inskickad på begärand av Magnus)\r\nvård vid enklare sjukdomstillstånd som individen kan ge sig själv.\r\nhttps://www.medicinskordbok.se/term/egenv%C3%A5rd', '2020-08-05 10:12:56.000000', 'enklare medicinsk åtgärd som person själv kan vidta mot lindrigare sjukdom och skada', '-', 'Svensk Ordbok 2009 (reviderad)', 'Publicera ej', 'egenvård', 'care for simple medical condition that individuals can provide for themselves\r\n\r\nKälla: Medicinskordbok.se', 'self-care', '-', 254, 'ANMÄRKNING 1: Behandling av egna, enklare åkommor, t. ex. huvudvärk, förkylning, mindre sårskador.', '2020-07-06, vikee1: Preliminärt definierad.\r\n2020-08-05, ollka3, sofan63, magfo: egenvård ska inte vara eget begrepp utan förs in som synonym till egenvårdsaktivitet som definieras i Contsys. Begreppet publiceras ej.', '-', 'vård vid enklare sjukdomstillstånd som individen kan ge sig själv\r\n\r\nKälla: Medicinskordbok.se'),
(845, 'AVPU ett sätt att mäta medvetandegraden hos en patient: A-alert (eng.), patienten är fullt vaken; V-voice-responsive (eng.), patienten är slö men reagerar på tilltal; P-pain-responsive (eng.), patienten reagerar på smärta; U-unresponsive (eng.), patienten visar ingen reaktion.', '2020-07-06 15:08:34.000000', 'BESKRIVNIG: En metod som används för att bedöma patientens medvetandegrad.', '-', 'Informatik VGR', 'Pågår', 'AVPU (Alert Voice Pain Unresponive)', '-', '-', '-', 255, 'ANMÄRKNING 1: AVPU, A-alert (eng.), patienten är fullt vaken; V-voice-responsive (eng.), patienten är slö men reagerar på tilltal; P-pain-responsive (eng.), patienten reagerar på smärta; U-unresponsive (eng.), patienten visar ingen reaktion.', '2020-07-06, davte1 och verwi6: Beskrivning och ändrad status till Preliminär.\r\n2020-08-04, ollka3, sofan63, magfo: Tveksamt terminologiskt ärende. Kunskap måste bestämma vilka medvetandeskalor som ska användas och av vem. Förkortningar ska undvikas. Det är en metodbenämning och ska kanske inte alls in i OLLI. Åter till David för diskussion med Lars Rex.', '-', '-'),
(846, 'Screeningverktyg för att upptäcka barn som far illa (SUBFI).\r\n\r\nhttps://predicare.se/content/uploads/191015-Hur-hittar-vi-barnen-som-far-illa-Ida-Horst-Linda-Enggren.pdf\r\n\r\nSe sidan 18.', '2020-07-06 15:04:48.000000', 'BESKRIVNING: En metod för hälso- och sjukvårdspersonal som används för att utvärdera om ett barn har farit illa. Detta görs genom att utvärdera en rad antal påstående som man stämmer av mot de uppgifter som uppkommer från undersökning och från samtal.', '-', 'Informatik VGR', 'Pågår', 'SUBFI (Screeningverktyg för att upptäcka barn som far illa)', '-', '-', '-', 256, '-', '2020-07-06, davte1 och verwi6: Gjort beskrivning och satt status till preliminär.\r\n2020-08-04, ollka3, sofan63, magfo: Tveksamt om detta ska definieras. Ärendet för till JIRA 1036 med önskan att David utreder och återkommer.', '-', '-'),
(847, '-', '2020-07-31 17:00:13.000000', 'vårdaktivitet som utförs där patienten normalt befinner sig i vårdprocessen', '-', 'Informatik VGR', 'Beslutad', 'patientnära vårdaktivitet', '-', '-', '-', 155, 'ANMÄRKNING 1: Vid en patientnära aktivitet förs utredningsutrustningen till patienten och inte tvärtom. Det kan också röra sig om labbanalyser som görs i apparatur i vårdplatsens eller undersökningsrummets omedelbara närhet.', '2020-06-26, karkj, vikee1, magfo: Begreppsposten skapad.\r\n2020-07-07, marel67: (Jira 957)\r\n2020-07-27, magfo: Skrivit i JIRA-ärendet.\r\n2020-07-30, magfo: Utredning avslutad i JIRA 957, termen justerad och defiinition skriven.\r\n2020-08-03, gerpe4, ollka3, magfo: Beslutad.', '-', '-'),
