(849, '-', '2020-08-05 09:17:06.000000', 'kön bestämt utifrån inre och yttre könsorgan, könskromosomer och hormonnivåer', '-', 'RFSL: Begreppsordlista | 2015', 'Beslutad', 'biologiskt kön', '-', 'Sex', '-', 30, '-', '2020-07-01, vikee1, verwi6, ajlja1: Preliminärt definierad\r\n2020-08-04, ollka3, sofan63, magfo: Anmärkning 1 struken, irrelevant för biologiskt kön och ska flyttas till socialt. Posten beslutad.', '-', '-'),
(850, '-', '2020-08-07 11:53:17.000000', 'persons uttryck för ett kön genom användning av attribut som förknippas med det könet', '-', 'Socialstyrelsen jämlikhets-/HBTQ-ordlista', 'Beslutad', 'socialt kön', '-', '-', '-', 36, 'ANMÄRKNING 1: Till exempel viss typ av kläder, kroppsspråk, frisyr, socialt beteende, röst.', '2020-07-01, vikee1, verwi6, ajlja1: Preliminärt definierad.\r\n2020-08-03, gerpe4, ollka3, magfo: Alla beteckningar på kön måste utreda vidare. Förs till JIRA 175.\r\n2020-08-07, sofan63, gerpe4, ollka3, magfo: Beslutad.', '-', 'ANMÄRKNING 1: Socialt kön är inte bara två, utan bör ses som en skala där ingen är helt ’man’ eller helt ’kvinna’. All information om kön går inte att få genom att se på en kropp, utan vilket biologiskt kön man har är en bedömning som läkare gör, socialt kön kan fastställas på många sätt.'),
(851, '-', '2020-08-03 14:33:15.000000', 'det kön som person själv identifierar sig med', '-', 'Socialdepartementet: Läs mig! Nationell kvalitetsplan för vård och omsorg om äldre personer | 2017, Ordförklaringar, s. 21–28 (reviderad)', 'Beslutad', 'könsidentitet', '-', '-', '-', 22, 'ANMÄRKNING 1: En persons självupplevda kön, dvs. det kön man känner Sig som (kvinna, intergender, genderqueer, ickebinär, man, transperson osv). biologiska och juridiska könet behöver inte säga någonting om en persons könsidentitet.\r\n\r\nANMÄRKNING 2: Könsidentiteten bör kodas. Det finns flera värdemängder att välja mellan.', '2020-07-01, vikee1, verwi6, ajlja1: Preliminärt definierad\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(853, 'Är ett screeningverktyg som används för att gradera patienter som far illa av att ligga länge på en akutmottagning. Dessa patienter behöver prioriteras. \r\n\r\n\r\nhttps://neurophys.gu.se/sektioner/halsa-och-rehabilitering/forskning/fresh/Forskningsprojekt+/Strukturerad-bedomning-ochscreening-av-skorhet\r\n\r\nhttps://lakartidningen.se/klinik-och-vetenskap-1/artiklar-1/klinisk-oversikt/2020/05/skorhetsbegreppet-viktigt-for-att-forsta-den-aldre-patientens-behov/', '2020-08-03 14:30:09.000000', 'BESKRIVNING: Metod för skörhetsbedömning som används för att gradera patienter som far illa av att ligga länge på en akutmottagning.', '-', 'Informatik VGR', 'Pågår', 'FRESH', '-', '-', '-', 257, 'ANMÄRKNING 1: Läkartidningen presenterar en översikt över skattningsskalor för skörhet:\r\nhttps://lakartidningen.se/klinik-och-vetenskap-1/artiklar-1/klinisk-oversikt/2020/05/skorhetsbegreppet-viktigt-for-att-forsta-den-aldre-patientens-behov/', '2020-07-06, davte1 och verwi6: Gjort en beskrivning och ändrat status till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Begreppet måste utredas och reda bringas i skalorna. Flyttas till pågår.', '-', '-'),
(854, 'Är en akutmottagning inom primärvården. Under detta begreppet kan vi hitta andra termer som jourcentral, primärvårdsakut och närakut.', '2020-07-06 14:41:16.000000', '-', '-', '-', 'Publicera ej', 'primärvård akut', '-', '-', '-', 258, '-', '2020-07-06, davte1 och verwi6: Dubblett, finns redan behöver redas ut mer då akutströmmen är i behov av detta begreppet. Satt till publiceras ej.', '-', '-'),
(855, 'Numerisk skala (NRS) innebär att patienten väljer en siffra mellan 0 (ingen smärta) och 10 (värsta tänkbara smärta). Patienten kan ange siffran verbalt, markera siffran på en linjal eller sätta ett kryss på en pappersskala. (Från vårdhandboken: https://www.vardhandboken.se/vard-och-behandling/akut-bedomning-och-skattning/smartskattning-av-akut-och-postoperativ-smarta/smartskattningsinstrument/ )', '2020-08-03 14:24:06.000000', 'BESKRIVNING: Metod som används för att bedöma den upplevda smärtan hos en patient genom en numerisk skala.', '-', 'Informatik VGR, Vårdhandboken', 'Pågår', 'NRS (Nummeric Raiting Scale)', '-', '-', '-', 259, 'ANMÄRKNING 1: Numerisk skala (NRS) innebär att patienten väljer en siffra mellan 0 (ingen smärta) och 10 (värsta tänkbara smärta).', '2020-07-06, davte1 och verwi6: Skrivit en beskrivning och satt som preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Denna liksom många andra smärskattningsskalor måste hanteras tillsammans, och JIRA 1035 har skapats. Innan frågan är generellt utredd kan vi inte avsluta begreppsposten.', '-', '-'),
(856, 'Visuell analog skala (VAS). Patienten anger sin smärta antingen med en markör eller ett kryss utmed en exakt 10 cm lång linje, med ändpunkterna \"ingen smärta = 0\" till \"värsta tänkbara smärta =10\". Läs av skalan med hjälp en linjal på 10 cm. Skalan finns även med en sida för patienten och en graderad sida för personalen att läsa av. Se vårdhandboken : https://www.vardhandboken.se/vard-och-behandling/akut-bedomning-och-skattning/smartskattning-av-akut-och-postoperativ-smarta/smartskattningsinstrument/', '2020-08-03 14:23:32.000000', 'BESKRIVNING: Metod som används för att bedöma den upplevda smärtan hos en patient genom att patienten anger sin smärta antingen med en markör eller ett kryss utmed en exakt 10 cm lång linje, med ändpunkterna \"ingen smärta = 0\" till \"värsta tänkbara smärta =10\". Läs av skalan med hjälp en linjal på 10 cm.', '-', 'Informatik VGR, Vårdhandboken', 'Pågår', 'VAS (Visuell analog scale)', '-', '-', '-', 260, '-', '2020-07-06, davte1 och verwi6: Skrivit en beskrivning samt ändrat status till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Denna liksom mångfa andra smärskattningsskalor måste hanteras tillsammans, och JIRA 1035 har skapats. Innan frågan är generellt utredd kan vi inte avsluta begreppsposten.', '-', '-'),
(857, 'En beteendeskala som kan användas om patienten har nedsatt kommunikationsförmåga. Hos små barn som ännu inte har ett utvecklat språk finns olika ansiktsskalor och beteendeskalor att använda i kombination med fysiologiska parametrar och kommunikation med föräldrar. Med hjälp av FLACC bedöms 5 olika smärtbeteenden. Observera barnets ansikte, ben, aktivitet, gråt och tröstbarhet och bestäm en poäng mellan 0 – 2 med vilken barnets beteende överensstämmer. Poängen kan högst bli 10 och ska dokumenteras. \r\n\r\nFrån:\r\nhttps://www.vardhandboken.se/vard-och-behandling/akut-bedomning-och-skattning/smartskattning-av-akut-och-postoperativ-smarta/smartskattningsinstrument/\r\n\r\noch\r\n\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/29058/Sm%c3%a4rtskattning%20av%20akut%20sm%c3%a4rta.pdf?a=false&guest=true', '2020-08-07 11:36:10.000000', 'BESKRIVNING: En beteendeskala som används för att bedöma smärtbeteenden för patienter med nedsatt kommunikation.', '-', 'Informatik VGR', 'Pågår', 'FLACC (Face, Legs, Acticity, Cry, Consolability)', '-', '-', '-', 261, 'ANMÄRKNING: Med hjälp av FLACC bedöms 5 olika smärtbeteenden. Observera barnets ansikte, ben, aktivitet, gråt och tröstbarhet och bestäm en poäng mellan 0 – 2 med vilken barnets beteende överensstämmer. Poängen kan högst bli 10 och ska dokumenteras.', '2020-07-06, davte1 och verwi6: Skrivit en beskrivning och ändrats status till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Denna liksom mångfa andra smärskattningsskalor måste hanteras tillsammans, och JIRA 1035 har skapats. Innan frågan är generellt utredd kan vi inte avsluta begreppsposten.\r\n2020-08-07, sofan63, gerpe4, ollka3, magfo: JIRA-posten kompletterad bl.a. med länk till smärtskattningsinstrument. Utredning fortsätter.', '-', '-'),
(858, 'Smärtskala med ansikten – Reviderad, HoS personalen visar ett barn sex ansikten som ger uttryck för smärta, från vänster till höger ökar smärtan och uttrycken på ansikten visar att personen får mer ont. Barnen bes att peka på det ansikte som reflekterar deras smärta. Beronede på vilket ansikte som väljs får de en viss poäng som leder till att man kan avgöra hur ont de har.\r\n\r\nhttps://s3.amazonaws.com/rdcms-iasp/files/production/public/Content/ContentFolders/Resources2/FPSR/facepainscale_swedish_sweden_swe-se.pdf\r\n\r\nVårdhandboken:\r\nhttps://www.vardhandboken.se/vard-och-behandling/akut-bedomning-och-skattning/smartskattning-av-akut-och-postoperativ-smarta/smartskattningsinstrument/', '2020-08-03 14:22:33.000000', 'BESKRIVNING: Metod för att uppskatta hur hög smärta en patient upplever genom att sex ansikten visas. Dessa ansiktet ger uttryck för smärta från vänster till höger ökar smärtan och uttrycken på ansikten visar att personen får mer ont. Patienten får sedan peka på vilket ansikte som reflekterar den upplevda smärtan.', '-', 'vårdhanboken', 'Pågår', 'FACES - Faces Pain Scale-Revised', '-', '-', '-', 262, '-', '2020-07-06, davte1, verwi6: Preliminär beskrivning gjorts. Flyttad till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Denna liksom mångfa andra smärskattningsskalor måste hanteras tillsammans, och JIRA 1035 har skapats. Innan frågan är generellt utredd kan vi inte avsluta begreppsposten.', '-', '-'),
(859, 'Från socialstyrelsen:\r\nscreening - rekommenderad - systematisk undersökning av en population för att identifiera individer som är omedvetna om att de har ohälsa eller är i riskzonen för att utveckla ohälsa\r\nhttps://termbank.socialstyrelsen.se/?TermId=410&SrcLang=sv', '2020-08-03 14:14:26.000000', 'undersökning för att identifiera individ som är omedveten om hälsoproblem eller är i riskzonen för att utveckla hälsoproblem', '-', 'Socialstyrelsens termbank, reviderad', 'Beslutad', 'screening', '-', '-', '-', 263, 'ANMÄRKNING 1: Screening kan genomföras till exempel med hjälp av ett medicinskt test eller ett enkelt frågeformulär.', '2020-07-06, davte1, verwi6: Preliminär definition och anmärknings har skrivits. Flyttad till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Definitionen ändrad så att hälsoproblem ersätter ohälsa. Beslutad.', '-', '-'),
(860, 'levnadsvana	rekommenderad		specifikt beteende i vardagliga aktiviteter och som individen själv kan påverka\r\nFrån socialstyrelsen: https://termbank.socialstyrelsen.se/?TermId=411&SrcLang=sv', '2020-07-06 11:18:52.000000', 'specifikt beteende i vardagliga aktiviteter och som individen själv kan påverka', '-', 'Socialstyrelsens termbank', 'Beslutad', 'levnadsvana', '-', '-', '-', 264, 'ANMÄRKNING 1: Vid förebyggande åtgärder fokuserar man vanligen på levnadsvanor associerade med mat, fysisk aktivitet, tobak, alkohol, sömn och sexualitet. \r\n\r\nLevnadsvanorna påverkas av livsvillkoren och levnadsförhållandena.\r\n\r\nANMÄRKNING 2: Ett ofta förekommande uttryckssätt är livsstil som inte ska användas.', '2020-07-06, davte1, verwi6: Preliminär definition och anmärkning tillagd. Flyttad till preliminär.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(861, 'Skörhet (frailty) är ett allt vanligare begrepp inom sjuk och äldrevården. Skörhet är ett tillstånd som kännetecknas av allmän svaghet, trötthet och låg fysisk aktivitet, nedsatt uthållighet, dålig balans, viktminskning eller aptitlöshet och nedsatt problemlösningsförmåga, minne mm. Ofta sätts gränsen till tre indikationer för att identifieras som skör.\r\n\r\nEn progredierande åldersrelaterad försämring av olika kroppsfunktioner som resulterar i minskade reserver och som leder till stor sårbarhet vid olika påfrestningar och därmed ökar risken för olika typer av negativa hälsoutfall. https://lakartidningen.se/klinik-och-vetenskap-1/artiklar-1/klinisk-oversikt/2020/05/skorhetsbegreppet-viktigt-for-att-forsta-den-aldre-patientens-behov/', '2020-08-03 14:07:23.000000', 'tillstånd där flera kroppsfunktioner successivt förlorar förmågan att hantera fysiska, psykiska och sociala påfrestningar', '-', 'Informatik VGR', 'Beslutad', 'skörhet', '-', 'Frailty', '-', 265, 'ANMÄRKNING 1: Skörhet leder till stor sårbarhet vid olika påfrestningar och därmed ökar risken för olika typer av negativa hälsoutfall.\r\n\r\nANMÄRKNING 2: Skalan för beräkning av skörhet heter på engelska clinical frailty scale och är presenterad av Linköpings universitet påÖ: \r\nhttps://liu.se/artikel/instrument-att-skatta-skorhet', '2020-07-06, davte1, verwi6: Skrivit preliminär definition och lagt till en anmärkning. Flyttad till preliminär.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad med tillägg i anmärkningarna.', '-', '-'),
(862, 'Personer över 75 år som besöker akuten screenas för skörhet genom ett frågeformulär. Definieras en patient som en skör äldre prioriteras patienten upp och får utökade omvårdnadsinsatser som exempelvis tryckavlastande madrass, näringsdryck och tätare tillsyn.\r\nSköra äldre är ett begrepp för att hitta äldre personer med behov av vård och omsorg och därigenom riskerar hög vårdkonsumtion\r\nhttps://www.sahlgrenska.se/nyheter/nyheter/satsning-pa-skora-aldre/', '2020-08-03 13:52:44.000000', 'äldre person med sviktande hälsa och risk för hög vårdkonsumtion', '-', 'Informatik VGR', 'Beslutad', 'skör äldre', '-', '-', '-', 266, 'ANMÄRKNING 1: Personer över 75 år som besöker akuten screenas för skörhet genom ett frågeformulär.', '2020-07-06, davte1, verwi6: skrivit preliminär defition. skrivit en anmärkning. Flyttad till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Definitionen justerad, posten beslutad.', '-', '-'),
(863, 'Detta begreppet är ett screeningverktyg som används under triagering på akutmottagningen. Det är förkortat för att spara utrymme. Vi kanske ska lägga till begreppet suicidriskscrenning som en synoym eller bara ta bort akutmott. Iaf, här kommer kontexten:\r\n\r\nMetod för bedömning om patient vill ta sitt liv vilket leder till att patienten behöver psykiatrisk vård i någon form.', '2020-08-03 13:46:11.000000', 'BESKRIVNING: Metod för bedömning om patient vill ta sitt liv vilket leder till att patienten behöver psykiatrisk vård i någon form.', '-', 'Informatik VGR', 'Pågår', 'suicidriskscreening', '-', '-', '-', 267, 'ANMÄRKNING 1: Metoden används i triagen på akutmottagningen.', '2020-07-06, davte1, verwi6: Skrivit preliminär beskrivning. Flyttat till preliminär.\r\n2020-08-03, gerpe4, ollka3, magfo: Måste stämmas av med Mats och David, riktig definition ska skrivas. Flyttas till pågår.', '-', '-'),
(864, 'Engelsk term: treatment calender\r\n\r\nVi har fått från cerner att treatment calender är en behandlingskalender endast för oss onkologi, hematologi och barncancer behandlingar samt immunbehandlingar inom onkologin, ingen annan har en sådan kalender och i nuläget ingen tillgång.\r\n\r\nVi tycker namnet med behandlingskalender med attribut onk blir bra om det i framtiden blir fler som använder denna men i nuläget är det inga andra som har denna kalender i Millennium enligt Cerner. \r\n\r\nDet som skiljer denna kalender från hälsokalendern enligt Cerner är att vi ser endast onkologi, hematologi och barn delarna i vår behandlingskalender specifikt för regimer och tablett behandlingar för onkologi/hematologi/barn antitumorala behandlingar. Du har beskrivit det väldigt bra nedan. En hälsokalender låter mer som den visar allt runt en patients bokningar och där skulle ju en behandlingskalender kunna ingå .\r\nBehandlingskalendern är gjord för patienten ska få en översikt av sina behandlingar och vad hen ska ta för mediciner den är inte för oss vårdpersonal i första hand.\r\n\r\n\r\nDetta är inte samma sak som hälsokalender. Man kan säga att det är ett behandlingsschema för patienten och personalen att hålla reda på  olika terapier för cancer, ett sätt att förtydliga kommunikation.\r\n\r\nJag förstår deras behov av att relatera till en kalender = tidsangivelse i relation till veckans 7 dagar och vilket veckonummer du är i. \r\nEn terapi kan pågår i ex 5 v. Varje vecka i det schemat kan ha olika antal dagar när behandlingen ska ske. Det kan innehålla olika läkemedel i olika kombinationer. För att alla ska exakt förstå så skriver man om det till exakta datum (därav kalendern) så det ska vara enklare för patienten att relatera till dag i sin vardag. \r\nFör läkarna räknas terapierna enligt de olika antitumorala regimerna med olika omfattning och perioder som finns angivna i regimbiblioteket. \r\nEn annan verksamhet som skulle kunna behöva behandlingskalender är transplantation (immunnedsättande behandling), hematologi där man gör stamcellstransplantationer eller barnmedicin som har speciella regimer. \r\nSkulle man kunna tänka sig begreppet behandlingskalender med ett attribut (ONK), (TXPL), kanske att psykiatri har liknande behov?', '2020-08-07 11:30:35.000000', 'översiktligt schema för patient som visar planerade behandlingar och läkemedel', '-', 'informatik VGR', 'Beslutad', 'behandlingskalender', '-', 'treatment calendar', '-', 268, 'ANMÄRKNING 1: Behandlingskalendern är gjord för patienten ska få en översikt av sina behandlingar och vad hen ska ta för mediciner den är inte för oss vårdpersonal i första hand.', '2020-07-06, davte1, verwi6: Preliminär definition, flyttad till preliminär.\r\n2020-07-31, magfo: Utredning i JIRA 1026 inte klar, backat till pågår.\r\n2020-08-07, sofan63, gerpe4, ollka3, magfo: Efter långa diskussioner (e-post och möten) fastställs en definition som är allmängiltig för alla specialiteter och får specificeras för den som så önskar.', '-', '-'),
(865, 'https://vgregionit.atlassian.net/browse/INFMTK-767\r\n\r\növersättning för subjective symtom\r\n\r\n\"Tiredness is a subjective symptom whereas cough or fever are objective symptoms\"\r\n\r\nska inte förväxlas med kontaktorsak', '2020-08-10 11:17:07.000000', 'patients subjektiva uppfattning av hälsotillstånd', '-', '-', 'Beslutad', 'upplevt symtom', '-', '-', '-', 269, 'ANMÄRKNING 1: Trötthet är ett exempel på ett upplevt symtom medan uppmätt feber är exempel på objektivt fynd.', '2020-07-07, marel67, davte1, verwi6: Defintion tillagd. Mer kontext tillagd. Flyttad till Preliminär. Symtom eller symptom. Det är frågan...\r\n2020-08-03, gerpe4, ollka3, magfo: Justerad definition, beslutad post.\r\n2020-08-10, karkj, magfo: Definitionen förbättrad. Symtom bytt mot hälsotillstånd.', '-', '-'),
(866, 'Vi vill inte skilja på öppen eller slutenvård. Används inom det administrativa, ekonomiska och uppföljning och rapportering. \r\n\r\n\r\nså här resonerar Termbanken:\r\nPlanerat vårdtillfälle = vårdtillfälle för vilket tid har avtalats\r\nPlanerat öppenvårdsbesök = öppenvårdsbesök för vilket tid har avtalats\r\nOplanerat vårdtillfälle = vårdtillfälle för vilket tid inte har avtalats (Socialstyrelsen)\r\nOplanerat öppenvårdsbesök = öppenvårdsbesök för vilket tid inte har avtalats (Socialstyrelsen).', '2020-08-03 13:40:50.000000', 'hälso- och sjukvårdskontakt för vilken tid bestämts', '-', 'Informatik VGR', 'Beslutad', 'planerad kontakt', '-', '-', '-', 270, 'ANMÄRKNING 1: I termbanken finns specialiseringarna definierade. Vi behöver också definiera det överordnade begreppet när det är planerat men inte påbörjat. Man kan dock fråga sig vad vi ska kalla en kontakt som finns på väntelista. Den är ju planerad.', '2020-07-27, magfo: Preliminär definition skriven.\r\n2020-08-03, gerpe4, ollka3, magfo: Definitionen justerad, posten beslutad.', '-', '-'),
(867, 'förebyggande vård, vaccin etc mammografiscreening.  dvs, de som inte är sjukvård.', '2020-08-10 11:13:18.000000', 'verksamhet som främjar hälsa och förebygger sjukdom', '-', 'Nationalencyklopedin, reviderad', 'Beslutad', 'hälsovård', '-', '-', '-', 271, 'ANMÄRKNING 1: Medan hälso- och sjukvård bekostas (i betydande del) av sjukvårdshuvudman (vårdöverenskommelse, vårdavtal) är hälsovård en verksamhet som inte ska bekostas av sjukvårdshuvudmannen utan av den som nyttjar tjänsten.', '2020-07-08, vikee1: Preliminärt definierad\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Definitionen justerad, anmärkning tillagd. Beslutad.\r\n2020-08-10, karkj, magfo: Definitionen nerkortad, förtydligad.', '-', '-'),
(868, 'test', '2020-07-27 15:15:36.000000', '-', '-', 'Inte definierad', 'Avråds', 'testbegrepp', '-', '-', '-', 272, '-', '2020-07-27, magfo: Detta är en leksak för Olle och Liam, ska till sist ej publiceras, får nu vara avrådd.', '-', '-'),
(869, 'En komponent i mPage som drar in längd, vikt, blodtryck, saturation, BMI mm. På engelska heter komponenten bara vital signs men eftersom man kan visa även längd & vikt som räknas som mätvärden valde WS Onkologi att lägga till det i rubriken för komponenten. Gissar att alla kliniska arbetsströmmar kommer ha denna komponent på sina mPages men tror inte att alla vill visa mätvärden utan vissa mPages bara ska innehålla vitalparametrar. Vore tacksamt om informatik kan komma med en term som passar för båda.\r\nAnna Ben Shabat är KA som äger mPage för WS onk Mia (maria.delin@vgregion.se) har tittat på den pga. semestertider.', '2020-07-27 15:13:23.000000', '-', '-', 'Inte definierad', 'Pågår', 'Mätvärden och vitalparametrar', '-', '-', '-', 273, '-', '2020-07-27, magfo: Utredning påbörjad i JIRA 1030.', '-', '-'),
(870, 'I mPage finns en komponent som heter Visits, Skåne har översatt till Besök. Där hamnar kontakter (fysiska besök & digitala kontakter) som patienten haft och som planeras (går att konfigurera hur många kontakter bakåt och framåt som ska synas) så WS onk tycker inte Besök är representativt. WS onkologi har tillfälligt döpt komponenten till Vårdkontakter men inväntar bättre förslag från informatik. Kanske Vårdkontakter, tidigare och kommande?\r\n\r\nOT 1: WS onkologi verkar vara först ut att designa mPage. Cerner har ingen metod för att standardisera benämningen av komponenter. Alla arbetsströmmar som har mPages har egna DCW för dessa och enligt Cerner kan vi fritt välja vad vi vill kalla komponenterna (suck...). David Tegel kom med ett bra förslag; att samla alla Component names i en DCW att ha som \"masterkälla\" (finns det något i avtalet som säger att sökord ska vara masterdata och om man ändrar på ett ställe så ändras alla som är samma?). Cerner kan ordna detta men den måste då förvaltas/underhållas. Jag tror att nästan alla komponenter, de är hundratals..., behöver diskuteras i Shared Content Forum.\r\n\r\nOT 2: Om det går att utveckla OLLI skulle det var bra att kunna klistra in skärmklipp från START-domänen så förfrågningarna blir tydligare. Dessutom vore det bra med ett fält där man anger när önskemålet behöver vara klart. Bör också gå att skriva Skype/Teams istället för ett telefonnummer eller att det fältet inte är obligatoriskt.', '2020-08-13 10:02:59.000000', '-', '308335008 |Patient encounter procedure (procedure)|', '-', 'Pågår', 'öppenvårdskontakt', 'Saknas', 'visits', 'Inte definierad', 274, 'ANMÄRKNING 1: Visits förekommer som fysiska och digitala öppenvårdskontakter (i vårt begreppssystem är öppenvårdskontakten alltid fysisk). Alltså måste kontaktträdet modelleras om, se JIRA 1029.\r\n\r\nANMÄRKNING 2: Den engelska termen står i pluralis, och det framgår av sammanhangsbeskrivningen att begreppet inte avser en \"visit\" utan en samling av kontakter, vilket måste beaktas i term och definition.', '2020-07-27, magfo: Terminologisk utredning inledd, se JIRA 1029.\r\n2020-08-13, karkj, magfo: Den nya modeller instoppad i kort 1029.', 'Snomed CT (stämmer inte helt)', '-'),
(871, 'Finns i mPage. Skåne har översatt till Aktuellt. Definitionerna skiljer sig något mellan Melior & Cerner. Är Aktuellt korrekt term för denna komponent i Millennium?\r\n\r\nTermen finns i Melior med följande definition: Händelser den senast tiden som föregått eller föranlett läkarbesöket. Beskrivning av symtom. Patientens egna föreställningar, farhågor och förväntningar.\r\n\r\nCerners definition:\r\nSubjective/History of Present Illness: A description of the development of the patient\'s present illness. The HPI is usually a chronological description of the progression of the patient\'s present illness from the first sign and symptom to the present.\r\n\r\nmagfo kommentar: Man kan se vad Cerner menar i bilden\r\nhttps://wiki.cerner.com/display/1101powercharttouchHP/Starting+History+of+Present+Illness%2C+Review+of+Systems%2C+Physical+Exam%2C+or+Assessment+and+Plan+Documentation+in+PowerChart+Touch\r\nOrdet subjective visar att det inte är en objektiv beskrivning :-) utan patientens berättelse. Sedan Spris grundjournal\r\nhttp://www.fogare.eu/dokument/spri_grundjournal/sgj_bilaga_3.pdf\r\nhar det hetat Aktuellt med Spris definition \"Aktuell symtomutvecking fram till senaste vårdtillfället\". Ur denna definition skapar vi den relevanta definitionen och termen får bli Aktuellt.', '2020-08-10 11:04:40.000000', '[hälso- och sjukvård] symtomutveckling fram till pågående vårdkontakt', '422625006 |History of present illness section (record artifact)|', 'Spris grundjournal (!) - reviderad', 'Beslutad', 'aktuellt', '-', 'Subjective/History of Present Illness', '-', 275, 'ANMÄRKNING 1: sökordet Aktuellt har haft samma betydelse sedan det fastställdes av Spri 1976. Det finns ingen anledning att ändra detta djupt rotade begrepp och byta term på det.', '2020-07-27, magfo: term och definition föreslagna.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Vi konstaterar att denn retrospektiva förloppsbeskrivning saknar representation i Contsys - nytt begrepp där? Definitionen justerad, beslutad.\r\n2020-08-10, karkj, magfo: Sammanhang inskrivet före definitionen.', 'Snomed CT', '-'),
(872, 'Komponent i mPage. Performance Status & Toxicities översatt av Skåne till Bedömningar/Skalor. Finns också en komponent som heter Bedömning och planering i mPage. För att skilja komponenterna åt kanske denna komponent bör heta Skalor och bedömningsinstrument istället.\r\nKomponentens betydelse: från Performance Status & Toxicities öppnas ett fönster som är översatt till Manuell journalföring (säger mig ingenting om innehållet i fönstret...), i fönstret når man mappar med olika skalor som t.ex. fatigue, ECOG, ROAG. Mappar kan skapas för olika områden t.ex. neurologi, onkologi, kardiologi, fysioterapi osv. Vi bör även ha en struktur på dessa mappar när det gäller namngivning.\r\nDet kan vara så att komponenten bara heter Performance Status & Toxicities i PowerChart Oncology men komponenten finns i alla mPage men kan ha andra namn.', '2020-08-13 11:26:06.000000', '-', 'Inte definierad', '-', 'Pågår', 'bedömning/skalor', 'Inte definierad', 'Inte definierad', 'Inte definierad', 276, 'Inte definierad', '2020-07-26, magfo: Ärendet oklart, se JIRA 1028. Ärendet sätts till pågår.\r\n2020-08-13, karkj, magfo: Brev till Anna Wallman. Ledde till lång konstruktiv diskussion. Ärendet flyttas till Skånesamarbete 810.\r\n2020-08-13, karkj, magfo:  Efter samtal med Anna: vi samlar alla begrepp om skalor till ett JIRA-kort i Skåneepiken men länkad till OLLI. Detta begrepp avser biverkningar som är ett eget begrepp (biverkning).', 'Inte definierad', '-'),
(873, 'Komponent i mPage Recommendations som Skåne översatt till Rekommendationer. WS onkologi tycker inte att den termen beskriver betydelsen bra utan önskar att den heter Rekommenderade interventioner.\r\nKomponenten visar rekommenderade åtgärder utifrån ålder, kön, diagnoser, symptom eller andra parametrar i journalen. T.ex. en rökare >60år som haft hosta längre tid kan generera en rekommendation för lungröntgen. Komponenten visar rekommendationerna under Väntande (oklart om det är korrekt term) som är bokade åtgärder? och Ej schemalagda/historiska.\r\nOklart när SoKI har lagt in underlag/konfigurerat för dessa rekommendationer. Ett gigantiskt arbete enl. Cerner.', '2020-08-03 11:46:22.000000', 'hälso- och sjukvårdsaktivitet som föreslås baserat på kombination av aktuell information om patient och vårdriktlinje', '-', 'Informatik VGR', 'Beslutad', 'rekommenderad vårdaktivitet', '-', '-', 'Inte definierad', 277, 'ANMÄRKNING 1: Ordet intervention ska vi undvika. Använd i stället vårdaktivitet/hälso- och sjukvårdsaktivitet eller rent av bara aktivitet.', '2020-07-26, magfo: Förslag till ändrad term och definition.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Definitionen justerad, beslutad.', '-', '-'),
(874, 'Komponent i mPage, Skåne översatt till Patientinformation. WS onk tycker inte termen klargör betydelsen utan önskar termen Information till patient eller annat förslag från informatik. Komponenten är bara ett fritextfält (går att lägga in autotext precis som i alla andra fritextfält i Millennium) där man anger patientspecifik information. När det gäller PowerChart Oncology kan denna information publiceras i patientens behandlingskalender (Treatment Calender).\r\nDet finns tre snarlika komponenter. Patient Education, Patient Information och Patient Instructions, i mPage som är viktiga att hålla i sär.', '2020-08-10 10:56:36.000000', 'anvisning till patient om tillvägagångssätt i pågående vårdprocess', '-', 'Informatik VGR (från Rikstermbanken, reviderad))', 'Beslutad', 'patientinstruktion', 'saknas', 'patient instructions', '-', 278, 'ANMÄRKNING 1: Det finns två definitioner av instruktion som tagits till utgångspunkt för den föreslagna. I TNC:s \"Basord i våra fackspråk (2012)\" anges: information som beskriver hur något ska utföras. I Språkrådets Svensk-albansk tolkordlista (2003) anges: anvisning om lämpligt tillvägagångssätt. Den senare definitionen är måhända terminologiskt elegantare.\r\n\r\nANMÄRKNING 2: Skåne har översatt patient instructions till patientinformation. vilket är riskabelt då man lätt tror att patientinformation är översättning av patient ininformation.\r\n\r\nANMÄRKNING 3: Analys av begreppet har gjorts. En instruktion är en anvisning om tillvägagångssätt. Om den ges till en patient bör det vara en anvisning hur patienten ska bära sig åt. Det kan röra sig om egenvårdsordination, dosering av läkemedel, besked om kommande vårdkontakt, allmänna råd om hälsofrämjande och sjukdomsförebyggande förhållningssätt. Om instruktioner ges är den aktuella processen alltjämt pågående.', '2020-07-26, magfo: Termposten startad med förslag till definition.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Definitionen justerad, beslutad.\r\n2020-08-10, karkj, magfo: Definitionen förädlad.', '-', '-'),
(875, 'Komponent i mPage som Skåne översatt till Patientdata (Cerniska är Patient information), WS onk tycker inte Skånes översättning beskriver innehållet i komponenten utan föreslår Patientuppgifter eller annan term som informatik anser är lämplig. \r\n\r\nKomponenten innehåller Adresser (patientens), Kontaktinformation och Kontakt vid nödsituation. Inga ändringar kan göras i denna komponent men klickar man på komponentens namn så kommer man till Patient Democraphics där ändringar kan göras. Förutom Patient Demographics finns flikarna Visit List och Relationship Summary här. Man når också Patient Demographics via menyn där termen är också är Patientdata, om man ändrar termen i mPage bör således motsvarande term i menyn ändras. \r\n\r\nDet finns tre snarlika komponenter. Patient Education, Patient Information och Patient Instructions, i mPage som är viktiga att hålla i sär. Alla är inskickade till OLLI.', '2020-08-03 11:42:24.000000', 'information om hur patient kontaktas, kontakt som ska tas i nödsituation och vilka vårdkontakter som planeras', 'Inte definierad', 'Informatik VGR', 'Beslutad', 'patientuppgift', 'saknas', 'patient information', '-', 279, 'ANMÄRKNING 1:  Patientinformation syftar på patients adress- och kontaktinformation.\r\n\r\noch kontakt vid nödsituation. Inga ändringar kan göras i denna komponent men klickar man på komponentens namn så kommer man till Patient Democraphics där ändringar kan göras. Förutom Patient Demographics finns flikarna Visit List och Relationship Summary här.\r\n\r\nANMÄRKNING 2: I \"kontaktuppgifter\" inkluderas också information om kommande vårdkontakter.\r\n\r\nANMÄRKNING 3: Termposten saknas i Cerner glossary.\r\n\r\nANMÄRKNING 4: Termen patientinformation avråds, eftersom den skulle kunna beteckna informations om ges till patienten, något helt annat. Det skånska termen patientdata är för vid: den omfattar allt i databasen som avser patienten, kort sagt: journalen.', '2020-07-09, perha11:  Påbörjad , kolla också på det vi tidigare kallat patientbakgrund.\r\n2020-07-25, magfo: Utrett begreppet på bas av vad som skrivits i sammanhangsstycket. Det tycks täckas helt av det som vi normalt kallar patientuppgifter. JIRA 1027.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Definitionen justerad, beslutad.', 'Inte definierad', '-');
INSERT INTO `ordbok_begrepp` (`id`, `begrepp_kontext`, `begrepp_version_nummer`, `definition`, `externt_id`, `källa`, `status`, `term`, `utländsk_definition`, `utländsk_term`, `id_vgr`, `beställare_id`, `anmärkningar`, `kommentar_handläggning`, `annan_ordlista`, `alternativ_definition`) VALUES
(876, 'Term i mPage som är översatt av Skåne till Patientutbildning. WS onk tycker att det är en bra översättning men skickar in ändå eftersom informatik behöver få en överblick av de 3 snarlika komponenterna Patient Education, Patient Information och Patient Instructions. \r\n\r\nHär hittar du broschyrer/blad med standarinformation till patienter (om VGR lägger in information här förstås, mycket bra komponent för att säkerställa att patienter får samma skriftliga information oavsett var vården ges). Det finns 3 knappar i denna komponent som heter Favoriter, Anpassad och Fler alternativ klickar du på någon av dem kommer flikarna Patientinformation och Läkemedelsbroschyrer upp. Just nu är komponenten tom eftersom VGR inte lagt in några dokument. Jag gissar att det kommer visas mappar för olika områden typ Onkologi, Neurologi, Fysioterapi där man sedan går in och väljer patientinformationen som ska ges (printas) till patienten.\r\n\r\nDet finns tre snarlika komponenter. Patient Education, Patient Information och Patient Instructions, i mPage som är viktiga att hålla i sär. Alla är inskickade till OLLI.', '2020-07-25 10:02:49.000000', 'systematisk information och instruktion till patient avseende ett hälsoproblem och dess behandling', '-', 'Informatik VGR', 'Beslutad', 'patientutbildning', 'saknas', 'patient education', '-', 280, 'Definitionen är hämtad från Universitets- och högskolerådes svensk-engelska ordbok, där undervisning definieras:\r\n\r\nförmedling av kunskaper i organiserad form och på systematiskt sätt\r\n\r\noch utbildning ses som ett samlat resultat av undervisning.\r\n\r\nI Cerners glossary finns termen inte med, inklusion i OLLI och översättning grundar sig på information från Skåne.', '2020-07-25, magfo: Utrett begreppet, föreslagit översättning och definition. JIRA 1027.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', '-', '-'),
(877, '-', '2020-08-10 10:48:09.000000', '[hälso- och sjukvård] villkor att person som översätter biträder i vårdkontakt för att den ska kunna genomföras', '315593009 |tolkbehov|', 'Informatik VGR', 'Beslutad', 'tolkbehov', '-', '-', '-', 58, 'ANMÄRKNING 1: Begreppsposten kommer från Patientbakgrund 2009, där den inte definieras men beskrivs: Tolkbehov och i så fall vilket/vilka språk patienten behärskar, även teckenspråk.', '2020-07-29, magfo: Begreppsposten skapad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.\r\n2020-08-10, karkj, magfo: definitionen förädlad.', 'Snomed CT', '-'),
(878, 'Hela begreppsposten kommer från Patientbakgrund 2009.', '2020-08-10 10:41:33.000000', '[arbetsmarknad] syssla som ger inkomst åt den enskilda', '14679004 |yrke eller sysselsättning|', 'Patientbakgrund', 'Beslutad', 'sysselsättning', '-', '-', '-', 58, 'ANMÄRKNING 1: Vid yrkesarbete anges nuvarande eller tidigare arbetsuppgifter, anställnings- förhållande och arbetsmiljövillkor\r\n\r\nANMÄRKNING 2: Försäkringskassan har ett kodverk som publiceras av Inera:\r\nKV_FKMU_0002.NUVARANDE_ARBETE.RBK\r\nKV_FKMU_0002.NUVARANDE_ARBETE.HLP\r\nKV_FKMU_0002.ARBETSSOKANDE.RBK\r\nKV_FKMU_0002.ARBETSSOKANDE.HLP\r\nKV_FKMU_0002.FORALDRALEDIG.RBK\r\nKV_FKMU_0002.FORALDRALEDIG.HLP\r\nKV_FKMU_0002.STUDIER.RBK\r\nKV_FKMU_0002.STUDIER.HLP\r\nKV_FKMU_0002.PROGRAM.RBK\r\nKV_FKMU_0002.PROGRAM.HLP\r\n\r\nANMÄRKNING 3: den föreslagna definitionen är extensionell då det är svårt att definiera vad sysselsättning egentligen är. Den alternativa definitionen är ett försök att definiera intensionellt.\r\n\r\nANMÄRKNING 4: Referensfil: https://projektilen.vgregion.se/Project/Documents.aspx?ProjectID=828&DocumentNumberID=506930\r\n\r\nANMÄRKNING 5: Volontärarbete räknas inte in i sysselsättningsbegreppet i detta sammanhang.\r\n\r\nANMÄRKNING 6: Sysselsättning omfattar avlönat arbete, studier, praktikplats, daglig verksamhet, arbetsmarknadspolitiskt program, arbetssökande, föräldraledighet, egenföretagare.', '2020-07-29, magfo: Begreppsposten skapad från Patientbakgrund 2009. Där är definitionen extensionell, bör bytas mot intensionell definition.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Sysselsättning måste avgränsas bättre. Sjukskrivna, arbetssökande, studerande, pensionär? Sänks till pågår.\r\n2020-08-07, sofan63, gerpe4, ollka3, magfo: Efter kompletterande utredning av Gertrude beslutas begeppsposten.\r\n2020-08-10, karkj, magfo: Intensionell definition införd.', 'Snomed CT', '-'),
(879, '-', '2020-08-10 10:15:29.000000', 'genetiska och andra hälsoproblem hos anhöriga som kan ha samband med patients hälsoproblem', '281666001 |hereditet för sjukdom|', 'Patientbakgrund', 'Beslutad', 'ärftlighet', '-', '-', '-', 58, '-', '2020-07-29, magfo: Begreppsposten i sin helhet importerad från Patientbakgrund 2009. Dess beskrivning är gjord till definition med liten justering.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.\r\n2020-08-10, karkj, magfo: term och synonym har fått göra rockad.', 'Snomed CT', '-'),
(880, '-', '2020-07-29 11:22:46.000000', 'vårdaktivitet, åtgärd och insats till enskild gällande socialtjänst, stöd och service till funktionshindrade samt hälso- och sjukvård enligt gällande lagar', '224930009 |tjänster|', 'Socialstyrelsen termbank, reviderad', 'Beslutad', 'vård- och omsorgstjänst', 'Inte definierad', 'Inte definierad', 'Inte definierad', 58, 'ANMÄRKNING 1: Primärvård, specialistvård, hemtjänst, hemsjukvård, särskilt boende och LSS, innefattar enhet samt information om ansvarig personal.\r\n\r\nANMÄRKNING 2: Begreppsposten hämtad från Patientbakgrund 2009.\r\n\r\nANMÄRKNING 3: Posten i Snomed CT har två underordnade begrepp: hälso- och sjukvårdstjänster samt sociala tjänster. SCT-begreppet är alltså identiskt med patientbakgrundens begrepp.', '2020-07-29, magfo: Begreppet hämtat från Patientbakgrund 2009, definierat med hjälp av Socialstyrelsens termbank samt analyserat i SCT.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT', '-'),
(881, '-', '2020-08-03 11:06:54.000000', 'dokument som intygar behörighet att framföra specificerad typ av motordrivet fordon', '446497005 |har körkort|', 'Socialstyrelsen termbank, reviderad', 'Beslutad', 'körkort', '-', '-', '-', 58, 'ANMÄRKNING 1: hämtad från Patientbakgrund 2009.', '2020-07-29, magfo: Begreppsposten skapad. Obs att begreppet avser att patienten har körkort, därför är SCT-begreppet rätt.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Definitionen  justerad, posten beslutad.', 'Snomed CT', 'dokument som ger behörighet att framföra vissa motordrivna fordon (Socialstyrelsens termbank)'),
(882, '-', '2020-08-03 11:02:41.000000', 'tillstånd att inneha skjutvapen', '-', 'Socialstyrelsen termbank', 'Beslutad', 'vapenlicens', '-', '-', 'Inte definierad', 58, '-', '2020-07-29, magfo: Begreppsposten skapad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', '-', 'ANMÄRKNING 1: Hämtad från Patientbakgrund 2009.'),
(883, '-', '2020-07-30 10:25:43.000000', 'ultraljudsundersökning av hjärtat', '40701008 |Echocardiography (procedure)|', 'Informatik VGR', 'Beslutad', 'ekokardiografi', '-', 'echocardiography', '-', 22, '-', '2020-07-30, magfo: Begreppsposten skapad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad.', 'Snomed CT', '-'),
(884, '-', '2020-08-02 13:01:17.000000', 'behandlingsplan som fortlöpande anpassas till utfall av aktiviteter i vårdprocess', '370858005 |Following clinical pathway protocol (regime/therapy)|', 'Informatik VGR', 'Pågår', 'dynamisk behandlingsplan', 'pathway for the healthcare activities informing the content of core care plans (synonym till clinical pathway; Contsys)', 'care pathway', 'Inte definierad', 58, 'ANMÄRKNING 1: Generellt gäller att en plan tecknar avsett förlopp hos en vårdprocess. När processen drar i gång kommer varje aktivitet att generera ett utfall. Det som skiljer care pathway från individuell plan är att varje utfall av en aktivitet (undersökningsfynd, labbsvar, remissvar, patientrapport om resultat etc.) ska påverka planen dynamiskt så att den anpassas till den aktuella situationen mitt under processen. Även nya tankar från patientens sida kan ändra planen (något som inkluderas i begreppet utfall av aktiviteten “kompletterande information från patienten”). En care pathway är alltså dynamisk och anpassas hela tiden till den aktuella situationen. \r\n\r\nANMÄRKNING 2: Beskrivningen i Snomed CT inkluderar inte den dynamik som såväl Contsys som Informatik VGR betonar.', '2020-08-01, magfo: Begreppsposten skapad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Osäkerheten om vad care pathway är gör att ärendet återöfr till pågår.', 'Snomed CT (stämmer inte helt)', '-'),
(885, '-', '2020-08-10 10:06:36.000000', 'läkemedel som omfattas av läkemedelsförmån', '-', 'Informatik VGR', 'Pågår', 'läkemedel med förmån', 'Beskrivning:  If a medication is “non-formulary,” it means it is not included on the insurance company\'s “formulary” or list of covered medications. A medication may not be on the formulary because there is an alternative proven to be just as effective and safe, but is less costly.', 'formulary', '-', 58, '-', '2020-08-01, magfo: Begreppsposten skapad efter handläggning av JIRA 191.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Termen justerad, synonym tillagd, beslutad.\r\n2020-08-10, karkj, magfo: lagt till [läkemedel] till synonymen.', '-', 'ANMÄRKNING 1: I den engelskspråkiga versionen av Millennium finns termerna formulary och non-formulary. Av den engelska förklaringen framgår att  \"non-formulary\" inte finns på försäkringabolagets lista över läkemedel, vilkas kostnader täcks av försäkringsbolaget. Det är alltså exakt samma sak som att läkemedelsförmån inte gäller. Det negerade begreppet ska inte användas, varför terminologin omvänd i förhållande till termen \"non-formulary\". Detta har inte ett dugg att göra med läkemedelsförteckning annat än TLV:s förteckning över förmänsläkemedel.\r\n\r\nANMÄRKNING 2: Termen är inte särkilt terminologiskt elegant, men på alla recept kryssas \"förmån\" när man menar läkemedel som ingår i läkemedelsförmånen.\r\n\r\nANMÄRKNING 3: Av möte i dag framgår att non-formulary är läkemedel som inte kan väljas från Multums/Millenniums lista. Termen fritextläkemedel är vedervärdig men införs som synonym för att ärendet inte ska tappas.'),
(886, '-', '2020-08-03 10:40:40.000000', 'specifik mängd av produkt som tillverkats samtidigt under samma förhållanden', '-', 'Rikstermbanken/Terminologicentrum TNC: Basord i våra fackspråk 2012, reviderad', 'Beslutad', 'batch', '-', '-', '-', 58, '-', '2020-08-03, magfo: Begreppspost skapad.\r\n2020-08-03, gerpe4, ollka3, sofan63, magfo: Beslutad med ändrad referens.', '-', '-'),
(887, 'person som lämnar information, oftast om en annan individ (patient)\r\nDavid hittade det i en DCW från akutströmmen. Tror att det fulla begreppet var ”Uppgiftslämnarens kontaktuppgifter (telefon/epost)”, som används i förregistreringsdokumentationen eller som den nu heter Föranmälan.\r\n\r\nDetta formuläret används när polis, mottagning eller ambulans ringer in till akuten. Vi kanske kan prata snabbt om detta på mötet i eftermiddag?', '2020-08-13 09:28:01.000000', 'person som lämnar information i specifikt ärende', 'Inte definierad', 'Informatik VGR baserat på Försvarsmakten', 'Beslutad', 'uppgiftslämnare', 'Inte definierad', 'Inte definierad', 'Inte definierad', 281, 'ANMÄRKNING 1: I vilket sammanhang gäller detta? Socialtjänst? Är en som gör orosanmälan en uppgiftslämnare? Är moster som ger kompletterande anamnes till patientens egen berättelse uppgiftslämnare? Fråga per e-post till David om detta.', '2020-08-11, karkj, magfo: Begreppsposten oklar. Försvarsmaktens definition insatt som alternativ. Kontexten avgör hur vi ska definiera. E-postbrev till David om detta.\r\n2020-08-13, karkj, magfo: David håller med. begreppsposten beslutas.', 'Inte definierad', 'person som självmant lämnar information (Försvarsmakten i underrättelseverksamhet)'),
(888, 'en anmälan till socialstyrelsen som görs av HoS personal vid misstänkt misshandel eller misskötning av barn. Diskussion i strömmen om anmälan görs på barnets namn eller föräldrarnas namn. Om föräldern är en missbrukare görs detta på vederbörande, om barnet har tecken på misshandel så görs det på barnet enligt verksamhetsexperter.', '2020-08-11 11:47:59.000000', 'anmälan till socialtjänsten angående kännedom eller misstanke om att ett barn far illa', 'Inte definierad', 'Informatik VGR, härledd ur socialtjänstlagen (2001:453, 14 kap. 1§)', 'Beslutad', 'orosanmälan', 'Inte definierad', 'Inte definierad', '-', 282, '-', '2020-08-11, karkj, magfo: Begreppsposten fullbordad och beslutad.', 'Inte definierad', '-'),
