(890, 'Diskussion från all shared-forumet. \r\n\r\nDet gäller de två begreppen: \r\n1. Generella symptom\r\n2. Allmänna symptom \r\n\r\n(två olika begrepp) ', '2020-08-13 12:05:37.259304', '', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'generella symptom', 'Inte definierad', 'Inte definierad', 'Inte definierad', 284, 'Inte definierad', 'Inte definierad', 'Inte definierad', NULL),
