(892, 'Rekommemderade interventioner (föredragna termen) eller rekomenderade åtgärder (som även är föreslaget) är rekommendationer som kommer från Millenium som baseras på patientens ålder, kön, diagnoser och symptom. \r\n\r\nT.ex. en kvinna som är 12 år så kommer Millenium att rekommendera vaccination för livmoderhalscancer baserat på infon om patienten.\r\n\r\nHar deadline den 2 september 2020.', '2020-08-14 15:03:00.250678', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'rekommenderade interventioner', 'Inte definierad', 'Inte definierad', 'Inte definierad', 286, 'ANMÄRKNING 1: begreppet är hanterat i posten rekommenderad vårdaktivitet', '2020-08-18, magfo: Definieras ej.', 'Inte definierad', '-'),
(893, 'I iView under Section Display Mätvärden så finns Event Set Name Patient Stated Heigt/Length med Event Set Display (alltså det som visas i sysyemet) Längd, av patient angiven. I samma sektion av iView står det kroppsvikt, angiven. Vi arbetsström onkologi tänker att det borde benämnas på samma sätt att informationen är given av patienten.\r\nVi tycker att \"Längd, angiven av patient\" är ett bra begrepp.', '2020-08-14 15:34:46.455724', '', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'Längd, angiven av patient', 'Inte definierad', 'Inte definierad', 'Inte definierad', 287, 'Inte definierad', 'Inte definierad', 'Inte definierad', NULL),
(894, 'i iView under Mätvärden finns Event Set Name \"Patient Stated Weight\". Event Set Display här är \"Kroppsvikt, angiven\". Vi önskar att det ändras till \"Kroppsvikt, angiven av patient\" eller att det matchar det som ni kommer fram till angående längd som är angiven av patient.\r\nI dag är det \"Längd, av patient angiven\" samt \"Kroppsvikt, angiven\". Det borde formuleras på samma sätt.\r\n', '2020-08-17 07:23:18.994089', '', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'kroppsvikt, angiven av patient', 'Inte definierad', 'Inte definierad', 'Inte definierad', 288, 'Inte definierad', 'Inte definierad', 'Inte definierad', NULL),
(895, 'Inte definierad', '2020-08-17 10:22:01.043552', '-', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'indikation saknas/avsluta', 'Inte definierad', 'Inte definierad', 'Inte definierad', 127, 'Inte definierad', 'Inte definierad', 'Inte definierad', '-'),
(896, 'I iView Under sektion ONK Patientinformation/Utbildning finns Event Set Display \"När bör man kontakta vårdgivare\" Event Set Name \"Ed-When to Call Health Care Provider\". Fyra val kommer fram där användare  kan kryssa i ett eller flera. \r\n1 Bekräftar förståelse. \r\n2 Demonstrerar. \r\n3 Behöver ytterligare instruktion. \r\n4 Behöver ytterligare träning. \r\nDet handlar om att vårdgivare ger information till patient och att patient antingen har förstått informationen eller behöver ytterligare instruktion, träning. Informationen kan t ex vara att det är viktigt att kontakta vårdgivare om patient har fått feber.\r\nVi behöver en bättre översättning', '2020-08-17 10:32:53.947437', '-', 'Inte definierad', '-', 'Definiera ej', 'När bör man kontakta vårdgivare', '-', '-', '-', 289, 'Man misstänker att beställaren med vårdgivare menar hälso- och sjukvårdspersonal eller vårdenhet. I så fall tas kontakt när man känner sig sjuk eller drabbas av skada.  Vårdgivare är organisationen (VGR, Capio etc.) Se vårdgivare i Olli!', '2020-08-25, karkj, perha11, davte1, magfo: Satt som ej definierat. Lyft detta begrepp till kodverksförvaltningen samt till Skåne.', 'Inte definierad', '-'),
(897, 'I iView under sektionen ONK Patientinformation/Utbildning finns Event Set Name \"Ed-Alopecia\" med Event Set Display \"Alopecia\". Vi önskar att detta skrivs på svenska dvs Håravfall. Termen används också under sektion NCI/CTC och Patient Education, Infection Control.', '2020-08-17 10:49:58.317726', '-', '-', '-', 'Definiera ej', 'håravfall', '-', '-', '-', 290, 'Svensk term är självklart håravfall. Hanteras inte terminologiskt.', '2020-08-25, karkj, perha11, davte1, magfo: Ska ej definieras.', '-', '-'),
(898, 'I iview under sektion ONK Patientinformation/Utbildning finns Event Set Name \"Ed-Anemia\" med Event Set Display \"Anemia\". Det borde vara Anemi precis som Event Set Name \"NCI Anemia\" har Event Set Display \"Anemi\".', '2020-08-17 10:58:06.102289', '-', '271737000 | anemi |', '-', 'Definiera ej', 'anemi', '-', '-', '-', 291, 'Anemi är ett tillstånd som beskrivs i ICD och SNOMED CT. Det heter blodbrist på svenska och ska inte definieras då detta reda är en vedertagen term.', '2020-08-25, karkj, perha11, davte1, magfo: Ska ej definieras.', 'SNOMED CT', '-'),
(899, 'i iView finns under sektion ONK Patientinformation/Utbildning Event Set Name \"Ed-Diet Restrictions\" med Event Set Display \"Diet Restrictions\". Det öppnas en flervalslista med fyra alternativ där användaren kan kryssa i en eller flera val.\r\n1 Bekräftar förståelse\r\n2 Demonstrerar\r\n3 Behöver ytterligare information\r\n4 Behöver ytterligare träning\r\n\r\nDiet Restrictions behöver en svensk översättning. Termen finns även under Section Display Nutrition Education och Patient Education, Infection Control', '2020-08-17 11:46:35.871954', 'definierad reduktion av näringstillförsel', '-', 'Informatik VGR', 'Beslutad', 'kostbegränsning', '-', 'diet restrictions', '-', 292, '-', '2020-08-25, karkj, perha11, davte1, magfo: Skrivit definition och satt status som beslutad. Kontexten är svår att begripa och svarsalternativen behöver förtydligas. Vilken form står verbet i? Ska detta hanteras av kodverk?', '-', '-'),
(900, 'I iView under sektion ONK Patientinformation/Utbildning finns Event Set Name \"Ed-Dietary Supplements\" med Event Set Display \"Dietary Supplements\". Användaren får upp en flervalslista där hen kan välja ett eller flera alternativ.\r\n1 Bekräftar förståelse\r\n2 Demonstrerar\r\n3 Behöver ytterligare instruktion\r\n4 behöver ytterligare träning\r\n\r\nDietary Supplements behöver en svensk översättning. Termen används också under sektionerna Nutrition Education, Nutrition Newborn-Neonate Education och Patient Education, Infection Control.', '2020-08-17 11:58:12.365675', 'essentiellt näringsämne som kan ges som komplettering till ordinarie diet', '108961000 |näringstillskott|', 'Svenska MeSH', 'Beslutad', 'kosttillskott', '-', 'Dietary Supplements', '-', 293, 'ANMÄRKNING 1: Kostprodukter i kapsel-, tablett- eller flytande form som ger essentiella näringsämnen, som t ex något vitamin, mineral, protein, någon ört eller liknande näringspreparat.', '2020-08-25, karkj, perha11, davte1, magfo: Skrivit definition och satt status som beslutad. Kontexten är svår att begripa och svarsalternativen behöver förtydligas. Vilken form står verbet i? Ska detta hanteras av kodverk?', 'SNOMED CT', '-'),
(901, 'I iView under Section display Respiration finns Event Set Name \"Nasal Drainage Color\" med Event Set Display \"Nasal flytning, färg\". Är detta en korrekt benämning eller ska det vara sekret? Termen finns även under Section Display Respiratory LTC.', '2020-08-17 16:01:19.576965', '-', '-', '-', 'Pågår', 'Nasal flytning, färg', '-', '-', '-', 294, 'Nasal flytning är en tråkig term, föreslår nässekret som anges till konsistent, färg och mängd. Inte begrepp för definition. Stöd finns i Snomed CT, där termen dock är snuva. Beträffande två underordnade begrepp nämns illaluktande nässekretion och mukopurulent nässekretion. Återremitteras, svar önskas.', '2020-08-25, karkj, perha11, davte1, magfo: Diskussion om term och uppdelning mellan de tre begreppsposterna, se anmärkning.', '-', '-'),
(902, 'I iView under Section display Respiration finns Event Set Name \"Nasal Drainage Amount\" med Event Set Display \"Nasal flytning, mängd\". Är detta en korrekt benämning eller ska det vara sekret? Termen finns även under Section Display Respiratory LTC.', '2020-08-17 16:03:25.307100', '-', '-', '-', 'Pågår', 'Nasal flytning, mängd', '-', '-', '-', 295, 'Nasal flytning är en tråkig term, föreslår nässekret som anges till konsistent, färg och mängd. Inte begrepp för definition. Stöd finns i Snomed CT, där termen dock är snuva. Beträffande två underordnade begrepp nämns illaluktande nässekretion och mukopurulent nässekretion. Återremitteras, svar önskas.', '2020-08-25, karkj, perha11, davte1, magfo: Diskussion om term och uppdelning mellan de tre begreppsposterna, se anmärkning.', '-', '-'),
(903, 'I iView under Section display Respiration finns Event Set Name \"Nasal Drainage Consistency\" med Event Set Display \"Nasal flytning, konsistens\". Är detta en korrekt benämning eller ska det vara sekret? Termen finns även under Section Display Respiratory LTC.', '2020-08-17 16:04:38.658206', '-', '164182009 |vid undersökning: snuva|', '-', 'Pågår', 'Nasal flytning, konsistens', '-', '-', '-', 296, 'Nasal flytning är en tråkig term, föreslår nässekret som anges till konsistent, färg och mängd. Inte begrepp för definition. Stöd finns i Snomed CT, där termen dock är snuva. Beträffande två underordnade begrepp nämns illaluktande nässekretion och mukopurulent nässekretion. Återremitteras, svar önskas.', '2020-08-25, karkj, perha11, davte1, magfo: Diskussion om term och uppdelning mellan de tre begreppsposterna, se anmärkning.', 'Snomed CT', '-'),
(904, 'I iView under Section Display ONK Patientutbildning finns Event Set Name \"Ed-Anorexia\" med Event Set Display \"Anorexia\". Användaren kan välja från ett eller flera alternativ från en flervalslista\r\n1 Bekräftar förståelse\r\n2 Demonstrerar\r\n3 Behöver ytterligare information\r\n4 Behöver ytterligare träning\r\n\r\nTermen finns också under Section Display \"Patient Education, Infection Control\". Under Section Name  \"NCI Toxicity ROS\" är Event Set Display \"Anorexi\" vilket är en den rätta benämningen (då det handlar om att patient inte kan äta p g a sin tumörsjukdom och inte att patient är sjuk i anorexia). Det går även att använda termen \"avmagring\", se länk  https://www.cancerfonden.se/forskningsprojekt/160572', '2020-08-17 16:19:42.974365', '-', '-', '-', 'Pågår', 'Anorexia', '-', '-', '-', 297, 'Diagnosnamn som inte ska definieras terminologiskt. Anorexi är en mental störnings om leder till matleda eller viljemässig avmagring. Kakexi är avmagring på grund av svår sjukdom eller grav brist på föda. Helt överraskande för cancerfonden enligt länken nedan ihop dessa båda termer till ett begrepp som tycks vara en biverkan av antitumoral behandling. Återkoppling till cancerfonden med onkologiskt information vore av värde.\r\n\r\nSvenska MeSH:\r\nCachexia - Utmärgling\r\nSvensk definition: Allmänt illabefinnande, undernäring och viktminskning, oftast i samband med kronisk sjukdom.\r\n\r\nAnorexia - Aptitlöshet\r\nSvensk definition: Ätstörning med aptitlöshet eller nedsatt aptit.\r\n\r\nAnorexia Nervosa - Självsvält\r\nSvensk definition: Ätstörning med extrem viktminskning, utebliven menstruation och nedsatt ämnesomsättning på grund matvägran och aptitlöshet. Sjukdomen som också innefattar en störd kroppsuppfattning drabbar framför allt flickor och unga kvinnor.', '2020-08-25, karkj, perha11, davte1, magfo: Utredning gjord, definieras ej utan förklaring har givits.', '-', '-'),
(905, 'I mPage finns en komponent som heter Allergier/Överkänsligheter. Där kan man se, revidera och registrera allergi (mat, läkemedel etc) eller överkänslighet. \r\nKomponenterna i mPage behöver standardiseras som att komponenterna i mPage heter lika oberoende av arbetsström. Ska tas upp på Shared Content Forum.', '2020-08-17 19:29:52.949537', '-', '-', '-', 'Definiera ej', 'Allergier/Överkänsligheter', '-', '-', '-', 298, 'Båda begreppen ingår i uppmärksamhetsinformation och ska inte definieras var för sig.', '2020-08-25, karkj, perha11, davte1, magfo: Båda begreppen ingår i uppmärksamhetsinformation och ska inte definieras var för sig. Ärendet diskuteras med Ingela J-L av Karin.', '-', '-'),
(906, 'I mPage finns en komponent som heter Imaging, Skåne har översatt till Bilddiagnostik. Där hamnar svar på olika undersökningar t ex röntgen, PET, ultraljud, datortomografi, MR, nuklearmedicin etc (går att konfigurera hur lång tid bakåt som resultat som ska synas).', '2020-08-18 08:22:04.233042', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Bilddiagnostik', 'Inte definierad', 'Inte definierad', 'Inte definierad', 299, 'Inte definierad', '2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Inget terminologiskt ärende, men termen är OK.', 'Inte definierad', '-'),
(907, 'I mPage finns en komponent som heter Labs, Skåne har översatt till Klinisk kemi. Där hamnar svar på olika blod- och urinprover. Det finns undergrupper i komponenten där det ingår prover förutom från Klinisk kemi även från Immunologi och Transfusionsmedicin.WS onkologi tycker att Lab är en bättre benämning.', '2020-08-18 08:40:15.257326', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Klinisk kemi', 'Inte definierad', 'Inte definierad', 'Inte definierad', 300, 'Inte definierad', '2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Detta är inte terminologi. Den rubrik som ska användas på informationsmängden ska relatera till den information som används. Lab är en förbjuden term, ska stavas labb. Återremitteras.', 'Inte definierad', '-'),
(908, 'Se ärende Klinisk kemi. Vi önskar termen Lab för komponent i mPage som Skåne har översatt till Klinisk kemi. Problemet med detta är att komponenten även innehåller information från immunologi och transfusionsmedicin.', '2020-08-18 10:58:16.195287', '-', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'undefined', 'Inte definierad', 'Inte definierad', 'Inte definierad', 301, 'Inte definierad', '2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Återremitteras: undefined???', 'Inte definierad', '-'),
(909, 'Är en komponent i mPage, Microbiology som Skåne har översatt till Mikrobiologi där man kan se svar angående mikrobiologi. Arbetsström onkologi tycker att det är en bra översättning.', '2020-08-18 11:03:30.182622', '-', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Mikrobiologi', 'Inte definierad', 'Inte definierad', 'Inte definierad', 302, 'Inte definierad', '2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Detta tycks vara rubrik för en ruta med information. Vad är omfånget av begreppet mikrobiologi? Borde det inte vara mikrobiologiskt svar? Återremiss.', 'Inte definierad', '-'),
(910, 'Komponent i mPage, Pathology som Skåne har översatt till Patologi.', '2020-08-18 11:07:26.022989', 'sjukdomslära', 'Inte definierad', 'Asklepios', 'Definiera ej', 'Patologi', 'Inte definierad', 'Inte definierad', 'Inte definierad', 303, 'Inte definierad', 'Inte definierad', 'Inte definierad', '-'),
(911, 'Staging är en komponent i mPage där man dokumenterar och läser om stadieindelningen för patientens tumörsjukdom. Det går även att designa VGR specifik stadieindelning och skapa komponenter för riskfaktorer för de sjukdomar som inte använder AJCC8. Arbetsström onkologi önskar att komponenten Stagning i mPage benämns Stadieindelning och riskgruppering.', '2020-08-18 11:50:54.126614', '-', 'Inte definierad', 'Inte definierad', 'Publicera ej', 'Stadieindelning och riskgruppering', 'Inte definierad', 'Inte definierad', 'Inte definierad', 304, 'Inte definierad', '2020-08-24, magfo: den typen av term får inte förekomma. Detta är två begrepp som ska definieras: 1) stadieindelning som är väl definierad inom onkologin; 2) riskgruppering som är ett vidare begrepp och finns inom all hälso- och sjukvård och ska ställas i relation till risk för vårdskada.\r\n2020-08-24, karkj, helse4, perha11, sofan63, davte1, magfo: Återremiss för förtydligande. Viktigt att skilja de två begreppen. Vad är riskgruppering för onkologen?', 'Inte definierad', '-'),
(912, 'Information om avslutad infusion ska vara:\r\n - när infusionen avslutades\r\n - om den avbröts (pga klinisk effekt eller tekniskt fel)\r\n - om lösningen tog slut\r\n - hur länge infusionen pågick', '2020-08-18 14:53:49.840142', '-', 'Inte definierad', 'Informatik VGR', 'Pågår', 'planerad infusionstid', 'Tveksamt vad infuse over egentligen ger för information.', 'infuse over', 'Inte definierad', 44, 'ANMÄRKNING 1:', '2020-08-18, helse4, karkj, sofan63, magfo: Påbörjat posten. JIRA 880', 'Inte definierad', '-'),
(913, 'I iView under sektion Överrapportering finns Event Set Name \"Nurse Giving Report\", \"Nurse Receiving Report\", \"Rapporterad till undersköterska\" och \"Rapporterad av undersköterska\" samt \"Rapporteringssätt\" (vid patienten, telefon, muntligt rapport på expedition, läsrapport). Först var Event Set Display Rapporterad till/av sjuksköterska alternativt undersköterska men vi ser i CERT domänen att detta är ändrat till Skriftrapport lämnad/av sjuksköterska alternativt undersköterska. Vi i arbetsström onkologi tycker inte detta är bra då man anger rapporteringssätt i valen och vi måste ha annan möjlighet till rapportering i annat än skrift.', '2020-08-18 16:12:48.226504', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'Skriftrapport', 'Inte definierad', 'Inte definierad', 'Inte definierad', 305, 'Inte definierad', '2020-08-24, magfo: skriftrapport är definitivt inte en acceptabel term. Frågan är om det är ett övergripande begrepp för rapporter (man kan tro det av Annas text). Det finns annars en term för denna typ av rapporter: tyst rapport, annars duger väl skriftlig rapport som inte behöver definieras.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Ärendet inte begripligt. Motfråga till Mia och Anna.', 'Inte definierad', '-'),
(914, 'För att beskriva sömn under dagen. Frågan är om det istället ska heta \"Sömn under dagen\". Tupplur kan upplevas som ett oklart begrepp för personer som inte har svenska som modersmål.', '2020-08-18 16:48:04.907457', 'kortvarig sömn', '-', 'Svenska Akademins Ordlista', 'Preliminär', 'tupplur', '-', 'powernap', '-', 306, '-', '2020-08-25, karkj, perha11, davte1: Definierat termen och ändrat status till preliminär.', '-', '-'),
(915, 'SME\'er inom arbetsström psykiatri vill att detta begrepp används i systemet istället för det mer gammaldags \"Avgiftning\".', '2020-08-19 15:17:24.147221', '', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'abstinensbehandling', 'Inte definierad', 'Inte definierad', 'Inte definierad', 308, 'Inte definierad', 'Inte definierad', 'Inte definierad', NULL),
(916, 'Implant History är en komponent i mPage där man ser vad patient har för implantat i kroppen, typ, material, MR klassificering, placering etc. Skåne har översatt Implant History till Implantathistorik. Är detta en korrekt benämning eller finns det ett bättre ord?', '2020-08-20 06:37:24.315370', 'förteckning över aktuella och tidigare implantat hos viss patient med uppgift om tillverkare, material och implantationsplats', 'Inte definierad', 'Inte definierad', 'Pågår', 'implantathistorik', 'Inte definierad', 'implant history', 'Inte definierad', 309, 'Inte definierad', '2020-08-24, magfo: Jag tycker översättningen är utmärkt. Ska bara hitta på en definition.\r\n2020-08-24, magfo: Nej, förresten, behöver inte definieras.', 'Inte definierad', '-'),
(917, 'Care Team är en komponent i mPage där man kan se iuppgifter om patients övriga vårdgivare, deras profession samt kontaktuppgifter till dessa. Skåne har översatt Care Team till Vårdteam.', '2020-08-20 06:41:44.800087', 'grupp av hälso- och sjukvårdspersonal som tillsammans deltar i vården av viss patient', 'Inte definierad', 'Inte definierad', 'Beslutad', 'vårdteam', 'Inte definierad', 'Inte definierad', 'Inte definierad', 310, 'ANMÄRKNING 1: Skåne har begränsat användningen till vilka vårdgivare som patienten har kontakt med, vilket inte är den intuitiva betydelsen av föreslagen term. Den bör i stället användas för att beteckna den grupp av hälso- och sjukvårdspersonal som patienten har kontakt med.', '2020-08-24, magfo: Definitionsförslag skrivet, förtydligande gjort att ett team inte kan bestå av vårdgivare utan hälso- och sjukvårdspersonal.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Beslutad.', 'Inte definierad', '-'),
(918, 'Clinical Images är en komponent i mPage där man kan spara och se media så som bilder och ljud. Skåne har översatt Clinical Images till Mediebibliotek.', '2020-08-20 06:47:13.248606', 'samling av ljud- och bildregistreringar', 'Inte definierad', 'Inte definierad', 'Pågår', 'mediebibliotek', 'Inte definierad', 'Inte definierad', 'Inte definierad', 311, 'ANMÄRKNING 1: Bild- och funktionsregistret ska vara VGR:s mediebibliotek.', '2020-08-24, magfo: Skånes översättning är utmärkt. Definition föreslagen.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Begreppsposten ska stämmas av med Gertrude och Micke.', 'Inte definierad', '-'),
(919, '-', '2020-08-20 10:48:57.864846', 'enskilt hem som på uppdrag av socialnämnden eller motsvarande tar emot barn och ungdomar för stadigvarande vård och fostran eller vuxna för vård och omvårdnad och vars verksamhet inte bedrivs yrkesmässigt', '-', 'Socialstyrelsens termbank', 'Publicera ej', 'familjehem', '-', '-', 'Inte definierad', 1, '-', '2020-08-20, vikee1, Preliminärt definierad.\r\n2020-08-20, vikee1, Fanns redan inlagd i OLLI sedan innan så den sätts till publiceras ej.', '-', '-'),
(920, 'Ska vara Utför men kunde inte lägga till begreppet utan att skriva X efter...\r\n\r\nÄr egentligen i kontext med begreppet Genomförs ej. Utförs är en knapp i Millenium som man klickar på för att utföra och dokumentera vissa aktiviteter som sjuksköterska, t.ex. ta vitalparametrar samt att dokumentera dem.', '2020-08-20 16:49:14.523805', '-', '-', '-', 'Pågår', 'utför', '-', '-', '-', 312, '-', '2020-08-25, karkj, perha11, davte1: Mer kontext behövs, David ska ta upp detta med akutströmmen: Dokument(Utför) och Inte klar(Genomförs ej, kanske Utförs ej? Utförs inte? Pga av att det ska användas inom Regionen), fråga om det förekommer på flera ställen i Millennium.', '-', '-'),
(921, 'Är egentligen i kontext med begreppet Utförs. Genomförs ej är en knapp i Millenium som man klickar på när inte en aktivitet för sjuksköterskor behöver genomföras, sen får man ange varför inte denna aktiviteten ska genomföras. SoKI sa att dessa två begrepp inte var hårdkodade.', '2020-08-20 16:58:50.439426', '-', '-', 'Inte definierad', 'Pågår', 'genomförs ej', '-', '-', '-', 313, '-', '2020-08-25, karkj, perha11, davte1: Mer kontext behövs, David ska ta upp detta med akutströmmen: Dokument(Utför) och Inte klar(Genomförs ej, kanske Utförs ej? Utförs inte? Pga av att det ska användas inom Regionen), fråga om det förekommer på flera ställen i Millennium.', '-', '-'),
(922, 'Del i mPage där användaren lägger in diagnos på patient. Det går att söka diagnos via text eller diagnoskod. Diagnosen anges som kronisk eller enbart detta besök. Denna del av MPage läser in diagnoser från alla enheter i regionen som använder Millennium. Det går också att se tidigare problem och användaren kan ärn avskriva problem om de inte längre är aktuella. Den engelska termen för denna komponent är Problem List och Skåne har översatt till Diagnoser och hälsoproblem', '2020-08-21 07:05:05.609336', '{felaktig term eftersom båda orden är separata termer. Bör döpas om till problemlista}', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Diagnoser och hälsoproblem', 'Inte definierad', 'Inte definierad', 'Inte definierad', 314, 'Inte definierad', '2020-08-24, magfo: Termfras som måste delas upp. Båda orden är definierade i VGR 1.0, och dessa definitioner ska användas. Termfrasen kan behållas eller bytas mot problemlista.', 'Inte definierad', '-'),
(923, 'Komponent i mPage där man kan se alla \"orders\" som finns på patienten det kan t ex gälla läkemedel som ges på sjukhus eller skickas med patienten hem från sjukhuset (alltså man ger patient några tabletter från avdelning/mottagning), remisser, lab-beställningar, mobilisering och restriktioner eller övrigt (orders för framtida bokningar) på den aktuella encountern. Den engelska termen för denna komponent är Order Profile och Skåne har översatt till Aktuella ordinationer. Eftersom Aktuella ordinationer idag i Melior är alla mediciner som patienten står på, kan denna term skapa förvirring. Begreppet bör diskuteras i Shared Documentation Forum.', '2020-08-21 07:25:15.675104', '{invänta vad Shared documentation forum säger}', 'Inte definierad', 'Inte definierad', 'Publicera ej', 'Aktuella ordinationer', 'Inte definierad', 'Inte definierad', 'Inte definierad', 315, 'Inte definierad', '2020-08-24, magfo: Eftersom ärendet är sänt till Shared Documentation Forum görs ingenting. Termen är självförklarande men får inte begränsas till läkemedelssammanhanget.', 'Inte definierad', '-'),
(924, 'Komponent i mPage som på engelska heter Assesment and Plan som vi önskar ska heta Bedömning och planering. I denna komponent läses de diagnoser som användaren har angett som diagnoser som ligger till grund för detta besök. Under vare diagnos, som står utskriven i text, finns en fritext ruta där användare kan antingen skriva själv, använda frasminne, klistra in taggad (kopierad) text eller använda sig av tal till text för att dokumentera. Komponenten läser även i de \"orders\" som har gjorts på det aktuella besöket.', '2020-08-21 07:38:00.091141', '{översättningsärende. De ingående termerna är väl förståeliga eller definierade. Frågan bör sändas till shared documentation forum för att säkra att alla strömmar använder frasen på samma sätt}', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Bedömning och planering', 'Inte definierad', 'Inte definierad', 'Inte definierad', 316, 'Inte definierad', '2020-08-24, magfo: Inte definitionsärende utan översättning som ska vara samma i alla strömmar.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Rubriksättning där ingående begrepp är vart för sig finns definierade.', 'Inte definierad', '-'),
(925, 'Komponent i mPage där användaren kan se \"ordrar\" från den aktuella encountern. Det kan t ex vara remisser, labbeställningar etc de kan ha status kommande, ofullständig, pågående, ordinerad, pausad eller väntande (t ex skickad från student och behöver godkännas av legitimerad personal). Komponenten heter Outstanding order på engelska och Skånde har översatt till Ordinationer att åtgärda. Bör diskuteras i Shared Documentation Forum.', '2020-08-21 07:47:01.290021', '-', 'Inte definierad', 'Inte definierad', 'Publicera ej', 'Ordinationer att åtgärda', 'Inte definierad', 'Inte definierad', 'Inte definierad', 317, 'Inte definierad', '2020-08-24, magfo: Eftersom ärendet är sänt till Shared Documentation Forum görs inget i BB', 'Inte definierad', '-'),
(926, 'Komponent i mPage där användaren kan beställa en \"order\", (remisser, recept, olika åtgärder etc) på ett snabbare och smidigare sätt än att gå via menyvalet Ordinationer.', '2020-08-21 08:03:49.050249', '{ska inte definieras, är självförklarande. Ren översättningsfråga}', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Ny ordination', 'Inte definierad', 'Inte definierad', 'Inte definierad', 318, 'Inte definierad', '2020-08-24, magfo: Ingen terminologisk fråga\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Definieras ej.', 'Inte definierad', '-'),
(927, 'Goals & Interventions är en del i mPage där användare kan tillsammans med patient sätta upp mål och åtgärder/strategier för att uppnå mål eller delmål samt dokumentera och följa upp målen. Komponenten heter Goals & Interventions på engelska och och vi i arbetsström onkologi önskar att komponenten heter Mål och åtgärder.', '2020-08-21 08:25:00.245845', '{översättningsfråga, ska inte definieras}', 'Inte definierad', 'Inte definierad', 'Definiera ej', 'Mål och åtgärder', 'Inte definierad', 'Inte definierad', 'Inte definierad', 319, 'ANMÄRKNING 1: Termen bör vara mål och aktiviteter med den föreslagna termen som tillåten synonym', '2020-08-24, magfo: Ej definitionsärende\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Namnsättningsfråga, inte definition.', 'Inte definierad', '-'),
(928, 'Komponent i mPage där man kan se alla patientens antitumorala behandlingar, aktuella  samt avslutade under det senaste året (tiden är konfigurerbar men rekommendationen från Cerner är ett år). Komponenten heter Oncology Chemotherapy Workflow och vi i arbetsström onkologi önskar namnet Antitumoral behandlingsuppföljning.', '2020-08-21 08:54:42.353501', '-', 'Inte definierad', 'Inte definierad', 'Pågår', 'Antitumoral behandlingsuppföljning', 'Inte definierad', 'Inte definierad', 'Inte definierad', 320, 'Inte definierad', '2020-08-24, magfo: Termen är självförklarande, ska inte definieras.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Behöver definieras. MF tar fram begreppet antitumoral behandling samt uppföljning därav.', 'Inte definierad', '-'),
(929, 'I Millennium namnet på en Mpage där snabbåtkomst till \"Orders\" finns för användaren. Skåne har översatt det till Snabbval. Oklart om detta är något hårdkodat, något som vi och Skåne måste vara överens om.\r\n\r\nDet skulle mycket väl kunna vara så att vi behöver beslutet om vad \"Order\" ska översättas till innan en svensk benämning på \"Quick Order\" kan beslutas. Ärendet är lyft på VGR internt Shared Content Forum med ID 86.\r\n\r\nTilläggskontext:\r\nFör vissa specialiteter skapas \"quick orders\" (nytt namn kommer senare) vilket är att betrakta som \"favorit-orders\": de enstaka orders man använder frekvent inom sin specialitet. Detta är inte att förväxla med \"order sets\" där man beställer en grupp av orders, för utredning eller behandling av en patient.\r\n\r\nSyftet med quick orders är att det är enstaka orders som en läkare lätt ska kunna beställa, t. ex. under en rond. Detta kan variera beroende var man arbetar, men skulle kunna vara t.ex. \"ASAT\", \"handleds-röntgen\", \"uppföljande remiss till primärvården\", etc. Dessa quick orders grupperas i olika kategorier och kan nås via n-pages.\r\n\r\nVarje SME är ansvarig för att välja ut quick order för sin specialitet. Dessa är gemensamma för alla läkare inom den specialité. Quick orders kan också uppdateras efter att Millenium sjösatts, så att de fortsätter att vara så god nytta som möjligt för medarbetarna. Det finns också möjligheter för enskilda läkare att skapa egna grupper av favorit-orders, som komplement till quick orders.', '2020-08-21 14:35:24.529605', '-', '-', '-', 'Pågår', '(quick order)', '-', 'quick order', '-', 322, '-', '2020-08-24, magfo: JIRA 86 existerar inte. Eftersom Shared Content Forum ska ta ställning görs ingenting från BB.\r\n2020-08-24, vikee1: Uppdaterat med ytterligare kontext.\r\n2020-08-24, vikee1: Shared Content Forum väntar på input från informatik innan de kan ta beslut i frågan eftersom det ännu inte finns någon översättning på order.\r\n2020-08-25, karkj, perha11, davte1: Har skapat ett Jira kort(1114) och sedan länkat till Skåne ordersets,', '-', '-'),
(930, 'Inte definierad', '2020-08-22 11:07:02.164186', '[läkemedel] tid som definierad läkemedelsdos har effekt', 'Inte definierad', 'Informatik VGR från FASS', 'Beslutad', 'duration', 'Inte definierad', 'duration', 'Inte definierad', 58, 'ANMÄKNING 1: homonym term som också har fått en allmän definition i separat begreppspost.', '2020-08-22, magfo: Termposten skapad, beslutsunderlag sänt till Sara. JIRA 1108 skapat.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo: Beslutad med liten justering av definitionen.', 'Inte definierad', '-'),
(931, 'Inte definierad', '2020-08-22 11:10:13.152540', 'tidsperiod under vilken en ordinerad läkemedelsprodukt ska ges till patient', 'Inte definierad', 'Informatik VGR från Socialstyrelsens termbank', 'Beslutad', 'behandlingstid', 'Inte definierad', 'duration', 'Inte definierad', 58, 'Inte definierad', '2020-08-22, magfo: Termposten skapad, beslutsunderlag sänt till Sara. JIRA 1108 skapat.\r\n2020-08-24, helse4, perha11, sofan63, davte1, magfo:  Begreppsposten beslutad.', 'Inte definierad', '-'),
(933, 'Förslag på lämplig översättning, brev till patient? begreppet ska användas till resultat för lab, rtg etc', '2020-08-24 11:30:51.762287', '-', '-', '-', 'Pågår', '(result letter)', '-', 'result letter', '-', 324, '-', '2020-08-25, karkj, perha11, davte1: Behöver mer kontext för att kunna definiera detta begreppet.  Kontakta beställaren och skapa ett Jira kort INFMTK-1113.', '-', '-'),
(935, 'Normativ längd på en person/barn enligt tillväxtkurva. Vad ska ett barn på 7 år vara för längd? Intressant för ortopedin (och implanteringar av implantat) samt tillväxtkliniker osv.\r\n\r\n ', '2020-08-26 10:08:29.788156', '', 'Inte definierad', 'Inte definierad', 'Ej Påbörjad', 'usual height', 'Inte definierad', 'Inte definierad', 'Inte definierad', 326, 'Inte definierad', 'Inte definierad', 'Inte definierad', NULL);
