INSERT INTO `ordbok_opponerabegreppdefinition` (`id`, `begrepp_kontext`, `datum`, `epost`, `namn`, `status`, `telefon`, `begrepp_id`) VALUES
(1, 'Finns dublett', '2020-03-04 12:13:00.000000', 'olle.karlsson@vgregion.se', 'Olle', 'Publicera ej', '0704894668', 477),
(3, 'T.ex förekommer information hur många tabletter patienten tar varje dag \r\n\r\nAkutsjukvård/Läkemedel', '2020-03-10 07:54:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '1', 564),
(4, 'ipox kallas detta i millenium', '2020-03-11 07:43:00.000000', 'olle.karlsson@vgregion.se', 'Olle', 'Ej Påbörjad', '0704894668', 519),
(5, 'Funderas över denna i klinisk vårddokumentation också, då folk säger att vitalparametrar är olika beroende på vart man är.', '2020-03-11 12:42:00.000000', 'olle.karlsson@vgregion.se', 'Olle', 'Ej Påbörjad', '0704894668', 495),
(6, 'compliance är den engelska termen för detta. I millennium är det översatt till följsamhet på några ställen och efterlevnad på andra. Används vid dokumentation av \"home medication\"', '2020-03-12 10:46:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 571),
(7, 'Ordinationer finns med på en sammanfattning av en operationsanmälan som gjorts. \r\nPå operationsanmälan syns pat id och namn, allergier och annan information om operationen, bl.a: \r\n\r\nOrdinationer: Ljumskbråck med implantat. \r\n\r\n- där ordinationer beskriver operationens namn och procedur. I Orbit kallas det operationsanmälan men i Millenium ordinationer vilket inte upplevs korrekt. Detta bör tittas över.', '2020-03-17 10:58:00.000000', 'viktoria.pettersson@vgregion.se', 'Viktoria', 'Ej Påbörjad', '0763444467', 341),
(8, 'Tillägg:\r\ne-hälsomyndigheten och NLL kallar detta doseringstyper. Doseringstyper kan i NLL bestå av:\r\n-frekvensdosering (En frekvensdosering uttrycker en dos med en viss frekvens per tidsenhet.)\r\n-intervalldosering (En intervalldosering uttrycker en dos som ges med ett visst (numeriskt) intervall mellan administreringstillfällen. Intervallet kan även uttryckas som ett intervall.)\r\n-tillfällesdosering (En tillfällesdosering kan uttryckas som en dos vid ett klockslag (hel- eller halvtimme) eller vid en viss period på dygnet.)\r\n-engångsdosering (flagga som markerar att en dos ska administreras vid ett unikt tillfälle.)\r\n-fritextdosering.', '2020-03-18 15:23:00.000000', 'sofia.charlotte.andersson@vgreion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 595),
(9, 'är detta arbetet klart ännu med Skåne? i så fall borde vi kanske inte ha status avrådd på hemläkemedel?', '2020-03-19 12:05:00.000000', 'louise.fernholm@vgregiom.se', 'louise', 'Ej Påbörjad', '0730383710', 583),
(10, 'PowerPlan är Cerners namn på order set.\r\nJag anser att det är begreppet \"order set\" som vi bör definiera och översätta och att PowerPlan sedan blir en synonym.', '2020-03-20 12:50:00.000000', 'viktor.een@vgregion.se', 'Viktor Een', 'Ej Påbörjad', '0707205924', 543),
(11, 'Öppenvårdskontakt eller öppenvård bör förtydligas, kanske mer åt SO(svensk ordbok)\'s hållet: \"sjuk­vård som baseras på besök på läkar­mottagning var­vid patienten inte läggs in\" eller medicinsk ordbok: \"samlingsterm för hälso- och sjukvård som utförs på icke inneliggande patienter.\"', '2020-03-24 17:15:00.000000', 'viktoria.pettersson@vgregion.se', 'Viktoria', 'Ej Påbörjad', '0763444467', 537),
(12, 'från Maria Delin \r\n\r\nOnkologi gruppen ville ha ett gemensamt uttryck för det. Det borde också vara ett uttryck som WS Clin.doc & Phys.doc också använder, förmodligen även Meds - kommentar från Onk SOKI.\r\n\r\nBland er informatiker som säkert kan välja bäst uttryck för detta. Jag har dock inte diskuterat detta med ”mina” SME:er men tänker att de har annat att tänka på…', '2020-03-25 09:16:00.000000', 'liam.thompson@vgregion.se', 'Liam Thompson', 'Ej Påbörjad', '0725382759', 16),
(13, 'Inte beläggningslista utan beläggningstavla.', '2020-03-25 14:16:00.000000', 'ajla.jakupovic@vgregion.se', 'Ajla Jakupovic', 'Klar', '0704820626', 616),
(14, 'Diagnoskodning är att omvandla den i fritext formulerade diagnosen (Hälsotillståndet) till ICDkoder\r\n\r\nEn vårdkontakt sammanfattas i en eller flera diagnosformuleringar. Att omvadla dessa diagnoser till koder är dignoskodning\r\n\r\n2020-03-30, Perha 11: Tycker att det är det vi skrivit?', '2020-03-29 09:26:00.000000', 'gunnar.henriksson@vgregion.se', 'Gunnar Henriksson', 'Pågår', '0703960996', 89),
(15, 'Åtgärdskodning är att omvandla textbeskrivningen av en åtgärd exvis en operation till en eller flera koder', '2020-03-29 09:39:00.000000', 'gunnar.henriksson@vgregion.se', 'Gunnar Henriksson', 'Ej Påbörjad', '0703960996', 534),
(16, 'Det här är en dubblet med k(K)ontrasignering. Ni kanske måste radera en.', '2020-03-30 13:13:00.000000', 'dejmail@gmail.com', 'Liam Jed Thompson', 'Ej Påbörjad', '0725382759', 262),
(17, 'Magnus föreslog levnadsvanor som term för detta begreppet under en design session. Kanske är något att ta med sig?', '2020-03-31 13:53:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 547),
(18, 'Vårdtyngd har även förekommit i akutströmmen. Här är det översatt från det engelska begreppet Priority. Akutströmmens verksamhetexperter menar att det borde heta prioritet på svenska.', '2020-04-01 11:29:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 576),
(19, 'Hej\r\n\r\nkodverksgruppen undrar hur angelägenhetsgrad förhåller sig till prioritet. Alternativt hälsoangelägenhetsgrad. Vi håller på med ett kodverk för angelägenhetsgrad.\r\n\r\n/ Anna', '2020-04-06 11:17:00.000000', 'anna.rossander@vgregion.se', 'Anna Rossander', 'Ej Påbörjad', '0707813751', 638),
(20, '\"Vårdnivå\" har i ett flertal artiklar i Läkartidningen följande innebörd: \'intensitet i sjukvård som tillhandahålls av läkare eller vårdinrättning\'. ”Egenvård” tycks inte omfattas av vårdnivå, utan vårdnivå är alltid kopplat till den hälso- och sjukvård som utförs av hälso- och sjukvårdspersonal.\r\nhttps://terminologiframjandet.se/h552a9FtZ/tnc.se/termfraga/vardniva/', '2020-04-07 14:37:00.000000', 'louise.fernholm@vgregion.se', 'Louise Fernholm', 'Ej Påbörjad', '0730383710', 612),
(21, 'Termen har uppkommit i ett till kontext: \r\nFör att få rätt ersättning för utförda prestationer måste all given vård registreras utifrån om denna är högspecialiserad vård av nationell karaktär, högspecialiserad vård av region karaktär eller länssjukvård. Detta har också betydelse för det fria vårdvalet och rätten till egenremiss. \r\n \r\nArbetsbeskrivning Klassificering \r\n \r\nL-vård = Länssjukvård  Vård som kan utföras på flera sjukhus inom Västra sjukvårdsregionen (VGR + Halland)  \r\nR-vård= Högspecialiserad vård av regionsjukvårdskaraktär. Vård som utförs av ett sjukhus i Västra sjukvårdsregionen och som samordnas med regionen som upptagningsområde.  \r\nN= Högspecialiserad vård av rikssjukvårdskaraktär  Vård som utförs av ett fåtal sjukhus i landet och som samordnas med hela landet som upptagningsområde (<3st) \r\n\r\n\r\nhttps://alfresco.vgregion.se/alfresco/service/vgr/storage/node/content/12385/Registrering%20av%20N,%20R%20och%20L%20vård%20samt%20inhämtande%20av%20betalningsförbindelse%20av%20annan%20vårdgivare.pdf?a=false&guest=true', '2020-04-09 15:35:00.000000', 'viktoria.pettersson@gmail.com', 'Viktoria', 'Ej Påbörjad', '0763444467', 612),
(22, 'Denna kontexten kommer från trellokortet. Se trellokort för mer kontext. \r\nDen vikt som utgör underlag för den aktuella ordinationen, kan vara en uppmätt,\r\nuppskattad vikt i en akut situation, torrvikt eller en medveten justerad vikt. För barn behöver man\r\nutföra en rimlighetskontroll vilket innebär att man enligt angivna riktlinjer ska väga barnet på nytt\r\nför att barnets vikt inte ska blir för gammalt.', '2020-04-15 10:19:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 624),
(23, 'Vi behöver en entydig definition av termen kodverk. \r\nOLLI\r\nkodverk - förteckning över koder\r\n\r\nDefinition av kodverk till arkitekturarbetet med datakatalog.\r\nkodverk-Klassifikation där varje element givit en kod enligt regler i ett kodschema\r\nEtt kodverk behöver väl inte vara en klassifikation.\r\n\r\nRegelverk för kodverk\r\nkodverk\r\nkodsystem\r\nkombination av en uppsättning koder (2.2) och en uppsättning kodtexter (2.3) som sammanfogats enligt ett kodschema (2.4) (Inera)\r\nANMÄRKNING	Kodverk kan vara små som exempelvis kodverk för kön eller stora som ICD-10 och Snomed CT.', '2020-04-15 16:03:00.000000', 'gerd.engstrom@vgregion.se', 'Gerd Engström', 'Pågår', '0703244378', 251),
(24, 'I Bengt I Lindskogs Medicinsk terminologi finns vårdnivå som uppslagsterm: vårdnivå - grad av specialisering inom sjukvården; I Sverige förekommer officiellt tre nivåer: primär-, läns- och regionsjukvård.\r\nNär vi arbetat med vårdnivå i team 1 med FVM EE är förslaget vårdnivå -specialiserad vård, primärvård och kommunal vård och omsorg. Specialiserad vård kan sedan delas in i - rikssjukvård, regionsjukvård, länssjukvård.', '2020-04-16 08:55:00.000000', 'gerd.engstrom@vgregion.se', 'Gerd Engström', 'Ej Påbörjad', '0703244378', 612),
(25, 'Från FVM EE/PAS använder man Vårdnivå på ett annat sätt som pekar ut organisationsform, dvs specialistvård, primärvård & kommunalvård. Specialistvården kan delas in i Nationellvård, regionvård och länssjukvård. \r\n\r\nDetta är något som kommer att behöva finnas. Förslaget är att man skiljer på vårdnivå och ekonomisk vårdnivå.', '2020-04-28 11:05:00.000000', 'ebba.cedergren@vgregion.se', 'Ebba Cedergren', 'Ej Påbörjad', '0709848458', 612),
(26, 'Onkologi strömmen har bestämt sig att använda \"Beredskap för anafylaxi\" i regimer, så begreppet i OLLI behöver ändras så att vi har bara ett begrepp i term fältet.\r\n\r\nJag frågade SOKI om dem andra begrepp borde stå som synonymer och vilka status de borde ta och jag fick förklaring här nere.\r\n------------------------------------------------------------------------------------------------------------------------------------------------\r\nJa det tycker jag i den kontexten som vi använder det (dvs andra termer står som avråds).\r\nFinns kanske medicinska tillfällen där patienten ”bara” kan drabbas av chock (chock är en del i det anafylaktiska förloppet) & det då är rimligt att använda chockberedskap. För mig är akutberedskap ett väldigt vitt begrepp som säkert kan användas i organisatorisk verksamhet men det säger ju väldigt lite i en medicinsk kontext. Så vad jag vill få fram är att man borde få använda de andra begreppen men inte i kontexten att det finns risk för anafylaxi i samband med medicinsk behandling :blush:', '2020-04-28 11:36:00.000000', 'liam.thompson@vgregion.se', 'Liam Thompson', 'Ej Påbörjad', '0725382759', 16),
(27, 'tillägg av eng. term: \r\nWEIGHT DOSING\r\n Used to document the patient\'s weight to be used to calculate medication dosing.', '2020-05-05 15:35:00.000000', 'gertrude.peterson@vgregion.se', 'Gertrude Petersson', 'Ej Påbörjad', '0', 624),
(28, 'tillägg eng. term:\r\nUSUAL WEIGHT\r\n Used to capture the patient\'s normal baseline weight prior to this spell of illness.\r\n\r\nOBS! ta bort kommentar om trellokort i kontextbeskrivning och se över länken funkar den?', '2020-05-05 15:37:00.000000', 'gertrude.Petersson@vgregion.se', 'Gertrude Petersson', 'Ej Påbörjad', '0', 646),
(29, 'Informatik är vetenskapen om hur man\r\n•	samlar in\r\n•	strukturerar\r\n•	hanterar  \r\n•	bearbetar\r\n•	kommunicerar\r\n•	utvärderar\r\nall information på ett kvalitetssäkrat sätt.', '2020-05-05 16:19:00.000000', 'louise.fernholm@vgregion.se', 'Louise Fernholm', 'Ej Påbörjad', '0730383710', 225),
(30, 'SoKI akutströmmen opponerar sig mot att använda termen utsöndring då de nästan aldrig använder sig av detta uttrycket tidigare. Även under designsessionen så opponerade sig flera verksamhetsexperter mot just utsöndring, där av skickades dessa in igen. Går det att byta term?', '2020-05-07 13:15:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 704),
(31, 'Definition: ultraljudsundersökning av urinblåsan. \r\nblåsskanning (med k)\r\navrådd term: bladderscanning, bladdrar etc.', '2020-05-07 13:54:00.000000', 'louise.fernholm@vgregion.se', 'Louise Fernholm', 'Ej Påbörjad', '0730383710', 705),
(32, 'jag har bett att få bort synonymen \"bladderscan\" som jag gjorde i SCT SE. dels verkar det inte vara den termen vi ville ha, dels låg den inte på ett bra begrepp. Begreppet det låg på innehåller även \'post miktion\' men det görs ju ibland även utan att pat kissat, tex post-op.\r\n700387001 | ultraljudsundersökning av urinblåsa för bestämning av residualurin efter miktion |\r\n\r\nJag tror inte det finns ett bra begrepp i dagsläget, men det går ju att göra förstås.', '2020-05-11 10:29:00.000000', 'anna.rossander@vgregion.se', 'Anna Rossander', 'Ej Påbörjad', '0707813751', 705),
(33, 'Detta är ett mail som inkommit från SME i Medicinsk Dokumentation:\r\n\r\nTack för bra diskussion! Jag håller med, Martin, att bladderscan är väldigt etablerat. Jag hade aldrig kommit i kontakt med begreppet \"blåsskanning\" tidigare och jag tror att det riskerar skapa förvirring.\r\n\r\nJag uppfattar det på följande sätt:\r\n\r\nbladderscan = med ultraljud undersöka hur mycket urin det finns i urinblåsan\r\nresidualurin (\"resurin\") = hur mycket urin som är kvar i blåsa efter miktion, vilket undersök genom bladderscan', '2020-05-12 12:58:00.000000', 'viktor.een@vgregion.se', 'Viktor Een', 'Ej Påbörjad', '0707205924', 705),
(34, 'I Medicinsk Dokumentation undrar hur NEWS/NEWS2 ska skrivas ut i Millennium?\r\nNEWS (National Early Warning Score)', '2020-05-12 15:58:00.000000', 'viktor.een@vgregion.se', 'Viktor Een', 'Ej Påbörjad', '0707205924', 625),
(35, 'Onkologi SMEr och SOKI la fram förslag att det skulle heta \"Patient Tavla\" (14 maj 2020). Kan ni ta med detta till diskussionen med Skåne?', '2020-05-14 13:43:00.000000', 'liam.thompson@vgregion.se', 'Liam Thompson', 'Ej Påbörjad', '0725382759', 620),
(36, 'Detta är en testkommentar för att se om allt funkar som det skall', '2020-05-19 09:46:00.000000', 'mikael.wintell@vgregion.se', 'Mikael', 'Ej Påbörjad', '13423532', 441),
(37, 'I Millenium betyder det att en läkare lämnar en muntlig rapport till läkaren som ska ta över patienten, då antecknar man detta under reevaluering, detta gör man inte i VGR. Istället för reevaluering då det inte betyder samma sak i Millenium ska det heta: Ny bedömning. Ny bedömning är inskickat som en separat term.', '2020-05-19 11:01:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 723),
(38, 'Flera medicinska uppdrag beskriver sin verksamhet genom att säga inom användningsområdet a) specialitet b) del av specialitet ex andningvård \r\n\r\nI Millenium finns ett behov av att definiera avgränsningar avseende ansvarsområde. Kan generiska termen täcka?', '2020-05-26 08:44:00.000000', 'helen.seeman-lodding@vgregion.se', 'helen seeman-lodding', 'Ej Påbörjad', '0736601722', 150),
(39, 'Behöver prioriteras upp. Beskrivs i författningen 2017:37, vårdhandboken och termen finns i SoS term\r\n\r\nKap 11 Läkemedelsgenomgångar', '2020-05-26 10:31:00.000000', 'helen.seeman-lodding@vgregion.se', 'helen seeman-lodding', 'Ej Påbörjad', '0736601722', 739),
(40, 'vi behöver också begreppet enteralt', '2020-05-26 10:34:00.000000', 'helen.seeman-lodding@vgregion.se', 'helen seeman-lodding', 'Ej Påbörjad', '0736601722', 748),
(41, 'I onkologi har dem en engelsk översättning av \"Scales and Assesments\" till den här termen. Det gäller onkologi bara.\r\n\r\n2020-06-01, Perha11:  ÖVerförd till begreppet', '2020-05-27 10:47:00.000000', 'liam.thompson@vgregion.se', 'Liam Thompson', 'Ej Påbörjad', '0725382759', 55),
(43, 'Vid genomgång av olika IPOC kommer frågan om Övervätskning upp. Denna term /Beskrivning finns med i omvårdnadsåtgärder vätskebalans.\r\nHär finns även Undervätskning. Skall detta ha egna termer i Ollie?', '2020-06-03 13:19:00.000000', 'gertrude.petersson@vgregion.se', 'Gertrude Petersson', 'Ej Påbörjad', '0703824384', 706),
(44, 'Fortsätter diskussioner om innehåll i IPOC - det rör övervakning av blodsockernivå hos patient- inte bara mätvärden utan andra observationer som kan  visa på låga eller höga blodsockernivåer.\r\n. [13:52] Åsa Sunesson\r\n    Monitorering= bevakning, granskning, övervakning', '2020-06-03 14:19:00.000000', 'gertrude.petersson@vgregion.se', 'Gertrude Petersson', 'Ej Påbörjad', '0703824384', 717),
(45, 'Är detta verkligen alltid angående uppmärksamhetsinformation med tanke på att uppmärksamhetsinformation rör numera den informationen angående Socialstyrelsens rekommendationer. Jag tänker att en notifikation även kan vara t.ex. i akutens Launchpoint, när labbprover har kommit in från labb med svaren redo och ligger som en notifikation för användaren.\r\nBara en fundering. \r\n\r\nEtt sätt är att försöka göra en mer generell definition på notifikation.', '2020-06-03 16:03:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 330),
(46, 'Enligt verksamhetsexperter  behöver man skilja på sköter själv och självadministrering. \r\nVid sköter själv är hela ansvaret patientens och kopplat till patientens vardag. Vid självadministrering administrerar patienten läkemedlet själv men hälso-och sjukvårdspersonal  är involverad i läkemedelsbehandlingen och behöver signera överlämning av läkemedlet.', '2020-06-04 09:57:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 678),
(47, 'Förslag från Helén: viktsberäknad dos', '2020-06-04 15:55:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 812),
(48, 'Masterdata i projektet personuppgifter vill ha skyddad identitet definierat.', '2020-06-12 08:15:00.000000', 'veronica.winter@vgregion.se', 'veronica winter', 'Ej Påbörjad', '0708501065', 434),
(49, 'Från ”home mediciation form” får man reda på att patienten tar medicin x. Den kommer inte att ingå i aktuell vård och patienten sköter detta själv. \r\nVi signerar att vi tagit emot informationen men bereder/iordningställer och administrerar ingenting. Patienten tar ansvar och sköter själv.\r\n\r\nKopplat till patientens egna vardag\r\n\r\nSköter själv och självadministrering behöver skiljas åt eftersom begreppen inte representerar samma sak.', '2020-06-12 13:12:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 810),
(50, 'Sköterskan iordningställer/bereder läkemedlet och lämnar över till patienten som administrerar det själv. SSK Signerar beredning/iordningställande, överlämnade och att hen informerat patienten att ta det själv\r\n\r\nPatient tar ansvar för sin del i läkemedelsprocessen. \r\n\r\nSe separat kommentar på \"sköter själv\"', '2020-06-12 13:14:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 678),
(51, 'Engelska definitionen bör omformuleras eller tas bort. Har en annan betydelse', '2020-06-12 13:43:00.000000', 'mats.loof@vgregion.se', 'Mats Lööf', 'Ej Påbörjad', '0702607062', 513),
(52, 'Från Rikstermbanken finns det redan en definition i lagtext, se nedan:\r\n\r\nalbansk term (rekommenderad):	certifikatë e vdekjes\r\nsvensk term (rekommenderad):	dödsbevis\r\nförklaring:	intyg som utfärdas av läkare vid en persons död och som skall ange dödsorsaken, Begravningslag (1990:1144) 2 §\r\n \r\nkälla:	Språkrådet: Svensk-albansk tolkordlista | 2003', '2020-06-16 13:32:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 765),
(53, 'Detta formuläret har döpts om till Föranmälan i akutströmmen efter utredningen som gjorts med Skåne.', '2020-06-16 16:59:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 593),
(54, 'Fick valet Telemetri när jag sökte på ADL', '2020-06-17 09:43:00.000000', 'gertrude.petersson@vgregion.se', 'Gertrude Petersson', 'Ej Påbörjad', '0703824384', 579),
(55, 'Används i läkemedelsströmmen vid administrering  (en rullista där man väljer vart t ex en infart sitter.) Önskar ha lokalisation som synonym', '2020-06-17 10:19:00.000000', 'sofia.charlotte.andersson@vgregion.se', 'Sofia Andersson', 'Ej Påbörjad', '0707367239', 17),
(56, 'Förkortningar till vitalparametrarna som kommer ifrån akutströmmen, Helén har även sagt att dessa är vedertagna men kan behövas att stämma av med henne för att vara säker. Går dessa förkortningar att lägga till som synonymer till vitalparameter?\r\n\r\n(förkortning - hela namnet)\r\n\r\nBT - blodtryck\r\n\r\nAF - andingsfrekvens\r\n\r\nSp02 - perifier saturation eller pulsoxymeter\r\n\r\nPuls - puls\r\n\r\nTemp - temperatur', '2020-06-23 13:35:00.000000', 'david.tegel@vgregion.se', 'David Tegel', 'Ej Påbörjad', '0707520447', 495),
(57, 'Vi lyfter begreppet på Shared documentation forum. Ursprungslängd är missvisande då det kan tolkas som längden när personen föddes. (Helst hade vi velat ha ett begrepp för ”kroppslängd-patienten-varit-som-längst”). Vet att dietister är intresserade av den längden. Kanske de har ett begrepp för det?\r\n\r\nFrom Maria Delin i Onkologi.', '2020-06-29 13:18:00.000000', 'liam.thompson@vgregion.se', 'Liam Thompson', 'Ej Påbörjad', '0725382759', 623),
(58, 'Vi skulle behöva exemplifiera detta begrepp om det är möjligt.\r\nFinns det något konkret exempel vi kan lägga till?', '2020-07-02 14:23:00.000000', 'viktor.een@vgregion.se', 'Viktor Een', 'Ej Påbörjad', '0707205924', 200),
(59, 'Flera förvaltningar inom regionen kallar detta för \"utskrivningsmeddelande\". Mig veterligen är det bara SU som använder termen \"vård-och läkemedelsberättelse\". Detta behöver således harmoniseras. \r\n\r\nDessutom finns begreppet utskrivningsmeddelande med i SAMSA-värden vilket ytterligare förvirrar det hela en smula.\r\n\r\nBrevsvar till Emil.', '2020-08-05 09:46:00.000000', 'emil.andreasson@vgregion.se', 'Emil Andreasson', 'Beslutad', '0702296066', 496),
(60, 'Även \"vanliga\" sjuksköterskor och anestesisjuksköterskor kan vara cirkulerande eller \"I korridoren\", beroende på opavdelning.\r\n\r\nmagfo: definitionen ändrad så att den nämner alla sjuksköterskor.', '2020-08-06 12:00:00.000000', 'jonas.nemeth@vgregion.se', 'Jonas Németh', 'Beslutad', '0722059485', 551),
(61, 'Jag önskar en engelsk term, för jämförelse. Kan tex vara Contact type motsvara kontaktorsak? Eller är det snarare att contacttype är typ av kontakt som telefonledes, brevledes, besök etc?\r\n\r\nmagfo: införd i begreppsposten med tillagd engelsk term.', '2020-08-07 11:32:00.000000', 'eva.elmqvist@vgregion.se', 'Eva Elmqvist', 'Beslutad', '0722004339', 259),
(62, 'I mPage så finns komponenten Histories. Skåne har översatt denna till Historik. Komponenten har underrubrikerna socialt, ärftlighet, åtgärder, graviditet, diagnoser och hälsoproblem. Ser att akutströmmen redan har lagt in termen familjehistorik, vet dock inte om termen har samma innehåll men mPage och namnen på rubrikerna i denna behöver diskutera i Shared documentation forum.', '2020-08-19 08:06:52.122025', 'anna.ben-shabat@vgregion.se', 'Anna Ben Shabat', 'Beslutad', '0730481320', 548),
(63, 'Angående komponent i mPage som på engelska heter Microbiology och som Skåne har översatt till Mikrobiologi (inkluderar bakterorologi och virologi). Vi i arbetsström onkologi önskar att komponenten får heta Klinisk Mikrobiologi.', '2020-08-20 16:47:52.487816', 'anna.ben-shabat@vgregion.se', 'Anna Ben Shabat', 'Ej Påbörjad', '0730481320', 909),
(64, 'Angående komponent i mPage Pathology som Skåne har översatt till Patologi. Vi i arbetsström onkologi önskar att benämningen blir Klinisk Patologi.', '2020-08-20 16:53:47.152430', 'anna.ben-shabat@vgregion.se', 'Anna Ben Shabat', 'Ej Påbörjad', '0730481320', 910),
(65, 'Om man definierar barn som under 18 år, vad händer med äldre barn? Det kan vara viktigt att hålla koll på även vuxna barn, tex anhöriga, men det går ju inte enligt denna definition? Eller?\r\n\r\nTermerna underårig och minderårig finns också. Underårig har ni avrått från. Minderårig förekommer i schiz-vårdförloppet (\"...om pat har minderåriga barn\") \r\n\r\nVi behöver kunna hålla koll på barn oavsett ålder, samt om de är över eller under 18 år. Tacksam om ni vill kika på detta igen. \r\n\r\n/ Anna', '2020-08-24 15:25:40.634755', 'anna.rossander@vgregion.se', 'Anna Rossander', 'Ej Påbörjad', '0707813751', 47),
(66, 'från Onkologi på Shared Documentation Forum\r\n Ändra i maximilängd definitionen och addera \"färdigväxt\".\r\nse nytt förslag på begrepp: (för skillnaden mellan begreppen) Usual height = vad ska ett barn på 7 år vara för längd? Intressant för ortopedin (och implanteringar av implantat. ) samt tillväxtkliniker osv.', '2020-08-25 10:12:22.728943', 'louise.fernholm@vgregion.se', 'Louise', 'Ej Påbörjad', '0730383710', 623),
(67, 'Föreslog begreppet för verksamhetsexperter och de menade att många inte kommer förstå vad det är och att det behöver bli tydligare att det rör intravenös och att detta är ett ”set”, likt order set.', '2020-08-25 11:51:50.815916', 'sofia.charlotte.andersson@vgregion.se', 'Sofia', 'Ej Påbörjad', '0707367239', 733);
